INSERT INTO `byp_content_info` VALUES ('7', '04', '线下展会合作', '线下展会合作Offline exhibition cooperation', '<div style=\"background:#b0e0e6; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">作为线下展会的补充与延伸，Marine Online海科在线致力于打造更优质的海事海洋行业线上会展。</span></span></div>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">As the complement and extension of offline exhibition, Marine-Online is committed to building&nbsp;more excellent online exhibitions which focus on the maritime industry.&nbsp;&nbsp;</span></span></p>\r\n\r\n<div style=\"background:#b0e0e6; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">以智能化、绿色化、服务化为主线，集品牌展示、技术交流、贸易合作、宣传推广、国际研讨于一体，为推动全球海洋行业升级提供一站式线上会展服务平台。</span></span></div>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">Marine-Online&nbsp;integrates brand promotion,&nbsp;technical&nbsp;communication, trade cooperation, propaganda promotion,&nbsp;and international seminar, focuses on &ldquo;Intelligent, Environmental Friendly, and Service&rdquo;. Marine-Online&nbsp;provides&nbsp;a one-stop exhibition service platform for promoting the global maritime&nbsp;industry upgrading.&nbsp;</span></span></p>\r\n\r\n<div style=\"background:#b0e0e6; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">欢迎各大商业协会、展会公司与我司洽谈展会合作业务，携手共创蓝色经济新未来。</span></span></div>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">We welcome all the commercial associations and exhibition enterprises in the maritime&nbsp;industry to establish trading relationship with us, and to join hands in&nbsp;creating&nbsp;a new-future of blue economy.</span></span></p>\r\n\r\n<div style=\"background:#b0e0e6; border:1px solid #cccccc; padding:5px 10px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">详情请致电</span></span></div>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">Please call Molly for details.</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:12px\">&nbsp; Name：汲圆圆 Molly<br />\r\n&nbsp; &nbsp; &nbsp; TEL：+86 156 9238 1030<br />\r\n&nbsp;E-mail：molly@boyamarine.com</span></span></p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171110/pic/20171110134742_126.jpg\" style=\"height:139px; width:780px\" /></p>', '1', '1', '6', '1', '0', '1', '2017-10-19 10:32:40', '32', '2017-11-10 14:01:45');
