INSERT INTO `byp_content_info` VALUES ('9', 'zcxy', '注册协议', '注册协议说明', '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p>下列说明的服务条款 (&quot;条款&quot;) 适用于您对Marine-Online.cn (&quot;Marine-Online&quot;) 服务的使用，请认真阅读:</p>\r\n\r\n<p><strong>1 </strong><strong>同意接受条款</strong></p>\r\n\r\n<p>Marine-Online依照以下的条款提供服务给您，本公司可随时修改该条款，不另行通知亦无需对您负任何责任。如您在修订条款后继续使用该服务，即表明同意接受此等修订的约束。如您不同意相关变更，必须停止使用服务。因此，您应随时查阅网站内最新版的条款。此外，当使用Marine-Online的升级服务 (如商务网站, 热门产品推广等) 您同意接受其额外的条款。如有任何抵触，则以该升级服务之条款为准。</p>\r\n\r\n<p><strong>2 </strong><strong>服务说明</strong></p>\r\n\r\n<p>Marine-Online现时通过国际互联网络为您提供工具及服务。本服务只提供于具有法律约束力的商业机构，如您不符合本项条件，请勿使用本服务。Marine-Online基于自身审核标准决定是否对其进行服务。为使用本服务，您应自行配备国际互联网络连线所需之一切必要装备，并自行负担所使用的连线费及一切相关服务费。</p>\r\n\r\n<p><strong>3 </strong><strong>注册资格及义务</strong></p>\r\n\r\n<p>Marine-Online可不提出任何理由而拒绝任何使用本服务的注册。您必需符合以下资格才可注册及使用本服务: a必须是当地合法的注册公司(在有需要的时候，Marine-Online有权要求您提供合法的注册文件。及b同意接受Marine-Online的服务条款。</p>\r\n\r\n<p>当您提出注册即保证:a已采取一切行动为取得订立并履行本条款的必要授权；b您在注册申请表格提供的公司登记资料属实、正确、最新及完整；c您会维持并立即更新登记资料，确保其为属实、正确、最新及完整；d您符合每一个法定企业只能注册一个会员资格的条款。如有违规，Marine-Online有权在给予或不给予通知的情况下取消您的会员资格。</p>\r\n\r\n<p><strong>4 </strong><strong>会员登入名、密码及安全</strong></p>\r\n\r\n<p>当您完成本服务的注册程序后，会收到一个会员登入名和密码。您须负责为您的会员登入名及密码保密并防止任何未经授权的使用。所有利用该会员登入名及密码所进行的一切行动，您需负完全的责任。如您的会员登入名或密码遭到未获授权的使用，或者其他任何安全问题发生时，您将立即通知Marine-Online。您未能遵守本项规定所衍生之任何损失或损害，Marine-Online无法也不予负责。如果您连续90天内没有以会员身份登录Marine-Online网站，您的会员资格会被取消。而您在Marine-Online发布的内容如公司资料、产品资料、供求信息等将会同时被删除。</p>\r\n\r\n<p><strong>5 </strong><strong>使用者责任</strong></p>\r\n\r\n<p>您了解一切的资讯(&quot;内容&quot;)包括资料、文字、软体、音乐、音讯、照片、图形、视讯、信息或其他资料，无论其为公开张贴或私下传送，均为内容提供者之责任。这表示您将对经由本服务上载、张贴、发送的电子邮件或传送之内容负完全的责任。您同意只将本服务作私人用途，并不会将会员资格出售或转送与其他人。您在Marine-Online发布的内容均符合并适用于其对使用者发布的内容要求，您同意Marine-Online基于自身审核标准决定，予通知或未通知的情形下更改、删除或隐藏任何不符合要求的内容。在使用本服务时您同意:a不会抄袭、复制、公开、分发、出售或以直接或间接与Marine-Online构成竞争的任何方式，为商业目的而利用本服务提供的服务及内容；b不会删除或更改任何由Marine-Online或透过其所提供的内容的任何版权或其他所有权告示；c不会发布或传输任何种类的违法、欺诈、中伤、诽谤、淫亵、色情、亵渎、恐吓、污秽、讨厌、令人反感或其他不良或过份的内容，包括但不限于传输含有或怂恿可构成刑事罪、导致民事责任，或以其他方式违反任何当地、国家、全国性或外国法律的行为的内容；d不会侵害任何人之任何专利、商标、营业秘密、版权或其他专属权利；e不会发布或者传输任何广告、游说、连锁信、层压式推销计划、投资机会或计划或其他未经要求而提供的商业通讯；f不会发布或传输含任何病毒、欺骗程序、蠕虫或者其他有害成分的任何内容；g不会未经其他人同意，利用本服务收集其他人的电邮地址及内容；h不会滥寄垃圾邮件。&nbsp;Marine-Online无法控制经由本服务而张贴之内容，因此不保证内容之正确性、完整性或品质。您了解使用本服务时，可能会接触到令人不快、不适当、令人厌恶、带有错误或欺诈方式之资讯，故请谨慎采用。在任何情况下，Marine-Online均不为任何内容负责，包含但不限于任何内容之任何错误或遗漏，以及经由本服务张贴、发送电子邮件或传送而衍生之任何损失或损害。Marine-Online为确保资料库的质量，有权在给于或不给于通知的情况下隐藏不适当或不完整的产品资料及供求信息。另外，每个会员不可选用多于5个的产品分类。</p>\r\n\r\n<p><strong>6 </strong><strong>收费</strong></p>\r\n\r\n<p>本公司保留权利就现时为您提供的免费服务征收费用。如果Marine-Online决定就免费服务征收费用，我们将用告示在网页内公布此收费。如您在公布后的任何时间继续使用有关的服务，阁下即同意向Marine-Online支付该等收费。本公司保留权利可随时修改其收费及付费方式而无需得到您的意见，但需于新收费有效期开始前７天通知您。</p>\r\n\r\n<p><strong>7 </strong><strong>私隐政策</strong></p>\r\n\r\n<p>您的个人资料经由我们提供该服务时而收集，这些资料均受到本公司的私隐政策的规范。有关Marine-Online的私隐政策，请参阅本网站内的私隐政策声明。</p>\r\n\r\n<p><strong>8 </strong><strong>您授予Marine-Online</strong><strong>的许可使用权</strong></p>\r\n\r\n<p>您授予Marine-Online独家的、全球通用的、永久的、免费的许可使用权利，使本公司有权使用、复制、修订、改写、发布、翻译、分发、执行和展示您的资料及内容或制作其派生作品。您更授予Marine-Online许可使用权利将您的名字公布于有关其运作及推广Marine-Online服务之用，而无须支付或给予您任的费用。</p>\r\n\r\n<p><strong>9 </strong><strong>补偿</strong></p>\r\n\r\n<p>您同意就您违反使用条款的任何一款及/或使用本网页有关或因此而产生的任何责任、损害赔偿、申索、诉讼、费用及支出(包括但不限于法律费用)而为Marine-Online提出抗辩，作出补偿并使本公司及各联号公司不受伤害。如有必要，Marine-Online可能参加任何申索或者诉讼的抗辩及参与任何和解商议。若无本公司事先书面同意，不得作出任何对本公司权利或义务有不利影响的和解。Marine-Online保留权利，在向您发出通知后，自费行使对任何申索或者诉讼的独有抗辩及独有控制。</p>\r\n\r\n<p><strong>10 </strong><strong>服务之修改</strong></p>\r\n\r\n<p>于通知或未通知之情形下，Marine-Online有权于任何时间暂时或永久修改或终止本服务（或其任何部分）。本服务任何修改、暂停或终止，您同意Marine-Online对您和任何第三人均不承担责任。</p>\r\n\r\n<p><strong>11 </strong><strong>终止</strong></p>\r\n\r\n<p>您同意Marine-Online基于自身审核标准决定，因任何理由，包含但不限于缺乏使用，或本公司认为您已经违反本服务条款的明文规定及精神，终止您就本服务的使用权，并将本服务内任何资料及资讯(如您的网页、供求信息等) 删除。Marine-Online亦得依其自行之决定，于通知或未通知之情形下，随时终止本服务或其任何部分。您同意依本服务条款任何规定提供之服务，无需进行事先通知即得终止，您承认并同意，Marine-Online得立即关闭或删除您的Marine-Online帐户及所有相关资料。此外，您同意若本服务之使用被终止，Marine-Online对您或任何第三人均不承担责任。</p>\r\n\r\n<p><strong>12 </strong><strong>连结</strong></p>\r\n\r\n<p>本服务或第三人可提供与其他全球资讯网上之网站或资源之连结。由于Marine-Online无法控制前开网站及资源，您了解并同意，前开外部网站或资源是否可供利用，Marine-Online不予负责，存在或源于前开网站或资源之任何资讯、广告、产品或其他资料，不代表Marine-Online对其赞同亦不予负责。您进一步同意，因使用或信赖存在或经由前开任何网站或资源之任何资讯、商品或服务所生或据称所生之任何损害或损失，Marine-Online不负任何直接或间接之责任。</p>\r\n\r\n<p><strong>13 </strong><strong>知识产权权利</strong></p>\r\n\r\n<p>本网页存有的一切知识产权权利属于Marine-Online。在此保留适用法律项下的一切权利。除经Marine-Online许可者外，鉴于本网页按适用法律具有版权，因此您不得以任何方式上载、发帖、发布、复制、传输或派发本网页的任何成分或在其上设定衍生作品。此外，您了解并同意，本服务及本服务所使用之任何相关必要软体含有受到相关知识产权及其他法律保护之专属性及机密性资料。</p>\r\n\r\n<p><strong>14 </strong><strong>免责声明</strong></p>\r\n\r\n<p>所有资讯仅供作一般参考。Marine-Online对该等资讯不负任何责任。您明确了解并同意 a您使用本服务之风险由您个人负担。本服务系依&quot;现况&quot;基础提供。Marine-Online明示不提供任何明示或默示的担保，包含但不限于商业适售性、特定目的之适用性及未侵害他人权利。b)Marine-Online不保证以下事项 I本服务将符合您的要求；II本服务不受干扰、及时提供、安全可靠或免于出错；III由本服务之使用而取得之结果为正确、充足或可靠；IV您经由本服务购买或取得之任何产品、服务、资讯或其他资料将符合您的期望；V软体中任何错误将得到更正。c是否经由本服务之使用下载或取得任何资料应由您自行考量且自负风险，因前开任何资料之下载而导致您电脑系统之任何损坏或资料流失，您应负完全责任。d您自Marine-Online或经由本服务取得之建议和资讯，无论其为书面或口头，绝不构成本服务条款未明示规定之任何保证。</p>\r\n\r\n<p><strong>15 </strong><strong>责任限制</strong></p>\r\n\r\n<p>在任何情况下，Marine-Online或其分公司对您或任何其他人士因使用或不能使用该等服务所发生的任何直接的、间接的、附带引起的、特别的、惩罚性的或者间接性的损失包括任何业务或盈利的损失，不承担任何责任。即使Marine-Online或其分公司已知悉可能会有该等损害赔偿，亦是如此。阁下在使用或解释该等资讯时，应运用并依赖自己的技能和判断。您有责任确保使用该等资讯须遵守所有适用的法律规定。本使用条款所含的责任限制适用于适用法律所许可的最大限度。</p>\r\n\r\n<p><strong>16 </strong><strong>通知</strong></p>\r\n\r\n<p>本服务的一般条款或其他事项有所变更时，将不会另行通知。因此，您应随时查阅网站内最新版的服务条款。</p>\r\n\r\n<p><strong>17 </strong><strong>规限法律及司法管辖权</strong></p>\r\n\r\n<p>因本协议或本公司服务所引起或与其有关的任何争议应向山东省青岛市即墨市人民法院提起诉讼，并以中华人民共和国法律为管辖法律。</p>', '1', '1', '11', '1', '0', '1', '2017-10-24 13:34:42', '1', '2017-11-02 16:41:19');
