INSERT INTO `byp_exhibition_activity_info` VALUES ('28', '36', '国际压载水管理技术与标准化论坛', '18324', '1', '<p>2017年9月12日至13日，由中国船舶信息中心和波罗的海航运公会（BIMCO）联合举办的&ldquo;国际压载水管理技术与标准化论坛&rdquo;在青岛美爵度假酒店召开。来自8个国家的150余名行业代表出席会议。论坛得到了国际标准化组织船舶与海洋技术委员会（ISO/TC8）的大力支持。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111104355_426.jpg\" style=\"height:439px; width:780px\" /></p>\r\n\r\n<p>本次论坛以&ldquo;加强多方合作，共建蓝色海洋&rdquo;为主题，主要分为：压载水公约履约及型式认可要求、港口国监管、符合验证取样和检验、压载水处理技术动态、设备的安装与运行、政策和产业漫谈七个部分。内容涵盖压载水管理的监管、试验、处理、安装、运行等全生命周期，特邀来自国际标准化组织、国际海事组织、巴拿马海事局、鹿特丹港及多个国家相关职能部门的专家，深度解析最新国际压载水管理公约法规履约和港口国监管现状，同时，邀请来自中国、日本、韩国、美国等国家的生产厂商、采购者、第三方试验厂商，就压载水管理技术发展形势、技术趋势预见，以及压载水公约履约进展和标准化需求等内容进行深度交流，通过产业链上下游相关主体间技术展示和探讨，识别在履约过程中存在的问题，深入挖掘压载水处理技术和标准的迫切需求，共同寻求标准化的技术解决方案，并推动国际上各企业之间的需求对接，从而促进全球海事业更好地履行国际压载水公约。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111104426_446.jpg\" style=\"height:570px; width:780px\" /></p>\r\n\r\n<p>本次论坛以&ldquo;标准化服务技术发展&rdquo;为理念，是一次将海事技术发展与标准化需求相融合的尝试与创新。论坛以促进海事业更好地履行压载水管理公约为目的，以保障全球船舶高效安全航行为导向，放眼全球，探索海洋特色高科技产业创新发展的新模式，对我国船舶配套产业及时掌握压载水最新管理技术，推动国内企业在压载水领域的优势技术和海洋服务&ldquo;走出去&rdquo;，巩固本土技术优势地位具有积极的意义。</p>', '1', '1', '0', '32', '2017-11-03 12:07:05', '32', '2017-11-11 12:13:52');
INSERT INTO `byp_exhibition_activity_info` VALUES ('29', '36', '海洋移动平台观测与探测技术论坛', '18325', '2', '<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111105743_488.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>9月12日，2017海洋移动平台观测与探测技术论坛在青岛国际博览中心顺利召开。本次论坛由青岛市人民政府、中国航天科技集团第十三研究所、青岛海洋科学与技术实验室主办，由青岛蓝谷管理局、青岛市科技局、航天海洋先进光机电技术研究中心、青岛海洋科学技术与技术国家实验室海洋观测与探测联合实验室承办。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111105825_178.jpg\" style=\"height:505px; width:780px\" /></p>\r\n\r\n<p>张德平副市长参加论坛开幕式，中国科学院院士、国际宇航科学院院士、航天十三所所长王巍发表大会致辞。出席此次活动的还有中国计量科学研究院、中科院海洋所、青岛海洋地质所、国防科技大学、吉林大学等科研机构、高等院校及知名企业的领导、专家。郑彦鹏、吕沛、王延辉、李海兵等11位海洋移动平台观测与探测技术专家作了题为《海洋地球物理探测技术发展趋势及需求》等学术报告。在2017海洋移动平台观测与探测技术论坛上，航天海洋先进光机电技术研究中心正式揭牌。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111110017_680.jpg\" style=\"height:520px; width:780px\" /></p>', '1', '1', '0', '32', '2017-11-03 12:07:21', '32', '2017-11-11 11:00:32');
INSERT INTO `byp_exhibition_activity_info` VALUES ('30', '36', '国际海洋创新发展论坛', '18327', '3', '<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111110659_518.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>海科展期间，2017国际海洋创新发展论坛暨2017国际海洋创新创业大赛启动仪式将如期举行。该活动由山东大学和青岛蓝谷管理局主办，山东大学中美国际科技创新园、山东大学海洋研究院、山东大学德国学院等机构共同承办，拟邀请政府代表、国内外知名学术界、企业界、投资领域的代表，以及高科技创新创业者参加。活动旨在通过紧密的实质性国际合作，促进蓝谷涉海科研机构更好地引领海洋领域科学技术创新以及研究成果项目转化，促进海洋领域国际科研、人才、社会资本和市场的融合。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111110812_529.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>2017国际海洋创新创业大赛将于论坛当天启动。该大赛是全世界首个覆盖全球多个国家的大规模专注海洋领域的创新创业大赛，10月份在美国、加拿大、德国、法国和英国等多个国家以及我国上海、济南、青岛等地举行一系列初赛，11月份在青岛蓝谷举行总决赛。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111110736_797.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>大赛期间，美国、加拿大、德国、法国、英国等多个国家的孵化器、海洋研究所以及中国可可资本（上海）等国内外合作伙伴紧密协作，汇聚优秀的技术创新团队以及创业团队，为大赛主办方、承办方与中外国家的高水平高校、企业、孵化器伙伴以及国内的相关机构搭建海洋创新创业领域的深度合作平台，提升他们在全世界海洋领域的影响力，促成全球海洋科学技术和产业交流。</p>', '1', '1', '0', '32', '2017-11-03 12:07:37', '32', '2017-11-11 11:08:48');
