INSERT INTO `byp_exhibition_activity_info` VALUES ('36', '36', '青岛蓝谷重点项目集中签约仪式', '18328', '5', '<p>9月12日下午，2017青岛蓝谷重点项目集中签约仪式在青岛蓝谷举行。本次集中签约仪式共签约项目27个，投资总额超过300亿元，其中武汉理工青岛研究院、天津大学青岛研究生院、中科院上海技术物理所青岛研究院等高校科研院所类项目8个，海洋科技小镇、海洋地理信息科技创新园、蓝色生物科技港等企业总部和研发中心类项目14个，齐鲁医院、利群集团蓝谷城市综合体、利客来蓝谷购物中心、青岛二中蓝谷学校等城市配套类项目5个。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111111913_894.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>国际海洋创新高地日益突显</p>\r\n\r\n<p>经过五年的发展，青岛蓝谷一大批重大海洋科技合作平台相继建成，依托海洋科学与技术国家实验室、国家深海基地等国家级国际海洋科技合作基地，坚持抓协同、搭桥梁、促合作，对外合作交流不断深入，国际影响力不断增强。海洋国家实验室与美国伍兹霍尔海洋研究所、俄罗斯希尔绍夫海洋研究所等世界一流的海洋科研机构建立了长期合作关系，发布&ldquo;未来海洋青岛共识&rdquo;宣言书，在全球海洋科技领域留下&ldquo;青岛印记&rdquo;。山东大学青岛校区与德国、美国、英国等国家世界知名高校和研究机构开展合作办学和科研攻关。由哈尔滨工业大学牵头组建，中俄两国40所实力雄厚的工科大学组成的中俄工科大学联盟，总部就设在青岛蓝谷，涵盖了航天、航空、能源、海洋工程等顶尖研究领域，青岛蓝谷的国际氛围日益浓厚。本次签约落户的<strong>港台国际海洋科技园项目</strong>由台湾第一大记忆体模组制造商&mdash;台湾威刚科技股份有限公司和香港路劲基建有限公司，投资约40亿元，在蓝谷建设以海洋生物医药、海洋高端制造、信息化与大数据、工业4.0、人工智能为主要产业方向的港台海洋科技园，打造具有示范效应的两岸三地高科技产业合作示范性项目。<strong>新东方罗伊国际学校</strong>将由加拿大新东方国际学院负责国际学校的整体运营管理，引进世界级的教育团队，全球化的教育体系，打造国际教育精品工程。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112006_736.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111111937_149.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>大院大所陆续进驻</p>\r\n\r\n<p>新引进的<strong>国家海洋计量中心</strong>隶属于中国计量科学研究院，是主要从事海洋装备、海洋环境参数、海洋探测与导航、海洋重力等领域的计量科学研究和量值传递工作的专业性科研和综合服务中心，该中心代表了我国海洋计量科技最高水平，将保证全国涉海各参量计量单位量值的统一和准确可靠，有效支撑中国的海洋国际竞争力。<strong>中国科学院上海技术物理研究所青岛研究院</strong>以上海技物所国内领先的红外光电技术特色和相关优势学科为基础，重点开展新型红外光电材料与器件、新能源材料与节能环保技术、海洋生物质能源和材料、光电感知高端装备、光电遥感海洋信息获取、大数据应用、综合工业技术服务等领域关键技术研究和相关成果的转移转化。活动期间举行揭牌仪式的<strong>中国航天科技集团第十三研究所海洋光机电研究中心</strong>，重点开展海洋高端仪器设备、海洋工程装备高精度检测、海洋物理场测量、精密超精密智能制造、北斗导航技术应用、特种电机与电源、载荷稳定关键技术及装备等领域研究和相关成果的转移转化，将成为综合实力国内领先的海洋光机电科技创新载体。<strong>山东省科学院海洋仪器仪表研究所</strong>整建制迁入蓝谷，其水下焊接关键技术，打破国外技术垄断，包揽我国大型船舶装备的船舶气象仪，海洋监测设备占国内市场90%以上份额。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112042_107.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>高等院校资源不断汇聚</p>\r\n\r\n<p>天津大学青岛海洋工程研究院自2015年启动运营以来，进驻了由30位国家千人计划专家、973首席、杰青、长江学者高端人才领衔的海洋信息工程研究所、深海智能装备与系统研究所等15个以海洋工程为主攻方向的专业化研究所，常驻科研人员100余人，进驻科研设备原值近1亿元。为进一步深化与青岛市的战略合作，本次集中签约活动中，<strong>天津大学青岛研究生院</strong>正式签约落户，这是天津大学首次在异地建成的研究生院,也是青岛市引进的首所研究生院。研究生院将培养总规模约为1000名具有正式学籍的各类研究生，今年8月底，首批机械工程、动力工程、电气工程、集成电路工程、控制工程、化学工程、环境工程、电子与通信工程、仪器与仪表工程等9个专业的142名研一新生已正式入学。<strong>武汉理工大学青岛研究院</strong>围绕蓝谷建设世界著名海洋科技新城和即墨市建设汽车新城的重大需求，先期规划在青岛蓝谷成立大型船舶先进制造、船舶动力和清洁排放、海洋环境保护技术、新能源汽车和智能汽车等十四个研究所（中心），力争用10年左右的时间，将研究院建成在国内外有重要影响的一流涉海领域创新载体，服务国家海洋强国战略。由<strong>山东建筑大学</strong>与山东省城建工程集团公司合作，投资6.2亿元，在青岛蓝谷建设青岛绿色建筑研究院及产业创新示范基地，主要建设绿色建筑研发中心、绿色建筑重点实验室及检测中心、绿色建筑培训及示范基地、绿色建筑技术国际交流中心、博士工作站在内的科技研发、成果展示空间，将形成绿色建筑产业群的聚集效应，带动相关产业升级和新产业引进。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112026_92.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>公共服务配套逐步提升</p>\r\n\r\n<p>围绕打造世界一流的海洋科技新城的目标，青岛蓝谷不断加大城市功能配套建设，目前，青岛第19中学、山东大学实验小学及幼儿园、嘉峪关小学蓝谷分校已正式投入使用，青岛蓝谷轨道交通（11号线）已进入调试阶段，将于明年年初正式通车，蓝色中心首个大型商场超市装修接近尾声、开业在即&hellip;&hellip;此次签约活动中，又有一大批高端医疗、教育、商业项目纷纷落户，合作建设青岛二中蓝谷中学，与加拿大新东方国际学院达成初步意向，在蓝谷区域设立国际学校，进一步优化蓝谷教育配套环境。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112111_843.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p><strong>山东大学齐鲁医院</strong>确定在蓝谷建设 &ldquo;大专科、小综合&rdquo;的现代化综合性医院，大大增强了青岛蓝谷医疗卫生服务能力。<strong>青岛二中</strong>和融创集团合作，在青岛蓝谷建设九年一贯制的青岛二中分校，将进一步提升了蓝谷的周边教育水平。<strong>利群集团、利客来集团</strong>将在青岛蓝谷投资建设集购物、休闲、餐饮、娱乐为一体的大型综合商业体和蓝谷购物中心，丰富城市的商业业态，一座宜居宜业的现代化科技新城正在迅速崛起！</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112137_100.jpg\" style=\"height:519px; width:780px\" /></p>\r\n\r\n<p>&nbsp;</p>', '1', '1', '0', '32', '2017-11-11 11:24:34', '32', '2017-11-11 11:24:34');
INSERT INTO `byp_exhibition_activity_info` VALUES ('37', '36', '跨界融合背景下的蓝色经济研讨会', '18329', '6', '<p>加快海洋经济新旧动能转换，9月12日，在中国&middot;青岛国际海洋科技展期间，省区域办会同沿海各市及蓝色经济区各海洋产业联盟，共同举办跨界融合背景下的蓝色经济研讨会。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111112728_793.jpg\" style=\"height:538px; width:780px\" /></p>\r\n\r\n<p>实施新旧动能转换重点是以发展新技术、新产业、新业态、新模式，促进产业智慧化、智慧产业化、跨界整合化、品牌高端化。山东海洋经济综合实力全国领先，以实施跨界融合为契机促进动能转换，有利于发挥海洋经济在全省发展的的引领和示范作用。研讨会将结合各海洋产业发展趋势和企业发展实际，深入研讨新形势下跨界融合的构想和方案，努力探索海洋经济新旧动能转换的最佳路径。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111120427_580.jpg\" style=\"height:585px; width:780px\" /></p>\r\n\r\n<p>省区域办、沿海各市区域办和蓝办、蓝谷管理局、海洋产业联盟及有关骨干企业参加研讨会。</p>', '1', '1', '0', '32', '2017-11-11 11:27:41', '32', '2017-11-11 12:04:50');
INSERT INTO `byp_exhibition_activity_info` VALUES ('38', '36', '中国海洋科普教育论坛', '18330', '7', '<p>9月12日-13日，以&ldquo;海洋科普与教育&rdquo;为主题的&ldquo;2017年中国海洋科普教育论坛&rdquo;在青岛市即墨召开。本次论坛是由中国海洋湖沼学会、中国科学院科学传播局、青岛蓝谷管理局、中国科学院海洋研究所、中国科学院烟台海岸带研究所主办，中国海洋湖沼学会科普专业委员会、青岛蓝谷科学技术协会、青岛海洋科技文化产业联盟承办的一次高水平、高规格的海洋科普与教育主题论坛。来自全国省市科技馆、科普传播与教育机构的100名科普教育领导、专家、学者参加了本次论坛。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111120256_240.jpg\" style=\"height:584px; width:780px\" /></p>\r\n\r\n<p>9月12日上午，全体参会人员前往青岛国际博览中心参观了2017中国&middot;青岛国际海洋科技展览会，12日下午，前往青岛即墨鳌山卫参观了青岛海洋科学与技术国家实验室、国家深潜基地。12日的参观行程，向各位代表展示了以青岛蓝谷为中心的国家海洋特色高科技研发及高技术产业集聚区的活力与风貌，彰显了青岛市海洋经济与科技的实力与发展潜力。各位代表纷纷表示，要坚定贯彻党的&ldquo;十八大&rdquo;作出的建设海洋强国的重大战略部署，以实际行动关心海洋、认识海洋、努力发展海洋科学技术，推动海洋科技向创新引领型转变，为实现党的十八大提出的&ldquo;建设海洋强国&rdquo;宏伟目标贡献自己的力量。</p>\r\n\r\n<p>9月13日上午，&nbsp;2017年中国海洋科普教育论坛盛大开幕。中国科学院海洋研究所纪委书记毕伟出席论坛致欢迎词。开幕式由中国海洋湖沼学会常务副秘书长任建明主持。</p>\r\n\r\n<p>13日上午，论坛邀请了4位专家做大会特邀主题报告，4个主题报告分别为：中国海洋湖沼学会首席科普专家、中国海洋湖沼学会甲壳动物分会理事长、中国科学院海洋研究所李新正研究员的&ldquo;海洋生物学科普宣传的一些体会&rdquo;；中国海洋大学出版社杨立敏董事长的&ldquo;发挥出版优势，繁荣科普创作，深入推进全民海洋科普教育&rdquo;；山东省教育厅装备专家委员会赵敬伟秘书长的&ldquo;搭建学校实践平台，提升学生核心素养&rdquo;； 中国科学院海洋研究所综合处副处长刘洋的&ldquo;互联网+&rdquo;时代的海洋科普工作思考。&nbsp;</p>\r\n\r\n<p>13日下午，论坛邀请了5位专家做大会报告，5个大会报告分别为：上海科技馆展教处教育活动部徐湮副主任的&ldquo;科普场馆科学教育活动的创新呈现&rdquo;；胶州市少海小学马菁华副校长的&ldquo;从近海走向蔚蓝&nbsp;&rdquo;；青岛海璟科普文化有限公司李丽萍总经理的&ldquo;走向深蓝&rdquo;；青岛海精灵科教文化有限公司褚聪聪总工的&ldquo;蔚蓝科教&middot;海洋篇&rdquo;；青岛中海探索文化科技有限公司王晓波总工的&ldquo;探索科学中心&rdquo;。</p>\r\n\r\n<p>论坛期间，与会专家围绕&ldquo;海洋科普与教育&rdquo;这一主题进行了深入探讨，总结交流了我国海洋科普与教育工作的先进经验、最新进展，本次论坛的召开将对我国海洋科普与教育事业发展起到积极的促进作用，鼓励、团结广大海洋湖沼科技工作者和海洋科普教育专家，把普及科学知识、弘扬科学精神、传播科学思想、倡导科学方法作为义不容辞的责任，在全社会推动形成讲科学、爱科学、学科学、用科学的良好氛围，创新海洋科普理念和服务模式，推动形成社会化科普工作格局，为把我国建设成为海洋湖沼科技强国发挥积极作用。</p>', '1', '1', '0', '32', '2017-11-11 11:29:14', '32', '2017-11-11 12:04:07');
INSERT INTO `byp_exhibition_activity_info` VALUES ('39', '36', '海洋生物材料的最新进展与发展趋势论坛', '18334', '8', '<p>为响应党的十八大提出的建设海洋强国的国家战略目标，充分发挥青岛作为新亚欧大陆桥经济走廊主要节点城市和海上合作战略支点的区位优势，深入挖掘青岛乃至全国的海洋科研人才和技术潜力，青岛蓝谷科学技术协会携手中国科学院海洋研究所、青岛海洋科学与技术国家重点实验室、青岛蓝谷管理局于 2017 年 9 月12-14 日举办第二届中国&middot;青岛国际海洋科技展览会（简称&ldquo;海科展&rdquo;)。借助本次海科展提供的平台，青岛大学海洋纤维新材料研究院将于2017 年 9 月13日下午在青岛国际展览中心举办&ldquo;海洋生物材料的最新进展与发展趋势论坛&rdquo;。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111120929_463.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>本次论坛由青岛大学海洋纤维新材料研究院院长夏延致教授主持，论坛邀请了中科院海洋研究所段德麟教授、中国水产科学研究院冷凯良研究员、中国科学院海岸带研究所秦松教授、海斯摩尔生物科技有限公司胡广敏董事长等国内海洋生物材料领域知名学者和企业家代表。论坛旨在探索海洋生物材料的开发前景，推动海洋生物材料技术成果转化，促进海洋经济向生态环保可持续的方向发展。论坛将围绕海洋生物材料绿色提取、海洋生物材料最新应用及海洋生物材料未来发展趋势等主题展开交流和研讨，具体议题包括海洋生物质纤维及其应用、组织工程角膜的最新研究进展、硅藻壳聚糖合成途径相关基因的挖掘与功能分析等。</p>\r\n\r\n<p><img alt=\"\" src=\"https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171111/pic/20171111120951_980.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>本次论坛还得到了东岚高科(青岛)有限公司和青岛蓝谷管理局的大力支持。</p>', '1', '1', '0', '32', '2017-11-11 12:10:02', '32', '2017-11-11 12:10:02');
