INSERT INTO `byp_exhibition_booth_document_info` VALUES ('42', '118', '5月26日-青岛市人社局、市北区政府相关领导莅临公司参观考察', '81', '2017年5月26日上午10时许，青岛市委组织部副部长、市人社局局长纪\r\n敏和青岛市北区委书记郑德燕等多位领导莅临公司参观考察，调研企业的经营发展情况，听取了企业领导关于公司发展方向的讲解和产品介绍，并根据介绍内容提出了问题和建议。', '18763', '1', '1', '1', '1', '0', '204', '2017-11-15 10:07:21', '204', '2017-11-15 11:34:49');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('43', '118', '6月9日-2017首届中创高科技博士创新论坛在青岛召开', '81', '2017年6月9日,由中创博士俱乐部主办，我公司合作协办的&ldquo;2017年首届中创高科技博士创新论坛&rdquo;在青岛市北博士创业园成功召开。', '18773', '2', '1', '1', '1', '0', '204', '2017-11-15 10:08:32', '204', '2017-11-15 10:08:32');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('44', '118', '7月27日-我公司入驻青岛（市北）博士创业园', '81', '2017年7月27日，青岛（市北）博士创业园企业入驻签约仪式在青岛市市北区山东路171号乙青岛科技创新大厦举行。', '18777', '3', '1', '1', '1', '0', '204', '2017-11-15 10:10:03', '204', '2017-11-15 10:10:03');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('45', '118', '9月1日-我公司参加&ldquo;青岛（市北）博士创业园企业座谈会&rdquo;', '81', '2017年9月1日下午2点，青岛（市北）博士创业园企业座谈会在青岛科技创新大厦举行。', '18778', '4', '1', '1', '1', '0', '204', '2017-11-15 10:11:58', '204', '2017-11-15 11:35:15');
