INSERT INTO `byp_exhibition_booth_document_info` VALUES ('47', '118', '9月12日-将参加2017中国（青岛）国际海洋科技展', '81', '中国（青岛）国际海洋科技展览会，简称&ldquo;OST&rdquo;，自2016年在青岛蓝谷举办，致力于打造最具规模、影响力的全国乃至全球海洋科技交流平台、成果交易平台。', '18780', '6', '1', '1', '1', '0', '204', '2017-11-15 10:15:14', '204', '2017-11-15 10:15:14');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('48', '118', '10月18日-我公司参加观看十九大开幕式实况直播活动', '81', '&ldquo;喜迎十九大，共赴新征程&rdquo;，为迎接党的十九大顺利召开，营造蓬勃向上的良好氛围。', '18781', '7', '1', '1', '1', '0', '204', '2017-11-15 10:15:44', '204', '2017-11-15 11:23:35');
