INSERT INTO `byp_exhibition_booth_document_info` VALUES ('73', '135', '揭秘&ldquo;疯狗浪&rdquo;（一）', '132', '1498年，哥伦布第3次前往美洲。当他的船队驶过特立尼达附近的海峡时，突如其来的超级巨浪将他的船队托起。', '19241', '1', '1', '1', '1', '0', '245', '2017-11-16 13:31:48', '245', '2017-11-16 16:16:44');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('74', '135', '沃夫特.蒙克和实地海浪观测实验', '132', '说起&ldquo;疯狗浪&rdquo;的研究，就不能不提及沃尔特.蒙克和他的实地海浪观测实验。', '19242', '2', '1', '1', '1', '0', '245', '2017-11-16 13:34:15', '245', '2017-11-16 14:41:28');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('75', '135', '&ldquo;疯狗浪&rdquo;也能实验室制造（二）', '132', '当长波浪与短波浪相遇是，一个波浪中的所有能量会骤然聚集在几个&ldquo;怪波&rdquo;之中&mdash;&mdash;有时甚至只有一个。', '19243', '3', '1', '1', '1', '0', '245', '2017-11-16 13:37:05', '245', '2017-11-16 16:17:05');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('76', '135', '&ldquo;疯狗浪&rdquo;并非传说（三）', '132', '&ldquo;德劳普纳巨浪&rdquo;被媒体报道后，人们才发现原来传说中的&ldquo;疯狗浪&rdquo;真的存在。', '19244', '4', '1', '1', '1', '0', '245', '2017-11-16 13:39:13', '245', '2017-11-16 16:17:26');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('77', '135', '&ldquo;疯狗浪&rdquo;从何而来（四）', '132', '科学家研究后认为&ldquo;疯狗浪&rdquo;产生的条件可归纳为2中。', '19245', '5', '1', '1', '1', '0', '245', '2017-11-16 13:40:14', '245', '2017-11-16 16:17:49');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('78', '135', '&ldquo;路易斯陛下&rdquo;号游轮遇袭事件', '132', '2010年3月3日，&ldquo;路易斯陛下&rdquo;号游轮离开西班牙东部的巴塞罗那，前往意大利北部的热那亚。', '19258', '6', '1', '1', '1', '0', '245', '2017-11-16 13:42:23', '245', '2017-11-16 14:40:48');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('79', '135', '伟大的海上探路者&mdash;&mdash;达.伽马（1）', '132', '达.伽马出生于葡萄牙希尼斯，他的父亲是一位严肃的贵族军官，这影响并造就了达.伽马坚韧而冷酷的性格。', '19275', '7', '1', '1', '1', '0', '245', '2017-11-16 14:18:56', '245', '2017-11-16 14:40:40');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('80', '135', '伟大的海上探路者&mdash;&mdash;达.伽马（2）', '132', '青年时期的达.伽马参加过葡萄牙和西班牙的战争，在军事上建有功勋，因此得到了王室的信任', '19276', '8', '1', '1', '1', '0', '245', '2017-11-16 14:22:45', '245', '2017-11-16 14:40:30');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('81', '135', '伟大的海上探路者&mdash;&mdash;达.伽马（3）', '132', '经过了5个月的艰难航行，12月10日，达.伽马一行到达了迪亚士航行的最远端，也就是现在南非东部的大雨河河口。', '19277', '9', '1', '1', '1', '0', '245', '2017-11-16 14:26:13', '245', '2017-11-16 14:40:17');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('82', '135', '&ldquo;镜头迷&rdquo;阿康（一）', '132', '作为专业摄影师，阿康对各式各样的摄影器材如数家珍，但他不喜欢拘泥于摄影棚，而是享受户外的自由自在。', '19280', '10', '1', '1', '1', '0', '245', '2017-11-16 14:28:21', '245', '2017-11-16 16:14:44');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('83', '135', '&ldquo;后起之秀&rdquo;石教练（二）', '132', '石教练总说自己在摄影这行里是后起之秀，之所以称他为教练，是因为他以前是一名优秀的潜水教练。', '19283', '11', '1', '1', '1', '0', '245', '2017-11-16 14:29:55', '245', '2017-11-16 16:15:03');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('84', '135', '&ldquo;探险王&rdquo;王老师（三）', '132', '生物专业的王老师在学生的眼中是个十足的旅行荷探险爱好者，因此有了个&ldquo;探险王&rdquo;的外号。', '19284', '12', '1', '1', '1', '0', '245', '2017-11-16 14:31:35', '245', '2017-11-16 16:16:04');
