INSERT INTO `byp_exhibition_booth_document_info` VALUES ('88', '135', '舟影鼓鸣（二）', '132', '石寨山型铜鼓是我国古代南越地区于东南亚越南、柬埔寨、泰国、马来西亚、印度尼西亚等地都有发现。', '19289', '13', '1', '1', '1', '0', '245', '2017-11-16 14:38:16', '245', '2017-11-16 16:14:09');
