INSERT INTO `byp_exhibition_booth_document_info` VALUES ('90', '147', '基于GNSS卫星的海洋多功能浮标监测系统', '144', '基于GNSS卫星的海洋多功能浮标监测系统是一种稳定可靠、连续工作能力强、测量数据准确度高的全天候测量系统。可安装在目前国内外多种浮标体内，并可在任一海域连续长期测量瞬时海面高、潮汐、波浪等水文参数。同时该系统具有较强的扩展功能，拥有多路数字和模拟数据采集通道，可以采集目前海洋浮标搭载的大多数的气象和水文传感器数据。', '19459', '1', '1', '1', '1', '0', '212', '2017-11-16 17:14:24', '212', '2017-11-16 17:14:24');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('91', '147', '多参数水质监测仪', '147', '多参数水质监测仪采用国际先进的荧光技术，灵敏度高，能实时在线监测水中的污染物含量，精度达到国际先进水平。监测仪具有性价比高，功耗低、多种通讯方式、在线处理和存储等功能。实时监测结果可通过通讯传输到手机、平板电脑、笔记本电脑和其它装置，也可通过这些装置遥控监测仪。监测仪可带六个传感器，监测水中六种污染物质的含量，包括重原油、轻原油、浊度、有色溶解有机物（CDOM）、藻红蛋白和溶解氧。', '19461', '2', '1', '1', '1', '0', '212', '2017-11-16 17:15:13', '212', '2017-11-16 17:15:13');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('92', '149', '形优技术介绍', '198', 'PolyJet 3D 打印技术具有快速加工和原型制造的诸多优势，甚至能快速、高精度地生成具有卓越的精致细节、表面平滑的最终用途零件。', '19550', '10', '1', '1', '1', '0', '227', '2017-11-17 10:35:04', '227', '2017-11-17 10:35:04');
