INSERT INTO `byp_exhibition_booth_document_info` VALUES ('102', '168', '公司介绍', '294', '青岛双瑞海洋环境工程股份有限公司（以下简称&ldquo;青岛双瑞&rdquo;）是中国船舶重工股份有限公司的控股子公司，成立于2003年，是拥有船舶压载水处理、腐蚀控制、电解制氯、海水淡化、饮用水消毒处理、生活污水处理、船舶废气处理等领域集技术研发、产品设计、生产施工、试验检测和工程总承包为一体的高科技产业公司。青岛双瑞连续10年被评为国家高新技术企业，是国家火炬计划重点高新技术企业。', '20349', '1', '1', '1', '1', '0', '290', '2017-11-18 08:59:11', '290', '2017-11-18 08:59:11');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('103', '168', '青岛双瑞BalClor获得USCG证书', '297', '青岛双瑞海洋环境工程股份有限公司（以下简称青岛双瑞）研发的拥有完全自主知识产权的BalClor&reg;压载水管理系统（BWMS），于2017年6月6日获得美国海岸警卫队（USCG）型式认可证书，成为亚洲首家、全球第四家获此证书的船舶压载水管理系统生产厂商。青岛双瑞 BalClor&reg; BWMS采用&ldquo;高效过滤+支路电解灭活&rdquo;技术，处理能力可达170-8500m3/h。', '20360', '3', '1', '1', '1', '0', '290', '2017-11-18 09:19:32', '290', '2017-11-18 09:19:32');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('104', '168', '青岛双瑞船用低速机高压SCR系统成功通过MDT', '297', '11月9日，青岛双瑞公司自主研发的船用低速机高压SCR系统在中国船柴青岛基地一次性通过MDT（曼恩柴油机与透平公司）的FTA台架试验，属于国内首例。同时，该系统成功通过CCS、DNV GL、LR三大船级社Tier Ⅲ排放台架试验。', '20361', '3', '1', '1', '1', '0', '290', '2017-11-18 09:20:40', '290', '2017-11-18 09:20:40');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('105', '177', '导航网介绍', '298', '&nbsp;导航网隶属于星河经纬（北京）资讯有限责任公司源自一九九三年六部委联合成立的中国高技术企业发展评价中心，秉承中国高技术企业发展评价中心降低中国企业经营成本的宗旨，除向政府管理部门及决策机构提供研究报告外，自2002年建立导航网（www.okcis.cn）开始向社会公开提供有偿建设信息服务。', '20371', '1', '1', '1', '1', '0', '194', '2017-11-18 09:31:44', '194', '2017-11-18 09:31:44');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('106', '168', '公司总宣传册（中文版2014）', '294', '青岛双瑞海洋环境工程股份有限公司（以下简称&ldquo;青岛双瑞&rdquo;）是中国船舶重工股份有限公司的控股子公司，成立于2003年，是拥有船舶压载水处理、腐蚀控制、电解制氯、海水淡化、饮用水消毒处理、生活污水处理、船舶废气处理等领域集技术研发、产品设计、生产施工、试验检测和工程总承包为一体的高科技产业公司。', '20382', '1', '1', '1', '1', '0', '290', '2017-11-18 09:52:53', '290', '2017-11-18 09:52:53');
