INSERT INTO `byp_exhibition_booth_document_info` VALUES ('109', '178', 'EchoQueen 宽带变频多波束测深仪', '309', 'Echo Queen是基于最新多波束技术发展成果精心打造而成的国产化多波束测深仪，是世界上分辨率最高的浅水多波束测深仪之一。', '20493', '9', '1', '1', '1', '0', '282', '2017-11-18 11:00:36', '282', '2017-11-18 11:00:36');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('110', '178', '倒置式回声仪（IES）', '313', '倒置式回声仪(IES)是一种海洋坐底观测仪器，可测量声波从海底发射经由水面反射再到海底接收的垂向声波往返传播时间（VATT），可安装压力传感器组成压力倒置式回声仪（PIES）.', '20494', '8', '1', '1', '1', '0', '282', '2017-11-18 11:03:31', '282', '2017-11-18 11:03:31');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('111', '178', '海测大师', '314', '海测大师6是一套完全自主研发的水道与海洋测绘调查软件，具备水道与海洋测绘调查现场作业所需的作业规划、调查导航，采集记录、实时处理、质量监控、结果展示与分析等各种实用功能，并将逐步发展成为广泛支持河道管理、水道测量、地形测绘、磁力调查、地质勘探、水下建造、海底布缆、港口安防、水下平台维护、USV/ROV/AUV作业支持等应用的完整解决方案。', '20495', '7', '1', '1', '1', '0', '282', '2017-11-18 11:08:30', '282', '2017-11-18 11:08:30');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('112', '178', '单点三维声学海流计', '315', '海星TM单点三维声学海流计配备四个声学换能器，采用高精度、高稳定性的直达波相位测量法，对水体进行高精度的三维流速测量。测量方法不依赖水体悬浮颗粒物后向声学反射信号，在洁净的水域依然能有效开展测量。采用超低功耗设计，可长时间值班测量。体积小，重量轻，便于安装和维护，非常适合于搭载于锚系观测链。', '20496', '5', '1', '1', '1', '0', '282', '2017-11-18 11:10:38', '282', '2017-11-18 11:10:38');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('113', '178', '剑鱼1020D侧扫声呐', '316', '剑鱼1020D侧扫声呐系统是一款现代数字线性调频拖曳式侧扫声呐，由全球首台Chirp技术侧扫声呐系统总设计师John Baker亲自操刀，结合最新技术发展成果，专为边界电子精心研发设计的。剑鱼1020D集成了FSI的CHIRPceiverTM 24bit CHIRP信号处理器以及100/400KHz双频同步扫测等先进技术来保证卓越的成像能力。大量程、高分辨率成像、2000米水深耐压等级使得剑鱼1020D成为多种中浅水测量应用的理想工具。', '20502', '3', '1', '1', '1', '0', '282', '2017-11-18 11:14:28', '282', '2017-11-18 11:14:28');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('114', '178', 'SSC-4/8 同步控制器', '317', '同步控制器可输出多路同步信号，为其他电子仪器的工作提供同步触发信号。', '20505', '2', '1', '1', '1', '0', '282', '2017-11-18 11:16:45', '282', '2017-11-18 11:16:45');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('115', '153', '智慧云图亮相2017中国（青岛）国际海洋科技展览会', '322', '2017年9月14日2017中国（青岛）国际海洋科技展览会在青岛国际博览中心圆满落幕！青岛智慧云图信息科技有限公司如邀参加展会，展示了智慧海洋信息化解决方案，巩固了已有合作关系，还发掘了大批潜在客户，为开拓市场奠定了基础。&nbsp;本届展会分为海洋科技新成果和新技术、海洋工程装备和仪器设备、海洋服务和咨询、海水综合利用、海洋生物五大板块，500余家海内外知名企业携各自最新成果参展，引领海洋科技最新动向。', '20536', '6', '1', '1', '1', '0', '268', '2017-11-18 11:53:10', '268', '2017-11-18 11:53:10');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('116', '153', '企业信息', '322', '青岛智慧云图信息科技有限公司作为国家级高新技术企业、双软认定企业，专业从事空间数据处理与建库，遥感影像处理，电子地图制作、地理信息系统研发及智慧海洋+大数据应用服务。公司重点专注于智慧海洋、大数据技术的研究，并积极探索&ldquo;空间信息+&rdquo;产业生态圈的建设，为用户提供智慧海洋整体解决方案。', '20537', '5', '1', '1', '1', '0', '268', '2017-11-18 11:54:14', '268', '2017-11-18 11:54:14');
