INSERT INTO `byp_exhibition_booth_document_info` VALUES ('132', '191', '全系统高性能星基增强定位板卡 P328', '408', 'P328是合众思壮基于全新一代基带芯片&ldquo;天琴&rdquo;开发的支持中国精度星基增强的高性能的定位接收机，单机即可实现厘米级定位精度。板卡支持多系统多频点，BDS B1/B2/B3；GPS L1CA/L1P/L1C/L2P/L2C/L5；GLONASS G1/G2,P1/P2；GALILEO E1BC/E5a/E5b；QZSS L1CA/L2C/L5/L1C；L-Band。', '21729', '99', '1', '1', '1', '0', '222', '2017-11-21 10:20:46', '222', '2017-11-21 10:20:46');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('133', '191', '星基增强信标接收机R330', '409', 'R330采用Hemisphere GNSS公司EclipseTM平台和我们最新的GNSS专利技术，R330支持GPS、GLONASS、BDS，R330通过使用诸如RTK、L-Band和信标等多种校正方法提供了精确的定位信息。可在任何高精度要求的海洋或者陆地应用中，都工作性能良好。', '21740', '98', '1', '1', '1', '0', '222', '2017-11-21 10:31:12', '222', '2017-11-21 10:31:12');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('134', '191', '分体式测向定位接收机Vector VS330', '410', '通过将L-Band技术整合在VectorTM VS家族产品中，精密海洋和陆地应用要求了VectorTM VS131/VS330接收机卓越的定向和定位性能，Vector VS131是在可接收到L-Band服务区域内进行专业机械控制和导航应用的理想选择，其自身的显示和用户界面，可以便捷地安装在终端设备上；双GPS天线可根据用户的定向精度要求进行单独安装。', '21741', '97', '1', '1', '1', '0', '222', '2017-11-21 10:32:08', '222', '2017-11-21 10:32:08');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('135', '191', '星基增强定位测向智能天线/GNSS罗经VectorV320', '411', 'VectorTM V320 GNSS罗经拥有精确定位和定向性能的卓越导航体验，支持GPS/GLONASS/BDS三星七频，高精度定位及测向。此外，支持合众思壮开发及运营的中国精度全球星基增强服务，单机即可获得厘米级高精度位置信息。采用先进的测向及定位技术从而提供了一个基于智能天线的低成本、高效率的定向和定位解决方案。', '21742', '96', '1', '1', '1', '0', '222', '2017-11-21 10:33:10', '222', '2017-11-21 10:33:10');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('136', '191', '智能监控终端MG10', '412', 'MG10高精度GNSS定位终端具有体积小巧、功能齐全、接口丰富等特点，可方便用于车辆监控、工程检测、机械控制、自动化数据采集等项目应用。', '21743', '95', '1', '1', '1', '0', '222', '2017-11-21 10:34:02', '222', '2017-11-21 10:34:02');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('137', '191', '坚固型北斗智能终端A5', '413', 'A5坚固型北斗智能终端最新升级版骁龙64位四核处理芯片，在兼容BDS、GPS、GLONASS全星座卫星系统接收的同时，支持CORS系统接入，最高可达亚米级定位精度，全网通的网络制式优化用户资产配置效率，是专业高精度采集和导航的理想选择。', '21744', '94', '1', '1', '1', '0', '222', '2017-11-21 10:34:48', '222', '2017-11-21 10:34:48');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('138', '191', 'GNSS智能天线UA203', '414', 'UA203TMGNSS智能天线提供了一种低成本的专业高精度定位解决方案。内置高精度天线和多模GNSS高精度接收机。天线具有优越的增益、相位中心、极化轴比等性能，GNSS接收机覆盖GPS、GLONASS、北斗信号的接收。输出信号接口包括两路RS232数据交换串口和一路秒脉冲信号，可为测量、机械控制、导航、授时等系统提供高精度位置、速度与时间等数据信息。', '21745', '93', '1', '1', '1', '0', '222', '2017-11-21 10:35:57', '222', '2017-11-21 10:35:57');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('139', '191', '坚固型智能平板UG905高精度版', '415', 'UG905高精度版使用全星座卫星系统定位芯片，更快的骁龙8核处理器，32GB大容量闪存，全网通网络，电池屏幕。今天，我们与时俱进，更新系统配置，发布UG905高精度版，不仅好用，而且精度高的有点狠。', '21747', '92', '1', '1', '1', '0', '222', '2017-11-21 10:36:35', '222', '2017-11-21 10:36:35');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('140', '191', 'G990高精度GNSS接收机', '416', 'G990高精度GNSS接收机是合众思壮公司的经典之作，基于20年专业GNSS产品研发经验整合国内外优质资源，为您奉上G990高精度GNSS接收机，完美品质期待与您共同见证。', '21749', '91', '1', '1', '1', '0', '222', '2017-11-21 10:37:16', '222', '2017-11-21 10:37:16');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('141', '191', 'NET20 PLUS高性能GNSS监测接收机', '417', 'NET20 PLUS是合众思壮公司针对CORS系统建设而设计的一款全星座高集成地基增强系统接收机。内置多星多频主板、3G、蓝牙、大容量存储、高容量电池、高清晰显示屏等。以LINUX系统作为开发平台，支持二次开发，功能强大稳定，更多数据接口，可兼容各领域的不同应用。', '21750', '89', '1', '1', '1', '0', '222', '2017-11-21 10:37:52', '222', '2017-11-21 10:37:52');
INSERT INTO `byp_exhibition_booth_document_info` VALUES ('142', '191', '全系统GNSS星基增强定位定向板卡 H328', '418', 'H328是合众思壮基于&ldquo;天琴&rdquo;芯片最新开发的一款高精度测向定位板卡，拥有一系列的最先进、最前沿的EclipseTM测向技术，包括短基线快速高精度测向，RTK定位，支持中国精度，单机实现厘米级定位精度。更低的功率消耗使其易于集成。', '21751', '88', '1', '1', '1', '0', '222', '2017-11-21 10:38:21', '222', '2017-11-21 10:38:21');
