INSERT INTO `byp_exhibition_booth_information_info` VALUES ('39', '111', '兴轮绳缆  绳牵世界', null, '四十年，只为一根绳\r\n我们用四十年去专研我们绳索的稳定性\r\n只为给您带来更安全\r\n我们用四十年去提升我们的创新性\r\n只为给您带来更高效\r\n我们用四十年去完善我们绳索的服务\r\n只为了让您更放心\r\n我们是兴轮绳缆\r\n是绳索的服务管家\r\n只为您提供更高效、节能、更具稳定性的绳索服务', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171113/pic/20171113153903_151.jpg&quot; style=&quot;height:744px; width:888px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171113/pic/20171113154015_391.jpg&quot; style=&quot;height:666px; width:888px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&amp;nbsp;&lt;/p&gt;', '1', '1', '1', '1', '0', '63', '2017-11-13 15:40:54', '63', '2017-11-15 10:12:27');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('40', '118', '青岛市人社局、市北区政府相关领导莅临公司参观考察', null, '2017年5月26日上午10时许，青岛市委组织部副部长、市人社局局长纪\r\n敏和青岛市北区委书记郑德燕等多位领导莅临公司参观考察，调研企业的经营发展情况。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171114/pic/20171114155904_19.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;2017年5月26日上午10时许，青岛市委组织部副部长、市人社局局长纪敏和青岛市北区委书记郑德燕等多位领导莅临公司参观考察，调研企业的经营发展情况，听取了企业领导关于公司发展方向的讲解和产品介绍，并根据介绍内容提出了问题和建议。&lt;/p&gt;\r\n\r\n&lt;p&gt;公司领导表示：青岛国能浩源海洋科技有限公司是一家以海洋科技为特色的高科技创新企业。目前公司的主要研发产品包括：海洋环境信息综合应用服务平台，水下滑翔机，模块化小型波浪发电装置及应用系统，小型高精度高海况浪流测量浮标等。公司未来将紧盯国家蓝色经济战略、着眼市场需求，加强与海洋相关科研单位的合作，为国家蓝色经济助力。&lt;/p&gt;\r\n\r\n&lt;p&gt;参观过程中，青岛市委组织部副部长、市人社局局长纪敏和青岛市北区委书记郑德雁对公司产品&amp;ldquo;水下滑翔机&amp;rdquo;非常感兴趣，提出了一系列问题，公司领导认真听取领导们提出的问题，并进行了一一解答。&lt;/p&gt;\r\n\r\n&lt;p&gt;公司领导表示：水下滑翔机不仅在海洋监测领域能够发挥重要作用，同时也具有非常广阔的军事用途，它可以在海底&amp;ldquo;静音&amp;rdquo;航行，使得传统的反潜声呐没有了用武之地。此外，水下滑翔机还能够携带各种侦察设备或武器，如同静默的&amp;ldquo;水下杀手&amp;rdquo;一样长时间潜伏海底，一旦得到命令再迅速启动。&lt;/p&gt;', '1', '1', '1', '1', '0', '204', '2017-11-14 15:48:47', '204', '2017-11-15 14:51:06');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('41', '117', '企业详细介绍', null, '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171114/pic/20171114155216_698.png&quot; style=&quot;height:876px; width:676px&quot; /&gt;&lt;/p&gt;', '1', '1', '1', '1', '0', '215', '2017-11-14 15:51:55', '215', '2017-11-14 15:52:20');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('42', '118', '2017首届中创高科技博士创新论坛在青岛召开', null, '2017年6月9日,由中创博士俱乐部主办，我公司合作协办的&ldquo;2017年首届中创高科技博士创新论坛&rdquo;在青岛市北博士创业园成功召开。围绕&ldquo;海洋产业&rdquo;这一主题，论坛邀请了众多顶尖高层次创新创业人才，全面展示了青岛及国内外各大科研单位及高校学科带头人的创业创新成果。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171114/pic/20171114160345_946.jpg&quot; style=&quot;height:457px; width:954px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;2017年6月9日,由中创博士俱乐部主办，我公司合作协办的&amp;ldquo;2017年首届中创高科技博士创新论坛&amp;rdquo;在青岛市北博士创业园成功召开。围绕&amp;ldquo;海洋产业&amp;rdquo;这一主题，论坛邀请了众多顶尖高层次创新创业人才，全面展示了青岛及国内外各大科研单位及高校学科带头人的创业创新成果。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;上午9时30分，论坛正式开始，政府领导和中创博士俱乐部负责人致辞后，数位海洋产业行业顶尖专家陆续登台，讲解自己的研究报告，将学术气氛一次次推向高潮。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp;下午五时许，参与论坛的各大教授陆续做完报告，会场充斥着浓烈的科研创新的学术氛围，在主持人的宣告下，2017届中创高科技博士创新论坛落下帷幕，并获得圆满成功。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;附：中创高科技博士创新论坛精彩研究报告目录：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;《关于水下滑翔机技术发展现状与海洋观测应用分析报告》&amp;mdash;&amp;mdash;孙秀军&lt;/p&gt;\r\n\r\n&lt;p&gt;《海洋明天技术联盟简介》&amp;mdash;&amp;mdash;宋军&lt;/p&gt;\r\n\r\n&lt;p&gt;《海洋混凝土与水务信息》&amp;mdash;&amp;mdash;王鹏刚&lt;/p&gt;\r\n\r\n&lt;p&gt;《海洋软管与相关水下生产系统研究》&amp;mdash;&amp;mdash;赵林&lt;/p&gt;\r\n\r\n&lt;p&gt;《CAE仿真分析助力高科技创新报告》&amp;mdash;&amp;mdash;戴昆&lt;/p&gt;\r\n\r\n&lt;p&gt;《电动汽车无刷直流电机能量回馈制动系统的研究报告》&amp;mdash;&amp;mdash;赵景波&lt;/p&gt;\r\n\r\n&lt;p&gt;《海洋水文观测数据的处理与管理报告》&amp;mdash;&amp;mdash;刘玉龙&lt;/p&gt;\r\n\r\n&lt;p&gt;《基于GPS波浪观测技术和北斗传输漂浮标项目汇报》&amp;mdash;&amp;mdash;马昕&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '2', '1', '1', '1', '0', '204', '2017-11-14 16:04:09', '204', '2017-11-14 16:04:09');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('43', '118', '我公司入驻青岛（市北）博士创业园', null, '2017年7月27日，青岛（市北）博士创业园企业入驻签约仪式在青岛市市北区山东路171号乙青岛科技创新大厦举行。\r\n27日下午2点，我公司与山东中创启华企业管理有限公司签订青岛（市北）博士创业园企业入驻协议书，这标志着我公司发展步入一个新的阶段。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171114/pic/20171114161027_340.jpg&quot; style=&quot;height:457px; width:954px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;2017年7月27日，青岛（市北）博士创业园企业入驻签约仪式在青岛市市北区山东路171号乙青岛科技创新大厦举行。&lt;/p&gt;\r\n\r\n&lt;p&gt;27日下午2点，我公司与山东中创启华企业管理有限公司签订青岛（市北）博士创业园企业入驻协议书，这标志着我公司发展步入一个新的阶段。&lt;/p&gt;\r\n\r\n&lt;p&gt;博士创业园负责人称：园区将对企业进行&amp;ldquo;进-管-出&amp;rdquo;的综合管理服务，指导协助乙方落实各项优惠扶持政策，同时为企业提供商机洽谈、项目推介、上午运营、人才培养、创业指导、成果交流等公共服务平台。&lt;/p&gt;\r\n\r\n&lt;p&gt;我公司领导也表示：公司将积极配合园区各项管理工作，力争在在合作中实现共赢。&lt;/p&gt;', '3', '1', '1', '1', '0', '204', '2017-11-14 16:11:04', '204', '2017-11-15 11:00:59');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('44', '118', '我公司参加&ldquo;青岛（市北）博士创业园企业座谈会&rdquo;', null, '2017年9月1日下午2点，青岛（市北）博士创业园企业座谈会在青岛科技创新大厦举行.', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171115/pic/20171115094939_885.jpg&quot; style=&quot;height:473px; width:988px&quot; /&gt;&amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;2017年9月1日下午2点，青岛（市北）博士创业园企业座谈会在青岛科技创新大厦举行。出席座谈会的有：青岛市北区人力资源和社会保障局局长张泳，青岛市北区人力资源和社会保障局主任李伟佳，青岛市北区人力资源和社会保障服务中心人才开发科科长池波，山东中创启华企业管理有限公司副总经理蔺文垒，青岛（市北）博士创业园负责人董旭及部分企业代表。我公司总经理作为企业代表出席了本次座谈会。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;会上，各企业代表向政府领导积极介绍了各自企业孵化发展情况，我公司负责人就公司情况及公司产品（海洋环境信息综合应用服务平台，水下滑翔机，模块化小型波浪发电装置及应用系统，小型高精度高海况浪、流、温、盐观测浮标等）做了简要介绍，政府领导在认真听取各单位的发言后，继续向企业了解其发展过程中遇到的问题，并逐项回应，结合企业实际过程中存在的困惑和希望提出了许多宝贵的意见和建议。&lt;/p&gt;\r\n\r\n&lt;p&gt;座谈会最后，青岛市北区人力资源和社会保障局局长张泳发言，他表示：政府非常重视与企业的对接，并将尽最大努力就企业发展过程中遇到的问题提供服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;下午4点，座谈会圆满结束。&lt;/p&gt;', '4', '1', '0', '1', '0', '204', '2017-11-15 09:10:33', '204', '2017-11-15 11:01:01');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('45', '118', '我公司参加2017中国（青岛）国际海洋科技展览会', null, '2017年9月12日至9月14日，我公司参加了2017中国（青岛）国际海洋科技展览会。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171115/pic/20171115095557_749.jpg&quot; style=&quot;height:473px; width:988px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;2017年9月12日至9月14日，我公司参加了2017中国（青岛）国际海洋科技展览会。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;本次展会由青岛蓝谷科学技术协会主办，在位于即墨的青岛国际博览中心举行。展会展出面积为30000平方米，共分为海洋科技新成果和新技术、海洋工程装备和仪器设备、海洋服务和咨询、海水综合利用、海洋生物等五大板块。500余家海内外知名企业携各自最新成果参展，引领海洋科技最新动向。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171115/pic/20171115095715_788.jpg&quot; style=&quot;height:473px; width:988px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;三天期间，我公司通过精彩的影像、海报、宣传页等展出方式，吸引观众驻足观看，提升了公司在行业内的知名度和影响力，达到了预期目的。&lt;/p&gt;', '5', '1', '1', '1', '0', '204', '2017-11-15 09:41:45', '204', '2017-11-15 09:57:22');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('46', '118', '9月12日-我公司将参加2017中国（青岛）国际海洋科技展', null, '中国（青岛）国际海洋科技展览会，简称&ldquo;OST&rdquo;，自2016年在青岛蓝谷举办，致力于打造最具规模、影响力的全国乃至全球海洋科技交流平台、成果交易平台。', '&lt;p&gt;中国（青岛）国际海洋科技展览会，简称&amp;ldquo;OST&amp;rdquo;，自2016年在青岛蓝谷举办，致力于打造最具规模、影响力的全国乃至全球海洋科技交流平台、成果交易平台。&lt;/p&gt;\r\n\r\n&lt;p&gt;2017中国（青岛）国际海洋科技展览会将于2017年9月12日至14日，在青岛国际博览中心（青岛市即墨市温泉镇温泉二路7-1号）举办。&lt;/p&gt;\r\n\r\n&lt;p&gt;以&amp;ldquo;科技经略海洋创新实现梦想&amp;rdquo;为主题，海科展将借海洋科技新成果及新技术、海洋工程装备及仪器设备、海洋服务及咨询、海水综合利用、海洋生物科技等五大板块，为参展观众带来最前沿的海洋科技盛宴。&lt;/p&gt;\r\n\r\n&lt;p&gt;我公司将于9月12日至14日参展，主要展示内容为海洋环境信息综合应用服务平台，水下滑翔机，模块化小型波浪发电装置及应用系统，小型高精度高海况浪流测量浮标等。&lt;/p&gt;', '6', '1', '0', '1', '0', '204', '2017-11-15 14:55:45', '204', '2017-11-15 14:56:20');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('47', '118', '10月18日-我公司参加观看十九大开幕式实况直播活动', null, '&ldquo;喜迎十九大，共赴新征程&rdquo;，为迎接党的十九大顺利召开，营造蓬勃向上的良好氛围。', '&lt;p&gt;&amp;ldquo;喜迎十九大，共赴新征程&amp;rdquo;，为迎接党的十九大顺利召开，营造蓬勃向上的良好氛围。园区管委于10月18日上午9点组织企业学习贯彻党的十九大精神，我公司积极响应园区号召，并派出代表出席观看十九大开幕式实况直播。&lt;/p&gt;', '7', '1', '0', '1', '0', '204', '2017-11-15 14:57:08', '204', '2017-11-15 14:57:27');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('48', '149', '形优制件社再增两台工业3D打印机，总投资数千万', null, '2017年，形优制件社成立并斥资建造全中国最顶级的3D打印工作间，为广大追求高质量的客户，提供工业3D打印服务，及国际标准的可测试性手板模型制作服务。\r\n为应对日益增加的订单数量，提升交付速度，形优制件社9月份又引进2台数百万级的工业3D打印机：Objet J750和 Fortus 380mc。', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;span style=&quot;font-size:16px&quot;&gt;形优制件社再增两台工业3D打印机，总投资数千万&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;2017年，形优制件社成立并斥资建造全中国最顶级的3D打印工作间，为广大追求高质量的客户，提供工业3D打印服务，及国际标准的可测试性手板模型制作服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117095815_448.png&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;为应对日益增加的订单数量，提升交付速度，形优制件社9月份又引进2台数百万级的工业3D打印机：Objet J750和 Fortus 380mc。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117095844_98.png&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117095904_354.png&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;至目前，制件社拥有多台工业3D打印机，均来自全球TOP1 3D打印机制造商&amp;mdash;美国Stratasys。包括：&lt;/p&gt;\r\n\r\n&lt;p&gt;FDM 3D打印机：&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;2台F370，&lt;/p&gt;\r\n\r\n&lt;p&gt;2台Fortus 450mc，&lt;/p&gt;\r\n\r\n&lt;p&gt;3台Fortus380mc，&lt;/p&gt;\r\n\r\n&lt;p&gt;1台Fortus 900mc&lt;/p&gt;\r\n\r\n&lt;p&gt;等FDM&amp;nbsp;工业3D打印机&lt;/p&gt;\r\n\r\n&lt;p&gt;Polyjet光固化3D打印机：&lt;/p&gt;\r\n\r\n&lt;p&gt;1台Objet 30prime，&lt;/p&gt;\r\n\r\n&lt;p&gt;2台Objet J750 全彩3D打印机，&lt;/p&gt;\r\n\r\n&lt;p&gt;1台Objet500Connex1&lt;/p&gt;\r\n\r\n&lt;p&gt;等Polyjet光固化工业3D打印机&lt;/p&gt;\r\n\r\n&lt;p&gt;每一台3D打印机都超百万，总投入数千万&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117095933_38.png&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117095948_739.jpg&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117100005_221.jpg&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117100028_184.jpg&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;与顶级工业3D打印机成配套的成型材料，也是由LG化学、杜邦、沙特基础工业等世界前列材料公司供应。制件社提供工程性塑料（ABS、PC、尼龙、ULTEM、PPSF等17种）和高性能光敏复合材料（高韧树脂、透明树脂、橡胶等近1000种复合材料）两大类材料。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117100052_91.jpg&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;所有材料均通过美国材料与试验协会认证，能提供传统板材所没有的详细MSDS（材料安全数据表），更能为你的功能性测试需求提供高质量保证。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;自运营以来，形优制件社服务世界500强及创新型客户超300家，拥有100多个高端会员客户。&lt;/p&gt;\r\n\r\n&lt;p&gt;形优制件社坚信可测试模型是设计验证的核心需求。我们严格按照两条&amp;ldquo;形优定义&amp;rdquo;为客户提供更高质量的工业3D打印服务、手板模型加工服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;可测试的&amp;ldquo;形优定义&amp;rdquo;&amp;mdash;&amp;mdash;&lt;/p&gt;\r\n\r\n&lt;p&gt;以进口顶级设备及材料保障高质量&lt;/p&gt;\r\n\r\n&lt;p&gt;模型制作材料与量产材料的类似性&lt;/p&gt;\r\n\r\n&lt;p&gt;材料与结构的同体一致性&lt;/p&gt;\r\n\r\n&lt;p&gt;不使用粘黏、翻模、覆膜等替代工艺&lt;/p&gt;\r\n\r\n&lt;p&gt;模型关键尺寸的严谨&lt;/p&gt;\r\n\r\n&lt;p&gt;保密机制的&amp;ldquo;形优定义&amp;rdquo;&amp;mdash;&amp;mdash;&lt;/p&gt;\r\n\r\n&lt;p&gt;数据、模型及后处理环节绝不外发、外包&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117100113_502.jpg&quot; style=&quot;height:167px; width:300px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;未来，形优制件社将继续致力为客户提供高质量的手板模型，以高端保障高质量交付，快速验证你的设计概念，从CAD到模型，从可测试模型到产品上市，制件社提供完善的解决方案。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '1', '1', '1', '1', '0', '227', '2017-11-17 10:02:04', '227', '2017-11-17 10:03:56');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('49', '172', '2017中国&bull;青岛国际海洋科技展览会', null, '公司在2017年9月17日参加了《2017中国&bull;青岛国际海洋科技展览会》，所展示的自主研发设计的高精度温盐深仪吸引了大量业内人士的关注，产品得到了行业的肯定。', '&lt;p&gt;公司在2017年9月17日参加了《2017中国&amp;middot;青岛国际海洋科技展览会》，&lt;/p&gt;\r\n\r\n&lt;p&gt;所展示的自主研发设计的高精度温盐深仪吸引了大量业内人士的关注，&lt;/p&gt;\r\n\r\n&lt;p&gt;产品得到了行业的肯定。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117174730_984.jpg&quot; style=&quot;height:667px; margin-left:60px; margin-right:60px; width:500px&quot; /&gt;&lt;/p&gt;', '1', '1', '1', '1', '0', '221', '2017-11-17 17:48:00', '221', '2017-11-17 17:50:17');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('50', '172', 'OI China国际海洋技术与工程设备展览会', null, '公司在2017年11月1日参加了第五届《OI China国际海洋技术与工程设备展览会》，此次展会展出了公司新研发的钛合金温盐深仪，深度可达海底7000米。并进行了现场的测量展示，测量数据的高准确度，高精度受到了参观人员的好评。产品的质量得到了业内人士的认可，吸引了大量客户前来咨询洽谈业务。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117175457_936.jpg&quot; style=&quot;height:708px; width:944px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 公司在2017年11月1日参加了第五届《OI China国际海洋技术与工程设备展览会》，此次展会展出了公司新研发的钛合金温盐深仪，深度可达海底7000米。并进行了现场的测量展示，测量数据的高准确度，高精度受到了参观人员的好评。产品的质量得到了业内人士的认可，吸引了大量客户前来咨询洽谈业务。&lt;/p&gt;', '2', '1', '1', '1', '0', '221', '2017-11-17 17:53:46', '221', '2017-11-17 17:56:35');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('51', '168', '青岛双瑞船用低速机高压SCR系统通过MDT FTA台架试验', null, '11月9日，青岛双瑞公司自主研发的船用低速机高压SCR系统在中国船柴青岛基地一次性通过MDT（曼恩柴油机与透平公司）的FTA台架试验，属于国内首例。同时，该系统成功通过CCS、DNV GL、LR三大船级社Tier Ⅲ排放台架试验。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118103902_662.jpg&quot; style=&quot;height:827px; width:827px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;11月9日，青岛双瑞公司自主研发的船用低速机高压SCR系统在中国船柴青岛基地一次性通过MDT（曼恩柴油机与透平公司）的FTA台架试验，属于国内首例。同时，该系统成功通过CCS、DNV GL、LR三大船级社Tier Ⅲ排放台架试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;该船用低速机高压SCR系统具有结构紧凑、自动化程度高、防震性好、催化剂效率高等优点，在系统设计、催化剂性能、控制策略等方面完全满足IMO柴油机NOx排放法规Tier Ⅲ及MDT FTA相关规定。本次台架试验，该系统配套安装于MAN 6S60ME-C8.5主机上，试验实测NOx排放值远低于IMO Tier Ⅲ规定的标准，赢得MDT公司和各船级社验船师的一致好评。&lt;/p&gt;\r\n\r\n&lt;p&gt;青岛双瑞公司长期致力于&amp;ldquo;资源节约、环境保护&amp;rdquo;，在海洋环保设备及船用关键设备领域不断推陈出新，继BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt;压载水管理系统之后，抓住船舶废气排放法规实施机遇，在中船重工集团及所属各船用柴油机厂的大力支持下，成功研制出具有完全自主知识产权、适用于中低速柴油机的高压系列SCR产品。此次该系统一举通过了MDT FTA台架试验以及三大船级社Tier Ⅲ排放台架试验，不仅填补了国内空白，还成功打破国外厂家在该领域的垄断，为今后的市场规模化推广应用迈出了关键的一步。&lt;/p&gt;', '1', '1', '1', '1', '0', '290', '2017-11-18 10:39:40', '290', '2017-11-18 10:39:40');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('52', '125', '深圳市强镜起重设备有限公司工程服务类', null, '深圳市强镜起重设备有限公司工程服务类', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094306_479.png&quot; style=&quot;height:666px; width:666px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;公司简介INTRODUCTION&lt;/p&gt;\r\n\r\n&lt;p&gt;深圳市强镜起重设备有限公司成立于2008年3月， 公司拥有一批高素质的管理人员，经验丰富，技术熟练的技术人员。公司以诚信为本，品质优先，服务至上为经营理念。以优质的产品，优越的性价比，周到的服务为宗旨，公司主要为石油公司、矿业公司、造船厂、港口码头、救助打捞作业、钻井承包商、工程机械公司提供专用的设备以及相关工程服务。&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;本公司是中海油总系统合格供应商，编号为：0300012121&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Shenzhen Qiangjing Qingzhong Equipment Co., Ltd(follow as SQJ) was set up in March,2008. Here, we have&amp;nbsp;a qualified team with highly- quality managers and experienced workers. Proving the high quality products, the best service is our consistent purpose. The business scope contains lifting equipments and their accessories, port supplies,&amp;nbsp;Ship Supplies and Oil platform supplies, shipyard ect.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;SQJ is the qualified supplier of CNOOC.NO:&amp;nbsp;0300012121&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094439_598.png&quot; style=&quot;height:905px; width:651px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094540_349.png&quot; style=&quot;height:905px; width:651px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;品牌代理：&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;台湾TIGER葫芦&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;德国YALE葫芦&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;英国BRIDON BRILUBE 70钢丝绳油脂&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;奥地利PEWAG高强度起重链条、发电厂专用捞渣系统链条&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;台湾YOKE起重配件（吊环、吊点、卸扣、绳套、滑轮、滑车）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;美国CROSBY起重配件（吊钩、卸扣、钢丝绳套、链条、滑车）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;英国BRIDON钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;西班牙SFE-犀飞力钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;意大利REDAELLI钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;All kinds of brands we &lt;/strong&gt;&lt;strong&gt;are &lt;/strong&gt;&lt;strong&gt;agenc&lt;/strong&gt;&lt;strong&gt;ing&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Taiwan TIGER chain blocks&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;&amp;nbsp;Germany YALE chain blocks&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;BRIDON BRILUBE 70 lubrication&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Austria PEWAG chain&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Taiwan YOKE ringing accessories(links, hooks ，shackles, thimbles, sheaves, blocks)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;USA &amp;nbsp;CROSBY （hooks, shackles, sockets, wire rope end fittings, chain, sheaves, blocks）&lt;/p&gt;\r\n\r\n&lt;p&gt;BRIDON wire rope (ropes are use in industry, the &amp;nbsp;crane in the ship, in windlass,&amp;nbsp;mining industry)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094632_650.png&quot; style=&quot;height:861px; width:665px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094649_550.png&quot; style=&quot;height:686px; width:887px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094755_833.png&quot; style=&quot;height:943px; width:426px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;工程服务类：&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;钢丝绳绕绳/排缆&lt;/p&gt;\r\n\r\n&lt;p&gt;海上电缆预紧力安装&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;吊机负载试重试验&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;钢丝绳索接头浇铸&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;&lt;strong&gt;Engineering &amp;nbsp;We &lt;/strong&gt;&lt;strong&gt;are &lt;/strong&gt;&lt;strong&gt;Servic&lt;/strong&gt;&lt;strong&gt;ing&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:7.1000pt&quot;&gt;1.Wire rope Spooling&lt;/p&gt;\r\n\r\n&lt;p&gt;2.Installation of marine cable pretightening&lt;/p&gt;\r\n\r\n&lt;p&gt;3.Crane load test&lt;/p&gt;\r\n\r\n&lt;p&gt;4.Wire rope socketing&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Spain SFE wire rope(ropes are use in industry, the &amp;nbsp;crane in the ship, in windlass,&amp;nbsp;mining industry)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;Italian REDAELLI wire rope (ropes are use in industry, the &amp;nbsp;crane in the ship, in windlass,&amp;nbsp;mining industry)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:18.0000pt&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094949_158.png&quot; style=&quot;height:695px; width:926px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120095012_650.png&quot; style=&quot;height:927px; width:695px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120095027_0.png&quot; style=&quot;height:927px; width:695px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '1', '1', '1', '1', '0', '193', '2017-11-18 19:22:48', '193', '2017-11-20 09:50:34');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('53', '120', '红岛东岚高科携手青大共建海藻纤维纸研发中心', null, '青岛新闻网7月10日讯 9日，&ldquo;青岛大学-东岚高科新材料新技术研发中心&rdquo;成立仪式在红岛经济区隆重举行。青岛新闻网记者了解到，青岛大学在海洋纤维新材料新技术方面具有厚实的研究基础和研发实力，而东岚高科（青岛）有限公司在相关纤维制成品生产及市场营销方面具有丰富经验和先进的理念，并有利用海藻纤维及原料开发后道制品的积极性和实力。在这种优势互补的前提下，双方强强联合，携手成立了研发中心。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120105209_585.jpg&quot; style=&quot;height:846px; width:546px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;青岛大学-东岚高科新材料新技术研发中心成立现场&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120105250_814.jpg&quot; style=&quot;height:846px; width:543px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;工作人员演示产品的阻燃特性&lt;/p&gt;\r\n\r\n&lt;p&gt;青岛新闻网7月10日讯 9日，&amp;ldquo;青岛大学-东岚高科新材料新技术研发中心&amp;rdquo;成立仪式在红岛经济区隆重举行。青岛新闻网记者了解到，青岛大学在海洋纤维新材料新技术方面具有厚实的研究基础和研发实力，而东岚高科（青岛）有限公司在相关纤维制成品生产及市场营销方面具有丰富经验和先进的理念，并有利用海藻纤维及原料开发后道制品的积极性和实力。在这种优势互补的前提下，双方强强联合，携手成立了研发中心。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;据介绍，青岛大学在海洋纤维研究领域，有着雄厚的研发实力，建有山东省高校海洋生物质纤维材料及纺织品协同创新中心，负有引领产业技术进步和解决社会发展中的需求的责任。东岚高科（青岛）有限公司将以海藻纤维纸为重点，在青岛大学及其企业专供纤维原料的基础上，在后道纤维纸及其他制品上联合攻关，与齐鲁工业大学造纸专业系联合攻克技术难关，使产品在外观、功能和用途上都取得了巨大突破，从而证明了&amp;ldquo;资源环境与人类的生产活动--是可以和谐共存&amp;rdquo;的研发理念。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;对于东岚高科的海藻纤维纸，相关负责人表示，传统的造纸一吨出10000平方米壁纸，而海藻纤维纸一吨出10000平方米。东岚高科的壁纸100%出口，截至目前，已有有2000万美金的订单量，主要出口欧洲、美国和日本，具有抗阻燃、抑菌和环保等特性。与青岛大学研发的主要项目是适用制作不同功能所需要的海藻纤维技术支持&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;青岛新闻网记者还了解到，研发中心拥有青岛大学夏延致教授为首的科技研发队伍，为东岚高科的海藻纤维纸的科技研发和创新提供了人才和技术质量保证；与此同时，联合研发基地拥有齐鲁工业大学王代启副教授作为&amp;ldquo;海藻纤维纸&amp;rdquo;的技术带头人，在造纸工业领域，将海洋纤维与造纸新材料技术和企业生产结合在一起，校企共同成长，实现学校与企业的互动共进，推动市场的开拓，最终实现合作共赢！（青岛新闻网记者 徐恺）&lt;/p&gt;', '1', '1', '1', '1', '0', '219', '2017-11-20 10:53:11', '219', '2017-11-21 13:41:26');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('54', '121', '西工大组织参加2017年中国（青岛）国际海洋科技展览会', null, '2017中国（青岛）国际海洋科技展览会于9月12&mdash;14日在青岛国际博览中心举行，本届海科展以&ldquo;科技经略海洋 创新实现梦想&rdquo;为主题，为参展观众带来最前沿的海洋科技盛宴。', '&lt;p&gt;2017中国（青岛）国际海洋科技展览会于9月12&amp;mdash;14日在青岛国际博览中心举行，本届海科展以&amp;ldquo;科技经略海洋 创新实现梦想&amp;rdquo;为主题，为参展观众带来最前沿的海洋科技盛宴。西工大为本次海科展做了充分准备并且精心安排，科技管理部、青岛研究院组织了西工大冰果团队、空间机构机器人团队、新通海上多功能浮潜平台团队和无人系统制导与控制研究团队等四个科研团队和50余项涉海专业发明专利参展，并带去了警用安防六旋翼无人机、Bingo-30工业级固定翼无人机、变构型小车、蛇形机械臂、ICT YZ-RMN数据处理单元等实物参展，突出了空天海融会贯通、学科间相互交叉的特点。西工大青岛研究院为依托，在展出已有展品的同时，吸引了很多涉海专业科研团队前来考察参观，为今后入驻西工大青岛研究院做好了充足准备。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120112640_615.jpg&quot; style=&quot;height:638px; width:851px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120112720_302.png&quot; style=&quot;height:600px; width:801px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;12日上午，即墨市委书记、青岛市蓝色硅谷管理局党委书记张军，即墨市市长、青岛蓝色硅谷管理局局长吕涛，青岛市科技局副局长李天传，青岛蓝色硅谷核心区管理委员会常务副主任岳国峰先后来到西工大展位参观指导，西工大青岛研究院常务副院长郑曦向各位领导逐一介绍西工大本次参展展品，并汇报了近年来西工大在海洋科技创新领域的科研成果。张军书记等领导同志均充分肯定了西工大在空天海领域不可撼动的地位，并提出了&amp;ldquo;加快产业化发展，与当地中小型企业合作带动青岛市海洋经济发展&amp;rdquo;的战略建议。&lt;/p&gt;\r\n\r\n&lt;p&gt;三天展会期间，西工大展位每天都吸引着大量展商和参观者前来咨询洽谈，寻求合作。大家通过视频资料和展品展板对西工大在空天海领域雄厚的科研能力和前沿技术创新方面的强大实力有了更直观的了解。&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;中国（青岛）国际海洋科技展览会已经成为青岛海洋科技产业对外交流合作、招商引智的重要支撑平台，在展示企业风采、促进产业交流合作等方面做出了巨大贡献。未来西工大将依托青岛研究院以及青岛市蓝色硅谷核心区的建设大力发展海洋经济，科学开发海洋资源，培育海洋优势产业，充分发挥西工大的航空航天航海领域优势，加快西工大在海洋科技成果孵化领域和海洋科技成果产业化推广领域的建设。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '1', '1', '1', '1', '0', '223', '2017-11-20 11:28:02', '223', '2017-11-20 11:50:49');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('55', '121', '西北工业大学张骏副书记一行赴青岛蓝谷洽谈', null, '月15日上午，西北工业大学党委常委、副书记张骏一行赴青岛市蓝色硅谷指导推进我校青岛研究院建设工作，并与即墨市委书记、青岛蓝谷管理局党委书记张军，青岛蓝谷管理局常务副局长岳国峰、青岛蓝谷管理局副局长王学东等进行了座谈交流。', '&lt;p&gt;9月15日上午，西北工业大学党委常委、副书记张骏一行赴青岛市蓝色硅谷指导推进我校青岛研究院建设工作，并与即墨市委书记、青岛蓝谷管理局党委书记张军，青岛蓝谷管理局常务副局长岳国峰、青岛蓝谷管理局副局长王学东等进行了座谈交流。&lt;/p&gt;\r\n\r\n&lt;p&gt;会谈首先由西工大青岛研究院常务副院长郑曦汇报了青岛研究院建设进展和近期重点工作。张骏代表学校感谢蓝谷管理局的大力支持，并希望在加快推进青岛研究院建设的同时，启动西工大青岛研究生院的建设。张军表示即墨市和蓝谷将会一如既往的支持西工大在蓝谷的发展，欢迎西工大在蓝谷建设研究生院。&lt;/p&gt;\r\n\r\n&lt;p&gt;座谈会结束后，在蓝谷管理局副局长王学东的陪同下，张骏副书记一行参观了国家海洋科学与技术重点实验室和青岛海检集团有限公司。在&amp;ldquo;海洋+&amp;rdquo;的模式下，西工大将同时发挥航空航天学科领先优势，在青岛建成&amp;ldquo;空天地海&amp;rdquo;一体化的产业结构继续壮大西工大的科研实力。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113000_605.jpg&quot; style=&quot;height:643px; width:858px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113009_741.jpg&quot; style=&quot;height:643px; width:858px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '2', '1', '1', '1', '0', '223', '2017-11-20 11:30:31', '223', '2017-11-21 13:38:58');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('56', '121', '西工大青岛研究院装修工作全面启动', null, '017年9月27日，西北工业大学青岛研究院装修工作全面启动，各地段均有条不紊按计划进度施工。研究院办公区计划10月9日装修完成并正式启用，后续建设主要为实验室、成果孵化基地和宿舍区的装饰装修工作。预计2017年底完成一期12000㎡空间基础装修和家居配置。', '&lt;p&gt;2017年9月27日上午，西北工业大学青岛研究院常务副院长郑曦、办公室主任仝巍会见了北京校友、北京灵动飞天动力科技有限公司负责人吴刚、熊飞并就开展校企合作等事宜进行了深入交流。&lt;/p&gt;\r\n\r\n&lt;p&gt;会谈中，北京灵动飞天动力科技有限公司负责人吴刚、熊飞先后介绍了公司现状及业务发展情况。郑院长代表青岛研究院对校友们的来访表示诚挚欢迎并对学院的优势条件、建设目标、运营模式等基本情况进行了介绍。期间，仝主任带领客人一行赴西工大青岛研究院参观考察并作简单介绍。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113140_193.jpg&quot; style=&quot;height:642px; width:859px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113148_298.jpg&quot; style=&quot;height:642px; width:859px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;郑院长表示希望结合双方优势，开展合作，促进双赢。北京灵动飞天动力科技有限公司专注于无人机、发动机等生产，双方有意在航天技术发展方面开展合作。郑院长多次强调将&amp;ldquo;新新结合&amp;rdquo;作为双方合作的关键点，同时指出青岛研究院将作为孵化器、加速器并依托学校资源为校友提供技术支持及良好的发展机会。青岛研究院也将进一步为促进人才引进、创业创新加强团队建设。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '3', '1', '1', '1', '0', '223', '2017-11-20 11:32:58', '223', '2017-11-20 11:50:12');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('57', '121', '青岛研究院与北京校友洽谈合作', null, '2017年9月27日上午，西北工业大学青岛研究院常务副院长郑曦、办公室主任仝巍会见了北京校友、北京灵动飞天动力科技有限公司负责人吴刚、熊飞并就开展校企合作等事宜进行了深入交流。', '&lt;p&gt;2017年9月27日上午，西北工业大学青岛研究院常务副院长郑曦、办公室主任仝巍会见了北京校友、北京灵动飞天动力科技有限公司负责人吴刚、熊飞并就开展校企合作等事宜进行了深入交流。&lt;/p&gt;\r\n\r\n&lt;p&gt;会谈中，北京灵动飞天动力科技有限公司负责人吴刚、熊飞先后介绍了公司现状及业务发展情况。郑院长代表青岛研究院对校友们的来访表示诚挚欢迎并对学院的优势条件、建设目标、运营模式等基本情况进行了介绍。期间，仝主任带领客人一行赴西工大青岛研究院参观考察并作简单介绍。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113514_485.jpg&quot; style=&quot;height:642px; width:855px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113522_973.png&quot; style=&quot;height:594px; width:779px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;郑院长表示希望结合双方优势，开展合作，促进双赢。北京灵动飞天动力科技有限公司专注于无人机、发动机等生产，双方有意在航天技术发展方面开展合作。郑院长多次强调将&amp;ldquo;新新结合&amp;rdquo;作为双方合作的关键点，同时指出青岛研究院将作为孵化器、加速器并依托学校资源为校友提供技术支持及良好的发展机会。青岛研究院也将进一步为促进人才引进、创业创新加强团队建设。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '4', '1', '1', '1', '0', '223', '2017-11-20 11:35:38', '223', '2017-11-20 11:49:57');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('58', '121', '学校职能部门和学院领导到西工大青岛研究院调研', null, '2017年10月11日晚，我校党委宣传部部长闫育周、党委研工部部长李春科、党委学工部副部长王玉玲、校团委副书记李刚、力学与土木建筑学院党委书记高大力、马克思主义学院院长杨云霞、马克思主义学院教师高宝营一行七人在工业和信息化部2017年部属高校思想政治培训间隔到西工大青岛研究院展开调研。', '&lt;p&gt;2017年10月11日晚，我校党委宣传部部长闫育周、党委研工部部长李春科、党委学工部副部长王玉玲、校团委副书记李刚、力学与土木建筑学院党委书记高大力、马克思主义学院院长杨云霞、马克思主义学院教师高宝营一行七人在工业和信息化部2017年部属高校思想政治培训间隔到西工大青岛研究院展开调研。&lt;/p&gt;\r\n\r\n&lt;p&gt;西工大青岛研究院常务副院长郑曦带领闫育周部长一行参观了西工大青岛研究院。参观期间，郑院长对西工大青岛研究院的建设进展、近期工作重点及未来发展方向进行了简单介绍，闫育周部长对西工大青岛研究院未来发展前景给予了肯定。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113824_140.jpg&quot; style=&quot;height:743px; width:834px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120113851_338.jpg&quot; style=&quot;height:694px; width:927px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '5', '1', '1', '1', '0', '223', '2017-11-20 11:39:02', '223', '2017-11-21 13:38:24');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('59', '121', '我校智能结构与力学测试团队，入驻西工大青岛研究院', null, '2017年10月13日上午，西北工业大学徐超教授一行三人在西工大青岛研究院常务副院长郑曦的陪同下参观了青岛研究院，双方就在青岛研究院建立智能结构与力学测试青岛研究中心达成共识，并就近期入驻的时间节点及相关事宜进行商讨。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120135853_943.jpg&quot; style=&quot;height:694px; width:927px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120135935_139.jpg&quot; style=&quot;height:644px; width:860px&quot; /&gt;2017年10月13日上午，西北工业大学徐超教授一行三人在西工大青岛研究院常务副院长郑曦的陪同下参观了青岛研究院，双方就在青岛研究院建立智能结构与力学测试青岛研究中心达成共识，并就近期入驻的时间节点及相关事宜进行商讨。&lt;/p&gt;\r\n\r\n&lt;p&gt;首先，郑院长代表西工大青岛研究院欢迎徐超教授一行三人的到来，并对青岛研究院的基本情况进行了简单介绍。随后，徐教授表示，希望将西工大青岛研究院作为孵化基地引进离轨技术，实现产业化发展；同时，也希望将青岛研究院作为有力地展示平台，打造力学环境测试设备产业聚集区。对此，郑院长指出，青岛研究院将为智能结构与力学测试团队的入驻提供各项相关支持，以促进团队产业化的快速发展。最后，郑院长表示，徐教授带领的智能结构与力学测试团队将作为首批科研团队入驻青岛研究院，希望双方通力合作促进先进技术与智能化的发展。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '6', '1', '1', '1', '0', '223', '2017-11-20 13:59:47', '223', '2017-11-20 16:19:21');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('60', '121', '西工大青岛研究院参与蓝谷高校院所座谈会', null, '2017年10月13日下午，西工大青岛研究院常务副院长郑曦、办公室主任仝巍代表西北工业大学青岛研究院出席了蓝谷高校院所座谈会，本次座谈由青岛蓝谷管理局召开，常务副局长岳国峰主持，有西北工业大学青岛研究院在内的五所高校参与。', '&lt;p&gt;2017年10月13日下午，西工大青岛研究院常务副院长郑曦、办公室主任仝巍代表西北工业大学青岛研究院出席了蓝谷高校院所座谈会，本次座谈由青岛蓝谷管理局召开，常务副局长岳国峰主持，有西北工业大学青岛研究院在内的五所高校参与。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120140041_735.jpg&quot; style=&quot;height:694px; width:927px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;file:///C:/Users/Mineak/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg&quot; /&gt;本次会议的主要目的是促进高校院所的平稳快速发展，会上，各高校院所负责人汇报了各研究院的运行情况及发展困难；随后，青岛蓝谷管理局常务副局长岳国峰传达了&amp;ldquo;全市大众创业万众创新推进工作会议&amp;rdquo;会议精神；最后，岳局长就年底观摩事宜做了相关安排。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '7', '1', '1', '1', '0', '223', '2017-11-20 14:00:49', '223', '2017-11-20 16:19:07');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('61', '121', '我校海洋生物技术研究团队赴西工大青岛研究院商讨入驻细节', null, '2017年10月18日下午，我校海洋生物技术研究团队胡金璐、董凯老师一行赴西工大青岛研究院参观，并对近期入驻青岛研究院相关事宜进行商讨。', '&lt;p&gt;2017年10月18日下午，我校海洋生物技术研究团队胡金璐、董凯老师一行赴西工大青岛研究院参观，并对近期入驻青岛研究院相关事宜进行商讨。&lt;/p&gt;\r\n\r\n&lt;p&gt;西工大青岛研究院常务副院长郑曦对胡老师一行的到来表示热烈的欢迎，并带领客人参观了青岛研究院。胡老师一行表示产业化将作为团队未来的发展重点。同时，郑院长表示，青岛研究院会为各研究团队提供个性化的服务，未来研究院会在学科建设、科研办学的基础上，作为对外合作平台，技术创新示范空间为入驻团队提供相应服务和技术支持，促进产业化发展。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141255_726.jpg&quot; style=&quot;height:656px; width:857px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141303_623.jpg&quot; style=&quot;height:645px; width:859px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '8', '1', '1', '1', '0', '223', '2017-11-20 14:13:18', '223', '2017-11-21 13:37:47');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('62', '121', '青岛大学原校长王安民一行赴西工大青岛研究院座谈交流', null, '2017年10月19日上午，青岛大学原校长王安民、青岛科技局原办公室主任邢立民、青岛陕西商会会长张德祥等一行5人莅临西工大青岛研究院参观指导，并与青岛蓝谷管理局常务副局长岳国峰就推进青岛研究院建设工作进行座谈交流。', '&lt;p&gt;2017年10月19日上午，青岛大学原校长王安民、青岛科技局原办公室主任邢立民、青岛陕西商会会长张德祥等一行5人莅临西工大青岛研究院参观指导，并与青岛蓝谷管理局常务副局长岳国峰就推进青岛研究院建设工作进行座谈交流。&lt;/p&gt;\r\n\r\n&lt;p&gt;会议开始前，在西工大青岛研究院常务副院长郑曦的陪同下，王安民一行参观了西工大青岛研究院并听取了青岛研究院的建设进展及未来的发展方向的介绍，对研究院未来的发展前景给予了充分的肯定，同时就研究院未来的发展方向提出了宝贵的意见与建议。青岛蓝谷管理局常务副局长岳国峰在座谈时对王安民支持蓝谷建设表示欢迎和感谢，对西工大青岛研究院寄予厚望，并表示青岛蓝谷管理局将会为青岛研究院的发展提供大力的支持。最后，西工大青岛研究院常务副院长郑曦表示，西工大青岛研究院将始终贯彻落实新发展理念，打造一流的高校产学研深度融合创新中心、交叉应用创新驱动桥头堡与高端人才产学研良港。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141427_851.jpg&quot; style=&quot;height:643px; width:856px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141437_977.jpg&quot; style=&quot;height:643px; width:856px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '9', '1', '1', '1', '0', '223', '2017-11-20 14:14:56', '223', '2017-11-21 13:37:35');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('63', '121', '飞机电技术重点实验室研究团队赴西工大青岛研究院商讨入驻细节', null, '2017年10月27日上午，我校飞机电推进技术重点实验室研究团队张晓斌、吴小华、吴旋律、李伟林老师一行赴西工大青岛研究院参观，并对近期入驻青岛研究院相关事宜进行商讨。', '&lt;p&gt;2017年10月27日上午，我校飞机电推进技术重点实验室研究团队张晓斌、吴小华、吴旋律、李伟林老师一行赴西工大青岛研究院参观，并对近期入驻青岛研究院相关事宜进行商讨。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141627_612.jpg&quot; style=&quot;height:637px; width:856px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141639_250.jpg&quot; style=&quot;height:656px; width:854px&quot; /&gt;西工大青岛研究院常务副院长郑曦对胡老师一行的到来表示热烈欢迎，并为客人讲解了未来研究院的发展定位。张老师一行表示产业化将作为团队未来的发展重点。同时，郑院长表示，青岛研究院会为入驻的各研究团队做好资源对接，未来研究院会在学科建设、科研办学的基础上，作为对外合作平台，技术创新示范空间为入驻团队提供相应服务和技术支持，促进产业化发展。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '10', '1', '1', '1', '0', '223', '2017-11-20 14:17:28', '223', '2017-11-20 16:17:40');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('64', '121', '智能结构与力学测试团队在西工大青岛研究院举行入驻揭牌仪式', null, '2017年10月28日下午，我校智能结构与力学测试团队正式入驻西工大青岛研究院，并隆重举行揭牌仪式。', '&lt;p&gt;2017年10月28日下午，我校智能结构与力学测试团队正式入驻西工大青岛研究院，并隆重举行揭牌仪式。&lt;/p&gt;\r\n\r\n&lt;p&gt;西工大青岛研究院常务副院长郑曦、西北工业大学徐超教授、西北工业大学国际合作处副处长苟兴旺等出席本次活动。郑院长及徐教授亲手为先进结构与智能测试研究中心揭牌，智能结构与力学测试团队成员参加了揭牌仪式。&lt;/p&gt;\r\n\r\n&lt;p&gt;本次揭牌仪式顺利举办，徐超教授带领的智能结构与力学测试团队成为首批科研团队正式入驻西工大青岛研究院，也预示着西工大青岛研究院在科研平台建设的大局上更近一步。西工大青岛研究院将继续发挥在科学研究、成果转化和创新人才培养等方面的优势，积极与各级地方政府、行业单位合作，形成技术创新、产业优化的良性循环机制，达成共赢。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120141947_788.jpg&quot; style=&quot;height:642px; width:858px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142002_374.jpg&quot; style=&quot;height:642px; width:858px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '11', '1', '1', '1', '0', '223', '2017-11-20 14:20:11', '223', '2017-11-21 13:37:12');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('65', '121', '2017年中国飞行力学与飞行试验学术论坛 在青岛召开', null, '2017年10月28日-29日，中国航空学会飞行力学与飞行试验学术论坛在青岛举行。全国航空、航天、兵器科研院所及高等院校的40多名代表出席了本次论坛。', '&lt;p&gt;&amp;nbsp;2017年10月28日-29日，中国航空学会飞行力学与飞行试验学术论坛在青岛举行。全国航空、航天、兵器科研院所及高等院校的40多名代表出席了本次论坛。&lt;/p&gt;\r\n\r\n&lt;p&gt;本次论坛由中国航空学会飞行力学与飞行试验分会主办，西北工业大学、西北工业大学青岛研究院承办，航天飞行动力学技术国防重点实验室、航空工业飞行仿真重点实验室、陕西省空天飞行器设计重点实验室协办。10月28日，会议在青岛召开，会上，专家代表做了精彩的学术报告，体现了近年来航空、航天飞行力学和飞行试验学科的发展趋势、最新进展、研究成果和工作经验。随后，与会专家就报告进行了热烈的讨论和交流，呈现了浓厚的学术气氛和专业精神。10月29日，在西工大青岛研究院常务副院长郑曦的陪同下，与会专家赴西工大青岛研究院参观交流。经过两天的学术交流和探讨，本次会议取得了圆满的成功。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142246_452.jpg&quot; style=&quot;height:643px; width:857px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142257_404.png&quot; style=&quot;height:619px; width:824px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '12', '1', '1', '1', '0', '223', '2017-11-20 14:23:24', '223', '2017-11-21 13:36:59');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('66', '121', '军委科技委某领域青岛X重点实验室发展规划研讨会在青岛蓝谷召开', null, '2017年10月29日-30日，军委科技委某领域青岛X重点实验室（筹）发展规划研讨会在青岛举行，共有17位航空航天专家学者出席了本次会议。本次会议由航天飞行动力学技术国防重点实验室、西北工业大学青岛研究院主办。', '&lt;p&gt;2017年10月29日-30日，军委科技委某领域青岛X重点实验室（筹）发展规划研讨会在青岛举行，共有17位航空航天专家学者出席了本次会议。本次会议由航天飞行动力学技术国防重点实验室、西北工业大学青岛研究院主办。&lt;/p&gt;\r\n\r\n&lt;p&gt;10月29日下午，中央军委科技委某领域首席科学家、西北工业大学袁建平教授为会议做了热情洋溢的开幕致辞，随后，与会专家就实验室策划建议方案进行了深入的讨论和交流。10月30日上午，专家一行赴西工大青岛研究院参观交流，各位专家学者就航天领域相关技术展开了热烈的讨论，并为西工大青岛研究院未来发展提出了宝贵的意见。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142457_635.jpg&quot; style=&quot;height:651px; width:857px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142509_102.jpg&quot; style=&quot;height:645px; width:857px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '13', '1', '1', '1', '0', '223', '2017-11-20 14:25:20', '223', '2017-11-21 13:36:48');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('67', '121', '中国宇航学会秘书长、航天科技交流中心党组书记王一然...', null, '017年10月30日下午，西北工业大学副校长张卫红陪同中国宇航学会秘书长、航天科技交流中心党委书记王一然赴西工大青岛研究院视察，并与青岛蓝谷管理局副局长王学东等进行了座谈交流。\r\n会谈首先由西工大青岛研究院常务副院长郑曦汇报了青岛研究院建设进展和近期重点工作。张卫红副校长代表学校感谢青岛蓝谷管理局的大力支持，并希望青岛研究院进一步结合青岛实际发展需求，加快建立校内科研团队与青岛当地产业沟通渠道与机制，释放产研结合新活力。王一然秘书长对青岛研究院的建设进展、运行模式、发展规划进行了调研，希望学校和蓝谷结合陆海统筹，加强与航天企事业单位的合作。王学东表示蓝谷将会一如既往的支持西工大在蓝谷的发展。', '&lt;p&gt;017年10月30日下午，西北工业大学副校长张卫红陪同中国宇航学会秘书长、航天科技交流中心党委书记王一然赴西工大青岛研究院视察，并与青岛蓝谷管理局副局长王学东等进行了座谈交流。&lt;/p&gt;\r\n\r\n&lt;p&gt;会谈首先由西工大青岛研究院常务副院长郑曦汇报了青岛研究院建设进展和近期重点工作。张卫红副校长代表学校感谢青岛蓝谷管理局的大力支持，并希望青岛研究院进一步结合青岛实际发展需求，加快建立校内科研团队与青岛当地产业沟通渠道与机制，释放产研结合新活力。王一然秘书长对青岛研究院的建设进展、运行模式、发展规划进行了调研，希望学校和蓝谷结合陆海统筹，加强与航天企事业单位的合作。王学东表示蓝谷将会一如既往的支持西工大在蓝谷的发展。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142711_100.jpg&quot; style=&quot;height:647px; width:858px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120142725_137.jpg&quot; style=&quot;height:643px; width:859px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '14', '1', '1', '1', '0', '223', '2017-11-20 14:27:52', '223', '2017-11-21 13:36:33');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('68', '121', '&ldquo;一带一路航天创新联盟&rdquo;青年学者研讨会在青岛成功举办', null, '2017年10月29日-31日，由西北工业大学和中国宇航学会共同主办，西北工业大学青岛研究院承办的&ldquo;&lsquo;一带一路&rsquo;航天创新联盟青年学者研讨会&rdquo;在青岛举行。来自海内外联盟成员高校的70多名青年学者，围绕&ldquo;青年创造航天未来&rdquo;的主题，在深空探测、航天发射与动力、民用无人飞行系统、新型商业发射技术与载荷等方面开展广泛而深入的交流与研讨。', '&lt;p&gt;2017年10月29日-31日，由西北工业大学和中国宇航学会共同主办，西北工业大学青岛研究院承办的&amp;ldquo;&amp;lsquo;一带一路&amp;rsquo;航天创新联盟青年学者研讨会&amp;rdquo;在青岛举行。来自海内外联盟成员高校的70多名青年学者，围绕&amp;ldquo;青年创造航天未来&amp;rdquo;的主题，在深空探测、航天发射与动力、民用无人飞行系统、新型商业发射技术与载荷等方面开展广泛而深入的交流与研讨。&lt;/p&gt;\r\n\r\n&lt;p&gt;10月30日上午，西北工业大学副校长张卫红教授在研讨会开幕式上发表了欢迎辞，中国宇航学会副理事长兼秘书长王一然在大会致辞并对青年学者们的到来表示热烈的欢迎；随后，会议代表们做了精彩的主旨报告。10月30日下午，与会代表分别围绕深空探测、航天发射与动力、商业发射技术与载荷以及民用无人飞行系统等四个分论坛主题进行了认真交流，深入研讨。10月31日，在西工大青岛研究院常务副院长郑曦的陪同下，与会代表赴西工大青岛研究院参观交流，并对青岛研究院未来发展给予了充分的肯定。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120143341_886.jpg&quot; style=&quot;height:639px; width:850px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120143401_722.jpg&quot; style=&quot;height:638px; width:851px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '15', '1', '1', '1', '0', '223', '2017-11-20 14:34:20', '223', '2017-11-21 13:35:52');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('69', '121', '常务副校长黄维院士一行 赴西工大青岛研究院考察调研', null, '017年11月2日，常务副校长黄维院士一行赴西工大青岛研究院进行考察调研，并与即墨区区委书记、青岛蓝谷管理局党委书记张军，青岛蓝谷管理局常务副局长岳国峰等进行了交流。西工大青岛研究院常务副院长郑曦、办公室主任仝巍等参加了接待。', '&lt;p&gt;2017年11月2日，常务副校长黄维院士一行赴西工大青岛研究院进行考察调研，并与即墨区区委书记、青岛蓝谷管理局党委书记张军，青岛蓝谷管理局常务副局长岳国峰等进行了交流。西工大青岛研究院常务副院长郑曦、办公室主任仝巍等参加了接待。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153513_832.jpg&quot; style=&quot;height:737px; width:856px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153522_431.jpg&quot; style=&quot;height:694px; width:927px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153534_604.jpg&quot; style=&quot;height:689px; width:861px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153543_425.jpg&quot; style=&quot;height:657px; width:859px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;在青岛蓝谷管理局常务副局长岳国峰的陪同下，黄维院士一行参观了青岛蓝谷规划展览馆、青岛海洋科学与技术国家实验室，相关负责人陪同参观并进行了介绍。参观结束后，黄维院士到西工大青岛研究院听取了西工大青岛研究院常务副院长郑曦对西工大青岛研究院建设进展、运行模式及发展规划的汇报，黄维院士对西工大青岛研究院现阶段工作成绩给予了肯定，同时就西工大青岛研究院未来发展方向提出了宝贵的意见与建议。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;', '16', '1', '1', '1', '0', '223', '2017-11-20 15:35:50', '223', '2017-11-21 13:34:59');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('70', '121', '我校三航生物交叉技术创新中心研究团队赴西工...', null, '2017年11月5日上午，我校生命学院三航生物交叉技术创新中心研究团队仓怀兴、牛卫宁、卢慧甍老师一行赴西工大青岛研究院参观，并就近期入驻青岛研究院相关事宜进行商讨。', '&lt;p&gt;2017年11月5日上午，我校生命学院三航生物交叉技术创新中心研究团队仓怀兴、牛卫宁卢慧甍老师一行赴西工大青岛研究院参观，并就近期入驻青岛研究院相关事宜进行商讨。&lt;/p&gt;\r\n\r\n&lt;p&gt;西工大青岛研究院常务副院长郑曦对仓院长一行的到来表示热烈欢迎，并为客人详细讲解了青岛研究院现阶段的建设、团队入驻情况以及未来研究院的发展思路与方向。仓院长一行充分肯定了青岛研究院的规划建设方案，同时提出了生命学院的基础研究要与产业化紧密结合起来，团队要和当地有相关技术需求的企业深度融合，在实践中寻求突破，达到双赢的目的。仓院长还介绍了中科院相关的技术转移中心在产业化方面的成功模式与经验，并带来了已经可以产业化的研究成果产品，希望团队将来能为青岛市乃至国家经济建设贡献自己的力量，产生社会与经济效益。郑院长非常感谢仓院长团队的宝贵提议和对青岛研究院的全力支持，同时表示，青岛研究院会为入驻的各研究团队做好渠道资源对接及服务工作，让西工大青岛研究院成为产业孵化的沃土与良港，促进产品产业化尽快落地。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;报送：&lt;/strong&gt;青岛市政府、青岛市科技局、青岛蓝谷管理局有关领导，西北工业大学相关单位。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153809_864.jpg&quot; style=&quot;height:645px; width:861px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153818_94.jpg&quot; style=&quot;height:645px; width:861px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120153827_986.jpg&quot; style=&quot;height:645px; width:861px&quot; /&gt;&lt;/p&gt;', '17', '1', '1', '1', '0', '223', '2017-11-20 15:38:53', '223', '2017-11-21 13:34:07');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('71', '191', '合众思壮三款新品亮相ChinterGEO2017[图]', null, '　10月20-22日，适逢北京合众思壮科技股份有限公司（股票代码：002383）成立23周年之际，由ChinterGEO联盟主办的2017中国测绘地理信息技术装备展览会在厦门国际会展中心隆重举行。作为时空技术引领者，合众思壮携全产业链产品和三款新品盛装亮相本次展会，并承办了北斗新技术新应用分论坛，就北斗高精度领域发展和新技术新应用进入深入分析和探讨。', '&lt;p&gt;　10月20-22日，适逢北京合众思壮科技股份有限公司（股票代码：002383）成立23周年之际，由ChinterGEO联盟主办的2017中国测绘地理信息技术装备展览会在厦门国际会展中心隆重举行。作为时空技术引领者，合众思壮携全产业链产品和三款新品盛装亮相本次展会，并承办了北斗新技术新应用分论坛，就北斗高精度领域发展和新技术新应用进入深入分析和探讨。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;strong&gt;销售中心总经理谢继会出席开幕式并剪彩（右五）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104133_140.png&quot; style=&quot;height:376px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;strong&gt;合众思壮盛装亮相ChinterGEO2017&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　展会期间，国家测绘地理信息局党组成员、副局长宋超智一行莅临展台参观，宋超智副局长对合众思壮在北斗高精度板卡及核心技术领域取得的领先成果给予了充分肯定，并对合众思壮推动北斗导航产业全球布局发展寄予很高的期望。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104219_529.png&quot; style=&quot;height:338px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 国家测绘地理信息局党组成员、副局长宋超智参观展台&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104311_243.png&quot; style=&quot;height:360px; width:550px&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 国际测量师联合会副主席 奥尔汗.埃尔坎参观展台&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　作为行业内为数不多的全产业链和平台型企业，合众思壮在本次展会上展示的核心技术、先进部件、终端产品、解决方案及服务平台受到了广大参展商的热切关注。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104356_820.png&quot; style=&quot;height:397px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;北斗高精度产品及解决方案&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;本次展会，合众思壮重磅推出了三款新品&lt;/strong&gt;：&lt;br /&gt;\r\n　　合众思壮G970II智能RTK接收机，是在经典产品G970上实现了小型化、智能化的第四代GNSS产品，G970II集思壮最优资源，从芯片到终端完全自主研发，所有部件系统级优化，搭载天琴芯片支持中国精度L-Band星站差分，新一代的倾斜测量算法无需校准，可实现&amp;ldquo;轻松测、任性量&amp;rdquo;。&lt;br /&gt;\r\n　　集思宝A8坚固型北斗智能终端搭载6寸视网膜屏幕、8核2.2GHz CPU荣耀上市。运行速度快、存储空间大、续航时间长，为行业用户奉上全新的使用体验。&lt;br /&gt;\r\n　　E7158坚固型Windows平板电脑配备Intel i5处理器，Windows10操作系统，10寸高清阳光屏幕，支持10点触控操作，防护等级IP68，为行业用户提供坚固可靠、军工级别的Windows终端。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104445_822.png&quot; style=&quot;height:338px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;G970II智能RTK接收机&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121104518_967.png&quot; style=&quot;height:284px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; A8坚固型北斗智能终端与E7158坚固型Windows平板&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　10月21日下午，由合众思壮承办的北斗新技术新应用分论坛受到了行业同仁的高度关注。在北斗分论坛上，销售中心总经理谢继会以《第四代GNSS定位：星基与地基地融合》为主题作了开场演讲，并向行业内发出合作邀请，合众思壮作为平台型企业，开放全球领先的产业链资源，向行业输出芯片、板卡、各类终端和星基增强系统等核心技术资源，欢迎行业内创新创业者合作共进，共赢测绘地理信息产业。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121105537_125.png&quot; style=&quot;height:340px; width:530px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;销售中心总经理谢继会做主题演讲&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;合众思壮以&amp;ldquo;成为时空信息领域全球领先的高精度专业产品与服务提供商&amp;rdquo;为企业愿景，深耕高精度卫星导航领域23载。23年行业专注始终见证、推动、引领中国卫星导航定位市场的发展。秉承&amp;ldquo;开放、联合、共赢&amp;rdquo;的理念，合众思壮将携手行业合作伙伴一同为推动北斗高精度卫星导航事业的发展而不懈努力！&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '99', '1', '1', '1', '0', '222', '2017-11-21 10:46:37', '222', '2017-11-21 10:55:42');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('72', '191', '&ldquo;北斗三号&rdquo;首组组网卫星升空 开启全球系统建设新时代', null, '　　2017年11月5日，我国在西昌卫星发射中心以&ldquo;一箭双星&rdquo;方式成功发射了第二十四、二十五颗北斗导航卫星，这两颗卫星属于中圆地球轨道卫星，是我国北斗三号第一、二颗组网卫星，标志着北斗卫星导航系统全球组网新时代正式开启。', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;ldquo;北斗三号&amp;rdquo;首组组网卫星升空 开启全球系统建设新时代&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2017年11月5日，我国在西昌卫星发射中心以&amp;ldquo;一箭双星&amp;rdquo;方式成功发射了第二十四、二十五颗北斗导航卫星，这两颗卫星属于中圆地球轨道卫星，是我国北斗三号第一、二颗组网卫星，标志着北斗卫星导航系统全球组网新时代正式开启。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121105652_169.png&quot; style=&quot;height:857px; width:642px&quot; /&gt;　　 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 此次北斗三号全球组网卫星首次发射，将稳步推动北斗三号系统建设，加快北斗系统尽早服务全球，造福全人类。后续计划根据这两颗卫星的运行情况，对外发布B1C、B2A信号ICD文件正式版，便于用户使用北斗三号信号。北斗三号在北斗二号性能基础上，将进一步提升1-2倍定位精度，达到2.5米-5米的水平，在保留北斗二号短报文功能的前提下，提升相关性能。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121105734_72.png&quot; style=&quot;height:544px; width:877px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　我国也将迎来新一轮北斗组网卫星高密度发射，截至2018年底前，将发射18颗北斗三号组网卫星，覆盖&amp;ldquo; 一带一路&amp;rdquo;沿线国家；到2020年，完成30多颗组网卫星发射，实现全球服务能力。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　&amp;ldquo;中国的北斗，世界的北斗&amp;rdquo;，&amp;ldquo;世界的资源，中国的资源&amp;rdquo;。北斗产业应用进入黄金机遇期，产业领军企业的主力军作用更为凸显。成立于1994年的北京合众思壮科技股份有限公司（股票代码：002383），作为国内进入卫星导航定位领域最早、技术储备最深厚、产业布局最完备的公司之一，始终见证、引领、推动北斗导航产业的发展。多年来坚持&amp;ldquo;引进来&amp;rdquo;与&amp;ldquo;走出去&amp;rdquo;相结合，已形成全球化业务布局和服务能力，构建了以中国、美国、加拿大、意大利在内的国内、外产品研发生产与营销架构体系，产品行销遍布全球的90多个国家和地区，为推动北斗全球发展奠定坚实基础。在未来北斗系统全球化征程中，合众思壮将充分发挥23年来积累的北斗应用研发人才和核心技术优势，持续加大技术和产品研发投入与力度、创新和开拓时空信息行业应用、不断拓展全球业务布局，不忘初心、砥砺前行，不断为推动北斗全球发展作出更大的贡献。&lt;/p&gt;', '98', '1', '1', '1', '0', '222', '2017-11-21 10:57:50', '222', '2017-11-21 11:09:42');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('73', '191', '合众思壮公布&ldquo;中国精度&rdquo;亚米级服务终身免费政策', null, '　　2017年11月12日，北京合众思壮科技股份有限公司在德国汉诺威国际农业机械展上宣布：自即日起至2018年6月30日期间，所有购买支持中国精度产品的中国用户，均可终身享受免费的全球星基亚米级增强服务。', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;合众思壮公布&amp;ldquo;中国精度&amp;rdquo;亚米级服务终身免费政策&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2017年11月12日，北京合众思壮科技股份有限公司在德国汉诺威国际农业机械展上宣布：自即日起至2018年6月30日期间，所有购买支持中国精度产品的中国用户，均可终身享受免费的全球星基亚米级增强服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121105858_482.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　合众思壮于2015年6月发布的全球星基高精度增强服务系统&amp;ldquo;中国精度&amp;rdquo;，通过L波段地球同步轨道通信卫星向全球播发差分数据, 为北斗、GPS和GLONASS等卫星定位系统提供强大的性能校正。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　&amp;ldquo;中国精度&amp;rdquo;目前提供亚米、分米和厘米级增强三种不同级别的授权服务。根据本次发布的政策，为自即日起至2018年6月30日期间，合众思壮将为所有购买支持中国精度产品的用户，提供稳定的亚米级增强激活服务Atlas Basic并终身有效，用户无需付费即可享受50CM精度的增强服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121105955_263.png&quot; style=&quot;height:247px; width:702px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　合众思壮旗下Hemisphere公司全球销售和业务发展副总裁Randy Noland表示：&amp;ldquo;这是一场改变游戏规则的服务，将为客户带来前所未有的性价比体验，并将随着客户的业务发展而灵活扩展。我们正以一种全新的方式，根据客户需求进行量身定制。&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110033_873.png&quot; style=&quot;height:648px; width:857px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　更高的定位精度和更广的服务范围，意味着更好的应用效果和更佳的用户体验。作为我国首个拥有完全自主知识产权的全球高精度星基增强服务系统，本次亚米级增强服务终身免费使用的政策，将使用户享受全球的SBAS级服务，助推北斗高精度应用的全球化拓展。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　合众思壮已推出支持&amp;ldquo;中国精度&amp;rdquo;系统的全产业链产品和解决方案，包括从星基增强芯片、板卡，终端接收机到下游的精准农业、海洋工程和机械控制等应用领域。&amp;ldquo;中国精度&amp;rdquo;服务将使用户拥有只受想象力限制的广阔市场空间，通过不断的市场挖掘，将实现高精度应用无处不在的社会效益。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '91', '1', '1', '1', '0', '222', '2017-11-21 11:01:00', '222', '2017-11-21 11:01:00');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('74', '191', '合众思壮重磅新品：2.5厘米精度的电动方向盘自动驾驶系统', null, '　　如果说柴油和发动机是拖拉机的动力源泉，那么方向盘就是拖拉机的&ldquo;指挥官&rdquo;。在精准农业领域，&ldquo;慧农&rdquo;北斗导航自动驾驶系统以强大的技术性能和人性化服务在业内广受好评。', '&lt;p&gt;　 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;strong&gt;合众思壮重磅新品：2.5厘米精度的电动方向盘自动驾驶系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　如果说柴油和发动机是拖拉机的动力源泉，那么方向盘就是拖拉机的&amp;ldquo;指挥官&amp;rdquo;。在精准农业领域，&amp;ldquo;慧农&amp;rdquo;北斗导航自动驾驶系统以强大的技术性能和人性化服务在业内广受好评。为进一步提高自动驾驶系统的性能指标和用户体验，北京合众思壮科技股份有限公司又推出北斗导航自动驾驶系统新成员&amp;mdash;&amp;mdash;适用于非液压转向系统农机的电动方向盘自动驾驶系统。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110157_26.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　电动方向盘自动驾驶系统是合众思壮依托在卫星定位领域全产业链的优势，采用多项自主知识产权的核心技术，以北斗卫星高精度定位技术和车辆转向技术为基础，通过控制方向盘旋转轴驱动农机自动转向，控制农机按AB直线、圆圈和AB曲线等规划路线行走，减轻驾驶人员的劳动量，提高农机自动驾驶操作效率，进一步提高农业生产自动化。电动方向盘控制器EAS100是该系统中亮点配件，可替代液压转向阀，和自动驾驶控制器MC3一起使用，可实现对农机自动驾驶的控制。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110229_600.png&quot; style=&quot;height:616px; width:846px&quot; /&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;strong&gt;电动方向盘控制器EAS100&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;与液压阀转向自动驾驶系统相比，&lt;strong&gt;合众思壮电动方向盘自动驾驶系统具有以下优势&lt;/strong&gt;：&lt;br /&gt;\r\n　● 使用RTK时自动驾驶精度可达到2.5cm；&lt;br /&gt;\r\n　● 安装简单方便、无需改装原车液压管路、易于车辆之间转移；&lt;br /&gt;\r\n　● 可以适配多种不同的农机，尤其适用没有液压转向系统的农机；&lt;br /&gt;\r\n　● 0.2秒内实现快速、精准转向响应和控制；&lt;br /&gt;\r\n　● 一键切换手动、自动两种驾驶模式。&lt;/p&gt;\r\n\r\n&lt;p&gt;除此之外，&lt;strong&gt;作为&amp;ldquo;慧农&amp;rdquo;自动驾驶系统的新成员，兼具&amp;ldquo;慧农&amp;rdquo;自动驾驶系统的技术创新点和性能&lt;/strong&gt;：&lt;br /&gt;\r\n　● 简化校车步骤和降低对校车场地的要求，3步轻松完成校车；&lt;br /&gt;\r\n　● 入线距离短，快速自动倒车入线距离&amp;lt;10米 ；&lt;br /&gt;\r\n　● 通过GNSS定位定向和9轴MEMS传感器融合技术，锁定GNSS航向, 停车无起步弯；&lt;br /&gt;\r\n　● 行业内首创双直线自动驾驶模式 ；&lt;br /&gt;\r\n　● 软件实现一键升级，支持远程升级；&lt;br /&gt;\r\n　● 双重数据备份，实时安全提示和控制；&lt;br /&gt;\r\n　● GNSS信号或RTK信号丢失控制精度不会突变。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　合众思壮作为北斗高精度应用在农业领域的开拓者，致力于&amp;ldquo;创造中国自主的现代化农业产品&amp;rdquo;，引领着中国农业朝着现代化的方向不断迈进。凭借电动方向盘自动驾驶系统高性能配置，便捷舒适的操作体验以及无忧售后解决方案，合众思壮在精准农业又将掀起自动驾驶系统的新潮流，为精准农业用户带去更多惊喜体验。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '90', '1', '1', '1', '0', '222', '2017-11-21 11:02:48', '222', '2017-11-21 11:02:48');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('75', '191', '合众思壮基于ISOBUS的VT技术亮相德国农机展', null, '　　2017年11月12-18日，Agritechnica德国农机展在汉诺威展览馆举行。作为北斗高精度应用在农业领域的开拓者，北京合众思壮科技股份有限公司（15展厅，E10展位）&ldquo;慧农&rdquo;自动驾驶系统及新推出的基于ISOBUS的VT（Virtual Terminal）虚拟终端技术，受到国际参展人士的高度关注。', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 合众思壮基于ISOBUS的VT技术亮相德国农机展&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　2017年11月12-18日，Agritechnica德国农机展在汉诺威展览馆举行。作为北斗高精度应用在农业领域的开拓者，北京合众思壮科技股份有限公司（15展厅，E10展位）&amp;ldquo;慧农&amp;rdquo;自动驾驶系统及新推出的基于ISOBUS的VT（Virtual Terminal）虚拟终端技术，受到国际参展人士的高度关注。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110336_93.png&quot; style=&quot;height:531px; width:875px&quot; /&gt;　　&amp;ldquo;慧农&amp;rdquo;是中国首款拥有完全自主知识产权的北斗导航农机自动驾驶系统。该系统曾凭借&amp;ldquo;3步轻松校车、快速自动倒车入线距离&amp;lt;10米、停车无起步弯和业内首创双直线自动驾驶模式&amp;rdquo;等优势，荣获2016年卫星导航定位科技进步特等奖。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110405_387.png&quot; style=&quot;height:253px; width:875px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　VT（Virtual Terminal）虚拟终端技术是 &amp;ldquo;慧农&amp;rdquo;自动驾驶系统的新增技术。目前，在国内成功研发基于ISOBUS的VT虚拟终端技术的新时空领域企业中，合众思壮尚属首家。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　该技术在无需改变显控终端原来软件及协议的前提下，就可实现&amp;ldquo;慧农&amp;rdquo;自动驾驶控制器（MCx）与&amp;ldquo;慧农&amp;rdquo;体系外的其他具有VT功能的显控终端进行通讯。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　同样，智能显控终端IRON1，可以与基于ISOBUS具有VT功能的第三方控制器进行通讯。与农机控制器进行通讯时，可以读取拖拉机和农具电控单元数据和报警信息，操作者还可以用慧农显控终端（IRON1）上的控制键、编辑键和功能键（软键）向各控制单元发送作业数据和控制信息。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110432_1.png&quot; style=&quot;height:515px; width:875px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110452_891.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　带有虚拟终端的&amp;ldquo;慧农&amp;rdquo;自动驾驶系统设备也可用于农业机械作业的远程信息识别和管理，读取车辆作业数据，制定农事操作方案和作业计划，下达给田间移动作业机械，也可以远程诊断判别故障。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　增加了VT技术的&amp;ldquo;新慧农&amp;rdquo;只需一个智能显控终端即可实现车辆上各设备状态的实时监测和控制。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　高精度产品部部门经理王芸表示，对于用户来说，不必购买多个单独显示终端，可大幅减少购置成本；对于主机厂来说，使用VT技术的不同制造商的电子设备可通用、兼容，互联互通，灵活好用；可实现与车辆电气设备的信息共享，可通过改变系统的软件实现系统功能的变化，降低开发成本。她说：&amp;ldquo;我们通过此次VT的全球亮相，也向世界传达着合众思壮向全球拓展精准农业的决心与实力&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121110609_273.png&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;　　Agritechnica德国国际农业机械展览会是全世界最大的国际农业机械展会，每两年举办一届，每届都吸引了来自全球各国的展商与观众。作为全球领先、国际一流的农业机械与设备展会，Agritechnica德国农机展为来自全球的供应商、经销代理商、用户及行业专家提供了业务洽谈、项目投资、技术合作、学术讨论的理想平台。&lt;/p&gt;', '88', '1', '1', '1', '0', '222', '2017-11-21 11:06:31', '222', '2017-11-21 11:06:31');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('76', '194', 'HEW-POWER', null, '我们的高品质特种电缆HEW-POWER(HEW电力)专用于电动机、发电机和变压器，他们确保了极高的可靠性。即使在极端条件下也可以保证良好的电气性能。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121153516_249.png&quot; style=&quot;height:862px; width:639px&quot; /&gt;&lt;/p&gt;', '99', '1', '1', '1', '0', '189', '2017-11-21 15:35:19', '189', '2017-11-21 15:35:19');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('77', '194', 'HEW-OIL&amp;GAS', null, 'HEW-KABEL也是石油和天然气工业中经济开发的开拓者和合作伙伴。优异的化学与机械性能以及优异的电气性能能使我们的特种电缆获得能源开采应用的资格。', '&lt;p&gt;HEW-KABEL也是石油和天然气工业中经济开发的开拓者和合作伙伴。优异的化学与机械性能以及优异的电气性能能使我们的特种电缆获得能源开采应用的资格。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121153816_413.png&quot; style=&quot;height:565px; width:885px&quot; /&gt;&lt;/p&gt;', '98', '1', '1', '1', '0', '189', '2017-11-21 15:38:20', '189', '2017-11-21 15:38:20');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('78', '194', 'HEW-KABEL', null, '量身定制的特种电缆技术，极端温度应用的电缆解决方案，耐温范围从-273&deg;到+1550&deg;。', '&lt;p&gt;量身定制的特种电缆技术，极端温度应用的电缆解决方案，耐温范围从-273&amp;deg;到+1550&amp;deg;。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121154040_850.png&quot; style=&quot;height:862px; width:639px&quot; /&gt;&lt;/p&gt;', '110', '1', '1', '1', '0', '189', '2017-11-21 15:40:42', '189', '2017-11-21 15:41:16');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('79', '194', 'HEW-KABEL特种电缆应用于各个行业的细分市场', null, 'HEW-KABEL特种电缆应用于各个行业的细分市场', '&lt;p&gt;HEW-KABEL特种电缆应用于各个行业的细分市场&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121154217_728.png&quot; style=&quot;height:529px; width:829px&quot; /&gt;&lt;/p&gt;', '109', '1', '1', '1', '0', '189', '2017-11-21 15:42:19', '189', '2017-11-21 15:42:19');
INSERT INTO `byp_exhibition_booth_information_info` VALUES ('80', '194', 'HEW-MARINE', null, '海军以及军事上特殊的要求注定了电线、绝缘和护套材料的品质之高。HEW-kabel所拥有的定制特种电缆借其特殊属性可带来个性化的有利优势。', '&lt;p&gt;海军以及军事上特殊的要求注定了电线、绝缘和护套材料的品质之高。HEW-kabel所拥有的定制特种电缆借其特殊属性可带来个性化的有利优势。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121154528_411.png&quot; style=&quot;height:566px; width:888px&quot; /&gt;&lt;/p&gt;', '107', '1', '1', '1', '0', '189', '2017-11-21 15:45:30', '189', '2017-11-21 15:45:30');
