INSERT INTO `byp_exhibition_booth_product_info` VALUES ('71', '111', 'CHNMAX &reg;', '65', '18462', '18466', '结构  8 股、12 股\r\n直径范围  16MM-96MM\r\n线密度  151Ktex-4970Ktex\r\n周长  2inch-12inch\r\n打扣前破断力  260KN-6180KN\r\n打扣后破断力  235KN-5560KN\r\n标准长度  220M（其他长度可根据客户要求定制）\r\n熔点  150 ℃\r\n延伸率  4%-5%\r\n打扣前后强度  &plusmn;10%\r\n重量和长度误差  &plusmn;5%\r\n吸水性  不吸水\r\n抗 UV 性  好\r\n耐磨性  非常好\r\n颜色  黄色、蓝色、红色\r\n其他颜色根据客户需求定制', 'CHNMAX是兴轮绳缆（XLROPE）结合先进的进口德国和丹麦设备、成熟的生产工艺创新而成的高品质、轻质特种高分子缆绳。超高的强度和稳定的性能使其成为绳缆领域一颗新星。', '&lt;p&gt;CHNMAX是兴轮绳缆（XLROPE）结合先进的进口德国和丹麦设备、成熟的生产工艺创新而成的高品质、轻质特种高分子缆绳。超高的强度和稳定的性能使其成为绳缆领域一颗新星。&lt;/p&gt;', '18349', '4', '1', '1', '1', '0', '1', '63', '2017-11-13 10:26:46', '63', '2017-11-13 15:24:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('72', '111', 'CHNMAX PLUS&reg;', '66', '18402', '21769', '纤维（内/外）  CHNMAX 纤维/CHNMAX 护套\r\n直径范围  8MM-96MM\r\n线密度  42Ktex-5300Ktex\r\n打扣后破断力  44.1KN-5650KN\r\n未打扣破断力  49KN-6280KN\r\n熔点  150 ℃/265℃\r\n延伸率  4%-5%\r\n打扣前后强度  &plusmn;10%\r\n重量和长度误差  &plusmn;5%\r\n吸水性  不吸水\r\n抗 UV 性  好\r\n耐磨性  非常好\r\n干湿环境  干湿环境下强度不变\r\n其他优点  强度高、延伸率低、稳定不扭结、易操作、\r\n寿命长\r\n应用  系泊、渔业、近海设施、商船队等', 'CHNMAX PLUS 是 XLROPE 为石油天然气行业专门研发的高端绳索，其结构由\r\n内芯 12 股 CHNMAX 和外编 24 股、36 股、48 股高强 XL 涤纶组合而成。CHNMAX PLUS\r\n让使用过程变的更加环保。', '&lt;p&gt;CHNMAX PLUS 是 XLROPE 为石油天然气行业专门研发的高端绳索，其结构由内芯 12 股CHNMAX 和外编 24 股、36 股、48 股高强 XL 涤纶组合而成。CHNMAX PLUS让使用过程变的更加环保。&lt;/p&gt;', '18369', '2', '1', '1', '1', '0', '1', '63', '2017-11-13 11:06:17', '63', '2017-11-21 10:57:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('73', '111', 'CHNMAX SLING&reg;', '67', '18380', '21770', 'Single Leg\r\n最小 D/c  4:1\r\nD/d  6:1\r\n直径  16MM-44MM\r\n周长  2inch-5-1/2inch\r\n工作负荷范围  38KN-264KN\r\nGrommet\r\n最小 D/c  4:1\r\nD/d  6:1\r\n直径  16MM-44MM\r\n周长  2inch-5-1/2inch\r\n工作负荷范围  68KN-428KN', 'CHNMAX SLING 通常由 12 股 CHNMAX 经过穿插工艺处理而成，轻巧方便、\r\n安全稳定，被广泛应用于吊装领域，成为了代替钢丝吊索的新选择。', '&lt;p&gt;CHNMAX SLING 通常由 12 股 CHNMAX 经过穿插工艺处理而成，轻巧方便、安全稳定，被广泛应用于吊装领域，成为了代替钢丝吊索的新选择。&lt;/p&gt;', '18383', '3', '0', '1', '1', '0', '1', '63', '2017-11-13 11:19:02', '63', '2017-11-21 10:58:04');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('74', '111', 'CHNLINE&reg;丙纶长丝', '70', '18399', '18471', '直径：4MM-160MM\r\n线密度：9.87Ktex-16100Ktex\r\n密度：浮水\r\n标准长度：220m/卷（可根据客户需求定制）\r\n使用环境：最高温度不超过80℃', 'CHNLINE 是XLROPE高强度聚丙烯绳的专有品牌，分别有CHNLINE长丝缆绳和CHNLINE单丝缆绳。结构有3股、8股、12股、多股双层编织。单丝缆绳 经济实惠，耐磨、不吸水、广泛用于系泊缆绳领域。复丝缆绳手感光滑、柔软不吸水、操作轻便、广泛运用于现代船舶远洋中。', '&lt;p&gt;CHNLINE 是XLROPE高强度聚丙烯绳的专有品牌，分别有CHNLINE长丝缆绳和CHNLINE单丝缆绳。结构有3股、8股、12股、多股双层编织。单丝缆绳 经济实惠，耐磨、不吸水、广泛用于系泊缆绳领域。复丝缆绳手感光滑、柔软不吸水、操作轻便、广泛运用于现代船舶远洋中。&lt;/p&gt;', '18388', '3', '1', '1', '1', '0', '1', '63', '2017-11-13 11:32:30', '63', '2017-11-13 15:27:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('75', '111', 'CHNMAX SHEATH&reg;', '69', '18474', '21771', '主要属性  耐磨、保护主缆绳\r\n护套编织绳索  CHNMAX 2MM-16MM\r\n护套颜色  可根据客户具体要求来确定\r\n防紫外线能力  最好\r\n防摩擦能力  最好\r\n浮水性  浮水\r\n其他特点\r\n超长的使用寿命\r\n便于抓握\r\n重量轻、易于操作\r\n存在意义  CHNMAX SHEATH 由曹宸睿先生发明并且在\r\n2013 年成功运用，改变了化纤绳索高强度摩\r\n擦单股纤维受损的缺陷，让特种行业的缆绳\r\n变的更加结实', 'CHNMAX SHEATH 是 XLROPE 独家研发的新型高分子护套产品，该护套通常\r\n用于主缆为 12 股的 CHNMAX 外部，由与主缆相对应的小规格 CHNMAX 编织而成，\r\nCHNMAX SHEATH 超耐磨擦，并且可以深层保护内芯主缆绳，让使用变的更安全。', '&lt;p&gt;CHNMAX SHEATH 是 XLROPE 独家研发的新型高分子护套产品，该护套通常用于主缆为 12 股的 CHNMAX 外部，由与主缆相对应的小规格 CHNMAX 编织而成，CHNMAX SHEATH 超耐磨擦，并且可以深层保护内芯主缆绳，让使用变的更安全。&lt;/p&gt;', '18407', '4', '0', '1', '1', '0', '1', '63', '2017-11-13 13:16:13', '63', '2017-11-21 10:58:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('76', '111', 'CHNLINE&reg; 丙纶扁丝', '70', '18414', '21774', '直径：4MM-160MM\r\n线密度：9.87Ktex-16100Ktex\r\n密度：浮水\r\n标准长度：220m/卷（可根据客户需求定制）\r\n使用环境：最高温度不超过80℃', 'CHNLINE 是 XLROPE 高强度聚丙烯绳的专有品牌，分别有 CHNLINE 长丝缆\r\n绳和 CHNLINE 单丝缆绳。结构有 3 股、8 股、12 股、多股双层编织。单丝缆绳 经济实惠，\r\n耐磨、不吸水、广泛用于系泊缆绳领域。复丝缆绳手感光滑、柔软不吸水、操作轻便、广泛\r\n运用于现代船舶远洋中。', '&lt;p&gt;CHNLINE 是 XLROPE 高强度聚丙烯绳的专有品牌，分别有 CHNLINE 长丝缆绳和 CHNLINE 单丝缆绳。结构有 3 股、8 股、12 股、多股双层编织。单丝缆绳 经济实惠，耐磨、不吸水、广泛用于系泊缆绳领域。复丝缆绳手感光滑、柔软不吸水、操作轻便、广泛运用于现代船舶远洋中。&lt;/p&gt;', '18419', '6', '0', '1', '1', '0', '1', '63', '2017-11-13 13:28:17', '63', '2017-11-21 11:01:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('77', '111', 'J-MAX&reg;', '68', '18427', '21773', '直径  4MM-20MM\r\n线密度  10.24Ktex-232Ktex\r\n打扣前破断力  16.23KN-380KN\r\n打扣后破断力  14.69KN-340KN\r\n安全性  安全性极高\r\n易操作  比钢丝绳轻 80%\r\n高强度  破断力比钢丝绳高 80%\r\n其他特点  浮水、柔软易弯曲，不打结', '每一根 J-MAX 绞盘绳背后都有一个故事，里面有感动、励志、拼搏，这就是 J-MAX\r\n的精神。越野&mdash;&mdash;勇敢者的挑战，绞盘&mdash;&mdash;越野的必备品，J-MAX&mdash;&mdash;每一部越野车的必\r\n备品。J-MAX 让越野变的更加安全，让挑战更加稳定。', '&lt;p&gt;每一根 J-MAX 绞盘绳背后都有一个故事，里面有感动、励志、拼搏，这就是 J-MAX的精神。越野&amp;mdash;&amp;mdash;勇敢者的挑战，绞盘&amp;mdash;&amp;mdash;越野的必备品，J-MAX&amp;mdash;&amp;mdash;每一部越野车的必备品。J-MAX 让越野变的更加安全，让挑战更加稳定。&lt;/p&gt;', '18423', '5', '0', '1', '1', '0', '1', '63', '2017-11-13 13:38:50', '63', '2017-11-21 10:59:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('78', '111', 'CHNMIX&reg;', '71', '18429', '21775', '使用环境  最高温度不超过 100℃\r\n直径  4MM-160MM\r\n线密度  9Ktex-12500Ktex\r\n密度  0.95-0.98 浮水\r\n标准长度  220m/coil（可根据客户需求定制）\r\n标准颜色  白色、黄色（可根据客户需求定制）\r\n误差  &plusmn;5%\r\n熔点  165℃-260℃\r\n延伸率  17%-21%\r\n抗紫外线  很好\r\n两端处理方式  标准插环，加保护套\r\n腐蚀性  很好\r\n耐磨性  很好\r\n包装  包装袋\r\n储存方式  密封、避潮湿、避暴晒', 'CHNMIX 是 XLROPE 高强度混合绳代表，其结构有：三股、六股、八股、十二\r\n股、多股双层编织。CHNMIX 的最大优点是耐磨，其浮水性较好、强度极高、防静电、使\r\n用寿命极长，是远洋船舶的必备选择！', '&lt;p&gt;CHNMIX 是 XLROPE 高强度混合绳代表，其结构有：三股、六股、八股、十二股、多股双层编织。CHNMIX 的最大优点是耐磨，其浮水性较好、强度极高、防静电、使用寿命极长，是远洋船舶的必备选择！&lt;/p&gt;', '18433', '10', '0', '1', '1', '0', '1', '63', '2017-11-13 13:44:23', '63', '2017-11-21 11:01:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('79', '111', 'CHNFLEX&reg;', '72', '18438', '21772', '使用环境  最高温度不超过 100℃\r\n直径  4MM-160MM\r\n线密度  9.87Ktex-16100Ktex\r\n密度  1.14 沉水\r\n标准长度  220m/卷（可根据客户需求定制）\r\n标准颜色  白色（可根据客户需求定制）\r\n误差  &plusmn;5%\r\n熔点  215℃\r\n延伸率  15%-25%\r\n抗紫外线  很好\r\n两端处理方式  标准插环，加保护套\r\n腐蚀性  很好\r\n耐磨性  很好\r\n包装  包装袋', 'HNFLEX 代表兴轮绳缆旗下的高强尼龙缆绳，其结构有三股、八股、十二股、\r\n多股双层编织。该缆绳强度高、延伸率长、抗冲击能力极其突出，在惊涛骇浪中更加能够确\r\n保船舶安全，是海洋中远行船舶的安全卫士。', '&lt;p&gt;HNFLEX 代表兴轮绳缆旗下的高强尼龙缆绳，其结构有三股、八股、十二股、多股双层编织。该缆绳强度高、延伸率长、抗冲击能力极其突出，在惊涛骇浪中更加能够确保船舶安全，是海洋中远行船舶的安全卫士。&lt;/p&gt;', '18439', '5', '0', '1', '1', '0', '1', '63', '2017-11-13 13:50:17', '63', '2017-11-21 10:59:09');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('80', '111', 'XLROPE&reg;', '73', '18456', '21768', '1. 单点系泊索 ；2. 缆绳尾&amp; 卸扣；3. 直升机防滑网 ；4. 天然纤维绳；5. 芳纶绳；6. 钢丝绳；7. 安全网；8. 吊货网；9. 特种绳索 ；10. 吊带；', 'XLROPE 是您最全面、最可靠的绳网管家。无论您是需要单点系泊索，直升机\r\n防滑网，芳纶绳，天然纤维绳，缆绳尾，钢丝绳，吊货网，安全网还是吊带，您都能在这里\r\n找到心仪的产品。', '&lt;p&gt;XLROPE 是您最全面、最可靠的绳网管家。无论您是需要单点系泊索，直升机防滑网，芳纶绳，天然纤维绳，缆绳尾，钢丝绳，吊货网，安全网还是吊带，您都能在这里找到心仪的产品。&lt;/p&gt;', '18443', '1', '0', '1', '1', '0', '1', '63', '2017-11-13 13:58:31', '63', '2017-11-21 10:56:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('81', '114', '壳寡糖', '74', '18498', '18505', '壳寡糖，又称寡聚氨基葡糖、甲壳低聚糖，化学名称：&beta;-（1, 4）-2- 氨基- 2- 脱氧-D-葡聚糖，是聚合度在20以下的低分子量壳聚糖，分子式：(C6H11NO4)n（n=2~20），', '壳寡糖\r\n英文名称：Chitosan oligosaccharides\r\n壳寡糖，又称寡聚氨基葡糖、甲壳低聚糖，化学名称：&beta;-（1, 4）-2- 氨基- 2- 脱氧-D-葡聚糖，是聚合度在20以下的低分子量壳聚糖，分子式：(C6H11NO4)n（n=2~20），', '&lt;p&gt;&lt;strong&gt;特性&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;壳寡糖是由壳聚糖解聚制成，是甲壳素、壳聚糖产品的升级产品，具有壳聚糖不可比拟的优越性。我公司采用先进的生物酶解法制备壳寡糖，它具有：&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;分子量低、水溶性好、功能作用大、易被人体吸收、生物活性高等优势。同时具有：&lt;/p&gt;\r\n\r\n&lt;p&gt;纯天然、无辐射、无污染、无添加等特点。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;功能&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;壳寡糖具有：&lt;/p&gt;\r\n\r\n&lt;p&gt;三调（免疫调节、调节PH值、调节荷尔蒙）&lt;/p&gt;\r\n\r\n&lt;p&gt;三降（降血脂、降血糖、降血压）&lt;/p&gt;\r\n\r\n&lt;p&gt;三排（排胆固醇、排重金属离子、排毒素）&lt;/p&gt;\r\n\r\n&lt;p&gt;三抑（抑制癌细胞、抑制癌细胞转移、抑制癌毒素）的功能。&lt;/p&gt;\r\n\r\n&lt;p&gt;此外，壳寡糖还有：&lt;/p&gt;\r\n\r\n&lt;p&gt;1.抗菌：预防或治疗由金黄色葡萄球菌、大肠埃希杆菌、放线杆菌、突变链球菌等细菌引起的动物疾病。可诱导植物的抗病性,对多种真菌、细菌和病毒产生免疫和杀灭作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;2.抗氧化：可消除人体氧自由基，活化机体细胞，延缓衰老，抑制皮肤表面有害菌滋生，保湿性能优异。&lt;/p&gt;\r\n\r\n&lt;p&gt;3.促生长：被微生物分解利用并作为植物生长的养份，可刺激植物生长。&lt;/p&gt;\r\n\r\n&lt;p&gt;4.促进骨折愈合：促使成骨细胞的活性增高，使得骨形态发生蛋白(BMP)在骨折修复早期表达增强，同时表达时间提前，从而促进骨折修复。&lt;/p&gt;\r\n\r\n&lt;p&gt;5.&amp;nbsp;改善肠道菌群：壳寡糖作为益生元在肠道中促进益生菌生长，可使体内乳酸菌、双歧杆菌等有益菌大量增殖，抑制大肠杆菌、沙门菌属、金黄色葡萄球菌等有害菌的生长，使体内微生态达到自然平衡，以提高胃肠道的正常生理机能。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '202', '2017-11-13 16:28:37', '202', '2017-11-13 16:44:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('82', '114', '高纯度壳寡糖原粉', '75', '18487', '18503', '化学名称：&beta;-（1, 4）-2- 氨基- 2- 脱氧-D-葡聚糖，又名几丁寡糖\r\n英文名称：chitosan oligosaccharide，简称：COS。\r\n分子式：(C6H11NO4)n（n=2~20）', '壳寡糖-医药、保健品级配料\r\n壳寡糖是以丰富的海洋生物资源（虾、蟹壳）为原料，通过生物酶降解得到的聚合度低于20的低聚糖，是自然界中唯一&ldquo;带正电荷的天然活性产物&rdquo;，由氨基葡萄糖通过&beta;-1,4糖苷键连接而成。', '&lt;p&gt;作用特点：&lt;br /&gt;\r\nl&amp;nbsp;水溶性好，人体吸收率高（水溶性大于99％，人体吸收率达到99.88％，是壳聚糖吸收率的20倍）；&lt;br /&gt;\r\nl&amp;nbsp;有效摄入量少（每日摄取的有效剂量为0.3－0.7克）；&lt;br /&gt;\r\nl&amp;nbsp;很难为人体消化酶系统所分解（各种消化酶集合都不能分解壳寡糖，其能量几乎为零，既不影响血糖浓度，也不增加血糖中胰岛素浓度，适合于高血压、糖尿病等患者）；&lt;br /&gt;\r\nl&amp;nbsp;对人体安全，无毒副作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;产品功能：&lt;br /&gt;\r\n&amp;nbsp;三排：排除多余胆固醇、排除重金属、排除毒素&lt;br /&gt;\r\n&amp;nbsp;三降：降血压、降血糖、降血脂&lt;br /&gt;\r\n&amp;nbsp;三抗：抗肿瘤、抗氧化、抗辐射&lt;br /&gt;\r\n&amp;nbsp;三调：免疫调节、肠道调节、内分泌调节&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n产品应用：&lt;br /&gt;\r\n1、医药保健品类：辅助治疗高血压、糖尿病、便秘、减肥等方面的药品及保健品&lt;br /&gt;\r\n2、食品类：功能性乳品、饮料、饼干、方便面等等。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '202', '2017-11-13 16:34:22', '202', '2017-11-13 16:42:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('83', '117', '焊接型铝阳极', '76', '18566', '18567', '平贴式船体铝块：850x(150+180)x180mm，68kg一块；\r\n压载舱焊接型铝块：23kg。', '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p&gt;聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&amp;ldquo;胜辉&amp;rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '215', '2017-11-14 13:55:50', '215', '2017-11-14 13:57:50');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('84', '117', '焊接型锌阳极', '77', '18603', '18604', '焊接型：8.5kg，10kg；平贴式牺牲锌阳极：250x100x40mm,6.5kg一块；平贴式牺牲锌阳极：300x150x35mm；平贴式牺牲锌阳极：400x100x55mm，15 kg9kg一块；', '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p&gt;聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&amp;ldquo;胜辉&amp;rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。&lt;/p&gt;', null, '2', '1', '1', '1', '0', '1', '215', '2017-11-14 14:58:35', '215', '2017-11-14 14:58:49');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('85', '118', '海洋环境信息综合应用服务平台', '81', '18590', '18932', '基于可视化、大数据、云计算、多维GIS等现代信息技术和海洋数值预报、溢油搜救、乘潮水位等动力学数值模型方法，以实时在线和定制化开发等多种形式，提供海洋环境预报信息、统计信息、综合管理信息、地理信息等产品。', '基于可视化、大数据、云计算、多维GIS等现代信息技术和海洋数值预报、溢油搜救、乘潮水位等动力学数值模型方法，以实时在线和定制化开发等多种形式，提供海洋环境预报信息、统计信息、综合管理信息、地理信息等产品。', '&lt;p&gt;针对我国海洋开发利用、海洋环境保护、海洋维权执法、军事海洋环境保障等重大海洋环境信息综合应用服务的需求，公司团队正在设计研发具有自主知识产权的、国内领先的中国海海洋环境信息综合应用服务平台。该平台的建设将进一步提升我公司海洋信息化服务市场水平，将公司发展成为国际、国内一流的海洋环境信息综合应用服务提供商。&lt;/p&gt;\r\n\r\n&lt;p&gt;基于可视化、大数据、云计算、多维GIS等现代信息技术和海洋数值预报、溢油搜救、乘潮水位等动力学数值模型方法，以实时在线和定制化开发等多种形式，提供海洋环境预报信息、统计信息、综合管理信息、地理信息等产品。&lt;/p&gt;', '18917', '99', '1', '1', '1', '0', '1', '204', '2017-11-14 14:59:50', '204', '2017-11-15 13:23:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('86', '117', '螺栓型铝阳极', '78', '18609', '18610', '螺栓式铝阳极：300x150x50mm,5.8kg', '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p&gt;聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&amp;ldquo;胜辉&amp;rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '215', '2017-11-14 15:01:54', '215', '2017-11-14 15:01:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('87', '117', '螺栓型锌阳极', '79', '18620', '18623', '螺栓连接式锌块：300x200x70mm,25kg；螺栓型：4kg锌块；', '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p&gt;聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&amp;ldquo;胜辉&amp;rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。&lt;/p&gt;', null, '4', '1', '1', '1', '0', '1', '215', '2017-11-14 15:21:16', '215', '2017-11-14 15:48:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('88', '118', '水下滑翔机', '85', '18621', '18940', 'PETREL-200S型水下滑翔机：\r\n水下滑翔机长2米，翼展1.5米，外径220mm，总重量64千克。排水量64千克，浮力变化量1.2L；最大搭载能力：8千克；最大航行距离：&gt;2000公里，连续工作时间：&gt;3个月；航行速度：0.5m/s；下潜深度: 200米;最小工作深度: 4米;转弯半径: 3米;', '采用模块化的结构设计，其前舱段设置有液压泵系统、俯仰调节机构等，后舱段设置有主控系统、尾舵转向系统和能源系统等，中部舱段为负载舱段，可以加装客户化订制的各类传感器，采用尾舵与天线集成模块，增加系统可靠性。', '&lt;p&gt;&lt;strong&gt;水下滑翔机&lt;/strong&gt;是一款通过改变自身浮力完成上浮和下潜，借助姿态调整和翼身升力实现锯齿形剖面运动的无人潜水器，具有卫星通信、全球定位和自主导航的能力，可以按照设定路径航行并获取海洋表面、海洋水体以及海底动力环境、水质生态和背景噪声等参数，并在上浮到水面时完成数据回传。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;strong&gt;优点&lt;/strong&gt;：航行阻力小、能源利用率高、航行距离大（可达上千公里）、噪声低、成本低、回收方便等优点。其制造成本和维护费用低、可重复使用、并可大量投放等特点，满足了长时间、大范围海洋探索的需要。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px&quot;&gt;&lt;strong&gt;功能&lt;/strong&gt;：海洋环境参数测量功能（可以根据测量需求，搭载各种海洋参数测量传感器）、自主滑翔运动控制功能、测量路径规划功能、测量数据存储与远距离传输功能等。&lt;/span&gt;&lt;/p&gt;', '18939', '98', '1', '1', '1', '0', '1', '204', '2017-11-14 15:25:47', '204', '2017-11-15 13:34:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('89', '109', 'ACFM水下智能可视化检测系统', '82', '18627', '18827', '最小可探测缺陷深度0.5mm，稳定检出率(POD)超过90%，非接触提离可达8mm，最大应用水深200m', 'ACFM水下智能可视化检测系统\r\n交流电磁场水下结构物缺陷智能可视化检测系统是基于电磁感应理论的表面结构缺陷非接触检测装置，由探头、主机、缺陷智能可视化识别上位机等模块组成，可有效实现水下结构缺陷实时判定、智能定量识别和形状可视化反演，最小可探测缺陷深度0.5mm，稳定检出率(POD)超过90%，非接触提离可达8mm，最大应用水深200m，已申请相关发明专利16 项，授权8项，发表论文40余篇，20余篇被SCI、EI收录，显著提高了海洋结构物缺陷检测效率和智能可视化水平，核心参数达到同类设备国际先进水平。', '&lt;p&gt;&lt;strong&gt;ACFM水下智能可视化检测系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;交流电磁场水下结构物缺陷智能可视化检测系统是基于电磁感应理论的表面结构缺陷非接触检测装置，由探头、主机、缺陷智能可视化识别上位机等模块组成，可有效实现水下结构缺陷实时判定、智能定量识别和形状可视化反演，最小可探测缺陷深度0.5mm，稳定检出率(POD)超过90%，非接触提离可达8mm，最大应用水深200m，已申请相关发明专利16 项，授权8项，发表论文40余篇，20余篇被SCI、EI收录，显著提高了海洋结构物缺陷检测效率和智能可视化水平，核心参数达到同类设备国际先进水平。&lt;/p&gt;', '18629', '20', '0', '1', '1', '0', '1', '195', '2017-11-14 15:29:58', '195', '2017-11-15 10:44:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('90', '118', '模块化波浪能发电装置及应用系统', '94', '18630', '19005', '成功研制出基于直线电机的小型化、模块化、可靠性强的波浪发电装置及其应用系统。系统发电效率高，结构简单，易于小型化、模块化推广应用。', '海洋上有很多的船舶、海床基、平台站、浮标和海上无人机等，搭载海洋仪器设备，观测海洋水文气象数据，为维护海洋正常活动提供信息。海洋设备供电通常用蓄电池、太阳能、柴油发电等，维护成本高。海洋波浪能蕴藏丰富，可与太阳能等能源互补，可为海洋观测设备提供电能。', '&lt;p&gt;海洋上有很多的船舶、海床基、平台站、浮标和海上无人机等，搭载海洋仪器设备，观测海洋水文气象数据，为维护海洋正常活动提供信息。海洋设备供电通常用蓄电池、太阳能、柴油发电等，维护成本高。海洋波浪能蕴藏丰富，可与太阳能等能源互补，可为海洋观测设备提供电能。&lt;/p&gt;\r\n\r\n&lt;p&gt;公司研发团队经过多年的努力，在已有波浪能发电技术基础上，成功研制出基于直线电机的小型化、模块化、可靠性强的波浪发电装置及其应用系统。由于实现了波浪-直线发电机间的二级能量转换，没有中间转换结构，系统发电效率高。结构简单、易于小型化、模块化推广应用。&lt;/p&gt;', '18889', '97', '0', '1', '1', '0', '1', '204', '2017-11-14 15:33:38', '204', '2017-11-15 14:12:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('91', '109', '爆炸技术在石油钻机中的应用', '83', '18636', '18836', '探伤检测表明焊合率大于98%  退火态复合板的拉伸强度最低，强度极限是392.5MPa；经过淬火＋回火调质处理后复合板的强度明显提高，强度极限达到657MPa。', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 由于爆炸技术的作用时间短和作用能量高等优点，在工业领域中的应用越来越广泛。随着石油工业的迅速发展，石油的钻采技术和工艺要求也越来越高。例如，在低温下和海洋上等非常规的环境中钻采石油时，常规钻机的一些材料和结构工艺就很难满足要求。从力学的观点上讲，在低温下低碳钢材料的屈服极限迅速减小，从而使其力学性能大大降低，进而影响整个钻机的正常工作。对此，可以利用非常规的爆炸技术来对在非常规环境中的钻机的一些材料（如低温材料）和结构（如由圆形、板形及椭圆形构件组成的结构）进行优化。', '&lt;p&gt;&lt;strong&gt;爆炸技术在石油钻机中的应用&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;机械；石油工程；海洋工程&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）李瑞勇；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;0532-86981775；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 由于爆炸技术的作用时间短和作用能量高等优点，在工业领域中的应用越来越广泛。随着石油工业的迅速发展，石油的钻采技术和工艺要求也越来越高。例如，在低温下和海洋上等非常规的环境中钻采石油时，常规钻机的一些材料和结构工艺就很难满足要求。从力学的观点上讲，在低温下低碳钢材料的屈服极限迅速减小，从而使其力学性能大大降低，进而影响整个钻机的正常工作。对此，可以利用非常规的爆炸技术来对在非常规环境中的钻机的一些材料（如低温材料）和结构（如由圆形、板形及椭圆形构件组成的结构）进行优化。例如：（1）对于钻机中的圆形、板形和椭圆形的构件及相互连接上引入&amp;ldquo;爆炸焊接技术&amp;rdquo;来减少特殊材料（如低温材料）的用量和增加构件之间的连接强度。（2）低温材料的屈服极限要求很高，但其强度明显下降。因此引入&amp;ldquo;爆炸硬化&amp;rdquo;的技术来提高低温材料的表面强度，同时材料内部绝大部分的屈服极限降低不大。爆炸技术具有加工速度快、加工工艺简单和节能等优点，会大大降低钻机的制造成本、缩短钻机的生产周期和提高钻机的生产效率，进而可以产生更大的经济和社会效益。&lt;/p&gt;\r\n\r\n&lt;p&gt;成果力学参数：&lt;/p&gt;\r\n\r\n&lt;p&gt;(1) 利用爆炸焊接技术成功将T10钢板与Q245钢板焊接在一起。探伤检测表明焊合率大于98%。金相分析表明爆炸焊接结合界面为典型的近似正弦波的形状，这也说明T10与Q245已实现良好的结合。&lt;/p&gt;\r\n\r\n&lt;p&gt;(2) 拉伸测试显示断裂先发生在T10处，再扩展到结合面处，最后Q245才断裂；退火态复合板的拉伸强度最低，强度极限是392.5MPa；经过淬火＋回火调质处理后复合板的强度明显提高，强度极限达到657MPa。&lt;/p&gt;\r\n\r\n&lt;p&gt;(3) 退火态复合板的弯曲性能最好，弯曲至90&amp;ordm;时才出现裂纹；淬火＋回火处理的复合板弯曲性能最差，内弯曲至30&amp;ordm;时出现裂纹，外弯曲至10&amp;ordm;左右时材料就发生了脆断。&lt;/p&gt;\r\n\r\n&lt;p&gt;(4) 爆炸态复合板的剪切强度最低，强度极限值仅为273.07MPa。淬火＋回火处理后复合板剪切强度明显提高，强度极限值达到530.22MPa。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '18643', '19', '0', '1', '1', '0', '1', '195', '2017-11-14 15:38:55', '195', '2017-11-15 11:03:57');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('92', '118', '浮标', '96', '18644', '19010', '本产品工作原理：基于GPS波浪观测和北斗卫星传输的漂流浮标，利用GPS接收到的频率与卫星信号发射信号频率产生的多普勒效应，测量运动状态，进而反演出波浪谱。测量的数据通过北斗卫星进行传输。', '基于GPS波浪观测和北斗卫星传输的漂流浮标，利用GPS接收到的频率与卫星信号发射信号频率产生的多普勒效应，测量运动状态，进而反演出波浪谱。测量的数据通过北斗卫星进行传输。', '&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;&lt;strong&gt;本产品的优势&lt;/strong&gt;：&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;1）GPS信号多普勒效应测量原理，无须基准站，可满足深海大洋要求。同时也兼容RTK-GPS、PPK-GPS技术，可实现近海观测。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;2）体积小，成本低、免维护；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;3）布放机制灵活：可以单点锚系，也可以漂流模式（&lt;strong&gt;高海况下采用漂流模式，可以获取大风条件下如台风的强烈而复杂的波浪、流和温盐实测资料！&lt;/strong&gt;），因而可以获得高海况下更大范围数据；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;4）测量精确高，有效波高相对精度优于1%；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;5）以北斗通讯为主，同时兼容GPRS通讯方式，数据传输成功率＞90%；&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px&quot;&gt;6）球形结构，316钢或玻璃钢材质。&lt;/span&gt;&lt;/p&gt;', '18881', '96', '1', '1', '1', '0', '1', '204', '2017-11-14 15:39:20', '204', '2017-11-15 14:13:28');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('93', '109', '高精度偏振光导航仪', '84', '18650', '18840', '无', '本成果为一种通过测量天空偏振光分布实现导航的高精度偏振光导航仪，具体包括：结构相同的第一偏振光镜筒、第二偏振光镜筒、第三偏振光镜筒和第四偏振光镜筒构成的偏振光接收系统；在该偏振光接收系统的输出方向顺次是光束转折器件、偏振调制系统和光电探测器阵列，该光电探测器阵列之后再依次连接锁相放大电路、对数放大电路、数据采集卡和计算机。光电探测器阵列将接收到的两路偏振光信号转换成电信号，经对数放大电路和锁相放大电路送到计算机中进行信号处理，实现运动物体的导航。', '&lt;p&gt;&lt;strong&gt;高精度偏振光导航仪&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋工程装备、船舶制造技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;海洋工程；仪器仪表&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;2009-&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）李代林；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;13506362105；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本成果为一种通过测量天空偏振光分布实现导航的高精度偏振光导航仪，具体包括：结构相同的第一偏振光镜筒、第二偏振光镜筒、第三偏振光镜筒和第四偏振光镜筒构成的偏振光接收系统；在该偏振光接收系统的输出方向顺次是光束转折器件、偏振调制系统和光电探测器阵列，该光电探测器阵列之后再依次连接锁相放大电路、对数放大电路、数据采集卡和计算机。光电探测器阵列将接收到的两路偏振光信号转换成电信号，经对数放大电路和锁相放大电路送到计算机中进行信号处理，实现运动物体的导航。本发明具有系统结构简单、可靠性好、导航精度高等特点，适用于船舶、飞机、车辆与机器人等交通工具和运动物体的实时导航。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '18654', '18', '0', '1', '1', '0', '1', '195', '2017-11-14 15:47:10', '195', '2017-11-15 11:04:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('94', '117', '锌棒', '80', '18624', '19157', '暂无', '聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&ldquo;胜辉&rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。', '&lt;p&gt;聊城市胜辉防腐材料科技有限公司是一家从事牺牲阳极产品的设计，制造和安装的专业性公司，公司制造和销售注册品牌为&amp;ldquo;胜辉&amp;rdquo;品牌的牺牲阳极，广泛应用于船舶、港工设施、海洋工程、石油储存和运输、发电厂、地下管网等钢结构的阴极保护。&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '215', '2017-11-14 15:48:07', '215', '2017-11-15 17:38:25');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('95', '109', '海底管道安全可靠性与风险评估技术', '86', '18672', '18846', '无', '面向海底管道服役期内腐蚀、疲劳和泄漏等复杂工程问题，结合国家重点研发计划课题，在腐蚀管线剩余强度评估、管跨涡激疲劳损伤及控制、海底管道裂纹评定与寿命预测、介质泄漏扩散风险评估、动态风险演化与事故建模，结构完整性数字化管理等方面取得进展，形成海底管道安全可靠性与风险评估技术。目前已经发表论文54篇，申请软件版权3项。该成果已经在杭州湾和胜利滩海等海底管道取得良好的应用，可有效评定海底管道各类失效风险，保证在役海底管道安全服役，降低检修成本，从而将管道失效风险控制在可接受范围内，应用前景良好。', '&lt;p&gt;&lt;strong&gt;海底&lt;/strong&gt;&lt;strong&gt;管道&lt;/strong&gt;&lt;strong&gt;安全&lt;/strong&gt;&lt;strong&gt;可靠性&lt;/strong&gt;&lt;strong&gt;与&lt;/strong&gt;&lt;strong&gt;风险评估&lt;/strong&gt;&lt;strong&gt;技术&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;面向海底管道服役期内腐蚀、疲劳和泄漏等复杂工程问题，结合国家重点研发计划课题，在腐蚀管线剩余强度评估、管跨涡激疲劳损伤及控制、海底管道裂纹评定与寿命预测、介质泄漏扩散风险评估、动态风险演化与事故建模，结构完整性数字化管理等方面取得进展，形成海底管道安全可靠性与风险评估技术。目前已经发表论文54篇，申请软件版权3项。该成果已经在杭州湾和胜利滩海等海底管道取得良好的应用，可有效评定海底管道各类失效风险，保证在役海底管道安全服役，降低检修成本，从而将管道失效风险控制在可接受范围内，应用前景良好。&lt;/p&gt;', '18675', '17', '0', '1', '1', '0', '1', '195', '2017-11-14 16:33:26', '195', '2017-11-15 11:07:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('96', '109', '海底气液多相增压举升泵', '87', '18677', '18860', '无', '海底气液多相增压举升泵是用于海洋油气田进行海底气液多相增压举升的新技术。该种增压举升泵采用螺旋轴流式结构，具有轴流泵和压缩机的双重特性，与普通增压泵相比在高含气工况下具有突出的输送效果。', '&lt;p&gt;海底气液多相增压举升泵是用于海洋油气田进行海底气液多相增压举升的新技术。该种增压举升泵采用螺旋轴流式结构，具有轴流泵和压缩机的双重特性，与普通增压泵相比在高含气工况下具有突出的输送效果。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 目前，该种泵在国外主要用于地面油气混输，在国内尚处于初期样机实验研究阶段。本课题组自主设计的具有独立自主知识产权的海底气液多相增压举升泵，具有高含气率下高效增压举升的能力，目前该种泵已进行了地面试验，效果达到了预期的设计指标。并已申请3项国家发明专利。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 该种泵既可用于海底、陆上油气田混输，又可用于单井混抽，将为海上高气油比油藏的开发和海底油气混输提供一种全新的技术，具有广阔的市场应用前景和巨大的应用价值。&lt;/p&gt;', '18683', '16', '0', '0', '1', '0', '1', '195', '2017-11-14 16:35:42', '195', '2017-11-15 11:12:21');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('97', '109', '海洋工程装备运动补偿技术', '88', '18688', '18871', '无', '在海洋工程领域，海浪会导致浮式平台的升沉运动，对海洋工程作业的工作进度、工作质量和安全都会产生影响，因此海上作业装置上必须配备升沉补偿系统。我国在该领域的研究还处于起步阶段，目前升沉补偿装备基本依靠进口。', '&lt;p&gt;&lt;strong&gt;海洋工程装备运动补偿技术 &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;在海洋工程领域，海浪会导致浮式平台的升沉运动，对海洋工程作业的工作进度、工作质量和安全都会产生影响，因此海上作业装置上必须配备升沉补偿系统。我国在该领域的研究还处于起步阶段，目前升沉补偿装备基本依靠进口。&lt;/p&gt;\r\n\r\n&lt;p&gt;本课题组多年来以海洋钻井升沉补偿为依托，在吸收国内外先进技术的基础上，进行具有自主知识产权的高性能升沉补偿系统的开发，通过理论研究、数值模拟、虚拟样机、试验验证等多种手段，开展补偿系统设计技术、驱动技术、控制技术、节能技术及检测技术的研究，有效突破了能耗和控制性能两大技术瓶颈；将进一步拓展研究成果的应用领域，将升沉补偿技术推广应用到海洋采矿、海上货物吊装、舰船间货物转运、潜器拖曳与回收、海洋结构物安装、海上救助和海底探测等其他海洋工程领域，有效提升海工装备的原始创新能力、突破自主化设计的瓶颈。&lt;/p&gt;', '18695', '15', '0', '1', '1', '0', '1', '195', '2017-11-14 16:38:39', '195', '2017-11-15 11:14:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('98', '109', '海洋结构物智能化安全检测技术', '89', '18697', '18878', '无', '以海洋工程装备为对象，开展基于声发射、磁记忆、红外热成像、振动、光纤应变、等多种方法的结构安全监测技术研究。特别针对海洋环境下海洋工程装备的结构、作业以及服役环境特点，分别从结构整体在线健康监测和关键构件无损检测两个方面开展技术攻关，研发出用于保障海洋装备结构完整性的集成化、智能化检测新技术。', '&lt;p&gt;&lt;strong&gt;海洋结构物智能化安全检测技术&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;以海洋工程装备为对象，开展基于声发射、磁记忆、红外热成像、振动、光纤应变、等多种方法的结构安全监测技术研究。特别针对海洋环境下海洋工程装备的结构、作业以及服役环境特点，分别从结构整体在线健康监测和关键构件无损检测两个方面开展技术攻关，研发出用于保障海洋装备结构完整性的集成化、智能化检测新技术。特别在海洋复杂结构系统缺陷的声发射检测及定位方法、结构应力集中的磁记忆检测及判定方法、复合材料补强钢结构的红外热像检测技术、检测信号智能化处理方法等方面取得良好研究进展。相关研究成果已经在渤海、东海、南海等海域多种海洋平台得到工程验证和初步应用。&lt;/p&gt;', '18699', '14', '0', '1', '1', '0', '1', '195', '2017-11-14 16:41:51', '195', '2017-11-15 11:16:11');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('99', '109', '海洋油气开采作业风险评价与重大事故控制技术', '90', '18717', '18879', '无', '围绕海洋油气重大事故，建立起开采作业风险分析、评估与防控体系。针对海洋油气开采风险的动态特性，从人因失误、工艺设备、环境危害和管理缺陷角度进行系统风险辨识，开展动态风险防控研究。', '&lt;p&gt;&lt;strong&gt;海洋油气开采作业风险评价与重大事故控制技术&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;围绕海洋油气重大事故，建立起开采作业风险分析、评估与防控体系。针对海洋油气开采风险的动态特性，从人因失误、工艺设备、环境危害和管理缺陷角度进行系统风险辨识，开展动态风险防控研究。围绕井喷等重大事故机理，建立重大事故仿真模型，制定基于安全屏障技术的防控方案。支持国家海洋工程装备科研项目第七代超深水钻井平台（船）创新专项&amp;mdash;&amp;mdash;安全风险设计与控制技术研究，国家863计划课题深水表层钻井关键技术及装备研究项目-深水表层钻井试验风险分析及控制。&lt;/p&gt;', '18720', '13', '0', '1', '1', '0', '1', '195', '2017-11-15 09:25:01', '195', '2017-11-15 11:16:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('100', '109', '近海石油老龄平台延寿技术', '91', '18722', '18880', '无', '该研究成果集老龄平台的剩余寿命评估、风险分析、维修加固于一体，共包括老龄平台剩余寿命预测与强度评估技术、老龄平台维修加固优化技术、老龄平台可靠性分析与风险评估技术、老龄平台安全运行信息化技术、安全延寿技术体系开发与应用5个方面的内容', '&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;成果名称（型号）：近海石油老龄平台延寿技术&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;成果简介&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;该研究成果集老龄平台的剩余寿命评估、风险分析、维修加固于一体，共包括老龄平台剩余寿命预测与强度评估技术、老龄平台维修加固优化技术、老龄平台可靠性分析与风险评估技术、老龄平台安全运行信息化技术、安全延寿技术体系开发与应用5个方面的内容；成果研究了构建近海老龄石油平台延寿服役安全保障体系所涉及到的核心技术及方法，有助于打破国外公司的技术垄断；能够在保证平台安全可靠运行的前提下延长平台的使用寿命，降低海洋油气的开采成本；另外该成果中已申请国家发明专利6项，获得老龄平台完整性（延寿）数字化管理系统软件版权；目前该成果已成功应用于渤海湾埕北油田的多个井组平台中，取得了良好的经济效应；鉴于老龄平台数量增多，该成果具有非常广阔的应用前景。&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;成果样图及图注&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;见附件。&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;关键技术&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;老龄平台剩余寿命预测与强度评估技术&lt;/li&gt;\r\n	&lt;li&gt;老龄平台维修加固优化技术&lt;/li&gt;\r\n	&lt;li&gt;老龄平台可靠性分析与风险评估技术&lt;/li&gt;\r\n	&lt;li&gt;老龄平台安全运行信息化技术&lt;/li&gt;\r\n	&lt;li&gt;安全延寿技术体系开发与应用技术&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;其他说明&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;本课题组研究的老龄平台延寿评估流程，对API和CCS规范中海洋平台评估部分内容进行了补充与完善。&lt;/p&gt;', '18725', '12', '0', '1', '1', '0', '1', '195', '2017-11-15 09:29:19', '195', '2017-11-15 11:16:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('101', '109', '井下油水分离同井采油注水装置', '92', '18727', '18743', '无', '本装置的先进性主要体现在同井井下油水分离，在井下将分离出的原油举升到地面，将分离出的水直接注入注水层或废弃层。该装置可实现采上层注下层或采下层注上层的工艺，是一项高效、节能、环保的新技术。', '&lt;p&gt;&lt;strong&gt;井下油水分离同井采油注水装置&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;地质；机械&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;01寻求合作实施&amp;nbsp;&amp;nbsp;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）李增亮；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;0546-8399914；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本装置的先进性主要体现在同井井下油水分离，在井下将分离出的原油举升到地面，将分离出的水直接注入注水层或废弃层。该装置可实现采上层注下层或采下层注上层的工艺，是一项高效、节能、环保的新技术。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 其创新性主要体现在井下机组的设计方法和井下油水分离系统的匹配设计方面。已获的国家专利（02281997.5），其专利名称为&amp;ldquo;井下倒置式电动潜油离心泵油水分离采注装置&amp;rdquo;。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 目前该项新技术已在陆上油田进行了小试，尚未进行海试。陆上试验表明它不仅可大量减少油井的采出水量，减少平台上或地面上水处理设备及运行费用，环保、节能，而且还会增加油井的原油产量。因此该项新技术对于海上和陆上油气田开发将具有广阔的应用前景和巨大的经济效益。&lt;/p&gt;', '18742', '11', '0', '1', '1', '0', '1', '195', '2017-11-15 09:47:41', '195', '2017-11-15 09:47:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('102', '109', '可生物降解油井水泥降失水剂', '93', '18744', '18750', '无', '本成果的技术关键是对天然高分子物质精制棉和动物明胶进行改性，制备出低分子量羟乙基纤维素、&alpha;-氨基酸接枝磺化醛酮缩聚物，并利用两者间的协同作用开发出一种可生物降解的油井水泥降失水剂。所开发的可生物降解降失水剂具有原料来源广、制备工艺简单、生产成本低等优点，所制备的样品降失水效果好、抗盐能力强、缓凝副作用较小，为人类更好地开发海洋油气资源提供了一种优质的可生物降解油井水泥降失水剂，可以大规模应用于海洋石油工业油气井固井领域。', '&lt;p&gt;&lt;strong&gt;可生物降解油井水泥降失水剂&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;化学化工&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;02技术转让&amp;nbsp;&amp;nbsp;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）步玉环、王成文；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;13884951607；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本成果的技术关键是对天然高分子物质精制棉和动物明胶进行改性，制备出低分子量羟乙基纤维素、&amp;alpha;-氨基酸接枝磺化醛酮缩聚物，并利用两者间的协同作用开发出一种可生物降解的油井水泥降失水剂。所开发的可生物降解降失水剂具有原料来源广、制备工艺简单、生产成本低等优点，所制备的样品降失水效果好、抗盐能力强、缓凝副作用较小，为人类更好地开发海洋油气资源提供了一种优质的可生物降解油井水泥降失水剂，可以大规模应用于海洋石油工业油气井固井领域。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 目前国内对环境友好的可生物降解油气井固井水泥降失水剂的研究与开发刚开始，预计本成果会有广阔的市场。&lt;/p&gt;', '18749', '10', '0', '1', '1', '0', '1', '195', '2017-11-15 09:55:00', '195', '2017-11-15 09:55:00');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('103', '109', '深水采油树系统', '95', '18751', '18757', '无', '深水采油树系统:是水下生产系统最重要的设备之一，在控制油井生产、调节出油产量等方面起着至关重要的作用，它的性能好坏直接决定整个水下生产系统的运行状态。', '&lt;p&gt;&lt;strong&gt;深水采油树系统:&lt;/strong&gt;是水下生产系统最重要的设备之一，在控制油井生产、调节出油产量等方面起着至关重要的作用，它的性能好坏直接决定整个水下生产系统的运行状态。根据深水采油树系统在线监测的传感器数据，迅速准确地判断故障的位置、类型和严重程度，制定最佳的维修与预防性维护策略，可以节约水下干预费用、降低深水操作风险，提高海洋石油勘探开发的安全性。本项目提出了一种基于多源信息融合技术的深水采油树系统在线监测与智能故障诊断方法，研制了一套智能故障诊断系统，对流花油田和陆丰油田的水下采油树进行了地面测试与故障诊断，效果良好。基于本项目，发表SCI、EI期刊论文15篇，授权《水下采油树智能监测与动态故障诊断系统》、《水下全电采油树系统一体式电动执行器》等中国发明专利十余项。&lt;/p&gt;', '18756', '9', '0', '1', '1', '0', '1', '195', '2017-11-15 09:58:10', '195', '2017-11-15 09:58:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('104', '109', '深水防喷器及控制系统', '97', '18758', '18765', '无', '深水防喷器及控制系统\r\n针对3000米深水防喷器组可靠性要求极高的特点，提出一种深水防喷器组的数字量输入、模拟量输入和数字量输出表决算法，以及基于冗余控制器、冗余以太网、冗余控制台、数据库冗余服务器、冗余水下电子模块和冗余电源等多种冗余技术的深水防喷器组电控系统设计方法，研制出了深水防喷器组电控系统的硬件和软件系统。', '&lt;p&gt;&lt;strong&gt;深水防喷器及控制系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;针对3000米深水防喷器组可靠性要求极高的特点，提出一种深水防喷器组的数字量输入、模拟量输入和数字量输出表决算法，以及基于冗余控制器、冗余以太网、冗余控制台、数据库冗余服务器、冗余水下电子模块和冗余电源等多种冗余技术的深水防喷器组电控系统设计方法，研制出了深水防喷器组电控系统的硬件和软件系统。该成果荣获第十三届中国国际石油石化技术装备展会唯一&amp;ldquo;展品创新金奖&amp;rdquo;。以上述研究内容撰写的博士学位论文《深水防喷器组控制系统及关键部件研究》被评为山东省优秀博士学位论文。专家组对本成果的评价是：水下防喷器组及控制系统的研制成功，是我国石油钻采和海洋工程装备的重大突破，填补了我国海洋工程水下关键设备的空白，打破了国外技术垄断。香港城市大学校长、美国国家工程院院士、台湾中央研究院院士、中国工程院外籍院士、俄罗斯工程院外籍院士W. Kuo教授 (Computers &amp;amp; Industrial Engineering, 2016) 等人评价申请人的研究&amp;ldquo;高可靠性地保障了深水防喷器系统的操作安全&amp;rdquo;。&lt;/p&gt;', '18764', '8', '0', '1', '1', '0', '1', '195', '2017-11-15 10:02:14', '195', '2017-11-15 10:02:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('105', '109', '深水固井水泥浆体系', '98', '18766', '18771', '无', '本成果的技术关键是以具有优异低温水化能力的硅酸盐-硫铝酸盐混合物为基础，通过优选降失水剂、分散剂、早强促凝剂和缓凝剂，以及加入中空微珠密度减轻剂和适量的水，制备出一系列具有优异性能、不同密度的深水固井水泥浆体系。该深水固井体系配制简单、现场施工方便并且外加剂对环境友好，其低温早期抗压强度、静胶凝强度&ldquo;过渡时间&rdquo;性能优于国外深水固井水泥浆体系，其它性能与国外同类水平相近。&nbsp;', '&lt;p&gt;深水固井水泥浆体系&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;地质；化学化工&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;&amp;radic;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）步玉环、王成文；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;13884951607；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本成果的技术关键是以具有优异低温水化能力的硅酸盐-硫铝酸盐混合物为基础，通过优选降失水剂、分散剂、早强促凝剂和缓凝剂，以及加入中空微珠密度减轻剂和适量的水，制备出一系列具有优异性能、不同密度的深水固井水泥浆体系。该深水固井体系配制简单、现场施工方便并且外加剂对环境友好，其低温早期抗压强度、静胶凝强度&amp;ldquo;过渡时间&amp;rdquo;性能优于国外深水固井水泥浆体系，其它性能与国外同类水平相近。&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 中国海洋油气资源丰富，从海洋开发更多的石油以缓解当前油气资源供需矛盾，已成为我国石油工业发展的新战略之一。然而，我国的深水固井相关研究刚开始。预计此固井水泥浆体系会有广阔的市场。&lt;/p&gt;', '18770', '7', '0', '1', '1', '0', '1', '195', '2017-11-15 10:07:13', '195', '2017-11-15 10:07:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('106', '109', '深水湿气分离新技术-超声速旋流分离器', '99', '18772', '18783', '无', '&nbsp; 超声速旋流分离器是一种用于天然气脱水和重烃分离的新装置，它集膨胀降温、旋流分离和压力恢复于管状结构中，无转动部件、体积小、支持无人值守，还具有无需外加能源、无需化学药剂、密闭无泄漏等优点，实现节能和环保的双重效益。该分离器特别适用于海洋湿气分离，脱水效率达到90%、脱重烃效率达到85%、而且还可脱除H2S、CO2等酸性气体，用于海上天然气开发，可替代井口节流和甘醇脱水装置，实现湿气脱水脱除重烃。', '&lt;p&gt;&lt;strong&gt;深水湿气分离新技术&amp;mdash;超声速旋流分离器&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;机械；化学化工&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;2010-&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）曹学文；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;15053208836；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 超声速旋流分离器是一种用于天然气脱水和重烃分离的新装置，它集膨胀降温、旋流分离和压力恢复于管状结构中，无转动部件、体积小、支持无人值守，还具有无需外加能源、无需化学药剂、密闭无泄漏等优点，实现节能和环保的双重效益。该分离器特别适用于海洋湿气分离，脱水效率达到90%、脱重烃效率达到85%、而且还可脱除H2S、CO2等酸性气体，用于海上天然气开发，可替代井口节流和甘醇脱水装置，实现湿气脱水脱除重烃。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 天然气超声速旋流天然气分离技术顺应了天然气工业安全、环保、节能降耗、降低开发成本的要求，支持无人值守，适应边际油气田、沙漠油气田特别是海洋油气田发展的趋势，有着广阔的发展前景，该技术的成功应用将大大降低投资和运行成本。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '18782', '6', '0', '1', '1', '0', '1', '195', '2017-11-15 10:17:47', '195', '2017-11-15 10:17:47');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('107', '109', '深水湿气计量新技术&mdash;分流取样式湿气流量计（WGFM-1）', '100', '18784', '18787', '各分相流量测量误差小于5%。', '深水湿气计量新技术采用分流取样式新型多相流体测量方法，通过流型整改和管壁取样有效地克服流型波动对流量测量精度的影响，测量原理简单可靠，可摒弃现有多相流量计过度依赖信号处理的缺陷，各分相流量测量误差小于5%。', '&lt;p&gt;&lt;strong&gt;深水湿气计量新技术&amp;mdash;分流取样式湿气流量计（WGFM-1）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;机械&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）曹学文；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;15053208836；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 深水湿气计量新技术采用分流取样式新型多相流体测量方法，通过流型整改和管壁取样有效地克服流型波动对流量测量精度的影响，测量原理简单可靠，可摒弃现有多相流量计过度依赖信号处理的缺陷，各分相流量测量误差小于5%。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 该计量装置具有体积小、测量范围广、基本不含移动部件、无需维护和环境适应性强等优点，可用于FPSO上的油气流量，还可直接安装于海底井口，实现水下湿式计量监测和湿气的海底计量。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 随着我国油气勘探技术的发展，越来越多的湿天然气和高酸性气田得到开发，这些为本项目研究提供了很好的应用领域，本技术的成功应用也将大大提高天然气的集输、处理工艺，降低开发成本。&lt;/p&gt;', '18785', '5', '1', '1', '1', '0', '1', '195', '2017-11-15 10:20:22', '195', '2017-11-18 19:39:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('108', '109', '深水钻井隔水管与井口系统设计分析与作业技术', '101', '18789', '18792', '以海洋石油981平台、南海8号平台以及兴旺号平台等20余口深水自营井等为研究对象', '深水钻井隔水管与井口系统设计分析与作业技术\r\n依托国家863计划、国家科技重大专项等课题，在国内首次系统开展深水钻井隔水管与井口系统设计分析与作业技术研究。在深水钻井隔水管系统设计技术、深水钻井隔水管系统分析技术、水下井口强度及稳定性分析技术、深水钻井隔水管作业窗口及作业决策技术、深水钻井隔水管设计分析及作业管理软件等5个方面取得重要进展', '&lt;p&gt;&lt;strong&gt;深水钻井隔水管与井口系统设计分析与作业技术&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;依托国家863计划、国家科技重大专项等课题，在国内首次系统开展深水钻井隔水管与井口系统设计分析与作业技术研究。在深水钻井隔水管系统设计技术、深水钻井隔水管系统分析技术、水下井口强度及稳定性分析技术、深水钻井隔水管作业窗口及作业决策技术、深水钻井隔水管设计分析及作业管理软件等5个方面取得重要进展，取得深水钻井隔水管系统设计、深水钻井隔水管-井口-导管耦合系统分析、深水钻井隔水管波激和涡激疲劳分析、井口结构套管承载能力分析、深水钻井隔水管作业窗口分析等多项创新成果，并以海洋石油981平台、南海8号平台以及兴旺号平台等20余口深水自营井等为研究对象，建立深水钻井隔水管与井口系统钻前设计和作业技术体系，打破国外公司的技术垄断，为我国的深水隔水管与井口系统设计、使用与管理提供技术支撑，且相关研究成果荣获2014年海洋工程科学技术特等奖、2016年中国石油和化学工业联合会科技进步一等奖。&lt;/p&gt;', '18791', '4', '1', '1', '1', '0', '1', '195', '2017-11-15 10:25:03', '195', '2017-11-18 19:39:16');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('109', '109', '水下井口头系统', '102', '18793', '18797', '具备了 1000m 水深、10000psi 等级水下井口头系统的设计和制造能力', '水下井口头系统 \r\n该项目研究打破了国外的技术垄断，掌握了深水水下井口头系统的设计和制造方法，具备了 1000m 水深、10000psi 等级水下井口头系统的设计和制造能力，填补了水下井口关键核心装备的空白，为实现水下井口系统国产化做出了贡献，形成了具有自主知识产权的水下井口关键技术；该系统在 2013 中国国际石油石化技术装备展览会展出。', '&lt;p&gt;&lt;strong&gt;水下井口头系统 &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;该项目研究打破了国外的技术垄断，掌握了深水水下井口头系统的设计和制造方法，具备了 1000m 水深、10000psi 等级水下井口头系统的设计和制造能力，填补了水下井口关键核心装备的空白，为实现水下井口系统国产化做出了贡献，形成了具有自主知识产权的水下井口关键技术；该系统在 2013 中国国际石油石化技术装备展览会展出。&lt;/p&gt;', '18796', '3', '1', '1', '1', '0', '1', '195', '2017-11-15 10:29:09', '195', '2017-11-18 19:39:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('110', '109', '延缓油气井工作液外加剂释放的微胶囊技术', '103', '18798', '18806', '无', '本成果的技术关键是选用抗压强度较高、比表面积大、能够吸收与自身重量相当的化学物质的多孔硅铝酸盐小球，通过硅铝酸小球来吸收油井水泥的早强促凝剂、胶凝强度促进剂、缓凝剂或者是水力压裂液的交联剂、破胶剂等，然后用具有一定耐热、耐碱能力的非水溶性聚合物将硅铝酸盐小球包裹制备微胶囊，实现油气井工作液外加剂延缓释放的目的。微胶囊的制备具有原料来源广、制备工艺简单、生产成本低等优点，且属于废物利用，所制备的微胶囊延缓释放效果好、抗压耐温、适用范围广，为人类更好地开发油气资源提供了一种优质的油气井工作液外加剂，可以大规模应用于石油工业油气井固井领域和水力压裂领域。&nbsp;', '&lt;p&gt;延缓油气井工作液外加剂释放的微胶囊技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋能源矿产勘探开发技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;地质；机械；化学化工&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;长期&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）步玉环、王成文；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;13884951607；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本成果的技术关键是选用抗压强度较高、比表面积大、能够吸收与自身重量相当的化学物质的多孔硅铝酸盐小球，通过硅铝酸小球来吸收油井水泥的早强促凝剂、胶凝强度促进剂、缓凝剂或者是水力压裂液的交联剂、破胶剂等，然后用具有一定耐热、耐碱能力的非水溶性聚合物将硅铝酸盐小球包裹制备微胶囊，实现油气井工作液外加剂延缓释放的目的。微胶囊的制备具有原料来源广、制备工艺简单、生产成本低等优点，且属于废物利用，所制备的微胶囊延缓释放效果好、抗压耐温、适用范围广，为人类更好地开发油气资源提供了一种优质的油气井工作液外加剂，可以大规模应用于石油工业油气井固井领域和水力压裂领域。&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 采用该微胶囊技术延缓其释放，不仅可以克服许多不足而且对油气井工作液性能没有副作用，使油气井工作液的性能实现可控。预计该成果会有广阔的市场前景。&amp;nbsp;&lt;/p&gt;', '18805', '2', '0', '1', '1', '0', '1', '195', '2017-11-15 10:32:59', '195', '2017-11-18 19:39:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('111', '109', '油气混输管线模拟仿真系统', '104', '18813', '18822', '无', '管道稳态和非稳态运行时，沿线各管段主要流动工艺参数的计算；稳态和非稳态流动时，计算并模拟显示管道内集液量，协助管理人员确定最佳清管周期；计算并显示清管液塞长度；判断水合物形成区段；根据管道起点工况预报管道终点工况，也可由管道终点压力推算起点压力，对管道可能发生的故障报警，提醒管理人员采取相应的措施。', '&lt;p&gt;&lt;strong&gt;油气混输管线模拟仿真系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;所属领域：&lt;/strong&gt;海洋工程装备、船舶制造技术&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;涉及专业：&lt;/strong&gt;海洋工程；计算机&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要完成单位：&lt;/strong&gt;中国石油大学（华东）&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果类型：&lt;/strong&gt;&amp;nbsp;01&amp;nbsp;发明专利&amp;nbsp;&amp;nbsp;02&amp;nbsp;新产品（或农业新品种）&amp;nbsp;&amp;nbsp;03&amp;nbsp;新装置&amp;nbsp;&amp;nbsp;04&amp;nbsp;新材料&amp;nbsp;&amp;nbsp;05&amp;nbsp;新工艺（新方法、新模式）&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;06&amp;nbsp;计算机软件&amp;nbsp;&amp;nbsp;07&amp;nbsp;技术标准&amp;nbsp;&amp;nbsp;08&amp;nbsp;其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;技术成熟度：&lt;/strong&gt;&amp;nbsp;01实验室（或样品）&amp;nbsp;&amp;nbsp;02小试&amp;nbsp;&amp;nbsp;03中试&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;04形成产品&amp;nbsp;&amp;nbsp;05其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果面向对象：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01中小企业&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02大型企业&amp;nbsp;&amp;nbsp;03其它&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;合作方式：&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&amp;radic;01寻求合作实施&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;02技术转让&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;radic;03其它方式&amp;nbsp;&amp;nbsp;04无需求&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;有效时间：&lt;/strong&gt;2010-&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系人：&lt;/strong&gt;（项目负责）李玉星；（科技处）刘明&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;联系方式：&lt;/strong&gt;0532-86981821；0532-86981833&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;成果简介：&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 该成果为用于油田集输以及海上管道模拟计算的专业软件，可以实现以下功能：&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 管道稳态和非稳态运行时，沿线各管段主要流动工艺参数的计算；稳态和非稳态流动时，计算并模拟显示管道内集液量，协助管理人员确定最佳清管周期；计算并显示清管液塞长度；判断水合物形成区段；根据管道起点工况预报管道终点工况，也可由管道终点压力推算起点压力，对管道可能发生的故障报警，提醒管理人员采取相应的措施。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 研究成果经上海市科委以及中石油组织的鉴定，成果达国际先进水平。获东营市科技成果一等奖。获上海市科技成果一等奖。已经在多家设计院以及油田推广使用。&lt;/p&gt;', '18821', '1', '0', '1', '1', '0', '1', '195', '2017-11-15 10:42:03', '195', '2017-11-18 19:39:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('112', '123', '水下机器人小艾', '105', '18934', '18982', '1.GPS围栏+一键返航   2.智能激光避障   3.无线控制+图传   4.云台：两轴防抖   5.重量：3.5kg   6.航速：0.2~2m/s   7.续航时间：2h   8.最大信号距离：1km   9. 手机App录制拍摄   10.相机：4k   11.尺寸：480X495X120mm   12.水下悬停精度：2cm（垂直）   13.稳定系统：9轴陀螺仪   14.最大下潜深度：5m', '水下机器人小艾是一款为游泳爱好者及酷客极玩量身定做的伴游伙伴，小艾可以实现快速上浮下潜并且具有自平衡悬停功能，本体配备4K超清相机，通过WIFI实时图传手机，记录水下的魅力瞬间。自动避障功能给您充分的安全感，让您随心所欲。', '&lt;p&gt;水下机器人小艾是一款为游泳爱好者及酷客极玩量身定做的伴游伙伴，小艾可以实现快速上浮下潜并且具有自平衡悬停功能，本体配备4K超清相机，通过WIFI实时图传手机，记录水下的魅力瞬间。自动避障功能给您充分的安全感，让您随心所欲。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '228', '2017-11-15 13:39:46', '228', '2017-11-15 13:54:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('113', '116', '防爆离心风机', '106', '18941', '18948', 'CBL系列舰船用防爆离心通风机', 'CBL系列舰船用防爆离心通风机：防爆，运转安全可靠、尺寸小、重量轻、低噪声、防腐性能好、抗摇摆、振动和冲击性强。\r\nCBLExplosion proof centrifugal fan for ship：Explosion proof, safe and reliable operation, small size, light weight, low noise, good corrosion resistance, anti swing, vibration and shock.', '&lt;p&gt;CBL系列舰船用防爆离心通风机：防爆，运转安全可靠、尺寸小、重量轻、低噪声、防腐性能好、抗摇摆、振动和冲击性强。&lt;/p&gt;\r\n\r\n&lt;p&gt;CBLExplosion proof centrifugal fan for ship：Explosion proof, safe and reliable operation, small size, light weight, low noise, good corrosion resistance, anti swing, vibration and shock.&lt;/p&gt;', '18947', '5', '0', '1', '1', '0', '1', '207', '2017-11-15 13:41:26', '207', '2017-11-15 13:41:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('114', '116', '防爆轴流风机', '107', '18949', '18959', 'CBZ系列舰船用防爆轴流通风机', 'CBZ系列舰船用防爆轴流通风机：防爆，运转安全可靠、防腐蚀性能好、抗摇摆、振动和冲击性能强。\r\nCBZExplosion proof axial fan for ship：Explosion proof, safe and reliable operation, good corrosion resistance, anti swing, vibration and shock performance.', '&lt;p&gt;CBZ系列舰船用防爆轴流通风机：防爆，运转安全可靠、防腐蚀性能好、抗摇摆、振动和冲击性能强。&lt;br /&gt;\r\nCBZExplosion proof axial fan for ship：Explosion proof, safe and reliable operation, good corrosion resistance, anti swing, vibration and shock performance.&lt;/p&gt;', '18954', '4', '0', '1', '1', '0', '1', '207', '2017-11-15 13:47:01', '207', '2017-11-15 13:47:01');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('115', '116', '离心风机', '108', '18960', '18965', 'JCL系列舰船用离心通风机', 'JCL系列舰船用离心通风机：尺寸小、重量轻、低噪声、防腐性能好、气密性好、启动力矩小、抗摇摆、振动和冲击性强。\r\nJCLMarine centrifugal fan：Small size, light weight, low noise, good corrosion resistance, good air tightness, small starting torque, anti swing, vibration and shock resistance.', '&lt;p&gt;JCL系列舰船用离心通风机：尺寸小、重量轻、低噪声、防腐性能好、气密性好、启动力矩小、抗摇摆、振动和冲击性强。&lt;br /&gt;\r\nJCLMarine centrifugal fan：Small size, light weight, low noise, good corrosion resistance, good air tightness, small starting torque, anti swing, vibration and shock resistance.&lt;/p&gt;', '18964', '3', '1', '1', '1', '0', '1', '207', '2017-11-15 13:50:41', '207', '2017-11-20 11:20:28');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('116', '116', '水驱风机', '109', '18966', '21054', '我公司生产的CBL、CBZ、JCL(CLQ)、JCZ(CZ)等系列舰船用防爆离心、轴流通风机；舰船用离心、轴流通风机是由中国船舶工业总公司上海船舶设备研究所设计，并经过专家鉴定，达到国内先进水平。', '我公司生产的CBL、CBZ、JCL(CLQ)、JCZ(CZ)等系列舰船用防爆离心、轴流通风机；舰船用离心、轴流通风机是由中国船舶工业总公司上海船舶设备研究所设计，并经过专家鉴定，达到国内先进水平。', '&lt;p&gt;我公司生产的CBL、CBZ、JCL(CLQ)、JCZ(CZ)等系列舰船用防爆离心、轴流通风机；舰船用离心、轴流通风机是由中国船舶工业总公司上海船舶设备研究所设计，并经过专家鉴定，达到国内先进水平。&lt;/p&gt;', '18970', '2', '1', '1', '1', '0', '1', '207', '2017-11-15 13:52:31', '207', '2017-11-20 11:20:25');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('117', '116', '轴流风机', '110', '18972', '21055', 'CBZ系列舰船用防爆轴流通风机：防爆，运转安全可靠、防腐蚀性能好、抗摇摆、振动和冲击性能强。', 'CBZ系列舰船用防爆轴流通风机：防爆，运转安全可靠、防腐蚀性能好、抗摇摆、振动和冲击性能强。', '&lt;p&gt;CBZ系列舰船用防爆轴流通风机：防爆，运转安全可靠、防腐蚀性能好、抗摇摆、振动和冲击性能强。&lt;/p&gt;', '18987', '1', '1', '1', '1', '0', '1', '207', '2017-11-15 13:57:57', '207', '2017-11-20 11:20:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('118', '126', '公务船船舶管理', '111', '19040', '19086', '2015年，应客户要求，青岛华洋成立船管部，正式进入船舶管理业务领域。目前共计为商船和特种用途船提供安全管理服务10余艘。', '2015年，应客户要求，青岛华洋成立船管部，正式进入船舶管理业务领域。目前共计为商船和特种用途船提供安全管理服务10余艘。', '&lt;p&gt;2015年，应客户要求，青岛华洋成立船管部，正式进入船舶管理业务领域。目前共计为商船和特种用途船提供安全管理服务10余艘。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '239', '2017-11-15 15:20:45', '239', '2017-11-15 16:14:08');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('119', '127', 'Chinook ROV', '114', '19068', '21779', '配备4个推进器  180度上下俯仰范围  供电单元输入100-240VAC 市电，输出350VDC，水下本体最大功耗1200w，室外建议2KW发电机供电。', 'Chinook ROV采取开放式模块化设计：\r\n配备4个推进器（最多可以添加至6个推进器，水下本体免维护设计，轴封正常使用寿命长达700-1000小时）\r\n标配一部彩色变焦摄像机，180度上下俯仰范围；选配至多3部固定安装定焦辅助摄像头和两个外独立LED灯。', '&lt;p&gt;Chinook ROV采取开放式模块化设计：&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;配备4个推进器（最多可以添加至6个推进器，水下本体免维护设计，轴封正常使用寿命长达700-1000小时）&lt;/li&gt;\r\n	&lt;li&gt;标配一部彩色变焦摄像机，180度上下俯仰范围；选配至多3部固定安装定焦辅助摄像头和两个外独立LED灯&lt;/li&gt;\r\n	&lt;li&gt;航向、深度、横摇和纵摇传感器、泄露与温度以及推进器过载警报和指示器&lt;/li&gt;\r\n	&lt;li&gt;标配335米双绞线电缆配备手动绞盘，选配光纤缆至多 2000-3000米电动绞盘。&lt;/li&gt;\r\n	&lt;li&gt;供电单元输入100-240VAC&amp;nbsp;市电，输出350VDC，水下本体最大功耗1200w，室外建议2KW发电机供电&lt;/li&gt;\r\n	&lt;li&gt;控制单元15寸LCD液晶显示屏，控制面板上有人机互动的摇杆和控制按钮以及串行接口，用于ROV的实时操控和水下数据传输。&lt;/li&gt;\r\n	&lt;li&gt;两年质保，终身维修支持&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;广泛应用于：水下专业摄影，搜救打捞、水电大坝检查、水产养殖、管道内部长距离检查、港口安全等领域。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '19073', '1', '0', '1', '1', '0', '1', '240', '2017-11-15 15:47:22', '240', '2017-11-21 13:46:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('120', '126', '公务船船员派遣', '112', '19096', '19098', '经过近10年的政府公务船管理业务发展，青岛华洋目前派遣在船公务船船员800余人，其中海警船400余人，科考船270余人，海事执法船50余人，工作艇60余人', '经过近10年的政府公务船管理业务发展，青岛华洋目前派遣在船公务船船员800余人，其中海警船400余人，科考船270余人，海事执法船50余人，工作艇60余人', '&lt;p&gt;经过近10年的政府公务船管理业务发展，青岛华洋目前派遣在船公务船船员800余人，其中海警船400余人，科考船270余人，海事执法船50余人，工作艇60余人&lt;/p&gt;', null, '2', '1', '1', '1', '0', '1', '239', '2017-11-15 16:05:15', '239', '2017-11-15 16:13:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('121', '126', '商船船员派遣', '113', '19109', '19110', '自公司成立，以市场为导向，依托部属企业的优势，始终致力于商船船员的劳务派遣。\r\n目前，青岛华洋每年船员外派达2200人次，在船人数超过700人，与国内外12余家知名船东建立了稳固的合作关系，共计为31条船派遣整套船员班子。', '自公司成立，以市场为导向，依托部属企业的优势，始终致力于商船船员的劳务派遣。\r\n目前，青岛华洋每年船员外派达2200人次，在船人数超过700人，与国内外12余家知名船东建立了稳固的合作关系，共计为31条船派遣整套船员班子。', '&lt;p&gt;自公司成立，以市场为导向，依托部属企业的优势，始终致力于商船船员的劳务派遣。 目前，青岛华洋每年船员外派达2200人次，在船人数超过700人，与国内外12余家知名船东建立了稳固的合作关系，共计为31条船派遣整套船员班子。&lt;/p&gt;', null, '3', '1', '1', '1', '0', '1', '239', '2017-11-15 16:13:39', '239', '2017-11-15 16:13:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('122', '133', '&ldquo;蓝水&rdquo;系列160型AUV', '115', '19125', '19130', '1.舰体长度：1.7M    2.舰体外径：160MM    3.最大工作深度：100M    4.自带能源：1.0KWH    5.续航时间：8小时', '自主式水下航行器（AUV）是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自主监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。中海蓝水自动化装备有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&ldquo;蓝水&rdquo;系统AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。', '&lt;p&gt;自主式水下航行器（AUV）是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自主监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。中海蓝水自动化装备有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&amp;ldquo;蓝水&amp;rdquo;系统AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。&lt;/p&gt;', '19126', '1', '1', '1', '1', '0', '1', '213', '2017-11-15 16:36:45', '213', '2017-11-18 19:37:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('123', '133', '&ldquo;蓝水&rdquo;系列210型AUV', '116', '19136', '19143', '1.舰体外径：210MM    2.舰体长度：2.2M    3.最大工作深度：200M    4.自带能源：2.0KWH    5.续航时间：12小时', '自主式水下航行器（AUV）是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自主监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。中海蓝水自动化装备有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&ldquo;蓝水&rdquo;系统AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。', '&lt;p&gt;自主式水下航行器（AUV）是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自主监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。中海蓝水自动化装备有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&amp;ldquo;蓝水&amp;rdquo;系统AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。&lt;/p&gt;', '19141', '2', '1', '1', '1', '0', '1', '213', '2017-11-15 16:46:16', '213', '2017-11-18 19:37:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('124', '132', '国内首条全仿生机器鱼&mdash;KenFish', '118', '19144', '21329', '&quot;3沟道&quot;，&ldquo;3关节&rdquo;设计，仿生人类最灵巧的手指结构设计；\r\n&ldquo;2.4G&rdquo; 自动调频设计，Km级无线通信；\r\n 内部&ldquo;5金结构&rdquo;，金属质感，纯铜齿轮；', '乐智与北大智能控制实验室联合研发的Rofish（多关节鱼）是国内首条全仿生机器鱼，在创新性、科学性、实用性上均达到了国内领先的水准。适用于教学、科研、水下作业等。', '&lt;p&gt;&lt;strong&gt;主要特&lt;/strong&gt;&lt;strong&gt;色：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;丰富的竞赛活动&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;从省市级赛事到区域级，再到国际水中机器人大赛，Rofish作为核心竞赛器具全面覆盖各级别的权威赛事，并有相关系列活动可供参与。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;北大工学院历尽10年科研成果&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;乐智联合北大工学院历时10年研究，以先进的电子、通信、控制及机械等技术为支撑，结合精准的仿生运动控制算法与精湛的防水工艺，为大家呈现一个仿真度极高甚至可以假乱真的效果。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;独有的配套水中机器人实验平台&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;可对机器鱼的控制参数进行设定：速度档位设置、升降档位设置、传感器使能设置、ID设置、通讯频率设置、控制方式设置等；也可对其进行编程及策略烧写进而实现机器人在水中的自主控制完成相关任务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;广泛的应用领域&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Rofish的强大性能还保证了其广泛的应用领域：（1）作为观赏鱼可用于科技馆、高档水族馆；（2）用于农业养殖，可有效提高鱼群的活性；（3）科研用鱼，仿生设计，无侵入感，近距离探测被测对象；（4）可用于教学使用，同时结合水中机器人大赛，更具挑战和趣味。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '238', '2017-11-15 16:53:11', '238', '2017-11-20 11:10:47');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('125', '133', '摄像头AI', '117', '19145', '19152', '1.物理参数：尺寸：直径54.8MM，长度104.9MM    重量：0.47KG（空气中），0.23KG（水中）    材质：6013铝合金、钛合金    最大工作深度：6000米    2.光学参数：视场：150&deg;HX 120&deg;V 185&deg;D    图像传感器：1/3IN CCD    \r\n分辨率：570TVL    深度：12000M', 'LS-CAM低照度水下摄像机，外形小巧、采用专业摄像镜头，圆顶设计消除了虚光现象，减小了图像失真。成像范围达到水平150度、垂直120度。LS-CAM将宽视场与低照度完美结合，适合搭载于各种水下机器人系统。', '&lt;p&gt;LS-CAM低照度水下摄像机，外形小巧、采用专业摄像镜头，圆顶设计消除了虚光现象，减小了图像失真。成像范围达到水平150度、垂直120度。LS-CAM将宽视场与低照度完美结合，适合搭载于各种水下机器人系统。&lt;/p&gt;', '19151', '3', '1', '1', '1', '0', '1', '213', '2017-11-15 17:07:46', '213', '2017-11-18 19:37:37');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('126', '133', '推进器', '119', '19154', '19164', '1.型号：BW-250W 推力：4.5kg（推力）1.6kg（拉力）重量:1kg（空气中）0.8kg（海水中）尺寸:10cm 22.6cm 2.型号：BW-500W 推力:7.8kg（推力）3.4kg（拉力）重量:1.8kg（空气中）1.4kg（海水中）尺寸:12cm 23cm 3.型号：BW-1KW 推力:18kg（推力）10kg（拉力）2kg（空气中）重量：1.5kg（海水中）尺寸：19cm 32cm 4.型号BW-1.5KW 推力：30kg（推力）21kg（拉力）重量：3.4kg（空气中）2.6kg（海水中）尺寸：22cm 34cm', '公司研发生产用于AUV、ROV等水下机器人系统的多种型号水下推进器。推进器采用磁耦合或充油补偿等稳定可靠的密封技术，功率从0.25KW-1.5KW，多种电压选择，连接器可根据用户需求定制。', '&lt;p&gt;公司研发生产用于AUV、ROV等水下机器人系统的多种型号水下推进器。推进器采用磁耦合或充油补偿等稳定可靠的密封技术，功率从0.25KW-1.5KW，多种电压选择，连接器可根据用户需求定制。&lt;/p&gt;', '19156', '4', '0', '1', '1', '0', '1', '213', '2017-11-15 17:45:17', '213', '2017-11-16 09:12:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('127', '133', '有缆式水下机器人', '120', '19166', '19168', '一：主要特点:1.ROV深度等级可达300M  2.强大的动力，紧凑型尺寸设计，可配备电电驱动机械抓手和液压驱动机械抓手  3.1080P高清摄像头，旋转云台  4.模块化设计；用户可制定传感器搭载系统，易于维护  二：性能：运动：三轴，加自身轴旋转  前进速度：3.5  节工作深度：300M  三：物理尺寸：1.尺寸：900*470*600（MM）空气中重量：70Kg不包括附选设备  2.材料：聚丙烯外框架，LY12铝合金耐压装置', '1.ROV深度等级可达300M   2.强大的动力，紧凑型尺寸设计，可配备电电驱动机械抓手和液压驱动机械抓手   3.1080P高清摄像头，旋转云台   4.模块化设计；用户可制定传感器搭载系统，易于维护', '&lt;p&gt;1.ROV深度等级可达300M &amp;nbsp; 2.强大的动力，紧凑型尺寸设计，可配备电电驱动机械抓手和液压驱动机械抓手 &amp;nbsp; 3.1080P高清摄像头，旋转云台 &amp;nbsp; 4.模块化设计；用户可制定传感器搭载系统，易于维护&lt;/p&gt;', '19165', '5', '0', '1', '1', '0', '1', '213', '2017-11-16 09:25:04', '213', '2017-11-16 09:25:04');
