INSERT INTO `byp_exhibition_booth_product_info` VALUES ('135', '140', 'S1500', '128', '19262', '19274', '天线转速 24&plusmn;2转/分钟  发射管MAF1421B   频率9410 &plusmn;30MHz  输出功率4KW', '产品特点:1、目标256级量化2、电子调谐功能 3、中/英文、海里/公里、日/夜模式任意切换 4、多脉冲精确配置 5、简易ARPA功能和简易AIS功能 6、三种回波颜色自由选择', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171116/pic/20171116140901_716.jpg&quot; style=&quot;height:861px; width:861px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171116/pic/20171116140925_101.jpg&quot; style=&quot;height:861px; width:861px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171116/pic/20171116140936_931.jpg&quot; style=&quot;height:861px; width:861px&quot; /&gt;&lt;/p&gt;', '19273', '1', '0', '1', '1', '0', '1', '252', '2017-11-16 14:09:48', '252', '2017-11-16 14:09:48');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('136', '138', '电缆桥架产品', '129', '19240', '19327', '我公司生产的不锈钢桥架，无铜铝桥架、钢制电缆桥架从结构到工艺低温焊接经过7项试验。根据海洋等级要求：(1)机械负载试验(2)撞击试验(3)交变湿热试验(4)盐雾试验(5)保护电路连续性试验(6)防护层性能试验(7)全负载风洞试验（40秒钟后达到预设定风速36m/s的设计风速，在重承载最高风速51.1m/s试验合格）。', '根据海洋平台模块工程技术规范要求制作，如因为桥架变更走向我公司派工程技术人员现场测会、测会后设计图纸甲方认可后制作异型弯通、三通、调高、调低、左旋、右旋等非标准桥架产品取的多向专利。国内承载试验标准为185kg，挠度4.0毫米，华通公司生产的桥架在动承载中能达到300kg负荷，检测承载挠度2.0毫米提高标准挠度1倍，完全符合海洋技术澄清规格书要求280Kg。超过国内标准、达到IEC和NEMA 20B标准。', '&lt;p&gt;根据海洋平台模块工程技术规范要求制作，如因为桥架变更走向我公司派工程技术人员现场测会、测会后设计图纸甲方认可后制作异型弯通、三通、调高、调低、左旋、右旋等非标准桥架产品取的多向专利。国内承载试验标准为185kg，挠度4.0毫米，华通公司生产的桥架在动承载中能达到300kg负荷，检测承载挠度2.0毫米提高标准挠度1倍，完全符合海洋技术澄清规格书要求280Kg。超过国内标准、达到IEC和NEMA 20B标准。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '209', '2017-11-16 15:10:39', '209', '2017-11-16 15:11:25');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('137', '138', '电机维修', '133', '19349', '19350', '在电机修理业务中，船舶电机维修是我公司的传统特色业务，自1993年我公司取得中国船级社船用电机电气修理资格证书以来，先后有渤海石油委托我公司修理吉林号发电机、锚机电机、风机电机及电气全项目工程并得到该公司的好评，在多年的维修服务中与各兄弟单位建立良好的业务关系。对我公司给予高度评价，并赠送了多面锦旗。建立了一整套完善的电机检测程序和配备了种类齐全的检测设备。对检修后的电动机进行全项检测包括绝缘电阻、直阻测定、耐压试验、瓦特损耗、匝间绝缘、空载损耗、甲方特除要求做负载试验做出厂160kw负载试验方可做负载出厂试验等，修理最大容量电机0.1KW&mdash;2000KW。', '公司是天津市滨海大港唯一给天津石化公司配套修理高低压电机专业厂，拥有独立的检修车间，修理各类高低压电动机同时还与大港油田、渤海石油等公司先后建立了长期良好的业务关系，公司月修理电动机能力800台，平均容量150KW。多年来与各协作单位承接各种电机，其中有国产电机、韩国电机、美国电机、台湾电机、德国西门子电机等，修理各类型如高低交流机、直流电机、变频电机、同步电机、VS电机、制动电机、横动电动、交流两速电动机、三速电动机和调速电机，还有各系列电焊机、大型发电机等，还包括包括拆装运输修理平台维护培养全项交钥匙工程、风机改造等等。', '&lt;p&gt;公司是天津市滨海大港唯一给天津石化公司配套修理高低压电机专业厂，拥有独立的检修车间，修理各类高低压电动机同时还与大港油田、渤海石油等公司先后建立了长期良好的业务关系，公司月修理电动机能力800台，平均容量150KW。多年来与各协作单位承接各种电机，其中有国产电机、韩国电机、美国电机、台湾电机、德国西门子电机等，修理各类型如高低交流机、直流电机、变频电机、同步电机、VS电机、制动电机、横动电动、交流两速电动机、三速电动机和调速电机，还有各系列电焊机、大型发电机等，还包括包括拆装运输修理平台维护培养全项交钥匙工程、风机改造等等。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '209', '2017-11-16 15:45:05', '209', '2017-11-16 15:45:05');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('138', '145', '船用气囊', '134', '19351', '21073', '船用橡胶气囊是一种具有我国自主知识产权的创新产品，经过二十多年的发展实践，证明这种产品具有安全高效、绿色环保、机动灵活等特点，目前已广泛应用在船舶上下水、沉箱起重移运、沉船打捞、水下安装工程的助浮等领域。船用气囊的应用受场地限制小，无需大型的机械设备，因此能够缩短工程周期、节省大量资金，很受国内外船厂 、打捞公司、大型建筑构件厂等用户的青睐。', '船用橡胶气囊是一种具有我国自主知识产权的创新产品，经过二十多年的发展实践，证明这种产品具有安全高效、绿色环保、机动灵活等特点，目前已广泛应用在船舶上下水、沉箱起重移运、沉船打捞、水下安装工程的助浮等领域。船用气囊的应用受场地限制小，无需大型的机械设备，因此能够缩短工程周期、节省大量资金，很受国内外船厂 、打捞公司、大型建筑构件厂等用户的青睐。', '&lt;p&gt;&lt;strong&gt;气囊应用及分类：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;橡胶气囊按功能和应用领域可划分为：船舶上下水用气囊；重物顶升移运、载动起重用气囊；助浮打捞用气囊；橡胶充气芯模等。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.船舶上下水气囊&lt;/p&gt;\r\n\r\n&lt;p&gt;船用气囊的应用受场地限制因素少，无需大型的机械设备，因此能够缩短工程周期、节省大量资金。经过二十多年的发展实践，证明这种产品具有安全高效、绿色环保、机动灵活等特点。下水船舶从自重几十吨的平底船发展到目前上万吨的大型船舶，实践证明船舶气囊上下水工艺是安全可靠的。目前，该项技术已被国内外造船业、港口建设业所认可，气囊下水技术已广泛应用到欧美、非洲、东南亚等国家。&lt;/p&gt;\r\n\r\n&lt;p&gt;2.重物起重搬运用气囊&lt;/p&gt;\r\n\r\n&lt;p&gt;利用橡胶气囊充气后的高承压力将大型重物起重顶升，并通过气囊的滚动移动重物，由于气囊起重搬运这一方式无需大型机械设备、投资少、安装简单，现已广泛应用在沉箱起重移运、钻井平台以及大型重物的顶升和搬运工程等领域。&lt;/p&gt;\r\n\r\n&lt;p&gt;3.助浮打捞用气囊&lt;/p&gt;\r\n\r\n&lt;p&gt;气囊充气后具有重量轻、简单易操作、浮力大、耐海水腐蚀等优点被广泛应用于搁浅失事船只的助浮施救打捞、沉箱下水助浮、大型管道助浮及水下安装工程助浮等领域。&lt;/p&gt;\r\n\r\n&lt;p&gt;4.橡胶充气芯模&lt;/p&gt;\r\n\r\n&lt;p&gt;橡胶充气芯模又叫混凝土预制空心板橡胶充气芯模，桥梁充气芯膜，橡胶内模。主要用于公路桥梁混凝土前张法后张法梁的浇筑成型和船舶工程。同时也被涵洞排污工程所采用。橡胶充气芯模使用简便，经济耐用，未充气能柔软收缩，任意折叠、卷曲，充气膨胀后具有足够的强度来承受混凝土的压力，这是任何传统刚性模板所无可比拟的。适用于钢筋混凝土构件抽孔，包括桩、屋架、屋面板柱、梁、建筑工程，水利工程(船坞、船台、码头)。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;青岛顺航气囊产品优势：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1．采用优质进口天然橡胶&lt;/p&gt;\r\n\r\n&lt;p&gt;2．耐磨、耐酸碱、抗老化&lt;/p&gt;\r\n\r\n&lt;p&gt;3．承载力大，气密性好、安全可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;4．高压安全防爆整体缠绕工艺&lt;/p&gt;\r\n\r\n&lt;p&gt;5．使用寿命长&lt;/p&gt;\r\n\r\n&lt;p&gt;6．完善的售后服务，提供气囊养护方法、修补工艺、修补材料及工具等。&lt;/p&gt;', '19352', '4', '0', '1', '1', '0', '1', '260', '2017-11-16 15:47:49', '260', '2017-11-18 19:27:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('139', '145', '橡胶充气护舷', '135', '19356', '21074', '橡胶充气护舷（靠球）是以空气为介质，利用压缩空气来吸收冲击能量，使船舶停靠时具有更柔性，更软性，以达到防碰防撞防避的效果，从而广泛用于船与船之间的转移停靠作业、油轮、集装箱船、游艇、海洋平台、大型船坞、军港码头、大型桥墩等。', '橡胶充气护舷（靠球）是以空气为介质，利用压缩空气来吸收冲击能量，使船舶停靠时具有更柔性，更软性，以达到防碰防撞防避的效果，从而广泛用于船与船之间的转移停靠作业、油轮、集装箱船、游艇、海洋平台、大型船坞、军港码头、大型桥墩等。', '&lt;p&gt;橡胶充气护舷（靠球）是以空气为介质，利用压缩空气来吸收冲击能量，使船舶停靠时具有更柔性，更软性，以达到防碰防撞防避的效果，从而广泛用于船与船之间的转移停靠作业、油轮、集装箱船、游艇、海洋平台、大型船坞、军港码头、大型桥墩等。&lt;/p&gt;\r\n\r\n&lt;p&gt;橡胶充气护舷的优点： &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1.吸收冲击能量大，对船舶反冲击力小&lt;/p&gt;\r\n\r\n&lt;p&gt;随着船舶吨位的增长，靠泊作业时，船舶接触岸壁或其它船只的冲撞能量也增长。巨大的冲撞能量必须依赖于护舷的充分变形及足够的接触面积来吸收。橡胶充气护舷利用内部压缩空气作为缓冲介质，吸收船舶冲击能量，弹性非常好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;2.弹性好，不会在压缩的作用下变形&lt;/p&gt;\r\n\r\n&lt;p&gt;充气护舷中充的是低压气体，在压缩变形中内压的提高很有限。由于接触面积大，作用于船体表面的单位压力很低，与其它护舷器具相比较，就不是一般的低反应力了。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;3. 经济实用，性价比高&lt;/p&gt;\r\n\r\n&lt;p&gt;橡胶充气护舷价格经济实惠，使用寿命长。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;4. 安装简单&lt;/p&gt;\r\n\r\n&lt;p&gt;充气护舷安装携带方便，广泛应用于各种船舶、外海大型码头以及潮差大的各种码头。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;5.漂浮性能好，不受潮差影响，护舷可保持在理想水位&lt;/p&gt;\r\n\r\n&lt;p&gt;充气橡胶护舷浮于水面（超过体积的50%），随着海潮涨落相对于船舷的位置不会改变。尤其是船舶随着海浪起伏时，圆柱形的充气护舷随着滚动，摩擦力很小，不会损伤船体表面的涂层。&lt;/p&gt;', '19358', '3', '0', '1', '1', '0', '1', '260', '2017-11-16 15:48:54', '260', '2017-11-18 19:30:15');
