INSERT INTO `byp_exhibition_booth_product_info` VALUES ('142', '146', '北京中能联合项目查询系统', '138', '19369', '19374', '北京中能联合项目查询系统', '北京中能联合项目查询系统', '&lt;p&gt;北京中能联合项目查询系统&lt;/p&gt;', '19372', '1', '0', '1', '1', '0', '1', '214', '2017-11-16 16:01:41', '214', '2017-11-16 16:02:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('143', '147', '多参数水质监测仪', '147', '19405', '19457', '监测仪可带六个传感器，监测水中六种污染物质的含量，包括重原油、轻原油、浊度、有色溶解有机物（CDOM）、藻红蛋白和溶解氧。', '多参数水质监测仪采用国际先进的荧光技术，灵敏度高，能实时在线监测水中的污染物含量，精度达到国际先进水平。监测仪具有性价比高，功耗低、多种通讯方式、在线处理和存储等功能。实时监测结果可通过通讯传输到手机、平板电脑、笔记本电脑和其它装置，也可通过这些装置遥控监测仪。监测仪可带六个传感器，监测水中六种污染物质的含量，包括重原油、轻原油、浊度、有色溶解有机物（CDOM）、藻红蛋白和溶解氧。', '&lt;p&gt;&amp;nbsp; 多参数水质监测仪采用国际先进的荧光技术，灵敏度高，能实时在线监测水中的污染物含量，精度达到国际先进水平。监测仪具有性价比高，功耗低、多种通讯方式、在线处理和存储等功能。实时监测结果可通过通讯传输到手机、平板电脑、笔记本电脑和其它装置，也可通过这些装置遥控监测仪。监测仪可带六个传感器，监测水中六种污染物质的含量，包括重原油、轻原油、浊度、有色溶解有机物（CDOM）、藻红蛋白和溶解氧。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171116/pic/20171116163312_139.jpg&quot; style=&quot;height:617px; width:888px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;第一种为移动手提式监测方式，用于随机检测水中污染物含量；&lt;/p&gt;\r\n\r\n&lt;p&gt;第二种为固定式监测方式，可固定在海洋采油井架、港口码头、浮标等位置，通过无线通讯传输将监测数据传到室内办公室；&lt;/p&gt;\r\n\r\n&lt;p&gt;第三种为移动拖体式水下监测方式，可将若干个监测仪串连在一起由船拖引获得监测数据。&lt;/p&gt;', '19456', '2', '1', '1', '1', '0', '1', '212', '2017-11-16 16:33:58', '212', '2017-11-16 17:15:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('144', '141', '电气产品实验室', '145', '19407', '19419', '1.容量试验： 40.5kV及以下通用电气产品和海洋电气产品的短路试验。\r\n2.绝缘试验： 40.5kV及以下开关设备工频电压耐受试验（干、湿）；雷电冲击耐受电压试验；局部放电测量试验。\r\n3.温升和动热稳定性试验：10000A及以下温升试验，50kA及以下产品动热稳定试验。\r\n4.机械寿命试验：按国家标准和IEC标准要求进行的机械寿命试验。\r\n5.综合环境试验：各种元部件、金属材料以及电气电子产品整件（如电气设备、各种材料、绝缘母线、40.5kV及以下开关设备及控制设备、中小型电力变压器、电抗器、绝缘子、套管等）的盐雾试验、污秽试验', '1.容量试验： 40.5kV及以下通用电气产品和海洋电气产品的短路试验。\r\n2.绝缘试验： 40.5kV及以下开关设备工频电压耐受试验（干、湿）；雷电冲击耐受电压试验；局部放电测量试验。\r\n3.温升和动热稳定性试验：10000A及以下温升试验，50kA及以下产品动热稳定试验。\r\n4.机械寿命试验：按国家标准和IEC标准要求进行的机械寿命试验。\r\n5.综合环境试验：各种元部件、金属材料以及电气电子产品整件（如电气设备、各种材料、绝缘母线、40.5kV及以下开关设备及控制设备、中小型电力变压器、电抗器、绝缘子、套管等）的盐雾试验、污秽试验', '&lt;p&gt;1.容量试验： 40.5kV及以下通用电气产品和海洋电气产品的短路试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;2.绝缘试验： 40.5kV及以下开关设备工频电压耐受试验（干、湿）；雷电冲击耐受电压试验；局部放电测量试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;3.温升和动热稳定性试验：10000A及以下温升试验，50kA及以下产品动热稳定试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;4.机械寿命试验：按国家标准和IEC标准要求进行的机械寿命试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;5.综合环境试验：各种元部件、金属材料以及电气电子产品整件（如电气设备、各种材料、绝缘母线、40.5kV及以下开关设备及控制设备、中小型电力变压器、电抗器、绝缘子、套管等）的盐雾试验、污秽试验、淋雨试验、气候防护试验、外壳防护等级试验、凝露试验、交直流短路试验、振动试验、倾斜与摇摆试验以及上述多种综合工况的复合试验；电气产品在振动的条件下设备性能检测，重量2T以下高压电气设备和控制设备及其它电气设备的振动试验；电气产品在倾斜和摇摆状态下的设备性能检测。&lt;/p&gt;', '19412', '1', '0', '1', '1', '0', '1', '254', '2017-11-16 16:40:42', '254', '2017-11-16 16:46:51');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('145', '141', '低压电能质量试验系统', '146', '19425', '19451', '一：低次谐波发生装置、高次谐波发生装置、无功电流发生装置的基本技术指标如下：\r\n1）可以发出指定次谐波和指定次的谐波组合，谐波次数预先指定，数值连续可调；2）每相谐波电流可单独设定，三相谐波电流可按需求曲线进行预先设置；\r\n3）装置具有过电流、过电压、热过载等保护措施。4）可发生容性无功、感性无功，数值连续可调，容性感性无功可突变；无功电流可按照需求曲线进行预先设置；二：试验范围:谐波电流发生装置可满足在三相1140V/690V/660V/600V/380V和单相220V，各档电压等级下的APF产品试验，谐波电流源均可发生50次谐波范围内指定单次谐波或指定次谐波的组合。', '低次谐波发生装置、高次谐波发生装置、无功电流发生装置的基本技术指标如下：\r\n1）可以发出指定次谐波和指定次的谐波组合，谐波次数预先指定，数值连续可调；2）每相谐波电流可单独设定，三相谐波电流可按需求曲线进行预先设置；\r\n3）装置具有过电流、过电压、热过载等保护措施。4）可发生容性无功、感性无功，数值连续可调，容性感性无功可突变；\r\n无功电流可按照需求曲线进行预先设置；', '&lt;p&gt;低次谐波发生装置、高次谐波发生装置、无功电流发生装置的基本技术指标如下：&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;可以发出指定次谐波和指定次的谐波组合，谐波次数预先指定，数值连续可调；&lt;/li&gt;\r\n	&lt;li&gt;每相谐波电流可单独设定，三相谐波电流可按需求曲线进行预先设置；&lt;/li&gt;\r\n	&lt;li&gt;装置具有过电流、过电压、热过载等保护措施。&lt;/li&gt;\r\n	&lt;li&gt;可发生容性无功、感性无功，数值连续可调，容性感性无功可突变；无功电流可按照需求曲线进行预先设置；&lt;/li&gt;\r\n&lt;/ol&gt;', '19450', '2', '0', '1', '1', '0', '1', '254', '2017-11-16 16:56:19', '254', '2017-11-16 17:09:09');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('146', '141', '新能源电力电子试验系统', '148', '19428', '19449', '低电压穿越测试能力装置可在35KV或10KV侧产生三相对称故障、两相或单相非对称故障，自动配置故障类型，操作简易，自动化程度高。试验装置串联在光伏电站与电网之间，通过改变阻抗分压比实现电机组出口变压器出电压跌落，完成对光伏电站低电压穿越能力的测试。技术指标：1.额定容量：1500跌落/骤升类型：三相对称、两相对称和不对称故障2.跌落/骤升持续时间：0~3s', '低电压穿越测试能力装置可在35KV或10KV侧产生三相对称故障、两相或单相非对称故障，自动配置故障类型，操作简易，自动化程度高。试验装置串联在光伏电站与电网之间，通过改变阻抗分压比实现电机组出口变压器出电压跌落，完成对光伏电站低电压穿越能力的测试。', '&lt;p&gt;低电压穿越测试能力装置可在35KV或10KV侧产生三相对称故障、两相或单相非对称故障，自动配置故障类型，操作简易，自动化程度高。试验装置串联在光伏电站与电网之间，通过改变阻抗分压比实现电机组出口变压器出电压跌落，完成对光伏电站低电压穿越能力的测试。&lt;/p&gt;', '19448', '3', '0', '1', '1', '0', '1', '254', '2017-11-16 16:59:24', '254', '2017-11-16 17:08:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('147', '141', '柔性交流输电试验系统', '149', '19431', '19452', '晶闸管阀组   控制调节系统', '晶闸管阀组   控制调节系统', '&lt;p&gt;晶闸管阀组 &amp;nbsp; 控制调节系统&lt;/p&gt;', '19446', '4', '0', '1', '1', '0', '1', '254', '2017-11-16 17:05:36', '254', '2017-11-16 17:12:53');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('148', '141', '低压变频器试验系统', '150', '19436', '19440', '可完成15kW及以下全电压全电机系列试验，380V、220V和110V不同电压的被试变频器由380V三相四线电源供电，经过公共的三相20kVA电动操作调压器提供0~430V可调电源（10套机组合用此一台调压器）。    \r\n机组H可进行容量为15kW，电压等级为380V/220V的各种变频器进行出厂试验及型式试验。机组由三台电机、两台转矩-转速传感器、一台编码器及联轴器、底板等组成。三台电机为#1和#3陪试电机和#2回馈电机。陪试电机设计为同步/异步合为一体的电机。', '可完成15kW及以下全电压全电机系列试验，380V、220V和110V不同电压的被试变频器由380V三相四线电源供电，经过公共的三相20kVA电动操作调压器提供0~430V可调电源（10套机组合用此一台调压器）。    \r\n机组H可进行容量为15kW，电压等级为380V/220V的各种变频器进行出厂试验及型式试验。机组由三台电机、两台转矩-转速传感器、一台编码器及联轴器、底板等组成。三台电机为#1和#3陪试电机和#2回馈电机。陪试电机设计为同步/异步合为一体的电机。', '&lt;p&gt;可完成15kW及以下全电压全电机系列试验，380V、220V和110V不同电压的被试变频器由380V三相四线电源供电，经过公共的三相20kVA电动操作调压器提供0~430V可调电源（10套机组合用此一台调压器）。 &amp;nbsp; &amp;nbsp;&lt;br /&gt;\r\n机组H可进行容量为15kW，电压等级为380V/220V的各种变频器进行出厂试验及型式试验。机组由三台电机、两台转矩-转速传感器、一台编码器及联轴器、底板等组成。三台电机为#1和#3陪试电机和#2回馈电机。陪试电机设计为同步/异步合为一体的电机。&lt;/p&gt;', '19439', '5', '0', '1', '1', '0', '1', '254', '2017-11-16 17:08:16', '254', '2017-11-16 17:08:16');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('149', '147', '基于GNSS卫星的海洋多功能浮标监测系统', '144', '19438', '19455', '	采集主机体积：不大于30cm*30cm*20cm；\r\n	采集主机质量：不重于5kg；\r\n	功耗：不大于15W；\r\n	潮位测量精度：&plusmn;5cm\r\n	波浪测量精度：\r\n波浪测量范围：波高&plusmn;20m；精度：&plusmn;（0.1+5%H） H为波高\r\n波浪周期：2～30s；波向0～360&deg;\r\n	扩展其他传感器（风、温湿压等）精度见设备参数', '基于GNSS卫星的海洋多功能浮标监测系统是一种稳定可靠、连续工作能力强、测量数据准确度高的全天候测量系统。可安装在目前国内外多种浮标体内，并可在任一海域连续长期测量瞬时海面高、潮汐、波浪等水文参数。同时该系统具有较强的扩展功能，拥有多路数字和模拟数据采集通道，可以采集目前海洋浮标搭载的大多数的气象和水文传感器数据。', '&lt;p&gt;&lt;strong&gt;一、系统简介&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;基于GNSS卫星的海洋多功能浮标监测系统是一种稳定可靠、连续工作能力强、测量数据准确度高的全天候测量系统。可安装在目前国内外多种浮标体内，并可在任一海域连续长期测量瞬时海面高、潮汐、波浪等水文参数。同时该系统具有较强的扩展功能，拥有多路数字和模拟数据采集通道，可以采集目前海洋浮标搭载的大多数的气象和水文传感器数据。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;二、系统组成&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;（一）数据采集系统：包含嵌入式数据采集器、高精度三轴加速度计、高精度三系统GNSS模块、北斗通信模块。&lt;/p&gt;\r\n\r\n&lt;p&gt;数据采集器可扩展集成：风速风向、温度湿度、气压、多参数水质传感器（含油污实时监测传感器）等。&lt;/p&gt;\r\n\r\n&lt;p&gt;（二）岸站系统：监控浮标运行状态（位置信息、姿态信息和各模块工作状态等）&lt;/p&gt;\r\n\r\n&lt;p&gt;（三）数据传输系统：北斗通信系统。&lt;/p&gt;\r\n\r\n&lt;p&gt;（四）数据处理系统：通过提取原始采集的GNSS卫星的伪距、载波相位数据和高精度的姿态数据等信息，实现对浮标所在海域的瞬时海面高、潮位、波浪数据的统计、分析和计算。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;三、系统优势&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;系统可以获取近海与深远海的绝对潮位数据和绝对海平面变化数据，成果可以统一到国家高程基准；&lt;/li&gt;\r\n	&lt;li&gt;系统可以进行GNSS多普勒测量，结合谱分析的方法获取波浪参数，为海洋工程规划、施工、运营与维护、离岸资源调查等提供基础数据；&lt;/li&gt;\r\n	&lt;li&gt;系统可以进行GNSS水汽反演，弥补星载或机载微波遥感、海上探空气球等方式的不足，为海气交互研究提供基础数据，也灾害性海洋天气的预报提供服务；&lt;/li&gt;\r\n	&lt;li&gt;系统可以搭载油污监测等传感器，实时监测所在海域的油污溶度、浊度等信息。&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;四、系统意义&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;海洋监测与开发在我国国民经济发展及国家安全保障中具有至关重要的位置。海洋中的潮汐和波浪直接影响我们海上航运、海洋资源开发、海上军事等活动。而且随着我国进入&amp;ldquo;十三五&amp;rdquo;，我国的海洋工作重心已开始由近海转向深远海，基于GNSS卫星的海洋多功能浮标监测系统能便捷、准确和安全地获取高精度的波浪与潮汐资料，为陆海基准统一、海平面变化监测、海洋卫星星载高度计在轨绝对定标、防灾减灾、海啸预报、海洋工程开发和船舶航行等科研工作和军事活动提供基础数据。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;五、部分用户&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;国家海洋局东海分局、国家海洋局南海分局、国家海洋局第一海洋研究所、国家测绘地理信息局第七地形测量队、山东科技大学（海岛礁重点实验室）等。&amp;nbsp;&lt;/p&gt;', '19454', '1', '1', '1', '1', '0', '1', '212', '2017-11-16 17:13:10', '212', '2017-11-16 17:15:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('150', '150', 'AIRMAR系列气象站', '151', '19467', '19471', 'RMS&mdash;&mdash;均方根，LEN&mdash;&mdash;负载等效数\r\n与 Vaisala&reg;仪器相比，湿度和温度读数\r\n*当风速小于 2 m / s 或空气温度低于 0&deg;C 时，风、温度和相对湿度读数将不太准确。\r\n**湿条件包括风道中的水分，雨，霜，露水，雪，冰或海', 'Airmar WX 系列超声波气象站仪器能满足人们对气象数据日益增长的实时数据监测，特殊场所运\r\n用的要求。该系列的高精度传感器能提供特定的天气数据来帮助相关机构来监测当地或偏远区域天气\r\n状况。', '&lt;p&gt;1 、 WX &amp;nbsp;系列产品 优点包括 ：&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;集成了多达 7 个传感器于一体，无移动部件，维护需求低&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;风的参数读数不受常见问题的影响，如机械风速计和气象计量设备轴承磨损，污渍堆积等导致&lt;br /&gt;\r\n的数据不精准&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;便于安装于固定或移动系统。可安装于 1&amp;rdquo;-14 UNS 或 &amp;frac34;&amp;rdquo; NPT 标准杆上&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;IPX6 防水等级（内置相对湿度传感器的型号防水等级为 IPX4）&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;运用于低于 1&amp;deg; C 较冷气候区域的可选择加装电加热&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;较大的适用电压范围：9-40 VDC&lt;br /&gt;\r\n2 、 产品特点 ：&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;风速和风向&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;大气压&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;超声波风数据读数&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;空气温度&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;风寒指数&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;相对湿度（可选）&lt;br /&gt;\r\n&amp;bull; &amp;nbsp;电加热（可选）&lt;/p&gt;', '19470', '1', '1', '1', '1', '0', '1', '233', '2017-11-16 18:28:33', '233', '2017-11-17 09:45:39');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('151', '150', 'AQUAlogger310TY浊度仪', '152', '19472', '19476', '多种采样方式：连续模式，Burst 模式，延时启动，多种采样率，间歇记录和平均记录方式', 'AQUAlogger 310TY 浊度仪', '&lt;p&gt;主要特点：&lt;br /&gt;\r\n➢ &amp;nbsp;测量浊度达 10000FTU（典型）&lt;br /&gt;\r\n➢ &amp;nbsp;通过 SSC 转换工具转换浊度为悬浮泥沙浓度值&lt;br /&gt;\r\n➢ &amp;nbsp;可选自动清洁刷&lt;br /&gt;\r\n➢ &amp;nbsp;磁钥匙快速启动测量&lt;br /&gt;\r\n➢ &amp;nbsp;摇晃设备检查状态&lt;br /&gt;\r\n➢ &amp;nbsp;多种采样方式：连续模式，Burst 模式，延时启动，多种采样率，间歇记录和平均记录方式&lt;br /&gt;\r\n应用：&lt;br /&gt;\r\n➢ &amp;nbsp;海岸侵蚀研究；&lt;br /&gt;\r\n➢ &amp;nbsp;海洋和环境研究；&lt;br /&gt;\r\n➢ &amp;nbsp;疏浚监测；&lt;br /&gt;\r\n➢ &amp;nbsp;悬浮泥沙监测；&lt;br /&gt;\r\n➢ &amp;nbsp;环境影响评估。&lt;br /&gt;\r\n可选型号：&lt;br /&gt;\r\n➢ &amp;nbsp;标准：测量浊度；浊度、温度、压力参数；&lt;br /&gt;\r\n➢ &amp;nbsp;深水型：耐压 6000m；&lt;br /&gt;\r\n➢ &amp;nbsp;&amp;lsquo;Select&amp;rsquo; logger：可选多种压力传感器，包含高精度的选项。&lt;/p&gt;', '19474', '2', '0', '1', '1', '0', '1', '233', '2017-11-16 18:36:14', '233', '2017-11-16 18:37:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('152', '150', 'Aquascat1000LT声学悬沙剖面仪', '152', '19477', '19518', '野外现场测量悬浮泥沙，耐压 200m', '泥沙研究和测量的理想工具', '&lt;p&gt;特点&lt;br /&gt;\r\n➢ 声学后向散射方法；&lt;br /&gt;\r\n➢ 2 个不同的声学频率；&lt;br /&gt;\r\n➢ &amp;nbsp;固定式的探头，可用于重复测量&lt;br /&gt;\r\n应用&lt;br /&gt;\r\n➢ 沉积物的运输研究&lt;br /&gt;\r\n➢ 疏浚监测（ Dredge plume monitoring ）&lt;br /&gt;\r\n➢ 水质监测&lt;/p&gt;', '19480', '2', '0', '1', '1', '0', '1', '233', '2017-11-16 18:47:08', '233', '2017-11-17 09:45:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('153', '150', 'Aquascat1000L声学悬沙剖面仪', '152', '19500', '19516', '泥沙量程：敏感粒径范围广，一般 20&mu;m 至 500&mu;m 半径。在 1 米量程时，\r\n0.01 g/l 至 20 g/l 泥沙浓度，量程更短时，可测泥沙浓度越大', '实验室测量悬浮泥沙', '&lt;p&gt;特点&lt;br /&gt;\r\n➢ 声学后向散射原理&lt;br /&gt;\r\n➢ &amp;nbsp;最多 4 种不同频率的换能器&lt;br /&gt;\r\n➢ &amp;nbsp;带缆式的换能器设计，应用灵活&lt;br /&gt;\r\n应用&lt;br /&gt;\r\n➢ 水槽中测量泥沙剖面&lt;br /&gt;\r\n➢ 实验室泥沙的运移研究&lt;/p&gt;', '19501', '2', '0', '1', '1', '0', '1', '233', '2017-11-17 09:21:37', '233', '2017-11-17 09:44:56');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('154', '150', 'Aquascat1000R声学悬沙剖面仪', '152', '19507', '19513', '泥沙量程：敏感粒径范围广，一般 20&mu;m 至 500&mu;m 半径。在 1 米量程时，\r\n0.01 g/l 至 20 g/l 泥沙浓度，量程更短时，可测泥沙浓度越大', '野外现场测量悬浮泥沙，耐压 1000m', '&lt;p&gt;特点&lt;br /&gt;\r\n➢ 声学后向散射方法；&lt;br /&gt;\r\n➢ 4 个不同的声学频率；&lt;br /&gt;\r\n➢ &amp;nbsp;带缆式探头，应用灵活&lt;br /&gt;\r\n应用&lt;br /&gt;\r\n➢ 沉积物的运输研究&lt;br /&gt;\r\n➢ 疏浚监测（ Dredge plume monitoring ）&lt;/p&gt;', '19508', '2', '0', '1', '1', '0', '1', '233', '2017-11-17 09:26:43', '233', '2017-11-17 09:43:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('155', '150', 'AQUAscat&reg; 1000S 声学悬沙剖面', '152', '19511', '19515', '野 外 现 场 测 量 悬 浮 泥 沙 ， 耐 压1000m', '野 外 现 场 测 量 悬 浮 泥 沙 ， 耐 压1000m；泥沙研究和测量的理想工具', '&lt;p&gt;特点&lt;br /&gt;\r\n 声学后向散射方法；&lt;br /&gt;\r\n 4 个不同的声学频率；&lt;br /&gt;\r\n 固定式的探头，可用于重复测量&lt;br /&gt;\r\n应用&lt;br /&gt;\r\n 沉积物的运输研究&lt;br /&gt;\r\n 疏浚监测（Dredge plume monitoring）&lt;/p&gt;', '19514', '2', '0', '1', '1', '0', '1', '233', '2017-11-17 09:44:27', '233', '2017-11-17 09:44:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('156', '150', 'OS 304plus CTD 温盐深剖面仪', '153', '19520', '19524', '2GB 大容量内存，60,000,000  组数据存储量', 'OCEAN SEVEN 304Plus CTD 是 Idronaut 公司高质量、高精度 OCEAN\r\nSEVEN CTDs 系列中的一款，具有直径小，功耗极低的特点。CTD 可方便\r\n地集成到浮标系统、ROV 和 AUV 等第三方操作平台，是在线监测和自容\r\n式记录的最佳选择。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;OCEAN SEVEN 304Plus CTD 是 Idronaut 公司高质量、高精度 OCEANSEVEN CTDs 系列中的一款，具有直径小，功耗极低的特点。CTD 可方便地集成到浮标系统、ROV 和 AUV 等第三方操作平台，是在线监测和自容式记录的最佳选择。CTD 采用独特的深海无泵低维护传感器和著名的Idronaut 公司专利的高精确度七铂环石英电导探头设计，具有体积小、性能高、功耗低等特点。该传感器采用了大直径（8mm）和短长度（46mm）的设计理念，在长期部放和生物活跃的水域中，也能保证不会堵塞。它可以在现场清洗，而无需进行重新校准。其它品牌的 CTD 电导传感器，孔径小，长度长，即使使用了有毒的抗生物试剂，也无法保证不会堵塞。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;CTD 无需采用泵或其它设备使测量水体流过传感器，从而大大降低了其功耗，这样即使在南北极使用也无需担心。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;CTD 采用标准 RS232 接口，也可接以下几种接口：RS485，遥测，无线蓝牙。数据传输速率可达 115200bps，大大减少了数据传输所需的时间。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;CTD 允许操作者针对海水或淡水选择合适的电导率测量范围，这使得该设备成为了在地下水和海洋调查中都是最明智的选择。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;根据布放深度不同分为 1000m（AISI 316 不锈钢）和 7000m（钛合金）两款。&lt;/p&gt;', '19522', '3', '0', '1', '1', '0', '1', '233', '2017-11-17 09:56:52', '233', '2017-11-17 09:58:47');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('157', '150', 'MIDAS ECM  电磁水流计', '153', '19525', '19528', '适用深度高达5000米。', 'MIDAS ECM  是一个高度灵活的点水流计，耐用并易于部署。Valeport  的最新电子架构允许多个额外传感器和多种通信选项，使其成为为数不多允许在数千米电缆上进行实时操作和自主部署的多参数水流计。有钛合金和缩醛壳体两种选择，适用深度高达5000米。', '&lt;p&gt;MIDAS ECM &amp;nbsp;是一个高度灵活的点水流计，耐用并易于部署。Valeport &amp;nbsp;的最新电子架构允许多个额外传感器和多种通信选项，使其成为为数不多允许在数千米电缆上进行实时操作和自主部署的多参数水流计。有钛合金和缩醛壳体两种选择，适用深度高达5000米。&lt;/p&gt;', '19527', '3', '0', '1', '1', '0', '1', '233', '2017-11-17 10:02:20', '233', '2017-11-17 10:02:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('158', '150', 'miniCTD', '153', '19529', '19532', 'miniCTD 配有 Valeport 独特的高稳定性数字电导电率传感器、PRT 温度传感\r\n器和应变式压力传感器。 除了列出的测量参数之外，也可通过软件计算盐度\r\n和密度值。', 'miniCTD 的开发旨在为 CTD分析的收集提供一个符合成本效益的工具，并且不影响数据的质量。miniCTD是 ROV 、沿海或小船应用中的理想选择，特别适合勘测公司、军方和学术界及类似的机构。它使用简单且易于处理。', '&lt;p&gt;miniCTD 的开发旨在为 CTD分析的收集提供一个符合成本效益的工具，并且不影响数据的质量。miniCTD是 ROV 、沿海或小船应用中的理想选择，特别适合勘测公司、军方和学术界及类似的机构。它使用简单且易于处理。&lt;/p&gt;', '19531', '3', '0', '1', '1', '0', '1', '233', '2017-11-17 10:09:15', '233', '2017-11-17 10:09:15');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('159', '150', '海洋卫士RCM海流计', '153', '19533', '19537', '详细参数请下载附件', '海洋卫士海流计系列是在海洋卫士数据记录平台和多普勒海流传感器基础上开发的完全新式的一代海流计。结合现代计算机技术的先进数字信号进程提供准确和精细的数据。一整套微型传感器可实现测量参数的选择，包括温度、压力和电导率。新的海洋卫士海流计系列有 300 米、2000米和 6000 米。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;海洋卫士海流计系列是在海洋卫士数据记录平台和多普勒海流传感器基础上开发的完全新式的一代海流计。结合现代计算机技术的先进数字信号进程提供准确和精细的数据。一整套微型传感器可实现测量参数的选择，包括温度、压力和电导率。新的海洋卫士海流计系列有 300 米、2000米和 6000 米。&lt;/p&gt;\r\n\r\n&lt;p&gt;优点&lt;br /&gt;\r\n. SD 卡存储容量大&lt;br /&gt;\r\n. 宽带多普勒多频技术降低了功耗，改善了质量&lt;br /&gt;\r\n. 记录间隔降低到 2 秒&lt;br /&gt;\r\n. 低电流&lt;br /&gt;\r\n. 灵敏的传感器技术以可靠地半高速 CAN 总线接口技术（AiCaP）&lt;br /&gt;\r\n. 多达四个模拟传感器输入（0~5V）&lt;br /&gt;\r\n. 基于 Windows CE 的数据记录器基于 TFT（薄膜晶体管）技术的彩色触摸屏，用于现场设置&lt;br /&gt;\r\n. 海洋卫士工具包可视化软件&lt;br /&gt;\r\n. 用于海洋和淡水&lt;br /&gt;\r\n. 实时 XML 输出&lt;/p&gt;', '19536', '3', '0', '1', '1', '0', '1', '233', '2017-11-17 10:16:25', '233', '2017-11-17 10:16:25');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('160', '150', 'ULS－100水下激光扫描仪', '154', '19538', '19578', '扫描量程 最小: 0.13m (0.43&rsquo;) | 最大: 1m (3.3&rsquo;)', 'ULS-100：小量程高精度水下激光三维扫描仪；', '&lt;p&gt;节省操作时间&lt;br /&gt;\r\n◆ 实时 3D 模型和确认测量结果&lt;br /&gt;\r\n◆ 不需要现场校准&lt;br /&gt;\r\n精细化结果&lt;br /&gt;\r\n◆ 生成真实水下物体 3D 模型&lt;br /&gt;\r\n◆ 采集高密度点云数据，测量到细小特征和损坏点&lt;br /&gt;\r\nULS-100 系统性能&lt;br /&gt;\r\n◆ 量程 0.13m 到 1m&lt;br /&gt;\r\n◆ 50&amp;deg;覆盖， 360&amp;deg; 旋转&lt;br /&gt;\r\n部署&lt;br /&gt;\r\n◆ 潜水员，ROV，管道爬形者，框架方式部署&lt;br /&gt;\r\n◆ 可在空间狭小位置操作水下扫描仪&lt;/p&gt;', '19542', '4', '0', '1', '1', '0', '1', '233', '2017-11-17 10:40:50', '233', '2017-11-17 10:57:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('161', '152', 'CS Fu Hai 福海号', '199', '19551', '21848', '福海是针对海缆施工市场不断提高的定位和埋设要求而专门设计的一艘海缆船。除其卓越的定位能力外，福海一次海缆装载量可达5700吨，最大系柱拖力达110吨，并全面支持目前世界上最先进的埋设犁的操作。福海系中英海底系统有限公司的船舶，于2000年11月建造完成，以上海为基地。自投入使用以来，福海先后为亚太2号光缆、中美光缆路由改道、C2C海底光缆网络和亚欧4号光缆等多个光缆系统提供了铺设和埋设服务。福海可进行电力电缆施工。同时还可以为海上油气田建设提供多项支持服务。', '福海是针对海缆施工市场不断提高的定位和埋设要求而专门设计的一艘海缆船。除其卓越的定位能力外，福海一次海缆装载量可达5700吨，最大系柱拖力达110吨，并全面支持目前世界上最先进的埋设犁的操作。福海系中英海底系统有限公司的船舶，于2000年11月建造完成，以上海为基地。自投入使用以来，福海先后为亚太2号光缆、中美光缆路由改道、C2C海底光缆网络和亚欧4号光缆等多个光缆系统提供了铺设和埋设服务。福海可进行电力电缆施工。同时还可以为海上油气田建设提供多项支持服务。', '&lt;p&gt;福海是针对海缆施工市场不断提高的定位和埋设要求而专门设计的一艘海缆船。除其卓越的定位能力外，福海一次海缆装载量可达5700吨，最大系柱拖力达110吨，并全面支持目前世界上最先进的埋设犁的操作。福海系中英海底系统有限公司的船舶，于2000年11月建造完成，以上海为基地。自投入使用以来，福海先后为亚太2号光缆、中美光缆路由改道、C2C海底光缆网络和亚欧4号光缆等多个光缆系统提供了铺设和埋设服务。福海可进行电力电缆施工。同时还可以为海上油气田建设提供多项支持服务。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117104037_938.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117104103_828.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;/p&gt;', null, '21', '1', '1', '1', '0', '1', '256', '2017-11-17 10:41:12', '256', '2017-11-21 16:12:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('162', '150', 'ULS－200水下激光扫描仪', '154', '19558', '19579', '扫描量程 最小: 0.36m (1.2&rsquo;) | 最大: 2.5m (8.2&rsquo;)', 'ULS-200：中量程高精度水下激光三维扫描仪；', '&lt;p&gt;节省操作时间&lt;br /&gt;\r\n◆ 实时 3D 模型和确认测量结果&lt;br /&gt;\r\n◆ 不需要现场校准&lt;br /&gt;\r\n精细化结果&lt;br /&gt;\r\n◆ 生成真实水下物体 3D 模型&lt;br /&gt;\r\n◆ 采集高密度点云数据，测量到细小特征和损坏点&lt;br /&gt;\r\nULS-2 20 00 &amp;nbsp;系统性能&lt;br /&gt;\r\n◆ 量程 0.36m 到 2.5m&lt;br /&gt;\r\n◆ 50&amp;deg;覆盖， 360&amp;deg; 旋转&lt;br /&gt;\r\n部署&lt;br /&gt;\r\n◆ 潜水员，ROV，管道爬形者，框架方式部署&lt;br /&gt;\r\n◆ 可在有限空间操作水下扫描仪&lt;/p&gt;', '19568', '4', '0', '1', '1', '0', '1', '233', '2017-11-17 10:51:19', '233', '2017-11-17 10:59:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('163', '152', 'Bold Maverick 宝马号', '201', '19566', '21850', 'Bold Maverick 是由德国 Volkswerft Stralsund 船厂于2001年建造的一条多功能的海上施工船。该船配备有先进的 Konsberg 二级动力定位系统(DP2)，因此具有卓越的海上定位能力及出色的可操作性。船上巨大的甲板空间及储存能力使她能够进行多样化的海上施工作业。目前由中英海底系统有限公司管理团队全面实施管理的Bold Maverick 船曾进行过大量的潜水支持作业，并为海上油气田建设进行过大量的SURF管（脐带缆、软管和立管）安装工作 。', 'Bold Maverick 是由德国 Volkswerft Stralsund 船厂于2001年建造的一条多功能的海上施工船。该船配备有先进的 Konsberg 二级动力定位系统(DP2)，因此具有卓越的海上定位能力及出色的可操作性。船上巨大的甲板空间及储存能力使她能够进行多样化的海上施工作业。目前由中英海底系统有限公司管理团队全面实施管理的Bold Maverick 船曾进行过大量的潜水支持作业，并为海上油气田建设进行过大量的SURF管（脐带缆、软管和立管）安装工作 。', '&lt;p&gt;Bold Maverick 是由德国 Volkswerft Stralsund 船厂于2001年建造的一条多功能的海上施工船。该船配备有先进的 Konsberg 二级动力定位系统(DP2)，因此具有卓越的海上定位能力及出色的可操作性。船上巨大的甲板空间及储存能力使她能够进行多样化的海上施工作业。目前由中英海底系统有限公司管理团队全面实施管理的Bold Maverick 船曾进行过大量的潜水支持作业，并为海上油气田建设进行过大量的SURF管（脐带缆、软管和立管）安装工作 。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117105134_565.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117105145_10.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;/p&gt;', null, '22', '1', '1', '1', '0', '1', '256', '2017-11-17 10:52:45', '256', '2017-11-21 16:12:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('164', '150', 'ULS-500 动态水下激光三维扫描仪', '154', '19570', '19580', '扫描量程 最小: 1.5m (4.92&rsquo;) | 最大: 20m (65.6&rsquo;)', 'ULS-500：动态水下激光三维扫描仪', '&lt;p&gt;动态扫描方案&lt;br /&gt;\r\n◆ 实时 3D 点云数据，快速检测长基线的测量&lt;br /&gt;\r\n◆ 部署简单，高精度、高效的测量&lt;br /&gt;\r\n高分辨率的 结果&lt;br /&gt;\r\n◆生成真实水下物体 3D 模型&lt;br /&gt;\r\n◆ 采集高密度点云数据，测量到细小特征和损坏点&lt;br /&gt;\r\n部署灵活&lt;br /&gt;\r\n◆ 设计可用于 AUV，ROV，集成系统，水面载体或潜水员&lt;br /&gt;\r\n◆ 扫描最大量程 20m，耐压 4000m&lt;br /&gt;\r\n高可靠性&lt;br /&gt;\r\n◆ 自 2013 年，由世界领先的海洋调查公司扫描超过 10 000km 的管线，海底，水下结构物等。&lt;br /&gt;\r\n◆ 动态激光扫描的测量精度始终超越其它的测量方案&lt;/p&gt;', '19574', '4', '0', '1', '1', '0', '1', '233', '2017-11-17 10:55:29', '233', '2017-11-17 11:00:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('165', '152', 'CS Fu An 福安号', '203', '19573', '21852', '福安号是一艘改装的海缆施工及多功能海上工程船。该船舶设计为一艘高标准，有能力从事各种海上工程的船舶。福安号系中英海底系统有限公司的船舶，以上海为基地。自改装成海缆施工船后，福安号进行过很多电缆安装及修理工作。她可以从事多种海上施工作业，包括水下机器人支持，电缆安装，维护和海 上工程建设项目。', '福安号是一艘改装的海缆施工及多功能海上工程船。该船舶设计为一艘高标准，有能力从事各种海上工程的船舶。福安号系中英海底系统有限公司的船舶，以上海为基地。自改装成海缆施工船后，福安号进行过很多电缆安装及修理工作。她可以从事多种海上施工作业，包括水下机器人支持，电缆安装，维护和海 上工程建设项目。', '&lt;p&gt;福安号是一艘改装的海缆施工及多功能海上工程船。该船舶设计为一艘高标准，有能力从事各种海上工程的船舶。福安号系中英海底系统有限公司的船舶，以上海为基地。自改装成海缆施工船后，福安号进行过很多电缆安装及修理工作。她可以从事多种海上施工作业，包括水下机器人支持，电缆安装，维护和海 上工程建设项目。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117110129_159.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117110144_452.jpg&quot; style=&quot;height:513px; width:913px&quot; /&gt;&lt;/p&gt;', null, '20', '0', '1', '1', '0', '1', '256', '2017-11-17 11:01:48', '256', '2017-11-21 16:10:34');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('166', '152', 'Sea Lion 水下机器人海狮', '204', '19584', '21841', '主要特点：- 智能动力分配系统为埋设系统提供更强劲动力- 卓越的埋设能力配合出色的可操作性- 先进的水动力设计配合大功率推进器能够克服3节水流- 最新设计的大流量2米、3米冲埋工具- 可调节间距冲埋刀适用于不同直径的海缆、中继器和管线等的埋设- 带有传感装置的海缆下压装置可以更精准地控制海缆埋设- 集成有电缆打捞装置', '水下机器人&ldquo;海狮&rdquo;是为海底电缆作业而专门建造的先进的水下设备，能够进行海缆修理、海缆检测及安装后冲埋服务，最大作业水深达 2500 米。该设备能够以轻装或履带两种方式运作，提高了操作的灵活性和可靠性。', '&lt;p&gt;水下机器人&amp;ldquo;海狮&amp;rdquo;是为海底电缆作业而专门建造的先进的水下设备，能够进行海缆修理、海缆检测及安装后冲埋服务，最大作业水深达 2500 米。该设备能够以轻装或履带两种方式运作，提高了操作的灵活性和可靠性。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117110715_303.jpg&quot; style=&quot;height:533px; width:911px&quot; /&gt;&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '256', '2017-11-17 11:07:22', '256', '2017-11-21 15:45:02');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('167', '152', 'PREDATOR 水下机器人捕猎者', '205', '19588', '19678', '结合多年海洋工程实践经验，捕食者检测级ROV（水下机器人）是为油气田、军事、渔业、近岸调查、科研调查、电信和能源等领域项目专门设计的。小巧轻便，易于安装，容易操作，维护方便。捕猎者水下机器人业已推向市场，中英海底系统公司为国内客户提供技术支持和备件服务。捕猎者是工作在300米水深以浅区域的检测级水下机器人，开发它的目的是为了满足市场对坚固、可靠的水下可视系统的需求。该水下机器人采用了最先进可靠的技术进行设计，确保在海洋工程中的最大的工作效率。开发该水下机器人系统可靠性为首要条件，配以完善的操控网络和复杂的诊断系统，该功能设计确保在所有工作状态下设备能持续工作。', '结合多年海洋工程实践经验，捕食者检测级ROV（水下机器人）是为油气田、军事、渔业、近岸调查、科研调查、电信和能源等领域项目专门设计的。小巧轻便，易于安装，容易操作，维护方便。捕猎者水下机器人业已推向市场，中英海底系统公司为国内客户提供技术支持和备件服务。捕猎者是工作在300米水深以浅区域的检测级水下机器人，开发它的目的是为了满足市场对坚固、可靠的水下可视系统的需求。该水下机器人采用了最先进可靠的技术进行设计，确保在海洋工程中的最大的工作效率。开发该水下机器人系统可靠性为首要条件，配以完善的操控网络和复杂的诊断系统，该功能设计确保在所有工作状态下设备能持续工作。', '&lt;p&gt;结合多年海洋工程实践经验，捕食者检测级ROV（水下机器人）是为油气田、军事、渔业、近岸调查、科研调查、电信和能源等领域项目专门设计的。小巧轻便，易于安装，容易操作，维护方便。捕猎者水下机器人业已推向市场，中英海底系统公司为国内客户提供技术支持和备件服务。捕猎者是工作在300米水深以浅区域的检测级水下机器人，开发它的目的是为了满足市场对坚固、可靠的水下可视系统的需求。该水下机器人采用了最先进可靠的技术进行设计，确保在海洋工程中的最大的工作效率。开发该水下机器人系统可靠性为首要条件，配以完善的操控网络和复杂的诊断系统，该功能设计确保在所有工作状态下设备能持续工作。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117111045_354.jpg&quot; style=&quot;height:575px; width:864px&quot; /&gt;&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '256', '2017-11-17 11:10:49', '256', '2017-11-17 13:21:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('168', '152', 'ROV SEALION III水下机器人海狮III', '206', '19607', '21853', '主要特点：- 智能动力分配系统为埋设系统提供更强劲动力- 卓越的埋设能力配合出色的可操作性- 先进的水动力设计配合大功率推进器能够克服3节水流- 最新设计的大流量2米、3米冲埋工具- 可调节间距冲埋刀适用于不同直径的海缆、中继器和管线等的埋设- 带有传感装置的海缆下压装置可以更精准地控制海缆埋设- 集成有电缆打捞装置', '水下机器人 &ldquo;海狮III&rdquo;代表最先进的水下机器人技术，在大功率和灵活的可操作性能间达到最佳平衡点。这一强大设备能够运用于极具挑战的海缆管线修理、安装后检测以及最深达3米的海缆管线冲埋作业，最大工作水深达2500米。这一600匹马力的新一代水下机器人具有先进的智能i-Power系统 &ndash; 一个先进的水下动力分配系统，其产生的强大水流显著提高了水下机器人埋设能力。水下机器人&ldquo;海狮III&rdquo;卓越的水下施工能力能够充分满足海底通讯、海上油气田和海上能源行业不断提高的施工要求。', '&lt;p&gt;水下机器人 &amp;ldquo;海狮III&amp;rdquo;代表最先进的水下机器人技术，在大功率和灵活的可操作性能间达到最佳平衡点。这一强大设备能够运用于极具挑战的海缆管线修理、安装后检测以及最深达3米的海缆管线冲埋作业，最大工作水深达2500米。这一600匹马力的新一代水下机器人具有先进的智能i-Power系统 &amp;ndash; 一个先进的水下动力分配系统，其产生的强大水流显著提高了水下机器人埋设能力。水下机器人&amp;ldquo;海狮III&amp;rdquo;卓越的水下施工能力能够充分满足海底通讯、海上油气田和海上能源行业不断提高的施工要求。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117111703_915.jpg&quot; style=&quot;height:727px; width:970px&quot; /&gt;&lt;/p&gt;', null, '19', '1', '1', '1', '0', '1', '256', '2017-11-17 11:17:43', '256', '2017-11-21 16:12:36');
