INSERT INTO `byp_exhibition_booth_product_info` VALUES ('170', '152', 'Wujing Depot 吴泾码头', '207', '19611', '19625', '吴泾码头设有保税仓库，专门适用于海底光缆、中继器、分路单元和其他海底设施的储备，服务面向光缆系统供应商和系统拥有者。吴泾码头于2000年和2001年分别进行了扩建，使其海蓝存储容量提高到了目前的3,841立方米。吴泾码头已向国际海缆维护组织之一的横滨电缆维护区的部分成员提供储存服务。同时，码头也协助储存一些中国国内的电缆系统备件，例如烟台-大连、北海-临高和长江过江光缆等系统。', '吴泾码头设有保税仓库，专门适用于海底光缆、中继器、分路单元和其他海底设施的储备，服务面向光缆系统供应商和系统拥有者。吴泾码头于2000年和2001年分别进行了扩建，使其海蓝存储容量提高到了目前的3,841立方米。吴泾码头已向国际海缆维护组织之一的横滨电缆维护区的部分成员提供储存服务。同时，码头也协助储存一些中国国内的电缆系统备件，例如烟台-大连、北海-临高和长江过江光缆等系统。', '&lt;p&gt;吴泾码头设有保税仓库，专门适用于海底光缆、中继器、分路单元和其他海底设施的储备，服务面向光缆系统供应商和系统拥有者。吴泾码头于2000年和2001年分别进行了扩建，使其海蓝存储容量提高到了目前的3,841立方米。吴泾码头已向国际海缆维护组织之一的横滨电缆维护区的部分成员提供储存服务。同时，码头也协助储存一些中国国内的电缆系统备件，例如烟台-大连、北海-临高和长江过江光缆等系统。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117112148_808.jpg&quot; style=&quot;height:466px; width:864px&quot; /&gt;&lt;/p&gt;', null, '7', '0', '1', '1', '0', '1', '256', '2017-11-17 12:30:33', '256', '2017-11-17 12:30:33');
