INSERT INTO `byp_exhibition_booth_product_info` VALUES ('174', '152', 'Hi-Plough 埋设犁', '209', '19635', '19641', '埋设犁 Hi 是先进的水下海缆作业设备， 它可以在铺设海缆的同时将海缆最大深埋至 海床下 3 米。埋设犁 Hi 拥有两套配置方案， 分别是配置 2.2 米切割刀和3.25 米冲埋刀。 每套方案均可配备强大的高压水下泵，能够将多种海缆，包括通讯光缆，动力电缆，信号缆在各种海床条件下得到精确深埋。', '埋设犁 Hi 是先进的水下海缆作业设备， 它可以在铺设海缆的同时将海缆最大深埋至 海床下 3 米。埋设犁 Hi 拥有两套配置方案， 分别是配置 2.2 米切割刀和3.25 米冲埋刀。 每套方案均可配备强大的高压水下泵，能够将多种海缆，包括通讯光缆，动力电缆，信号缆在各种海床条件下得到精确深埋。', '&lt;p&gt;埋设犁 Hi 是先进的水下海缆作业设备， 它可以在铺设海缆的同时将海缆最大深埋至 海床下 3 米。埋设犁 Hi 拥有两套配置方案， 分别是配置 2.2 米切割刀和3.25 米冲埋刀。 每套方案均可配备强大的高压水下泵，能够将多种海缆，包括通讯光缆，动力电缆，信号缆在各种海床条件下得到精确深埋。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117130040_190.png&quot; style=&quot;height:635px; width:840px&quot; /&gt;&lt;/p&gt;', null, '9', '0', '1', '1', '0', '1', '256', '2017-11-17 13:00:44', '256', '2017-11-17 13:00:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('175', '152', '电缆接续学校', '211', '19645', '19649', '公司于 2004 年 3 月 8 日在上海吴泾码 头成立了电缆工程师及接续培训学校。该校由中英海底系统有限公司与英国全球海事公司共同投资设立。目前，培训学校能够提供多种海底光缆接续培训，如通用电缆接续 （UJ）、通用快速电缆接续（UQJ）和通用中 继器 - 电缆接续（UC）等培训课程。这些课 程将与英国 Boreham 的培训学校课程完全同 步。全球海事公司负责为该培训学校提供培\r\n训教师资源，以保证培训达到国际认证的要求。该培训学校也可以日租的方式为外单位提供培训及设施租赁服务。', '公司于 2004 年 3 月 8 日在上海吴泾码 头成立了电缆工程师及接续培训学校。该校由中英海底系统有限公司与英国全球海事公司共同投资设立。目前，培训学校能够提供多种海底光缆接续培训，如通用电缆接续 （UJ）、通用快速电缆接续（UQJ）和通用中 继器 - 电缆接续（UC）等培训课程。这些课 程将与英国 Boreham 的培训学校课程完全同 步。全球海事公司负责为该培训学校提供培\r\n训教师资源，以保证培训达到国际认证的要求。该培训学校也可以日租的方式为外单位提供培训及设施租赁服务。', '&lt;p&gt;公司于 2004 年 3 月 8 日在上海吴泾码 头成立了电缆工程师及接续培训学校。该校由中英海底系统有限公司与英国全球海事公司共同投资设立。目前，培训学校能够提供多种海底光缆接续培训，如通用电缆接续 （UJ）、通用快速电缆接续（UQJ）和通用中 继器 - 电缆接续（UC）等培训课程。这些课 程将与英国 Boreham 的培训学校课程完全同 步。全球海事公司负责为该培训学校提供培&lt;br /&gt;\r\n训教师资源，以保证培训达到国际认证的要求。该培训学校也可以日租的方式为外单位提供培训及设施租赁服务。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117130653_937.png&quot; style=&quot;height:734px; width:656px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117130703_382.png&quot; style=&quot;height:734px; width:652px&quot; /&gt;&lt;/p&gt;', null, '10', '0', '1', '1', '0', '1', '256', '2017-11-17 13:07:09', '256', '2017-11-17 13:07:09');
