INSERT INTO `byp_exhibition_booth_product_info` VALUES ('177', '152', 'JianLong ROV school', '212', '19662', '19667', '凭借在海洋工程领域丰富的工程作业经验及强大的科研教学能力，上海剑龙水下机器人科技有限公司能够提供以下服务。 &middot;ROV 操作手培训 &middot;ROV操作手注册及技术支持。 &middot;ROV技术研发及科技转换服务 &middot;ROV设备销售及维护服务 &middot;ROV配件物流及进出口服务 &middot;为ROV工程项目提供解决方案 &middot;ROV及ROV工具租赁 &middot;ROV技术咨询及服务', '公司是国际海事承包商协会及中国潜水 打捞协会的成员，具有 ROV 培训资格。基于 IMCA标准，我们的专业ROV操作手 / 技术员 课程能够满足所有行业标准的要求，其中包括 ROV专业知识，实践经验，模拟培训以及ROV 训练池实操训练。', '&lt;p&gt;公司是国际海事承包商协会及中国潜水 打捞协会的成员，具有 ROV 培训资格。基于 IMCA标准，我们的专业ROV操作手 / 技术员 课程能够满足所有行业标准的要求，其中包括 ROV专业知识，实践经验，模拟培训以及ROV 训练池实操训练。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117131431_149.png&quot; style=&quot;height:637px; width:840px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117131445_755.png&quot; style=&quot;height:444px; width:840px&quot; /&gt;&lt;/p&gt;', null, '11', '0', '1', '1', '0', '1', '256', '2017-11-17 13:14:52', '256', '2017-11-17 13:14:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('178', '150', 'AWAC 浪龙声学多普勒波浪剖面流速仪', '155', '19644', '19680', '剖面范围：30m（1MHz），50m（600KHz）(视现场情况而定)', 'AWAC 是一款应用革命性的技术设计的仪器，能够同时测量剖面流速和波浪。用\r\n户能够使用它以层宽一米的设置测量水底至水面的剖面流速和流向，并同时测量长周期波浪、飓风波浪、短周期波浪以及行使的船舶产生的瞬态波。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;AWAC 是一款应用革命性的技术设计的仪器，能够同时测量剖面流速和波浪。用户能够使用它以层宽一米的设置测量水底至水面的剖面流速和流向，并同时测量长周期波浪、飓风波浪、短周期波浪以及行使的船舶产生的瞬态波。 浪龙被设置为一款沿岸检测系统。小巧，坚固，适合在恶劣条件下长期投放使用。外壳为工程塑料和钛合金材料，避免腐蚀。浪龙的系统频率有两种（1MHz 和 600KHz），以适应不同工作水深的应用环境。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;浪龙通常投放于水底，在水底，他可以有效地避免水表的恶劣天气的影响，人为破坏，和水面船只的影响。水底投放方式支持自容和实时两种工作模式：自容式工作模式是由浪龙自身的存储器存储原始数据，由外置电池供电。可选择不同的外置电池类型，当设置为每小时采集一次波浪数据时，使用碱性电池包可达 4 个月的连续投放期，使用锂电池可达 8 个月的连续投放期。实施工作模式可使用多种通讯方式。***常用的是长的水密电缆（5Km）和声学调制解调器。实时系统可选配备用电池仓，保护缆和水面接口单元，实时通讯软件。可查阅&amp;ldquo;实时系统案例&amp;rdquo;。&lt;/p&gt;', '19643', '5', '0', '1', '1', '0', '1', '233', '2017-11-17 13:16:56', '233', '2017-11-17 13:24:28');
