INSERT INTO `byp_exhibition_booth_product_info` VALUES ('180', '150', 'AXYS－波浪传感器（加速度）', '155', '19681', '19692', '物理参数：\r\n尺寸：15cm x 15cm x 9cm\r\n重量：1.5kg\r\n外壳材料：玻璃纤维，石墨填料，无卤，紫外线稳定', 'TRIAXYS NextWave II 波浪传感器主要用于提供可靠、精确的波浪参数和方向波谱数据。', '&lt;p&gt;特点及优势：&lt;br /&gt;\r\n◆ 针对低功耗应用而设计的；&lt;br /&gt;\r\n◆ 体积小，无任何移动部件；&lt;br /&gt;\r\n◆ 连续波浪数据输出；&lt;br /&gt;\r\n◆ 根据项目要求，可配置输出数据的内容；&lt;br /&gt;\r\n◆ 内存卡支持&amp;gt;5 年的数据存储；&lt;br /&gt;\r\n◆ 可选择铱卫星遥测数据，或实时串口输出数据。&lt;/p&gt;', '19691', '5', '0', '1', '1', '0', '1', '233', '2017-11-17 13:36:38', '233', '2017-11-17 13:36:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('181', '130', '气动葫芦', '213', '19693', '19709', '以0.5-0.6Mpa普通压缩空气为动力源，体积小、重量轻', '以0.5-0.6Mpa普通压缩空气为动力源，体积小、重量轻（为相同吨位电动葫芦的1/3&mdash;1/8）、\r\n防爆（等级为Ⅰ区危险场所，含Ⅱ区，Ｔ５组及以下）、耐酸碱蒸汽、抗高粉尘、可调速、高效的\r\n气动起重设备。广泛用于医药制造、化工纤维、机械修理、海洋钻井、高端国防等领域', '&lt;p&gt;以0.5-0.6Mpa普通压缩空气为动力源，体积小、重量轻（为相同吨位电动葫芦的1/3&amp;mdash;1/8）、&lt;br /&gt;\r\n防爆（等级为Ⅰ区危险场所，含Ⅱ区，Ｔ５组及以下）、耐酸碱蒸汽、抗高粉尘、可调速、高效的&lt;br /&gt;\r\n气动起重设备。广泛用于医药制造、化工纤维、机械修理、海洋钻井、高端国防等领域&lt;/p&gt;', '19708', '8', '0', '1', '1', '0', '1', '234', '2017-11-17 13:43:57', '234', '2017-11-17 13:43:57');
