INSERT INTO `byp_exhibition_booth_product_info` VALUES ('183', '150', 'MIROS SM-140 雷达波浪、水位潮位传感器', '155', '19706', '19723', '量程： SM-140/w/01/20: 1-23m\r\nSM-140/w/01/45: 3-47m\r\nSM-140/w/01/90: 3-95m\r\n尺寸：122 x 340 mm(高 x 直径)\r\n重量： 11kg', 'SM140 传感器发射 FM Chirp 微波(线性调频 Chirp)信号，并同时接收由水体表面反射的回波。信号在水体表面到传感器表面的距离传播时会产生差频信号的返回，通过对该差频信号的高级信号处理可以计算出精确的距离数值。', '&lt;p&gt;该雷达波浪、水位潮位 传感器主要设计用于 以下测量 ：&lt;br /&gt;\r\n◆ 气隙（水表面与桥之间的距离）和吃水；&lt;br /&gt;\r\n◆ 海洋波浪、潮位的变化；&lt;br /&gt;\r\n◆ 水坝、河流、湖泊等水域的水位；&lt;br /&gt;\r\n◆ 桥梁与水面间的空隙。&lt;br /&gt;\r\nSM140 传感器发射 FM Chirp 微波(线性调频 Chirp)信号，并同时接收由水体表面反射的回波。&lt;br /&gt;\r\n信号在水体表面到传感器表面的距离传播时会产生差频信号的返回，通过对该差频信号的高级信号处理可以计算出精确的距离数值。&lt;br /&gt;\r\n该传感器的体积小，重量轻。&lt;br /&gt;\r\nFM Chirp 信号是由数值化综合频率扫描振动产生的，具有绝对的频率线性和高稳定性，所以该传感器可以提供精确的距离测量和长期性的稳定。&lt;br /&gt;\r\n由于采用低频（对比激光）方式的工作，雾、雨和水溅均不对测量产生影响。&lt;br /&gt;\r\n传感器的信号处理由微机控制，可提供平均方式的测量，分辨率 1mm，用户可以选择平均测量数据的时间参数。&lt;br /&gt;\r\n信号的输出可以是连续的，或者用户设定的频率，或者是每次用户请求时。&lt;br /&gt;\r\nSM-140 传感器有多种量程、多种天线波束宽度的型号选择。&lt;/p&gt;', '19722', '5', '0', '1', '1', '0', '1', '233', '2017-11-17 13:47:35', '233', '2017-11-17 13:47:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('184', '130', '气动绞车', '215', '19717', '19725', 'QDJC-\r\n0.2&times;100\r\nQDJC-\r\n0.5&times;30\r\nQDJC-\r\n0.5A&times;48\r\nQDJC-\r\n1.0&times;48\r\nQDJC-\r\n1.0A&times;24\r\nQDJC-\r\n2.0&times;24\r\n牵引力(ton) 0.2 0.5 0.5 1.0 1.0 2.0\r\n绳速(M/min） 100 30 45 48 48 24', 'QDJC型气动绞车是以气动马达为动力，通过齿轮减速机构驱动卷筒，实现重物牵引、运输或托\r\n运的绞车装置。它具有结构紧凑、操作方便、工作安全可靠、维修简单、运转平稳、无级变速等优\r\n点。作为防爆牵引、运输或托运装置，特别适用于油田、地质钻井、矿山开采及易爆、易燃气体等\r\n场所。适用于海拔1000米以下,气温-40~60℃的环境', '&lt;p&gt;QDJC型气动绞车是以气动马达为动力，通过齿轮减速机构驱动卷筒，实现重物牵引、运输或托&lt;br /&gt;\r\n运的绞车装置。它具有结构紧凑、操作方便、工作安全可靠、维修简单、运转平稳、无级变速等优&lt;br /&gt;\r\n点。作为防爆牵引、运输或托运装置，特别适用于油田、地质钻井、矿山开采及易爆、易燃气体等&lt;br /&gt;\r\n场所。适用于海拔1000米以下,气温-40~60℃的环境&lt;/p&gt;', '19724', '6', '0', '1', '1', '0', '1', '234', '2017-11-17 13:49:26', '234', '2017-11-17 13:49:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('185', '149', '尼龙', '167', '19735', '19741', '3D打印服务/材料分类/尼龙', '3D打印服务/材料分类/尼龙', '&lt;p&gt;3D打印服务/材料分类/尼龙&lt;/p&gt;', null, '96', '0', '1', '1', '0', '1', '227', '2017-11-17 13:52:54', '227', '2017-11-17 13:53:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('186', '150', 'Valeport DWR压力式波浪仪', '155', '19731', '19744', '内部：  32 个 C 型、1.5V 碱性或 3.6V 锂电池\r\n外部：  9 - 30vDC\r\n功率：  1.7W（采样），&lt;1mW（睡眠）\r\n电池寿命：  取决于采样设置，通常是：\r\n&gt;1 个月的操作（碱性电池）\r\n&gt;2 个月的操作（锂电池）\r\n连接器： Subconn 钛合金 MCBH10F', 'MIDAS DWR 定向波形记录仪采用成熟的线性波浪理论的波浪分析方法来测量浅水部署（最深20米）。MIDAS DWRR &nbsp;采用了 Valeport 的最新传感器技术、64位数据处理和改良的采样选择范围。数据上传迅速、更换电池传送带快捷及操作软件直观让 MIDAS WTR成为最通用且易于使用的压力式波形记录仪之一。', '&lt;p&gt;MIDAS DWR 定向波形记录仪采用成熟的线性波浪理论的波浪分析方法来测量浅水部署（最深20米）。MIDAS DWRR &amp;nbsp;采用了 Valeport 的最新传感器技术、64位数据处理和改良的采样选择范围。数据上传迅速、更换电池传送带快捷及操作软件直观让 MIDAS WTR成为最通用且易于使用的压力式波形记录仪之一。&lt;/p&gt;\r\n\r\n&lt;p&gt;The M IDAS DWR 的标准配备有应变仪或高精度压阻式压力传感器和快速响应PRT 温度传感器。需要注意的是，虽然压阻传感器的绝对精度极高，但波形数据的质量更多取决于部署位置和采样模式，而非传感器的性能。选配的额外传感器包括电导率和浊度传感器。&lt;/p&gt;', '19743', '5', '0', '1', '1', '0', '1', '233', '2017-11-17 13:54:05', '233', '2017-11-17 13:54:05');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('187', '150', 'DeepVision 侧扫声呐', '156', '19748', '19754', 'DeepVision 侧扫声纳性能特点：\r\n优异的图像质量；\r\n易于使用；\r\n紧凑设计；\r\n低成本、高性能。', 'Deepvision 是高性能、低成本侧扫声纳，用于水下综合科考、沉船探测、水下溺水人员搜救、海底地形地貌研究、湖泊海洋测绘等。Deepvision 侧扫声纳可固定在船体（Hull Mount），也可以用作水下拖鱼（Towfish），水下拖鱼最深可用于水下 100m。系统可生成高质量水底图像，适用于各种海底应用和研究。', '&lt;p&gt;Deepvision 是高性能、低成本侧扫声纳，用于水下综合科考、沉船探测、水下溺水人员搜救、海底地形地貌研究、湖泊海洋测绘等。Deepvision 侧扫声纳可固定在船体（Hull Mount），也可以用作水下拖鱼（Towfish），水下拖鱼最深可用于水下 100m。系统可生成高质量水底图像，适用于各种海底应用和研究。&lt;/p&gt;', '19750', '6', '1', '1', '1', '0', '1', '233', '2017-11-17 14:06:51', '233', '2017-11-17 14:32:05');
