INSERT INTO `byp_exhibition_booth_product_info` VALUES ('189', '162', '均相离子交换膜', '222', '19775', '19806', '主要品种有扩散渗析阴（阳）膜、电渗析膜和双极膜，在化工、电子工业、食品工业、医药、环境保护等领域有广泛的应用。', '主要品种有扩散渗析阴（阳）膜、电渗析膜和双极膜，在化工、电子工业、食品工业、医药、环境保护等领域有广泛的应用。', '&lt;p&gt;主要品种有扩散渗析阴（阳）膜、电渗析膜和双极膜，在化工、电子工业、食品工业、医药、环境保护等领域有广泛的应用。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '281', '2017-11-17 14:15:31', '281', '2017-11-17 14:23:48');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('190', '162', '均相膜电渗析器', '223', '19786', '19805', '用于各种化工/食品/医药生产过程中的物料脱盐、苦咸水淡化、海水淡化、天然水纯化、工业废水净化、工业中水回用、海水或卤水制盐等。', '用于各种化工/食品/医药生产过程中的物料脱盐、苦咸水淡化、海水淡化、天然水纯化、工业废水净化、工业中水回用、海水或卤水制盐等。', '&lt;p&gt;用于各种化工/食品/医药生产过程中的物料脱盐、苦咸水淡化、海水淡化、天然水纯化、工业废水净化、工业中水回用、海水或卤水制盐等。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '281', '2017-11-17 14:17:07', '281', '2017-11-17 14:23:30');
