INSERT INTO `byp_exhibition_booth_product_info` VALUES ('192', '162', '双极膜电渗析器', '226', '19790', '19804', '用于有机酸的生产、有机碱的生产、酸性气体的脱除、含盐废水的资源化利用、零排放工程及食品和化工中的清洁生产和分离等。', '用于有机酸的生产、有机碱的生产、酸性气体的脱除、含盐废水的资源化利用、零排放工程及食品和化工中的清洁生产和分离等。', '&lt;p&gt;用于有机酸的生产、有机碱的生产、酸性气体的脱除、含盐废水的资源化利用、零排放工程及食品和化工中的清洁生产和分离等。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '281', '2017-11-17 14:17:56', '281', '2017-11-17 14:23:15');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('193', '162', '酸回收扩散渗析器', '224', '19793', '19803', '用于钢铁、化成箔、蓄电池、湿法冶金、多晶硅、电镀、石墨、稀土及其他有色金属冶炼等工业领域的废酸回收。', '用于钢铁、化成箔、蓄电池、湿法冶金、多晶硅、电镀、石墨、稀土及其他有色金属冶炼等工业领域的废酸回收。', '&lt;p&gt;用于钢铁、化成箔、蓄电池、湿法冶金、多晶硅、电镀、石墨、稀土及其他有色金属冶炼等工业领域的废酸回收。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '281', '2017-11-17 14:19:01', '281', '2017-11-17 14:23:00');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('194', '162', '碱回收扩散渗析器', '225', '19797', '19802', '用于碱与金属盐混合液的分离、提纯，可应用于有色金属冶炼、有机化工、印染等行业的废碱回收。', '用于碱与金属盐混合液的分离、提纯，可应用于有色金属冶炼、有机化工、印染等行业的废碱回收。', '&lt;p&gt;用于碱与金属盐混合液的分离、提纯，可应用于有色金属冶炼、有机化工、印染等行业的废碱回收。&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '281', '2017-11-17 14:20:46', '281', '2017-11-17 14:22:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('195', '150', 'SonarMite V5 便携式回声测深仪', '157', '19796', '19812', '整合了 Windows 操作系统的蓝牙技术\r\nProven &#39;Smart&#39; transducer design with QA output\r\n内置电池保证长时间的野外工作，适应野外环境的坚固设计以及 50 米范围蓝牙连接的独到设计兼容其他操作软件（天宝、莱卡手薄）与 GPS 定位系统', 'SonarMite 便携式回声测深仪是英国 OHMEX 公司经过了两年多潜心开发研制生产的水文测量系统，是OHMEX 公司在继 1997 年推出世界上首台得到广泛使用的真正的回声测深系统SonarLite 后的延续产品，是全球目前最小最轻的浅水水文测深系统,简单易用,带蓝牙及串口,易于远程监测。SonarMite 产品的发布标志着 WinStrument 概念在产品设计上步入了一个新的阶段。', '&lt;p&gt;SonarMite 便携式回声测深仪是英国 OHMEX 公司经过了两年多潜心开发研制生产的水文测量系统，是OHMEX 公司在继 1997 年推出世界上首台得到广泛使用的真正的回声测深系统SonarLite 后的延续产品，是全球目前最小最轻的浅水水文测深系统,简单易用,带蓝牙及串口,易于远程监测。SonarMite 产品的发布标志着 WinStrument 概念在产品设计上步入了一个新的阶段。&lt;/p&gt;', '19774', '7', '0', '1', '1', '0', '1', '233', '2017-11-17 14:26:23', '233', '2017-11-17 14:28:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('196', '161', 'TSY09滩涂水域收油机', '221', '19818', '19831', 'TSY09滩涂水域收油机为钢质双浮箱、单层连续甲板、浮箱单层底结构，采用柴油机液压动力驱动浮箱履带行走马达，可在水、陆、滩涂行驶并在滩涂、泥沙上、河流和湖泊等水域进行回收溢油及挖掘的专用工具,特别是在滩涂和淤泥中行驶的特殊工具', 'TSY09滩涂水域收油机为钢质双浮箱、单层连续甲板、浮箱单层底结构，采用柴油机液压动力驱动浮箱履带行走马达，可在水、陆、滩涂行驶并在滩涂、泥沙上、河流和湖泊等水域进行回收溢油及挖掘的专用工具,特别是在滩涂和淤泥中行驶的特殊工具', '&lt;p&gt;TSY09滩涂水域收油机为钢质双浮箱、单层连续甲板、浮箱单层底结构，采用柴油机液压动力驱动浮箱履带行走马达，可在水、陆、滩涂行驶并在滩涂、泥沙上、河流和湖泊等水域进行回收溢油及挖掘的专用工具,特别是在滩涂和淤泥中行驶的特殊工具&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '218', '2017-11-17 14:33:46', '218', '2017-11-17 14:33:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('197', '161', 'PP&mdash;2型吸油毡', '227', '19832', '19858', '特点是:a  比重小,能漂浮在水面上；b  人造亲油疏水材料，多孔亲油具有强烈的吸油性能, 只吸收水面和水中的油质，极少吸收水份,吸油毡吸油过程中,能将水排出；c  耐酸,耐碱,耐多种化学品腐蚀, 对人、生物及周边自然环境无危害性，燃烧处理无二次污染；d  对多种油脂类均可使用，且油被吸附后不易脱落，保油性好, 常温下油保持率80% 以上，能反复使用；e  可吸附高、中、低各种粘度的液体溢油，根据溢油性质选取不同吸油毡；f  在常见溢油油品和水中无溶解和形变现象；吸油后振荡12h仍浮于水面并保持原形；g  钩挂自重25倍的重锤3min后不发生撕裂；可反复使用五次以上；', '特点是:a  比重小,能漂浮在水面上；b  人造亲油疏水材料，多孔亲油具有强烈的吸油性能, 只吸收水面和水中的油质，极少吸收水份,吸油毡吸油过程中,能将水排出；c  耐酸,耐碱,耐多种化学品腐蚀, 对人、生物及周边自然环境无危害性，燃烧处理无二次污染；d  对多种油脂类均可使用，且油被吸附后不易脱落，保油性好, 常温下油保持率80% 以上，能反复使用；e  可吸附高、中、低各种粘度的液体溢油，根据溢油性质选取不同吸油毡；f  在常见溢油油品和水中无溶解和形变现象；吸油后振荡12h仍浮于水面并保持原形；g  钩挂自重25倍的重锤3min后不发生撕裂；可反复使用五次以上；', '&lt;p&gt;PP&amp;mdash;2型吸油毡是用聚丙烯人造制成的纤维毡,是一种良好的清油器材。其特点是:&lt;br /&gt;\r\na &amp;nbsp;比重小,能漂浮在水面上；b &amp;nbsp;人造亲油疏水材料，多孔亲油具有强烈的吸油性能, 只吸收水面和水中的油质，极少吸收水份,吸油毡吸油过程中,能将水排出；c &amp;nbsp;耐酸,耐碱,耐多种化学品腐蚀, 对人、生物及周边自然环境无危害性，燃烧处理无二次污染；d &amp;nbsp;对多种油脂类均可使用，且油被吸附后不易脱落，保油性好, 常温下油保持率80% 以上，能反复使用；e &amp;nbsp;可吸附高、中、低各种粘度的液体溢油，根据溢油性质选取不同吸油毡；f &amp;nbsp;在常见溢油油品和水中无溶解和形变现象；吸油后振荡12h仍浮于水面并保持原形；g &amp;nbsp;钩挂自重25倍的重锤3min后不发生撕裂；可反复使用五次以上；&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '218', '2017-11-17 14:36:31', '218', '2017-11-17 14:36:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('198', '149', '透明光敏材料', '170', '19834', '19860', '3D打印服务/材料分类/透明光敏材料', '3D打印服务/材料分类/透明光敏材料', '&lt;p&gt;3D打印服务/材料分类/透明光敏材料&lt;/p&gt;', null, '93', '0', '1', '1', '0', '1', '227', '2017-11-17 14:37:33', '227', '2017-11-17 14:37:33');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('199', '130', '气动单梁起重机 气动单梁悬挂起重机', '216', '19861', '19865', '起重量t 0.1 0.2 0.5 1.0 1.5 2.0 2.5 3.0 5.0 6.0 8.0 10.0\r\n吊钩\r\nm/min\r\n起 6 3 5.4 4.0 3.3 2.0 1.5 1.4 0.75 0.7 0.4 0.4\r\n降 8 4 10 7 6 3.5 3 3 1.5 1.4 1 1', '本起重机的大小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无任何电\r\n源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高可靠\r\n性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。', '&lt;p&gt;本起重机的大小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无任何电&lt;br /&gt;\r\n源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高可靠&lt;br /&gt;\r\n性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食&lt;br /&gt;\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。&lt;/p&gt;', '19859', '5', '0', '1', '1', '0', '1', '234', '2017-11-17 14:38:26', '234', '2017-11-17 14:38:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('200', '161', '收油机', '228', '19866', '19869', '收油机为复合式结构，将动态斜面式、堰式、及负压方式的收油结构紧凑地集成为一体发挥它们各自的特长，并采用了智能化的控制系统，构成了可在较恶劣环境中有效作业的高性能收油装置', '收油机为复合式结构，将动态斜面式、堰式、及负压方式的收油结构紧凑地集成为一体发挥它们各自的特长，并采用了智能化的控制系统，构成了可在较恶劣环境中有效作业的高性能收油装置', '&lt;p&gt;收油机为复合式结构，将动态斜面式、堰式、及负压方式的收油结构紧凑地集成为一体发挥它们各自的特长，并采用了智能化的控制系统，构成了可在较恶劣环境中有效作业的高性能收油装置&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '218', '2017-11-17 14:38:55', '218', '2017-11-17 14:38:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('201', '130', '气动旋臂起重机', '217', '19870', '19877', '额定起重量 Gn\r\nt\r\n0.1，0.2，0.25，0.5，1，2，2.5，3，5，6.，8，10\r\n起升高度 h\r\nm\r\n2～10(可按 0.5m 递增)\r\n有效半径 R\r\nm\r\n2～10(可按 0.5m 递增)\r\n起升速度 v\r\n（m/min）\r\n常速 按起重量 0.35，0.45，0.7，1.4，2.0，3.3，4.0，5.4，6.0，18\r\n运行速度 v\r\n（m/min）\r\n气动 6-8\r\n手动 &mdash;\r\n回转速度\r\nr/min\r\n气动 0.5-2\r\n手动 &mdash;\r\n回转角度 180&deg;，270&deg;，360&deg;', '本起重机的旋臂转动、小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无\r\n任何电源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高\r\n可靠性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。', '&lt;p&gt;本起重机的旋臂转动、小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无&lt;br /&gt;\r\n任何电源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高&lt;br /&gt;\r\n可靠性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食&lt;br /&gt;\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。&lt;/p&gt;', '19868', '4', '0', '1', '1', '0', '1', '234', '2017-11-17 14:40:25', '234', '2017-11-17 14:40:25');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('202', '130', '气动门式起重机', '218', '19880', '19892', '起重量t 0.1 0.2 0.5 1.0 1.5 2.0 2.5 3.0 5.0 6.0 8.0 10.0\r\n吊钩\r\nm/min\r\n起 6 3 5.4 4.0 3.3 2.0 1.5 1.4 0.75 0.7 0.4 0.4\r\n降 8 4 10 7 6 3.5 3 3 1.5 1.4 1 1\r\n小车m/min 8-10 6-8 3-4\r\n起重机m/min 4-6 3-4 2-3', '本起重机的大小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无任何电\r\n源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高可靠\r\n性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。', '&lt;p&gt;本起重机的大小车行走及起吊重物的动力均采用了0.5-0.6Mpa普通压缩空气，整机无任何电&lt;br /&gt;\r\n源，解决了起重机在易燃、易爆、粉尘环境中的难题，在减少安全隐患、降低生产成本、提高可靠&lt;br /&gt;\r\n性方面起到很好的促进作用。广泛用于军工、航天、船舶、轻纺、化工、石油、机械、交通、食&lt;br /&gt;\r\n品、制药等行业，是特殊环境中宇航训练、生产线自动化、物料搬动、装配维修的必备先进设备。&lt;/p&gt;', '19878', '3', '0', '1', '1', '0', '1', '234', '2017-11-17 14:42:14', '234', '2017-11-17 14:42:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('203', '149', '安防行业', '171', '19881', '19893', '3D打印服务/行业分类/安防行业', '3D打印服务/行业分类/安防行业', '&lt;p&gt;3D打印服务/行业分类/安防行业&lt;/p&gt;', null, '92', '0', '1', '1', '0', '1', '227', '2017-11-17 14:42:32', '227', '2017-11-17 14:42:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('204', '161', '阻燃型围油栏改进型', '231', '19886', '19894', '防火围油栏除了与一般围油栏一样，具备拦截水面溢油（各种粘度的原油及成品油）的功能之外，还具有耐火、防火功能，用来围控海面上着火的溢油，控制火势蔓延，以便进一步采取行动。防火围油栏还可用在对溢油进行焚烧处理，减少溢油污染损害程度。围油栏接头采用对钩接头具有互换性，防火围油栏水上部分采用耐热防锈的高合金结构钢，柔性段采用耐热金属丝网、航天工业所用的防火布、防火纤维编织布等多层材料组成。具有优异的耐火性能，可在1000℃长时间工作。围油栏在拦截油火后具有重复使用的功能。', '本产品是我所多年前阻燃型围油栏的改进型产品，它克服了旧产品每次拦火后局部需换修的缺点，而上升为可长期使用的新型产品&mdash;&mdash;防火围油栏，产品不仅经过自己的多次试验，还经受大面积流淌火灾灭火实战演习的考验（见封面照片）。随着高新技术材料的不断出现，本产品的部分材料又被更新的高性能的新产品取代，性能更佳。', '&lt;p&gt;本产品是我所多年前阻燃型围油栏的改进型产品，它克服了旧产品每次拦火后局部需换修的缺点，而上升为可长期使用的新型产品&amp;mdash;&amp;mdash;防火围油栏，产品不仅经过自己的多次试验，还经受大面积流淌火灾灭火实战演习的考验（见封面照片）。随着高新技术材料的不断出现，本产品的部分材料又被更新的高性能的新产品取代，性能更佳。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '218', '2017-11-17 14:42:44', '218', '2017-11-17 14:42:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('205', '130', '气动平衡器', '219', '19897', '19899', '型 号 气压范围 平衡重量\r\n升降\r\n行程\r\n工字钢\r\n规格\r\n自重Kg\r\n外 形 尺 寸\r\n缸筒 长&times;厚&times;高\r\nPHQ&mdash;60-1\r\n0.1&mdash;0.7\r\nMPa\r\n0&mdash;60Kg 2000mm\r\n10#\r\n12#\r\n14#\r\n25 ф160&times;300 410&times;270&times;300\r\nPHQ&mdash;100-1 0&mdash;100Kg 3000mm 30 ф265&times;306 416&times;275&times;300\r\nPHQ&mdash;200-1 0&mdash;200Kg 1500mm 40 ф265&times;306 416&times;300&times;330', '气动平衡器主要是用平\r\n衡重物之用，随气压的调\r\n整，提升力可以从零调整至\r\n平衡器最大的额定平衡力。\r\n用于汽车制造厂、机加\r\n工等行业。可大大减轻劳动\r\n强度，方便操作', '&lt;p&gt;气动平衡器主要是用平&lt;br /&gt;\r\n衡重物之用，随气压的调&lt;br /&gt;\r\n整，提升力可以从零调整至&lt;br /&gt;\r\n平衡器最大的额定平衡力。&lt;br /&gt;\r\n用于汽车制造厂、机加&lt;br /&gt;\r\n工等行业。可大大减轻劳动&lt;br /&gt;\r\n强度，方便操作&lt;/p&gt;', '19895', '2', '0', '1', '1', '0', '1', '234', '2017-11-17 14:43:39', '234', '2017-11-17 14:43:39');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('206', '130', '无火花型手拉葫芦  手拉手推单轨行车', '220', '19900', '19905', '型 号 HSA1/2 HSA1 HSA1 HSA2 HSA2 HSA5 HSA10\r\n额定起重量 Gn 吨  0.5 1 1.5 2 3 5 10\r\n标准起升高度 米 2.5 3\r\n动载试验载荷 吨 1.5Gn 1.5Gn\r\n两钩间最小距离 毫米 280 300 360 380 470 600 730', 'FB-HSZ-A系列无火花型手拉葫芦是在HSZ-A型手拉葫芦的基础上，对某些零部件的材质、结构\r\n进行了改变和调整，使之扩大了一般普通手拉葫芦的使用范围。特别是石油、石化、化纤等行业对\r\n环境要求防爆、不允许产生火花的场合，更具有独特的优势。\r\nFB-HSZ-A系列无火花型手拉葫芦亦可与单轨行车及各式起重机配套使用', '&lt;p&gt;无火花型手拉葫芦:B-HSZ-A系列无火花型手拉葫芦是在HSZ-A型手拉葫芦的基础上，对某些零部件的材质、结构&lt;br /&gt;\r\n进行了改变和调整，使之扩大了一般普通手拉葫芦的使用范围。特别是石油、石化、化纤等行业对&lt;br /&gt;\r\n环境要求防爆、不允许产生火花的场合，更具有独特的优势。&lt;br /&gt;\r\nFB-HSZ-A系列无火花型手拉葫芦亦可与单轨行车及各式起重机配套使用.&lt;/p&gt;\r\n\r\n&lt;p&gt;手拉手推单轨行车&lt;br /&gt;\r\n手拉单轨行车以手链驱动，行走于工字钢轨道的下翼缘上。手推单轨行车则以手直接推动起吊&lt;br /&gt;\r\n重物面行走。将手拉葫芦配挂于行车下部组成行走的。手拉葫芦可安装于直道或弯道单轨架空运输&lt;br /&gt;\r\n线上或手动单梁桥式旋臂式起重机上。广泛适用于工厂、矿山码头船坞、仓库和机房等地的设备安&lt;br /&gt;\r\n装和货物吊运，尤其在无电源地点的设备维修时更具有突出的优点。&lt;/p&gt;', '19904', '1', '0', '1', '1', '0', '1', '234', '2017-11-17 14:46:24', '234', '2017-11-17 14:46:24');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('207', '150', 'AQUAlogger520_验潮仪', '158', '19871', '19914', '体积小：200mm&times;32mm（直径）；重量轻：空气中190g，水中41g；', 'AQUAlogger520 是英国AQUAtec公司制造的一款高精度自容式潮位仪。它体积小重量轻，广泛应用于海洋河流湖泊等水体的短期或长期水位及潮位观测。', '&lt;p&gt;AQUAlogger520 是英国AQUAtec公司制造的一款高精度自容式潮位仪。它体积小重量轻，广泛应用于海洋河流湖泊等水体的短期或长期水位及潮位观测。&lt;/p&gt;', '19908', '8', '0', '1', '1', '0', '1', '233', '2017-11-17 14:46:43', '233', '2017-11-17 14:48:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('208', '149', '创新电子', '172', '19906', '19913', '3D打印服务/行业分类/创新电子', '3D打印服务/行业分类/创新电子', '&lt;p&gt;3D打印服务/行业分类/创新电子&lt;/p&gt;', null, '91', '0', '1', '1', '0', '1', '227', '2017-11-17 14:47:30', '227', '2017-11-17 14:47:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('209', '161', '容积泵', '229', '19922', '19924', '由于凸轮表面有用特殊工艺方法制成的高强度高分子弹性体层，因此泵内的配合间隙可设计得很小，甚至是过盈。因此本泵与一般的凸轮转子泵相比,具有自吸能力强、吸程和扬程高、颗粒通过能力高等特点，能够输送从低粘度到高粘度的、含较大颗粒杂质的、某些腐蚀性的介质以及要求低剪切率的介质。可广泛用于环保、化工、石油、采矿、建筑、船舶、陶瓷、食品加工及农业等行业。如：输送污水、污油、泥浆水、采矿废水，废燃油、石灰浆、洗涤液、乳状液等等。目前所生产的泵，流量范围是从10m3/h至100m3/h', '泵属于一种由一对互相啮合的弹性表面凸轮转子和泵体等构成的容积泵类产品。', '&lt;p&gt;泵属于一种由一对互相啮合的弹性表面凸轮转子和泵体等构成的容积泵类产品。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '218', '2017-11-17 14:51:58', '218', '2017-11-17 14:51:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('210', '150', 'DCX-22 自容式潮位仪', '158', '19919', '19931', '机身材料: 不锈钢316L\r\nO型换材料:Viton&reg;\r\n尺寸 :0.87直径x9.84长(2.2厘米直径x28厘米长)\r\n传感器重量:0.78lb（355g）', 'DCX-22 自容式潮位仪,绝对压力和温度联合采集', '&lt;p&gt;DCX-22 自容式潮位仪是一款高精度，自容式的，电池供电的设备，用于长时间记录水深和温度. 传感器, 电子器件,和电池安装在一个坚固的，双密封316不锈钢管内用于长期的水下测量工作. DCX-22 无需外部线缆，可以使用安全线缆的悬挂.当需要下载单元记录的数据的时候, 你可以很容易的从测量点取回DCX-22并移除双密封头盖连通数据端口.DCX-22 有 2 个可用的测量范围.订购的时候, 请选择包含了期望最大量程的最小测量范围(全部水深不需要).&lt;/p&gt;', '19928', '8', '0', '1', '1', '0', '1', '233', '2017-11-17 14:54:36', '233', '2017-11-17 14:54:36');
