INSERT INTO `byp_exhibition_booth_product_info` VALUES ('212', '161', '多功能浮油回收船', '230', '19934', '19949', '该系列多功能浮油回收船是用于在沿海水域进行溢油围控及清除作业，并可兼作港区小范围油污水和垃圾污染的日常清除回收作业的环保专用工作船。浮油回收船采用双体船型，具有水流集聚导引效果好，流入双体船间的油流和固体漂浮垃圾（块状油）有良好的封闭功能，能有效提高浮油回收船的应急作业快捷性和抗风浪能力。船装有复合式收油机，油水分离效果好、收油率高，可回收低、中、高粘度及块状浮油。对浮油回收环境适应性强。该系列浮油回收船除了能回收各种粘度油和海上漂浮物外，还可用作拖带围油栏及多船联合作业等作业。', '我公司先后为各大海事局及清污公司、中石油中石化应急中心设计、制造、生产了相关船舶。涉及船长7---46m的单、双体溢油应急回收船舶。该系列船舶包括：中油应急302、威海清污1号、碧海一号、航鹏01等各种回收能力的浮油回收船舶。', '&lt;p&gt;我公司先后为各大海事局及清污公司、中石油中石化应急中心设计、制造、生产了相关船舶。涉及船长7---46m的单、双体溢油应急回收船舶。该系列船舶包括：中油应急302、威海清污1号、碧海一号、航鹏01等各种回收能力的浮油回收船舶。该系列多功能浮油回收船是用于在沿海水域进行溢油围控及清除作业，并可兼作港区小范围油污水和垃圾污染的日常清除回收作业的环保专用工作船。浮油回收船采用双体船型，具有水流集聚导引效果好，流入双体船间的油流和固体漂浮垃圾（块状油）有良好的封闭功能，能有效提高浮油回收船的应急作业快捷性和抗风浪能力。船装有复合式收油机，油水分离效果好、收油率高，可回收低、中、高粘度及块状浮油。对浮油回收环境适应性强。该系列浮油回收船除了能回收各种粘度油和海上漂浮物外，还可用作拖带围油栏及多船联合作业等作业。&lt;/p&gt;', null, '6', '0', '1', '1', '0', '1', '218', '2017-11-17 14:58:16', '218', '2017-11-17 14:59:55');
