INSERT INTO `byp_exhibition_booth_product_info` VALUES ('215', '150', 'DCX-25潮位仪', '158', '19939', '19977', '压力量程：0.8-2.3bar（10 米），0.8-3bar（20 米），0.8-6bar（50 米），0.8-11bar（100 米）可选压力精度： 线性 0.02% FS，全温度范围精度：0.05%FS', 'DCX-25 潮位仪是根据中国海域海水的特点而研发的自容式潮位仪。它采用了高精度的哈氏合金材质的压力传感器，在保证精度的前提下抗腐蚀性更强。同时，外壳采用工程塑料材质，克服了容易腐蚀生锈的缺点，更好的保证了内部电路及存储器的安全性。DCX-25 自容式潮位仪采用独立的温度传感器，保证了压力的温度补偿效果。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;DCX-25 潮位仪是根据中国海域海水的特点而研发的自容式潮位仪。它采用了高精度的哈氏合金材质的压力传感器，在保证精度的前提下抗腐蚀性更强。同时，外壳采用工程塑料材质，克服了容易腐蚀生锈的缺点，更好的保证了内部电路及存储器的安全性。DCX-25 自容式潮位仪采用独立的温度传感器，保证了压力的温度补偿效果。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;DCX-25 潮位仪采用绝压压力传感器，工作时全部没入水中，DCX-25 会根据用户之前设置的采样方式自动采集潮位和水温数据，回收后通过配套数据线下载数据即可。在长期潮位观测工作中，大气压力的变化是不可忽略的，为了后期抵消掉大气压力值，建议同时使用另一个 DCX-25 或其他型号压力传感器记录大气压值用于后期数据分析。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;DCX-25 潮位仪可采用如固定时间间隔记录、时间标志记录、事件标志记录等多种方式来采集记录数据，采用非易失性存储芯片，并且可以循环使用。您可以很方便地对多次采集的数据进行平均计算，将因波浪产生的数据波动进行数据平滑。所配套的设置和数据处理软件，可以方便地将采集存储的水位和水温数据生成表格和曲线，并输出为单独的文件。&lt;/p&gt;', '19976', '8', '0', '1', '1', '0', '1', '233', '2017-11-17 15:13:22', '233', '2017-11-17 15:16:52');
