INSERT INTO `byp_exhibition_booth_product_info` VALUES ('217', '150', 'TideSTAR II  潮位仪', '158', '19986', '19990', 'TideStar II 具备极强的系统扩展性能，可选配气象、水流等定制传感器。', 'TideStar II 是一款高精度、高稳定性的潮位/水位测量仪器，具备安装简便，坚固耐用等特点，满足用户便携式或全天候无人值守工作的要求。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;TideStar II 是一款高精度、高稳定性的潮位/水位测量仪器，具备安装简便，坚固耐用等特点，满足用户便携式或全天候无人值守工作的要求。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;TideStar II 具备极强的系统扩展性能，可选配气象、水流等定制传感器。&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;系统标配 4GB SD 卡，可存贮 2 年以上的潮位数据，且数据掉电不丢失。内置 GPRS 模块可远程摇报。系统功耗极低内置 12AH 锂电池可连续工作一个月以上，同时也可以外接电源，使工作时间更长。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;TideStar II 具有连续采集和 Burst 采集模式，支持数据取平均功能，采集间隔和平均时间可手动修改。&lt;/p&gt;', '19989', '8', '0', '1', '1', '0', '1', '233', '2017-11-17 15:22:49', '233', '2017-11-17 15:22:49');
