INSERT INTO `byp_exhibition_booth_product_info` VALUES ('219', '150', 'SediMeter SM3 沉积物运动测量仪', '159', '19994', '20004', '专利 SediMeter 传感器由 36 组近红外光学后向散射探测器阵列组成，每间隔 10 mm 深度测量一个浊度值，而水床变化的测量分辨率达 0.01 mm。将记录器集成到传感器一起，因此仪器直径大大缩小，仅为 15mm。', 'SediMeter SM3 沉积物运动测量仪可用于测量垂直剖面浊度，以及沉积物厚度的细微变化，精度达毫米级。主要用于现场及水槽测量近底层水体垂直剖面浊度，分析泥沙侵蚀和沉积物的细微变化。', '&lt;p&gt;应用领域&lt;br /&gt;\r\n■ &amp;nbsp;水床的沉积和侵蚀&lt;br /&gt;\r\n■ &amp;nbsp;水床附近浊度变化、淤积&lt;br /&gt;\r\n■ &amp;nbsp;探测推移质和悬浮泥沙的运移&lt;br /&gt;\r\n■ &amp;nbsp;底型可变性和泥沙输运研究&lt;br /&gt;\r\n■ &amp;nbsp;泥沙淤积和再悬浮研究&lt;br /&gt;\r\n■ &amp;nbsp;沉积过程和缺氧沉积的研究&lt;/p&gt;', '20002', '9', '0', '1', '1', '0', '1', '233', '2017-11-17 15:28:52', '233', '2017-11-17 15:28:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('220', '150', 'PA200 / PA500  海底 高度计', '160', '20005', '20008', '长度： 160mm\r\n直径 ：47mm\r\n标准耐压深度： 4000m（不锈钢）\r\n可选耐压等级 ：700m/2000m/6800m\r\n空气中重量 ：1.1kg\r\n水中重量 ： 0.8kg', 'Tritech 新一代 PA200 和 PA500 高精度数字高度计，以其先进的 SeaKing 声纳电子技术为基础，能提供对海底和水下目标的回声测距，以模拟和数字两种形式对外输出。PA200和PA500 高度计具有设计紧凑、高性 能和可靠性的特点，广泛应用于 ROV/AUV 的定高反馈、冰下测量和浅水河流地形初步测绘等方面。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;Tritech 新一代 PA200 和 PA500 高精度数字高度计，以其先进的 SeaKing 声纳电子技术为基础，能提供对海底和水下目标的回声测距，以模拟和数字两种形式对外输出。PA200和PA500 高度计具有设计紧凑、高性 能和可靠性的特点，广泛应用于 ROV/AUV 的定高反馈、冰下测量和浅水河流地形初步测绘等方面。&lt;/p&gt;', '20007', '10', '0', '1', '1', '0', '1', '233', '2017-11-17 15:32:44', '233', '2017-11-17 15:32:44');
