INSERT INTO `byp_exhibition_booth_product_info` VALUES ('229', '150', 'Bathy-2010PC地层剖面仪', '161', '20057', '20064', 'Bathy-2010PC  是一款便携高分辨率的 CHIRP  浅地层剖面仪。它设计用于测深和浅地层测量，支持 6000  米水深环境下测量。可选双频模式', 'Bathy-2010PC  是一款便携高分辨率的 CHIRP  浅地层剖面仪。它设计用于测深和浅地层测量，支持 6000  米水深环境下测量。可选双频模式', '&lt;p&gt;Bathy-2010PC &amp;nbsp;是一款便携高分辨率的 CHIRP浅地层剖面仪。它设计用于测深和浅地层测量，支持 6000米水深环境下测量。可选双频模式&lt;/p&gt;', '20063', '11', '0', '1', '1', '0', '1', '233', '2017-11-17 15:46:53', '233', '2017-11-17 15:46:53');
