INSERT INTO `byp_exhibition_booth_product_info` VALUES ('235', '136', 'SCM用阀门测试系统AVT', '266', '20118', '20128', '测试介质：	液压油\r\n压力等级：	20,000psi\r\n压力控制精度：	&plusmn;1%FS\r\n控制方式：	PLC控制\r\n\r\n输出方式：	多路高低压输出', '设备采用不锈钢框架、面板，四边设有四个吊耳，每个吊耳的承载力都经过了严格的计算测试。设备四边采用铰链门式结构，便于操作维护。', '&lt;p&gt;产品1：液压控制系统HPU&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wps83E2.tmp.png&quot; style=&quot;float:left; height:375px; width:310px&quot; /&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;设备描述：&lt;/p&gt;\r\n\r\n&lt;p&gt;设备采用不锈钢框架、面板，四边设有四个吊耳，每个吊耳的承载力都经过了严格的计算测试。设备四边采用铰链门式结构，便于操作维护。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;设备应用：液压动力单元是用来控制海上平台安全液压设备（防喷器、节流压井管汇）和水下液压系统（水下采油树、安全阀、管汇）的集成式液压动力源，通过其提供的液压源控制井口、井下安全设备的开启关闭。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;参考标准：&lt;/p&gt;\r\n\r\n&lt;p&gt;GB/T21412.6-2009 &amp;nbsp;石油天然气工业水下生产系统的设计与操作 第六部分 水下生产控制系统&lt;/p&gt;\r\n\r\n&lt;p&gt;DNV NO.2.7-1 &amp;nbsp;近海集装箱标准&lt;/p&gt;\r\n\r\n&lt;p&gt;BS EN 12079-2006 &amp;nbsp;&amp;nbsp;海岸集装箱及其相关提升设备&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;功能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;设备取得ATEX认证认可通过。&lt;/li&gt;\r\n	&lt;li&gt;设备具有防误操作功能。&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;人性化设计，设备操作更加简单便捷。&lt;/p&gt;', '20127', '5', '0', '1', '1', '0', '1', '247', '2017-11-17 16:06:13', '247', '2017-11-17 16:06:13');
