INSERT INTO `byp_exhibition_booth_product_info` VALUES ('237', '136', '脐带缆上部终端TUTA', '267', '20130', '20135', '试压回路最大工作压力	10,000psi\r\n工作介质	水/乙二醇\r\n工位	10工位\r\n控制回路最大工作压力	4,785psi\r\n\r\n控制面板尺寸约	1600*950*1650mm（长&times;宽&times;高）\r\n防撞框架尺寸约	1800*1150*1850mm（长&times;宽&times;高）\r\n结构形式	防撞框架结构', '水下液压系统控制面板主要用于控制水下采油树，水下阀门等水下液压执行机构。水下液压控制面板吊装通过DNV认证。', '&lt;p&gt;产品2：水下液压系统控制面板&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wpsE085.tmp.png&quot; style=&quot;float:left; height:303px; width:323px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;设备应用：水下液压系统控制面板主要用于控制水下采油树，水下阀门等水下液压执行机构。水下液压控制面板吊装通过DNV认证。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;参考标准：&lt;/p&gt;\r\n\r\n&lt;p&gt;API RP 14C海上生产平台地面安全系统的分析、设计、安装和测试&lt;/p&gt;\r\n\r\n&lt;p&gt;API RP14D 海上服务用井口地面安全阀和水下安全阀规范&lt;/p&gt;\r\n\r\n&lt;p&gt;API RP 14F海上生产平台电气系统的设计和安装的推荐作法&lt;/p&gt;\r\n\r\n&lt;p&gt;API RP 550炼油厂仪表和控制系统安装手册（第1章，第10节，液压系统；第2章，第12节，控制面板）&lt;/p&gt;\r\n\r\n&lt;p&gt;ASTM A269-07通用无缝和焊接奥氏体不锈钢管标准规范&lt;/p&gt;\r\n\r\n&lt;p&gt;SY/T6276-1997石油天然气供应健康、安全与环境管理体系&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '20134', '4', '0', '1', '1', '0', '1', '247', '2017-11-17 16:07:35', '247', '2017-11-17 16:07:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('238', '136', '水下控制模块测试系统', '268', '20136', '20140', '压力范围：	0-9370psi\r\n\r\n介质: 	水/油\r\n低压系统\r\n压力范围:	0-3770PSI\r\n介质: 	水/油\r\n冲洗填充系统：\r\n压力范围：\r\n	0-785psi\r\n介质： 	水/油\r\n油箱：	250L不锈钢容腔，带有过滤器', '该设备用于水下控制系统的测试和冲洗，配有三路独立液压系统，可根据需要分别提供不同压力的流量输出。', '&lt;p&gt;产品3：水下控制模块测试系统&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;设备描述：该设备用于水下控制系统的测试和冲洗，配有三路独立液压系统，可根据需要分别提供不同压力的流量输出。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;参考标准：&lt;/p&gt;\r\n\r\n&lt;p&gt;GB/T21412.6-2009 &amp;nbsp;石油天然气工业水下生产系统的设计与操作 第六部分 水下生产控制系统&lt;/p&gt;\r\n\r\n&lt;p&gt;ANSI/AWS D1.1-D1.1M-2006 &amp;nbsp;钢结构焊接规范&lt;/p&gt;\r\n\r\n&lt;p&gt;DNV NO.2.7-1 &amp;nbsp;近海集装箱标准&lt;/p&gt;\r\n\r\n&lt;p&gt;API RP 520 炼油厂压力泄放装置的尺寸确定、选择、安装&lt;/p&gt;\r\n\r\n&lt;p&gt;BS PD5500-2006 &amp;nbsp;非直接火焊接压力容器规范&lt;/p&gt;\r\n\r\n&lt;p&gt;PED 97/23/EC&amp;nbsp;&amp;nbsp;压力设备指令&lt;/p&gt;\r\n\r\n&lt;p&gt;ASME IX&amp;nbsp;&amp;nbsp;焊接与钎焊评定&lt;/p&gt;\r\n\r\n&lt;p&gt;SAE J 514&amp;nbsp;&amp;nbsp;液压管接头标准&lt;/p&gt;\r\n\r\n&lt;p&gt;SAE J 517&amp;nbsp;液压胶管标准&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;功能特点：&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;液压控制单元模块和清洗单元集成于一体。&lt;/li&gt;\r\n	&lt;li&gt;紧急关断功能&lt;/li&gt;\r\n	&lt;li&gt;配有声光报警装置&lt;/li&gt;\r\n	&lt;li&gt;电信号远程控制功能&lt;/li&gt;\r\n	&lt;li&gt;蓄能器组设计参照ASME IX/PED 标准设计&lt;/li&gt;\r\n	&lt;li&gt;&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wpsC258.tmp.png&quot; style=&quot;float:left; height:316px; width:275px&quot; /&gt;框架结构设计参照AISC, ANSI/AWSD1.1 和DNV NO.2.7-1&lt;/li&gt;\r\n&lt;/ol&gt;', '20139', '3', '0', '1', '1', '0', '1', '247', '2017-11-17 16:09:41', '247', '2017-11-17 16:09:41');
