'0', '1', '247', '2017-11-17 16:12:08', '247', '2017-11-17 16:12:08');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('240', '150', 'StrataBox  TM 浅地层剖面仪', '161', '20141', '20151', '穿透 40米地层 6厘米地层分辨率、 深度精度&plusmn;0.5%、 兼容NMEA 地理位置输入、 数据存储和回放、 缩放模式、 事件标记、 便携或安置于舱壁、 10-30V直流输入、 支持WindowsXP 和VISTA系统。', 'Strata Box  TM 是 一 款便携式高分辨率 海洋沉积物成 像设备，能够穿透深达40米的地层，最高 6厘米 海洋沉积物分辨率，是 一 款专为150米水深以内近海和沿海 海洋地质调查而设计的设备，它使用简单、 成本低，是您测深调查和海洋物探应用的 最佳选择。\r\n     传感器单元非常轻便，可直接与标准笔记本电脑进行连接，并配有高效声学收发器单元和Windows电脑软件。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;Strata Box TM 是 一 款便携式高分辨率 海洋沉积物成 像设备，能够穿透深达40米的地层，最高 6厘米 海洋沉积物分辨率，是 一 款专为150米水深以内近海和沿海 海洋地质调查而设计的设备，它使用简单、 成本低，是您测深调查和海洋物探应用的 最佳选择。&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;传感器单元非常轻便，可直接与标准笔记本电脑进行连接，并配有高效声学收发器单元和Windows电脑软件。&lt;/p&gt;', '20149', '11', '0', '1', '1', '0', '1', '233', '2017-11-17 16:13:27', '233', '2017-11-17 16:13:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('241', '136', '液压控制系统HPU', '270', '20146', '20153', '低压系统：\r\n最大工作压力：14,500psi\r\n控制方式：自动控制\r\n驱动压力：72.5psi-145psi\r\n高压系统：\r\n最大工作压力：36,250psi\r\n控制方式：手动控制\r\n驱动压力：72.5psi-145psi', 'SCM用阀门测试系统AVT用于对安装在水下控制系统SCM中的阀门进行静压测试、泄漏测试和功能测试。', '&lt;p&gt;产品5：SCM用阀门测试系统/AVT&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;设备应用：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;SCM用阀门测试系统AVT用于对安装在水下控制系统SCM中的阀门进行静压测试、泄漏测试和功能测试。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;功能特点：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1、设备具有两个压力回路：低压系统和高压系统。低压系统压力可达14,500psi，采用三位三通比例阀技术，可自由编程压力曲线；高压系统压力可达36,250psi，需手动调节压力。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、设备的冲洗和过滤装置配备颗粒计数器，保证管路洁净度符合标准。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、设备主要元器件均采用全进口德国MAXIAMTOR产品。&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;&lt;strong&gt;技术参数：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;&lt;strong&gt;低压系统：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;最大工作压力：14,500psi&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;控制方式：自动控制&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;驱动压力：72.5psi-145psi&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;&lt;strong&gt;高压系统：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;最大工作压力：36,250psi&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;控制方式：手动控制&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:290.4500pt&quot;&gt;驱动压力：72.5psi-145psi&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '20152', '1', '0', '1', '1', '0', '1', '247', '2017-11-17 16:14:07', '247', '2017-11-17 16:14:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('242', '167', '船用手扳葫芦', '264', '20154', '20156', '1.5T、3T', '手扳葫芦是一款使用简单，携带方便的手动起重工具。手扳葫芦可以进行提升、牵引、下降、校准等作业。广泛地应用于造船、电力、运输、建筑、矿山、邮电等行业的设备安装，物品起吊、机件牵拉等。', '&lt;p&gt;手扳葫芦是一款使用简单，携带方便的手动起重工具。手扳葫芦可以进行提升、牵引、下降、校准等作业。广泛地应用于造船、电力、运输、建筑、矿山、邮电等行业的设备安装，物品起吊、机件牵拉等。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '283', '2017-11-17 16:15:55', '283', '2017-11-17 16:55:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('243', '150', 'miniSVS声速仪', '162', '20157', '20165', 'miniSVS -  仍是世界上最精准的声速传感器。没有其他仪器可以相媲美。', '我们独特的数字飞行时间技术实现了无与伦比的性能表现，信号噪声和量级优于任何其他传感器。客户可选择配置miniSVS并选配压力或温度传感器。 提供适合各种应用的尺寸选择。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;我们独特的数字飞行时间技术实现了无与伦比的性能表现，信号噪声和量级优于任何其他传感器。客户可选择配置miniSVS并选配压力或温度传感器。 提供适合各种应用的尺寸选择。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;miniSVS - &amp;nbsp;仍是世界上最精准的声速传感器。没有其他仪器可以相媲美。&lt;/p&gt;', '20164', '12', '0', '1', '1', '0', '1', '233', '2017-11-17 16:18:45', '233', '2017-11-17 16:18:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('244', '167', '环链电动葫芦', '273', '20162', '20166', '7.5T', '&ldquo;电动环链葫芦&rdquo;又称环链电动葫芦是一种轻小型起重设备。电动环链葫芦由电动机，传动机构和链轮组成。电动环链葫芦全部按照国际标准生产，机身外形美观，结实耐用，内部齿轮全部经过高温淬火，增加了齿轮的耐磨性和韧性，采用国际最先进的工艺，做工精细，齿轮间契合严密。', '&lt;p&gt;&amp;ldquo;电动环链葫芦&amp;rdquo;又称环链电动葫芦是一种轻小型起重设备。电动环链葫芦由电动机，传动机构和链轮组成。电动环链葫芦全部按照国际标准生产，机身外形美观，结实耐用，内部齿轮全部经过高温淬火，增加了齿轮的耐磨性和韧性，采用国际最先进的工艺，做工精细，齿轮间契合严密。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '283', '2017-11-17 16:18:58', '283', '2017-11-17 16:55:09');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('245', '149', '医学模型', '186', '20168', '20181', '3D打印服务/行业分类/医学模型', '3D打印服务/行业分类/医学模型', '&lt;p&gt;3D打印服务/行业分类/医学模型&lt;/p&gt;', null, '78', '0', '1', '1', '0', '1', '227', '2017-11-17 16:21:20', '227', '2017-11-17 16:21:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('246', '150', 'Valeport_MidasSVX2多参数声速仪', '162', '20178', '20188', 'M IDAS  SVX2配有Valeport数字飞行时间声速传感器、高稳定性的电导率传感\r\n器、一个高准确度的温度补偿压阻式压力传感器和快速响应PRT温度传感器。', 'M IDAS SVX2 是Valeport 独特仪器的最新版本。鉴于认识到用户需要 SVP &nbsp;的声速数据的同时仍需要 CTD的盐度和密度数据的冲突，MIDAS SVX2 结合了这两种技术并取得了两全其美的效果。配备0.01 ％压力传感器作为标准配备的SVX2 还使用同步采样来确保完美测流，由于 SV 传感器的数字飞行时间是世界上最准确的，也可以将真实的声速数据与常用公式生成的数据进行比较。', '&lt;p&gt;M IDAS SVX2 是Valeport 独特仪器的最新版本。鉴于认识到用户需要 SVP &amp;nbsp;的声速数据的同时仍需要 CTD的盐度和密度数据的冲突，MIDAS SVX2 结合了这两种技术并取得了两全其美的效果。配备0.01 ％压力传感器作为标准配备的SVX2 还使用同步采样来确保完美测流，由于 SV 传感器的数字飞行时间是世界上最准确的，也可以将真实的声速数据与常用公式生成的数据进行比较。&lt;/p&gt;', '20187', '12', '0', '1', '1', '0', '1', '233', '2017-11-17 16:25:19', '233', '2017-11-17 16:25:19');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('247', '150', 'Valeport_miniSVP声速剖面仪', '162', '20208', '20212', 'miniSVP 配有 Valeport 的数字飞行时间声速传感器、PRT 温度传感器和应变\r\n式压力传感器。', 'miniSVP  的开发旨在为声速信息的收集提供一个符合成本效益的工具，并且不影响数据的质量。P miniSVP 是 是  ROV 、沿海或小船应用的理想选择，特别适合勘测公司、军方和学术界以及类似的机构，它使用简单且易于处理。', '&lt;p&gt;miniSVP 的开发旨在为声速信息的收集提供一个符合成本效益的工具，并且不影响数据的质量。P miniSVP 是ROV 、沿海或小船应用的理想选择，特别适合勘测公司、军方和学术界以及类似的机构，它使用简单且易于处理。&lt;/p&gt;', '20210', '12', '0', '1', '1', '0', '1', '233', '2017-11-17 16:45:23', '233', '2017-11-17 16:45:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('248', '150', 'Valeport_ultraSV搭载声速仪', '162', '20214', '20219', '自接插件开始重新整体设计，UltraSV  是无与伦比的智能化可拆卸型声速传感器。', 'UltraSV 的重要电子器件均在壳体内,是真正可拆卸的 SV 传感器，极适合系统集成商和 OEM 应用。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;UltraSV 的重要电子器件均在壳体内,是真正可拆卸的 SV 传感器，极适合系统集成商和 OEM 应用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;让一个单一声脉冲通过一个已知的距离来测量每个声速，由此产生的测量数据不受所有CTD 存在的固有计算误差的影响。我们独特的数字信号处理技术几乎消除了信号噪声，并能产生几乎瞬时的响应。数字测量也完全为线性，在所有环境条件下达到其预期性能。&lt;/p&gt;', '20218', '12', '0', '1', '1', '0', '1', '233', '2017-11-17 16:48:18', '233', '2017-11-17 16:48:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('249', '150', 'IMU 10x 系列_ 三维姿态仪&amp;波浪补偿仪', '163', '20220', '20224', 'SMC已开发出一系列IMU运动传感器，以满足水上测量及各海洋部门的需求。', 'SMC已开发出一系列IMU运动传感器，以满足水上测量及各海洋部门的需求。', '&lt;p&gt;SMC已开发出一系列IMU运动传感器，以满足水上测量及各海洋部门的需求。&lt;/p&gt;', '20223', '13', '0', '1', '1', '0', '1', '233', '2017-11-17 16:52:46', '233', '2017-11-17 16:52:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('250', '158', 'BINGO-30 工业级固定翼无人机', '274', '20216', '20454', 'BINGO-30 工业级固定翼无人机：1.翼展：4100mm 2.机长：2400mm  3.最大飞行速度：45m/s  4.最大飞行高度：5000m  5.任务载荷：10kg  6.续航时间：&ge;8h  7.控制半径：65km  8.双光光电吊舱360&deg;全景云台', '广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。', '&lt;p&gt;BINGO-30机身由高强度碳纤维复合材料制成，采用模块化设计和最佳气动布局，续航时间8小时，挂载重量10公斤。超长的续航时间和强大的载重能力，搭配高清图传设备，在高度集成式地面站协助下，可以广泛的应用于海域救援、海事调查、调查取证、搜寻与救助、航标巡查等领域。BINGO-30 工业级固定翼无人机：1.翼展：4100mm 2.机长：2400mm &amp;nbsp;3.最大飞行速度：45m/s &amp;nbsp;4.最大飞行高度：5000m &amp;nbsp;5.任务载荷：10kg &amp;nbsp;6.续航时间：&amp;ge;8h &amp;nbsp;7.控制半径：65km &amp;nbsp;8.双光光电吊舱360&amp;deg;全景云台。广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117171512_202.png&quot; style=&quot;height:367px; width:945px&quot; /&gt;&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '277', '2017-11-17 16:52:47', '277', '2017-11-18 10:27:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('251', '158', 'BINGO-solar 太阳能无人机', '275', '20229', '20443', 'BINGO-solar 太阳能无人机：1.翼展：7100mm  2.巡航速度：30-60km/h  3.续航时间：&ge;24h  4.实用升限海拔：8000m  5.控制半径：100km  6.机身材料碳纤维复合材料，应急通讯平台搭载微型通信中继模块', '广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。', '&lt;p&gt;太阳能无人机可以执行远距离、大面积（100 平方千米以上）、长行时的任务。携带红外摄像头与可见光镜头，通过远距离图传将画面实时传输到地面指挥中心，可以对特定区域进行。搭载微型通信中继模块，作为应急通信平台，为救灾抢险提供长时间不间断的通信服务BINGO-solar 太阳能无人机：1.翼展：7100mm &amp;nbsp;2.巡航速度：30-60km/h &amp;nbsp;3.续航时间：&amp;ge;24h &amp;nbsp;4.实用升限海拔：8000m &amp;nbsp;5.控制半径：100km &amp;nbsp;6.机身材料碳纤维复合材料，应急通讯平台搭载微型通信中继模块 &amp;nbsp;7.能源管理技术：先进能源管理技术，智能电池存储系统。广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117170506_441.jpg&quot; style=&quot;height:373px; width:950px&quot; /&gt;&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '277', '2017-11-17 17:01:34', '277', '2017-11-18 10:23:50');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('252', '158', 'BINGO-ME15 六旋翼无人机', '276', '20243', '20442', 'BINGO-ME15 六旋翼无人机：1.轴距：1200mm  2.最大飞行速度：15km/h  3.实用升限：4000m  4.任务载荷：5kg  5.续航时间：1h  6.控制半径：20km', '广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。', '&lt;p&gt;BINGO-ME15空警安防无人机系统，采用机体一体化设计和主框架镂空设计，使得飞行器的操控性、抗风性、巡航能力得到提升。支持GPS/北斗定位导航，具备一件返航等功能。无人机拥有三防作业性能，可全天候作业，广泛用于应急救灾、空中侦察、安全反恐等领域。BINGO-ME15 六旋翼无人机：1.轴距：1200mm &amp;nbsp;2.最大飞行速度：15km/h &amp;nbsp;3.实用升限：4000m &amp;nbsp;4.任务载荷：5kg &amp;nbsp;5.续航时间：1h &amp;nbsp;6.控制半径：20km &amp;nbsp;7.远距离无线图像传输：全程高清（1080p）录像，高清图像实时回转，HDMI输出。广泛应用于高清拍摄、巡逻执法、溢油排污监视、反恐、近海巡航等作业。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117171257_41.jpg&quot; style=&quot;height:361px; width:950px&quot; /&gt;&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '277', '2017-11-17 17:13:08', '277', '2017-11-18 10:23:20');
