INSERT INTO `byp_exhibition_booth_product_info` VALUES ('256', '172', '温盐深测量仪', '279', '20272', '20276', '材质：钛合金；运行方式：自容。', '本公司的DW163-T-0温盐深仪是一款高质量、高精确度的传感器，可以测量海洋、河流或者湖泊中的物理、化学和光学参数，测量深度可达6000米。', '&lt;p&gt;本公司的DW163-T-0温盐深仪是一款高质量、高精确度的传感器，可以测量海洋、河流或者湖泊中的物理、化学和光学参数，测量深度可达6000米。本公司的DW163-T-0温盐深仪用内置电池组供电，在预设的时间间隔或者深度间隔上采集的数据存储在256M存储卡上。通过标准RS-232或USB接口进行数据采集程序的设定和数据读取。本公司提供的SSCOM3数据读取软件，可在Windows 操作系统中使用，可以处理数据记录过程，通过用户界面显示实时获得的数据或存储的数据。&lt;/p&gt;', '20275', '2', '1', '1', '1', '0', '1', '221', '2017-11-17 17:41:30', '221', '2017-11-17 17:41:36');
