INSERT INTO `byp_exhibition_booth_product_info` VALUES ('258', '169', '蓝水一号', '283', '20281', '20284', '产品特点：可用于市政饮用水系统中水罐、水管、水库检查；排污/排涝管道、下水道检查洋输油管道检查；跨江、跨河管道检查船舶河道海洋石油船体检修；水下锚、推进器、船底探查码头及码头桩基、桥梁、大坝水下部分检查；航道排障、港口作业钻井平台水下结构检修、海洋石油工程；可用于检查大坝、桥墩上是否安装爆炸物以及结构好坏情况遥控侦察、危险品靠近检查水下基阵协助安装/拆卸船侧、船底走私物品检测(公安、海关)水下目标观察，废墟、坍塌矿井搜救等。', '蓝水一号是约肯公司第一款消费级别的水下机器人，开启了水下勘探的新纪元。', '&lt;p&gt;蓝水一号是约肯公司第一款消费级别的水下机器人，开启了水下勘探的新纪元。 &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;产品特点：可用于市政饮用水系统中水罐、水管、水库检查；排污/排涝管道、下水道检查洋输油管道检查；跨江、跨河管道检查船舶河道海洋石油船体检修；水下锚、推进器、船底探查码头及码头桩基、桥梁、大坝水下部分检查；航道排障、港口作业钻井平台水下结构检修、海洋石油工程；可用于检查大坝、桥墩上是否安装爆炸物以及结构好坏情况遥控侦察、危险品靠近检查水下基阵协助安装/拆卸船侧、船底走私物品检测(公安、海关)水下目标观察，废墟、坍塌矿井搜救等；搜寻水下证据(公安、海关)海上救助打捞、近海搜索，核电站反应器检查、管道检查、异物探测和取出水电站船闸检修；水电大坝、水库堤坝检修(排沙洞口、拦污栅、泄水道检修)。同时可用于水下电视拍摄、水下摄影潜水、划船、游艇；看护潜水员，潜水前合适地点的选择，水环境、水下生物的观测、研究和教学海洋考察；冰下观察。&amp;nbsp;&amp;nbsp;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117175531_971.png&quot; style=&quot;height:371px; width:705px&quot; /&gt;&lt;/p&gt;', '20283', '1', '0', '1', '1', '0', '1', '272', '2017-11-17 17:56:59', '272', '2017-11-17 17:56:59');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('259', '110', '光纤激光打标机RL-FP系列', '284', '20290', '20292', '产品特点：■采用高度成的光纤激光器，全封闭激光腔体设计，全屏蔽激光外腔设计\r\n■高品质的激光器结合高速扫描振镜系统，完美满足高精度、高速度的打标要需求\r\n■电光转换效率更高，可达50%以上\r\n■采用风冷方式冷却，整机体积小巧，运输和放置方便\r\n■脉冲重复频率高，功率稳定性高，单脉冲能量波动小于1%■光束质量好，接近基膜，光斑直径小，完美适用于超精细标记■可靠性高、超长的运行寿命，无耗材，免维护，低能耗', '产品特点：■采用高度成的光纤激光器，全封闭激光腔体设计，全屏蔽激光外腔设计\r\n■高品质的激光器结合高速扫描振镜系统，完美满足高精度、高速度的打标要需求\r\n■电光转换效率更高，可达50%以上\r\n■采用风冷方式冷却，整机体积小巧，运输和放置方便\r\n■脉冲重复频率高，功率稳定性高，单脉冲能量波动小于1%■光束质量好，接近基膜，光斑直径小，完美适用于超精细标记■可靠性高、超长的运行寿命，无耗材，免维护，低能耗', '&lt;p&gt;产品特点：■采用高度成的光纤激光器，全封闭激光腔体设计，全屏蔽激光外腔设计&lt;br /&gt;\r\n■高品质的激光器结合高速扫描振镜系统，完美满足高精度、高速度的打标要需求&lt;br /&gt;\r\n■电光转换效率更高，可达50%以上&lt;br /&gt;\r\n■采用风冷方式冷却，整机体积小巧，运输和放置方便&lt;br /&gt;\r\n■脉冲重复频率高，功率稳定性高，单脉冲能量波动小于1%■光束质量好，接近基膜，光斑直径小，完美适用于超精细标记■可靠性高、超长的运行寿命，无耗材，免维护，低能耗&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '196', '2017-11-17 18:17:02', '196', '2017-11-20 11:18:16');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('260', '110', '紫外激光打标机RL-UV系列', '285', '20293', '20295', '应用行业：&bull;  对光滑度、精细度要求较高的领域；&bull;  手机壳LOGO，充电器壳子打标；&bull;  电子元器件、集成电路（IC）；&bull;  电工电器、通讯产品、标牌；&bull;  PVC管材、医疗器械等行业。', '应用行业：&bull;  对光滑度、精细度要求较高的领域；&bull;  手机壳LOGO，充电器壳子打标；&bull;  电子元器件、集成电路（IC）；&bull;  电工电器、通讯产品、标牌；&bull;  PVC管材、医疗器械等行业。', '&lt;p&gt;应用行业：&amp;bull; &amp;nbsp;对光滑度、精细度要求较高的领域；&amp;bull; &amp;nbsp;手机壳LOGO，充电器壳子打标；&amp;bull; &amp;nbsp;电子元器件、集成电路（IC）；&amp;bull; &amp;nbsp;电工电器、通讯产品、标牌；&amp;bull; &amp;nbsp;PVC管材、医疗器械等行业。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117182021_956.png&quot; style=&quot;height:865px; width:745px&quot; /&gt;&lt;/p&gt;', null, '2', '1', '1', '1', '0', '1', '196', '2017-11-17 18:20:25', '196', '2017-11-20 11:18:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('261', '110', '半导体端泵激光打标机RL-EP系列', '286', '20296', '20298', '性能特点：1.采用进口集成的端泵激光器，全封闭激光腔体设计，全屏蔽激光外腔设计2.激光模式优良，光斑直径小，适合超精细加工3.全风冷设计，控温精度高，激光稳定性好，满足长时间连续工作需求4.采用端面泵浦，光电转化效率高达30%以上，能耗低，生产运行以及维护成本低', '1.适用于金属和非金属材料的精细标记，尤其适合在塑胶、塑料、硅胶等喷涂产品上的透光图案标记。2.重点应用于手机、电脑、电表壳、消费类电子产品、电子元器件、塑胶硅胶、透光按键灯领域。', '&lt;p&gt;1.适用于金属和非金属材料的精细标记，尤其适合在塑胶、塑料、硅胶等喷涂产品上的透光图案标记。2.重点应用于手机、电脑、电表壳、消费类电子产品、电子元器件、塑胶硅胶、透光按键灯领域。性能特点：1.采用进口集成的端泵激光器，全封闭激光腔体设计，全屏蔽激光外腔设计2.激光模式优良，光斑直径小，适合超精细加工3.全风冷设计，控温精度高，激光稳定性好，满足长时间连续工作需求4.采用端面泵浦，光电转化效率高达30%以上，能耗低，生产运行以及维护成本低&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117182424_655.png&quot; style=&quot;height:887px; width:574px&quot; /&gt;&lt;/p&gt;', null, '3', '1', '1', '1', '0', '1', '196', '2017-11-17 18:25:49', '196', '2017-11-20 11:18:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('262', '110', 'CO2激光打标机RL-CO2系列', '287', '20300', '20302', '性能特点：1.采用进口CO2金属激光器，高度集成，整体封装2.打标软件功能齐全，支持常用的PLT、DXF、WMF等格式3.支持在线高速飞行打标，稳定性高', '1.主要应用于各种非金属材料的打标、雕刻。\r\n2.广泛用在聚氧乙烯（PVC）、环氧树脂、亚克力、玻璃、竹木器、树脂、塑料、橡胶、纸张、皮件、电器和IC的打标加工。\r\n3.典型应用案例如纸质包装盒体激光飞行打标、饮料塑料瓶生产日期的在线飞行打标等。', '&lt;p&gt;1.主要应用于各种非金属材料的打标、雕刻。&lt;br /&gt;\r\n2.广泛用在聚氧乙烯（PVC）、环氧树脂、亚克力、玻璃、竹木器、树脂、塑料、橡胶、纸张、皮件、电器和IC的打标加工。&lt;br /&gt;\r\n3.典型应用案例如纸质包装盒体激光飞行打标、饮料塑料瓶生产日期的在线飞行打标等。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '196', '2017-11-17 18:36:22', '196', '2017-11-17 18:36:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('263', '110', '光纤传输激光焊接机RL-LPY系列', '288', '20306', '20309', '设备型号Model	RL-LPY-75R	 RL-LPY-150R	 RL-LPY-300R', '设备型号Model	RL-LPY-75R	 RL-LPY-150R	 RL-LPY-300R', '&lt;p&gt;设备型号Model&amp;nbsp;&amp;nbsp; &amp;nbsp;RL-LPY-75R&amp;nbsp;&amp;nbsp; &amp;nbsp; RL-LPY-150R&amp;nbsp;&amp;nbsp; &amp;nbsp; RL-LPY-300R&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '196', '2017-11-17 18:39:11', '196', '2017-11-17 18:39:11');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('264', '110', '激光模具修复机RL-LMR系列', '289', '20310', '20312', '1.采用高品质陶瓷聚光腔体，耐腐蚀、耐高温、寿命（8-10）年， 氙灯寿命800万次以上。2.采用先进的自动遮光系统，消除了在工作时光对眼睛的刺激。3.激光头可旋转360度，光路部份可转动360度，以及上下电动升降前后推动适合各种大、中、小型模具的修补。 4.参数调节采用智能化遥控器控制，操作简单、快捷。5.工作台可电动升降，三维移动。', '1.适用于补焊各种模具钢、不锈钢、钹钢、贵金属及极硬材料等。2.适合补焊多种模具材料：S136，NAK80，718，738，P20，SKD-11，SKD-61，H13，W302，GS2344，GS2343，GS2082等各国模具钢材。3.普遍应用于手机、数码产品、眼镜、玩具等模具制造和成型行业。精密注塑、压铸、模具的修补金属饰品及配件、精密冲压件的焊接、失蜡铸件、铝铸件、不锈钢砂孔修补。', '&lt;p&gt;1.适用于补焊各种模具钢、不锈钢、钹钢、贵金属及极硬材料等。2.适合补焊多种模具材料：S136，NAK80，718，738，P20，SKD-11，SKD-61，H13，W302，GS2344，GS2343，GS2082等各国模具钢材。3.普遍应用于手机、数码产品、眼镜、玩具等模具制造和成型行业。精密注塑、压铸、模具的修补金属饰品及配件、精密冲压件的焊接、失蜡铸件、铝铸件、不锈钢砂孔修补。&lt;/p&gt;', null, '6', '0', '1', '1', '0', '1', '196', '2017-11-17 18:43:48', '196', '2017-11-17 18:43:48');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('265', '110', '气动打标机RL-GD系列', '290', '20313', '20316', '1.适合各种金属和非金属材料的气动标记。2.适合于各种汽车零部件、铭牌、金属标牌、齿轮、管件、钢轮等各种金属件平面打标和圆锥类横向打标。', '性能特点：1.电脑编程 ：打印自动进行，可打印英文、数字、汉字、图形，打印内容可任意改变。  2.对针系统 ：国内首推鼠标、键盘对针系统，可准确快速地把打印内容移动到相应位置。 3.多种字体 ：百种字体可选，并可自行编辑新字体。                       \r\n4.升降功能 ：打标针头可以上下调动，随意调节打标深度。   5.标记要求 ：专用合金打印针，标记效果清晰。', '&lt;p&gt;1.适合各种金属和非金属材料的气动标记。2.适合于各种汽车零部件、铭牌、金属标牌、齿轮、管件、钢轮等各种金属件平面打标和圆锥类横向打标。性能特点：1.电脑编程 ：打印自动进行，可打印英文、数字、汉字、图形，打印内容可任意改变。 &amp;nbsp;2.对针系统 ：国内首推鼠标、键盘对针系统，可准确快速地把打印内容移动到相应位置。 3.多种字体 ：百种字体可选，并可自行编辑新字体。 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;br /&gt;\r\n4.升降功能 ：打标针头可以上下调动，随意调节打标深度。 &amp;nbsp; 5.标记要求 ：专用合金打印针，标记效果清晰。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117184809_26.png&quot; style=&quot;height:719px; width:912px&quot; /&gt;&lt;/p&gt;', null, '7', '0', '1', '1', '0', '1', '196', '2017-11-17 18:47:03', '196', '2017-11-17 18:48:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('266', '110', '对外激光加工、维修服务', '291', '20317', '20319', '来料激光加工：主要包括：1、手机及通讯周边包括各种手机按键、外壳、内饰件、电源适配器、电池、手机视讯配件、电源接头等等2、电脑及外设激光标记已经基本覆盖了整个电脑周边产品，被越来越多的生产厂商接收，如键盘、鼠标、USB接口、笔记本电脑外壳、显示器外壳等等 3、消费电子产品及周边\r\n如相机外壳、MP3外壳、U盘外壳、游戏机等4、电子元器件、电工产品包括各种电子元器件、集成块、shell、晶振、IC、开关、滤波器、电表、电源、插座等塑料、阳极铝外壳等', '我公司拥有独立的激光加工中心，配备先进的光纤激光打标机和半导体激光打标机，欢迎广大客户前来参观和洽谈。另外，激光加工中心承接各种产品的来料加工服务，标记内容涵盖大部分金属和非金属材料的LOGO、条形码、序列号等打标、深雕、雕刻、切割。', '&lt;p&gt;来料激光加工：我公司拥有独立的激光加工中心，配备先进的光纤激光打标机和半导体激光打标机，欢迎广大客户前来参观和洽谈。另外，激光加工中心承接各种产品的来料加工服务，标记内容涵盖大部分金属和非金属材料的LOGO、条形码、序列号等打标、深雕、雕刻、切割。主要包括：1、手机及通讯周边包括各种手机按键、外壳、内饰件、电源适配器、电池、手机视讯配件、电源接头等等2、电脑及外设激光标记已经基本覆盖了整个电脑周边产品，被越来越多的生产厂商接收，如键盘、鼠标、USB接口、笔记本电脑外壳、显示器外壳等等 3、消费电子产品及周边&lt;br /&gt;\r\n如相机外壳、MP3外壳、U盘外壳、游戏机等4、电子元器件、电工产品包括各种电子元器件、集成块、shell、晶振、IC、开关、滤波器、电表、电源、插座等塑料、阳极铝外壳等4、&amp;nbsp;&amp;nbsp; &amp;nbsp;五金工具包括各种电动工具、餐具、厨具、洁具、刀具、阀、轴、开关等6、汽车零部件包括汽车各种配件如按键、背光表盘、LOGO、轴承、曲轴、连杆、缸体缸套等7、服饰礼品包括各种皮革、布料、压克力、木材、纸张、陶瓷、钟表、珠宝8、包装 烟酒、饮料、医药、化妆品、食品、日用品等等的包装可进行激光在线标记&lt;/p&gt;\r\n\r\n&lt;p&gt;1.对外维修各种通用型、专用型激光打标机、激光焊接机、激光切割机、气动打标机等设备&lt;/p&gt;\r\n\r\n&lt;p&gt;2.可承包客户已过保、已失保激光设备的维护、维修和保养工作&lt;/p&gt;\r\n\r\n&lt;p&gt;3.可提供各种激光设备(如激光器、振镜、场镜、Q开关、打标卡、控制卡、开关电源等）已损坏配件的检测、维修服务。&lt;/p&gt;', null, '8', '0', '1', '1', '0', '1', '196', '2017-11-17 18:55:40', '196', '2017-11-17 18:55:40');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('267', '128', 'SiPESC.FEMS 分析功能及应用', '292', '20327', '20334', '海洋平台自振特性分析：桩基平台作为目前海洋石油工业采用最多的平台形式，它的稳定性与安全性直接关系到整个石油工业。海上风力发电结构的自振特性分析：海上风电机组多种基础结构形式尽管各具优势，但是所处的环境条件复杂，容易受到风、浪、流、地震等环境载荷的威胁，且风轮基础的激振对结构的安全性影响巨大，依照相关规范要求，风轮基础的激振频率和整个系统的固有频率之间的比值需要满足一定的要求.', '1海洋平台自振特性分析2.海上风力发电结构的自振特性分析3.大型多用途远洋船舶结构自振特性分析', '&lt;p&gt;&lt;strong&gt;1.海洋平台自振特性分析：&lt;/strong&gt;桩基平台作为目前海洋石油工业采用最多的平台形式，它的稳定性与安全性直接关系到整个石油工业。平台的性能尽管收到它所面临的海况的影响，但更大程度上还是取决于平台本身的结构与性能。平台的自振特性是平台本身的固有特性，利用SiPESC.FEMS进行自振分析，有助于监测平台安全性与稳定性，预防事故发生。2.&lt;strong&gt;海上风力发电结构的自振特性分析：&lt;/strong&gt;海上风电机组多种基础结构形式尽管各具优势，但是所处的环境条件复杂，容易受到风、浪、流、地震等环境载荷的威胁，且风轮基础的激振对结构的安全性影响巨大，依照相关规范要求，风轮基础的激振频率和整个系统的固有频率之间的比值需要满足一定的要求。在设计的过程中不论采取哪一种基础结构，对于风机塔筒的自振特性的分析都是最重要一环，也是一切动力分析的基础。3.&lt;strong&gt;大型多用途远洋船舶结构自振特性分析：&lt;/strong&gt;由于船舶整体或局部发生共振会产生人体不适、船上精密仪器失灵和结构系统破坏等后果，因此有必要在设计阶段对大型多用途远洋船舶结构的总体和局部振动性能进行预报，了解这类船舶的结构动力响应特性，以便在结构设计方面采用合理方案和必要措施，以减轻结构振动的危害．&lt;strong&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117190728_609.png&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '237', '2017-11-17 19:09:08', '237', '2017-11-17 19:18:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('268', '128', 'SiPESC.CoLab 模型修正应用', '293', '20330', '20332', '1.	勘探三号海洋石油井架的仿真模型修正及安全承载能力评价：由于海洋石油钻井作业长期处于海洋环境中，井架受工作载荷、风载荷和波浪载荷作用的影响很大。2.船舶轴系实验台推进轴系横向振动的有限元模型修正：利用试验模态参数修正了船舶柴油机轴系实验台推进轴系横向振动的有限元模型，使其能够较精确地描述轴系横向振动的动力学特性。', '1.勘探三号海洋石油井架的仿真模型修正及安全承载能力评价2.船舶轴系实验台推进轴系横向振动的有限元模型修正', '&lt;p&gt;1.勘探三号海洋石油井架的仿真模型修正及安全承载能力评价：由于海洋石油钻井作业长期处于海洋环境中，井架受工作载荷、风载荷和波浪载荷作用的影响很大。海洋井架经过长时间的使用以及受环境腐蚀等因素的影响，不可避免地存在一些缺陷，井架结构的物理特性已经发生改变，已不具备原始设计阶段的特性，这将严重影响井架的安全承载能力，给海上石油钻井生产带来安全隐患。为保证海洋石油钻井作业安全，能够准确评定海洋石油井架的安全承载能力意义重大。以海洋随机波浪脉动作为激励，对勘探三号海洋石油井架进行了现场模态试验，识别出前二阶固有频率。以此作为有限元模型修正的基础，对动力有限元模型进行了修正。进一步，采用修正后的有限元模型进行静、动力分析和安全承载能力评价。2.船舶轴系实验台推进轴系横向振动的有限元模型修正：利用试验模态参数修正了船舶柴油机轴系实验台推进轴系横向振动的有限元模型，使其能够较精确地描述轴系横向振动的动力学特性。与传统的计算相比，修正后的有限元模型不仅在实测点，而且在非测点都能给出较精确的相对幅值。由于轴系实验台推进轴系与实际舰船轴系(特别是快艇轴系)相近，因而具有一定的实用价值。修正方案可作为研究舰船动力装置振动的一种有效的方法。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117191631_466.jpg&quot; style=&quot;height:642px; width:857px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117191552_31.png&quot; style=&quot;height:742px; width:830px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117191607_774.jpg&quot; style=&quot;height:375px; width:857px&quot; /&gt;&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '237', '2017-11-17 19:16:37', '237', '2017-11-17 19:16:37');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('269', '144', '中国水产网，最具影响力的水产网站', '296', '20350', '21152', '最具影响力的水产网站', '中国水产门户网www.bbwfish.com成立于2000年10月，是全国最早的水产行业综合性网络媒体，历经十七年的运营与发展，现已成为中国最具影响的水产网站！连续七年被中国农业部评予&ldquo;中国农业网站一百强&rdquo;称号！企业宗旨：志创中国渔业信息化第一品牌！ 助力中国渔业企业信息化进程！', '&lt;p&gt;中国水产门户网www.bbwfish.com成立于2000年10月，是全国最早的水产行业综合性网络媒体，历经十七年的运营与发展，现已成为中国最具影响的水产网站！连续七年被中国农业部评予&amp;ldquo;中国农业网站一百强&amp;rdquo;称号！企业宗旨：志创中国渔业信息化第一品牌！ 助力中国渔业企业信息化进程！&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '257', '2017-11-18 09:09:31', '257', '2017-11-20 09:37:57');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('270', '177', '导航网', '298', '20363', '20369', '导航网的建设项目信息数据库超过600万条，覆盖了大部分国家财政性投资项目和重大项目，涵盖了建筑行业，城市设施、农林水利、交通能源、冶金化工、机械、电力等建设领域。', '导航网的建设项目信息数据库超过600万条，覆盖了大部分国家财政性投资项目和重大项目，涵盖了建筑行业，城市设施、农林水利、交通能源、冶金化工、机械、电力等建设领域。', '&lt;p&gt;导航网的建设项目信息数据库超过600万条，覆盖了大部分国家财政性投资项目和重大项目，涵盖了建筑行业，城市设施、农林水利、交通能源、冶金化工、机械、电力等建设领域。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '194', '2017-11-18 09:30:32', '194', '2017-11-18 09:30:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('271', '168', '船舶废气处理SCR、EGR, EGC系统', '295', '20393', '20398', '	满足MARPOL公约附则Ⅵ的TIER Ⅲ排放标准以及船级社船用柴油机氮氧化物排放试验检验指南的要求，脱硝效率&ge;80%', '	满足MARPOL公约附则Ⅵ的TIER Ⅲ排放标准以及船级社船用柴油机氮氧化物排放试验检验指南的要求，脱硝效率&ge;80%\r\n	获得中国船级社颁发的首张中低速船用柴油机选择性催化还原（SCR）系统原理认可证书\r\n	获得MAN公司和WINGD公司授权，成为其船用主机SCR系统的配套供应商\r\n	采用逆流喷淋技术，脱硫效率&gt;98%\r\n	与托普索&mdash;&mdash;船舶废气脱硝专用催化剂厂家开展战略合作\r\n	申请专利22项，授权专利13项', '&lt;p&gt;&lt;strong&gt;船舶废气处理&lt;/strong&gt;&lt;strong&gt;SCR&lt;/strong&gt;&lt;strong&gt;、&lt;/strong&gt;&lt;strong&gt;EGR, EGC&lt;/strong&gt;&lt;strong&gt;系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;满足MARPOL公约附则Ⅵ的TIER Ⅲ排放标准以及船级社船用柴油机氮氧化物排放试验检验指南的要求，脱硝效率&amp;ge;80%&lt;/li&gt;\r\n	&lt;li&gt;获得中国船级社颁发的首张中低速船用柴油机选择性催化还原（SCR）系统原理认可证书&lt;/li&gt;\r\n	&lt;li&gt;获得MAN公司和WINGD公司授权，成为其船用主机SCR系统的配套供应商&lt;/li&gt;\r\n	&lt;li&gt;采用逆流喷淋技术，脱硫效率&amp;gt;98%&lt;/li&gt;\r\n	&lt;li&gt;与托普索&amp;mdash;&amp;mdash;船舶废气脱硝专用催化剂厂家开展战略合作&lt;/li&gt;\r\n	&lt;li&gt;申请专利22项，授权专利13项&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;SCR DeNOx, EGR WTS, EGC system&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Meet the TIER III requirements under Annex VI of the MARPOL Convention, as well as the Classification Society guidelines on emission testing and survey of nitrogen oxides (NOx) from marine diesel engines, high DeNOx efficiency &amp;ge; 80%&lt;/li&gt;\r\n	&lt;li&gt;Got the first Approval Certificate In Principle (AIP) for Marine Selective Catalytic Reduction (SCR) system on low-speed engine issued by China Classification Society (CCS)&lt;/li&gt;\r\n	&lt;li&gt;Authorized by MAN Diesel &amp;amp; Turbo, WinGD companies to be their supplier for SCR DeNOx system&lt;/li&gt;\r\n	&lt;li&gt;Advanced scrubber design technology, high DeSOx efficiency &amp;gt;98%&lt;/li&gt;\r\n	&lt;li&gt;Carried out the long-term strategic cooperation with HALDOR TOPSOE and adopts their special catalyst for reduction of NOx in diesel engine exhaust gas&lt;/li&gt;\r\n	&lt;li&gt;Applied for 22 patents in the fields of SCR &amp;amp; EGC, authorized 13 patents&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '20396', '1', '1', '1', '1', '0', '1', '290', '2017-11-18 10:10:53', '290', '2017-11-18 10:25:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('272', '168', 'BalClor&reg;船舶压载水管理系统', '295', '20416', '20418', 'BalClor&reg;船舶压载水管理系统', 'BalClor&reg;船舶压载水管理系统', '&lt;p&gt;&lt;strong&gt;BalClor&amp;reg;&lt;/strong&gt;&lt;strong&gt;船舶压载水管理系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;拥有完全自主知识产权的船舶关键配套设备&lt;/li&gt;\r\n	&lt;li&gt;中国首家通过国际海事组织最终认可&lt;/li&gt;\r\n	&lt;li&gt;亚洲首家、全球第四家获得美国海岸警卫队（USCG）型式认可证书&lt;/li&gt;\r\n	&lt;li&gt;拥有世界九大主流船级社认证的压载水管理系统&lt;/li&gt;\r\n	&lt;li&gt;主编首个国家标准CB/T 4399-2014《船舶压载水电解法处理系统设计与安装》。&lt;/li&gt;\r\n	&lt;li&gt;荣获国家战略性创新产品&lt;/li&gt;\r\n	&lt;li&gt;订单量稳居世界前三，尤其在大型船舶领域的装船量保持世界第一&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;BalClor&amp;reg; Ballast water management system&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Key Auxiliary Equipment on ship which owns complete independent property right&lt;/li&gt;\r\n	&lt;li&gt;First IMO Final Approval granted manufacturer in China&lt;/li&gt;\r\n	&lt;li&gt;First Asian, 4th of the global maker secures USCG type-approval&lt;/li&gt;\r\n	&lt;li&gt;DNV, CCS, LR, NK, BV, ABS, RINA Classification Societies type approval certified&lt;/li&gt;\r\n	&lt;li&gt;Public China&amp;#39;s first industry standard CB/T 4399-2014 &amp;ldquo;Design and installation of ballast water treatment system for ships using electrolytic method&amp;rdquo;.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Won &amp;ldquo;National Strategic Innovation Product&amp;rdquo;&lt;/li&gt;\r\n	&lt;li&gt;Market orders of BalClor&amp;reg; Ballast water management system occupied the top three in the world, especially the first rank of installation quantity on large ships&lt;/li&gt;\r\n&lt;/ul&gt;', '20402', '2', '1', '1', '1', '0', '1', '290', '2017-11-18 10:16:40', '290', '2017-11-18 10:26:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('273', '168', '海水淡化处理系统', '295', '20420', '20426', '海水淡化处理系统', '海水淡化处理系统', '&lt;p&gt;&lt;strong&gt;海水淡化处理系统&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;膜法海水淡化从设计、制造到安装调试、运行的全过程控制技术&lt;/li&gt;\r\n	&lt;li&gt;承接国内首个第三代核电项目三门核电站的海水淡化项目，当时国内单台产能最大&lt;/li&gt;\r\n	&lt;li&gt;印尼Awar电厂首个海水淡化项目，2013年成功制水&lt;/li&gt;\r\n	&lt;li&gt;成功开发具有自主核心技术的MED海水淡化系统，申请两项发明专利，已授权一项实用新型专利&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Seawater Desalination System&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Independent Design, manufacture, installation and engineering services of RO treatment technology&lt;/li&gt;\r\n	&lt;li&gt;Successfully installed RO Seawater Desalination in Sanmen nuclear power station, which was the biggest capacity RO treatment project in China that year&lt;/li&gt;\r\n	&lt;li&gt;&amp;nbsp;First project in Awar-awar power station in Indonesia, and produced fresh water successfully in 2013&lt;/li&gt;\r\n	&lt;li&gt;Successfully developed independent core MED seawater desalination technology, two invention patents &amp;amp; one model patent authorized&lt;/li&gt;\r\n&lt;/ul&gt;', '20419', '3', '0', '1', '1', '0', '1', '290', '2017-11-18 10:20:35', '290', '2017-11-18 10:20:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('274', '158', 'BINGO-UH35 无人直升机', '310', '20433', '20439', '该系统可根据实际应用场景搭载不同的载荷，并定制开发环境感知和交互的软硬件。具有载重量大、控制范围广、滞空时间长、飞行高度高的特点，能够到达人员无法到达的任何地点进行视频和图像的实时传输并进行存储。', 'BINGO-UH35无人直升机系统是款为客户定制的、经过长期稳定可靠作业验证的无人机系统。', '&lt;p&gt;BINGO-UH35无人直升机系统是款为客户定制的、经过长期稳定可靠作业验证的无人机系统。该系统可根据实际应用场景搭载不同的载荷，并定制开发环境感知和交互的软硬件。具有载重量大、控制范围广、滞空时间长、飞行高度高的特点，能够到达人员无法到达的任何地点进行视频和图像的实时传输并进行存储。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '277', '2017-11-18 10:21:07', '277', '2017-11-18 10:21:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('275', '125', '索具配件卸扣滑车链条', '311', '20441', '21076', '无', '品牌代理： \r\n台湾TIGER葫芦 \r\n德国YALE葫芦 \r\n英国BRIDON BRILUBE 70钢丝绳油脂 \r\n奥地利PEWAG高强度起重链条、发电厂专用捞渣系统链条 \r\n台湾YOKE起重配件（吊环、吊点、卸扣、绳套、滑轮、滑车） \r\n美国CROSBY起重配件（吊钩、卸扣、钢丝绳套、链条、滑车） \r\n英国BRIDON钢丝绳（工业起重、船舶吊机、锚机、矿业领域） \r\n西班牙SFE-犀飞力钢丝绳（工业起重、船舶吊机、锚机、矿业领域） \r\n意大利REDAELLI钢丝绳（工业起重、船舶吊机、锚机、矿业领域）', '&lt;p&gt;&lt;strong&gt;品牌代理：&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;台湾TIGER葫芦&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;德国YALE葫芦&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;英国BRIDON BRILUBE 70钢丝绳油脂&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;奥地利PEWAG高强度起重链条、发电厂专用捞渣系统链条&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;台湾YOKE起重配件（吊环、吊点、卸扣、绳套、滑轮、滑车）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;美国CROSBY起重配件（吊钩、卸扣、钢丝绳套、链条、滑车）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;英国BRIDON钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;西班牙SFE-犀飞力钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;意大利REDAELLI钢丝绳（工业起重、船舶吊机、锚机、矿业领域）&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118102415_215.png&quot; style=&quot;height:861px; width:665px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118102429_422.png&quot; style=&quot;height:686px; width:887px&quot; /&gt;&lt;/p&gt;', '21075', '1', '0', '1', '1', '0', '1', '193', '2017-11-18 10:24:52', '193', '2017-11-18 19:31:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('276', '168', '怡口ECLOR TM现场制备次氯酸钠发生系统', '295', '20444', '20449', '设备使用寿命大于40年，充足的备件库存，8小时售后服务响应', '怡口ECLOR TM现场制备次氯酸钠发生系统（饮用水消毒领域）', '&lt;p&gt;&lt;strong&gt;怡口&lt;/strong&gt;&lt;strong&gt;ECLOR TM&lt;/strong&gt;&lt;strong&gt;现场制备次氯酸钠发生系统（饮用水消毒领域）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;恒温一次电解，电解效率高&lt;/li&gt;\r\n	&lt;li&gt;盐耗、电耗低，能效高&lt;/li&gt;\r\n	&lt;li&gt;转化效率高，无氯气泄漏，网络远程监控，安全可靠&lt;/li&gt;\r\n	&lt;li&gt;设备使用寿命大于40年，充足的备件库存，8小时售后服务响应&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;ECLOR TM On-Site Sodium Hypochlorite Generation System (Disinfection of Drinking Water)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Advanced technology and advantages of constant temperature electrolysis technology&lt;/li&gt;\r\n	&lt;li&gt;Low power, low salt consumption, high concentration degree&lt;/li&gt;\r\n	&lt;li&gt;Remote network monitoring control, high conversion efficiency, no chlorine leakage&lt;/li&gt;\r\n	&lt;li&gt;Long service life, sufficient inventory of spare parts, after service response with 8 hours&lt;/li&gt;\r\n&lt;/ul&gt;', '20448', '4', '0', '1', '1', '0', '1', '290', '2017-11-18 10:25:23', '290', '2017-11-18 10:25:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('277', '178', 'Echo Queen宽带变频多波束测深仪', '309', '20451', '20457', '&Oslash;  170 kHz &ndash; 450 kHz可变工作频率\r\n&Oslash;  波束宽度 0.45&deg;*  0.9&deg;\r\n&Oslash;  扇区开角 10&deg;-160&deg;\r\n&Oslash;  量程 500m\r\n&Oslash;  重量轻、体积小、功耗低', 'Echo Queen是基于最新多波束测深技术发展成果精心打造而成的国产化多波束测深仪。', '&lt;p&gt;Echo Queen是基于最新多波束技术发展成果精心打造而成的国产化多波束测深仪，是世界上分辨率最高的浅水多波束测深仪之一。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;Echo Queen具有在线连续调频的能力，用户可以在170~450kHz范围内实时在线选择20多种工作频率，使用户在权衡分辨率与量程之间的关系和控制现有声学系统的干扰等方面具有前所未有的灵活性。&lt;/p&gt;', '20455', '9', '1', '1', '1', '0', '1', '282', '2017-11-18 10:28:23', '282', '2017-11-18 10:54:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('278', '178', '倒置式回声仪（IES）', '313', '20462', '20464', '6000米水深压力等级17英寸(43cm) 直径玻璃球仪器封装\r\n6000米水深压力等级12KHz深水换能器\r\n8GB工业级数据存储卡\r\n熔断式声学释放器\r\n独立声学释放电路及电池\r\n高精度系统时钟', '倒置式回声仪(IES)是一种海洋坐底观测仪器，可测量声波从海底发射经由水面反射再到海底接收的垂向声波往返传播时间（VATT），可安装压力传感器组成压力倒置式回声仪（PIES），亦可同时安装压力传感器和流速传感器组成流速/压力倒置式回声仪（CPIES）。', '&lt;p&gt;倒置式回声仪(IES)是一种海洋坐底观测仪器，可测量声波从海底发射经由水面反射再到海底接收的垂向声波往返传播时间（VATT），可安装压力传感器组成压力倒置式回声仪（PIES），亦可同时安装压力传感器和流速传感器组成流速/压力倒置式回声仪（CPIES）。该仪器在主温跃层深度及其相关参数的观测、海洋动力参数剖面的反演、内波和内潮的观测等应用方面取得了较广泛的应用。&lt;/p&gt;', '20459', '8', '1', '1', '1', '0', '1', '282', '2017-11-18 10:35:22', '282', '2017-11-18 10:54:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('279', '168', '生活污水处理装置', '295', '20458', '20466', '生活污水处理技术', '生活污水处理技术', '&lt;p&gt;1.独特的电解流技术，消毒杀菌效率可达100%。&lt;/p&gt;\r\n\r\n&lt;p&gt;2.体积小，无需外加消毒剂。&lt;/p&gt;\r\n\r\n&lt;p&gt;3.可以应用于海洋平台、FPSO船、远洋船舶、海岸设施。&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '290', '2017-11-18 10:35:55', '290', '2017-11-18 10:35:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('280', '178', '海测大师2017', '314', '20468', '20471', '&Oslash;  集作业规划、调查导航、采集记录、实时处理与结果展示等功能于一体；\r\n&Oslash;  自主研发、中文界面、操作简便、效果直观；\r\n&Oslash;  支持按需开发、功能与接口定制。', '海测大师2016是一套完全自主研发的水道与海洋测绘调查软件，具备水道与海洋测绘调查现场作业所需的作业规划、调查导航。', '&lt;p&gt;海测大师2017是一套完全自主研发的水道与海洋测绘调查软件，具备水道与海洋测绘调查现场作业所需的作业规划、调查导航，采集记录、实时处理、质量监控、结果展示与分析等各种实用功能，并将逐步发展成为广泛支持河道管理、水道测量、地形测绘、磁力调查、地质勘探、水下建造、海底布缆、港口安防、水下平台维护、USV/ROV/AUV作业支持等应用的完整解决方案。&lt;/p&gt;', '20470', '7', '1', '1', '1', '0', '1', '282', '2017-11-18 10:41:01', '282', '2017-11-18 10:54:22');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('281', '178', '单点三维声学海流计', '315', '20478', '20480', '量程\r\n0-600cm/s\r\n精度\r\n读数1%+0.5cm/s\r\n分辨力\r\n0.01 cm/s\r\n采样率\r\n1~10Hz\r\n采样模式\r\n连续、间隔、延时启动\r\n流速矢量平均时间间隔\r\n1s至1h可选', '海星TM单点三维声学海流计配备四个声学换能器，采用高精度、高稳定性的直达波相位测量法，对水体进行高精度的三维流速测量。', '&lt;p&gt;海星TM单点三维声学海流计配备四个声学换能器，采用高精度、高稳定性的直达波相位测量法，对水体进行高精度的三维流速测量。测量方法不依赖水体悬浮颗粒物后向声学反射信号，在洁净的水域依然能有效开展测量。采用超低功耗设计，可长时间值班测量。体积小，重量轻，便于安装和维护，非常适合于搭载于锚系观测链。&lt;/p&gt;', '20472', '5', '0', '1', '1', '0', '1', '282', '2017-11-18 10:46:28', '282', '2017-11-18 10:46:28');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('282', '155', '维萨拉AWS430自动气象站', '299', '20460', '20483', '1.AWS430 是专为港口、船舶及海上平台等海洋环境应用而设计的自动气象站。2.功能/优点3.专为关键海洋气象应用设计4.符号劳氏船级社和IEC60945规范要求的高质量耐腐设计和EMC 特性5.数据可用性高6.内置测试程序及数据验证功能7.可针对多个传感器的精确真风计算8.满足NMEA 0183和IEC 1162-1 的数据通讯要求9.遵循CAP437规范的要求', '专为满足极限应用需求而设计的维萨拉AWS430 自动气象站', '&lt;p&gt;专为满足极限应用需求而设计的维萨拉AWS430 自动气象站，1.AWS430 是专为港口、船舶及海上平台等海洋环境应用而设计的自动气象站。2.功能/优点3.专为关键海洋气象应用设计4.符号劳氏船级社和IEC60945规范要求的高质量耐腐设计和EMC 特性5.数据可用性高6.内置测试程序及数据验证功能7.可针对多个传感器的精确真风计算8.满足NMEA 0183和IEC 1162-1 的数据通讯要求9.遵循CAP437规范的要求&lt;/p&gt;', '20481', '1', '0', '1', '1', '0', '1', '277', '2017-11-18 10:48:44', '277', '2017-11-18 10:48:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('283', '178', '剑鱼1020D侧扫声呐', '316', '20485', '20487', '工作频率\r\n100kHz，400 kHz（同时）\r\n脉冲类型\r\nChirp 或 CW\r\n量程\r\n600m@100kHz（单侧）\r\n150m@400kHz（单侧）\r\n水平波束宽度\r\n0.85&deg;@100kHz\r\n0.3&deg;@400kHz\r\n垂直波束宽度\r\n60&deg;\r\n俯仰角\r\n20&deg;\r\n垂直航迹分辨率\r\n8cm@100kHz\r\n2cm@400kHz\r\n标配传感器\r\n艏向、横摇、纵摇\r\n选配传感器\r\n深度计\r\n串口输入外部传感器\r\n2个RS-232接口，可集成磁力仪等外部传感器；\r\n12V或24VDC供电', '剑鱼1020D侧扫声呐系统是一款现代数字线性调频拖曳式侧扫声呐，由全球首台Chirp技术侧扫声呐系统总设计师John Baker亲自操刀。', '&lt;p&gt;剑鱼1020D侧扫声呐系统是一款现代数字线性调频拖曳式侧扫声呐，由全球首台Chirp技术侧扫声呐系统总设计师John Baker亲自操刀，结合最新技术发展成果，专为边界电子精心研发设计的。剑鱼1020D集成了FSI的CHIRPceiverTM&amp;nbsp;24bit CHIRP信号处理器以及100/400KHz双频同步扫测等先进技术来保证卓越的成像能力。大量程、高分辨率成像、2000米水深耐压等级使得剑鱼1020D成为多种中浅水测量应用的理想工具。&lt;/p&gt;', '20484', '4', '0', '1', '1', '0', '1', '282', '2017-11-18 10:50:37', '282', '2017-11-18 10:50:37');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('284', '178', 'SSC-4/8 同步控制器', '317', '20490', '20492', '输出通道数量\r\n8\r\n时标数量\r\n1或2           *(1)\r\n同步模式\r\n1&times;8或2&times;4\r\n时间分辨率\r\n10us或100us\r\n定时范围\r\n30us～42949.67295s(10us 分辨率)\r\n300us～429496.7295s (100us 分辨率)\r\n时基精度\r\n&lt;5ppm', '同步控制器可输出多路同步信号，为其他电子仪器的工作提供同步触发信号，同步信号的输出可由仪器内部时钟或者外部触发信号控制。', '&lt;p&gt;&amp;nbsp;同步控制器可输出多路同步信号，为其他电子仪器的工作提供同步触发信号，同步信号的输出可由仪器内部时钟或者外部触发信号控制。多路同步信号的设置简单灵活，可灵活控制多台电子仪器协同工作，例如控制多台发射设备分时工作以避免相互干扰或控制多台采集设备同时采集。具有10us级的定时精度，主要面向中低时间精度应用领域（例如海洋调查、地球物理勘探、自动化控制等领域）提供有竞争力的同步控制产品。&lt;/p&gt;', '20489', '3', '0', '1', '1', '0', '1', '282', '2017-11-18 10:54:01', '282', '2017-11-18 10:54:01');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('285', '155', 'PWD20', '300', '20507', '20511', '特点：▪ 精确测量能见度▪ 结构紧凑，重量轻▪ 便于安装维萨拉能见度传感器PWD20的测量范围为10...20,000米，能够为港口、沿海地区、直升机停机坪、风力发电等各种应用提供能见度测量。', 'PWD10, PWD12, PWD20 和 PWD22天气现象与能见度传感器维萨拉PWD系列天气现象和能见度传感器为您提供精确和可靠的实时测量，能够满足您的不同应用需求。', '&lt;p&gt;PWD10, PWD12, PWD20 和 PWD22天气现象与能见度传感器维萨拉PWD系列天气现象和能见度传感器为您提供精确和可靠的实时测量，能够满足您的不同应用需求。特点：▪ 精确测量能见度▪ 结构紧凑，重量轻▪ 便于安装维萨拉能见度传感器PWD20的测量范围为10...20,000米，能够为港口、沿海地区、直升机停机坪、风力发电等各种应用提供能见度测量。&lt;/p&gt;', '20503', '2', '0', '1', '1', '0', '1', '277', '2017-11-18 11:18:48', '277', '2017-11-18 11:18:48');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('286', '155', 'WXT530', '301', '20514', '20516', '▪ 适用的参数组合▪ 方便使用和集成▪ 气象参数集成器▪ 可添加模拟传感器▪ 体积小、重量轻▪ 功耗低▪ 电流输出适合工业应用▪ 高性价比', '维萨拉气象变送器WXT530是一款独特的系列传感器，将各种参数组\r\n合应用，方便您针对自己的需求进行合适的选择。灵活的模块化设\r\n计是WXT530系列的基本特征，适合于各种气象应用领域。WXT530系\r\n列能帮助您更好地掌握气象状况。', '&lt;p&gt;维萨拉气象变送器WXT530是一款独特的系列传感器，将各种参数组&lt;/p&gt;\r\n\r\n&lt;p&gt;合应用，方便您针对自己的需求进行合适的选择。灵活的模块化设&lt;/p&gt;\r\n\r\n&lt;p&gt;计是WXT530系列的基本特征，适合于各种气象应用领域。WXT530系&lt;/p&gt;\r\n\r\n&lt;p&gt;列能帮助您更好地掌握气象状况。▪ 适用的参数组合▪ 方便使用和集成▪ 气象参数集成器▪ 可添加模拟传感器▪ 体积小、重量轻▪ 功耗低▪ 电流输出适合工业应用▪ 高性价比&lt;/p&gt;', '20512', '3', '0', '1', '1', '0', '1', '277', '2017-11-18 11:22:43', '277', '2017-11-18 11:22:43');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('287', '155', 'CL 31', '302', '20517', '20521', '性能：▪ 测距0-7.5km(0-25000英尺)▪ 模块化设计,易于安装与维护。▪ 第二代高级单镜头光学部件，在低空探测中同样性能出色▪ 快速测量功能可确保探测到厚云团底下的薄云层。▪ 在所有天气条件下运行可靠,降水时垂直能见度和测云性能无与伦比。▪ 来自世界领先制造商的最新技术,以5000多个安装于世界各地的维萨拉云高仪为基础。▪ 丰富的自我诊断程序,具备故障分析能力。', '维萨拉C L 31云高仪是一种结构紧凑、重量轻巧的仪器，可以测量云底高度和垂直能见度，可同时监测三个云层。该云高仪采用了脉冲二极管激光LIDAR（激光探测和测距）技术，是适用于航空和气象应用的理想测量仪器。', '&lt;p&gt;维萨拉C L 31云高仪是一种结构紧凑、重量轻巧的仪器，可以测量云底高度和垂直能见度，可同时监测三个云层。该云高仪采用了脉冲二极管激光LIDAR（激光探测和测距）技术，是适用于航空和气象应用的理想测量仪器。性能：▪ 测距0-7.5km(0-25000英尺)▪ 模块化设计,易于安装与维护。▪ 第二代高级单镜头光学部件，在低空探测中同样性能出色▪ 快速测量功能可确保探测到厚云团底下的薄云层。▪ 在所有天气条件下运行可靠,降水时垂直能见度和测云性能无与伦比。▪ 来自世界领先制造商的最新技术,以5000多个安装于世界各地的维萨拉云高仪为基础。▪ 丰富的自我诊断程序,具备故障分析能力。&lt;/p&gt;', '20520', '4', '0', '1', '1', '0', '1', '277', '2017-11-18 11:27:11', '277', '2017-11-18 11:27:11');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('288', '153', '企业介绍', '322', '20528', '20531', '青岛智慧云图信息科技有限公司是专业从事空间数据处理与建库，遥感影像处理，电子地图制作、地理信息系统研发及智慧城市+大数据应用服务的软件企业。', '青岛智慧云图信息科技有限公司是专业从事空间数据处理与建库，遥感影像处理，电子地图制作、地理信息系统研发及智慧城市+大数据应用服务的软件企业。', '&lt;p&gt;青岛智慧云图信息科技有限公司是专业从事空间数据处理与建库，遥感影像处理，电子地图制作、地理信息系统研发及智慧城市+大数据应用服务的软件企业。&lt;/p&gt;', '20529', '6', '0', '1', '1', '0', '1', '268', '2017-11-18 11:49:03', '268', '2017-11-18 11:49:03');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('289', '153', '业务介绍', '323', '20532', '20535', '业务板块详细介绍', '业务板块详细介绍', '&lt;p&gt;业务板块详细介绍&lt;/p&gt;', '20534', '5', '0', '1', '1', '0', '1', '268', '2017-11-18 11:51:41', '268', '2017-11-18 11:51:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('290', '155', 'CL51', '303', '20540', '20542', '特点：▪云探测距离高达13公里(43000英尺)▪ 后向散射廓线覆盖全程高达1 5公里▪ 第二代高级单镜头光学部件,在低空探测中同样性能出能▪ 实践验证,可在所有天气条件下24/7自动运行▪ 模块化设计,易于安装和维护▪ 丰富的自我诊断程序,具备故障分析能力▪ 可靠运行于所有天气条件：在降水条件下的性能无与伦比▪ 以坚实、低廉的激光二极管技术为基础▪ 探测卷云▪ 来自世界领先制造商的最新技术,以5000多个安装于世界各地的维萨拉云高仪为基础。', '维萨拉CL51云高仪能够透过低空和中空云层测量高空卷云, 或不良天气状况下的垂直能见度。CL 51 采用脉冲二极管激光L I D A R(激光探测和测距)技术,沿着垂直或近乎垂直的方向发射短促、强大的激光脉冲。因云层、降水或其他光线遮拉物所产生的激光反射( 后向散射)可被用来分析和确定云底的高度。', '&lt;p&gt;维萨拉CL51云高仪能够透过低空和中空云层测量高空卷云, 或不良天气状况下的垂直能见度。CL 51 采用脉冲二极管激光L I D A R(激光探测和测距)技术,沿着垂直或近乎垂直的方向发射短促、强大的激光脉冲。因云层、降水或其他光线遮拉物所产生的激光反射( 后向散射)可被用来分析和确定云底的高度。特点：▪云探测距离高达13公里(43000英尺)▪ 后向散射廓线覆盖全程高达1 5公里▪ 第二代高级单镜头光学部件,在低空探测中同样性能出能▪ 实践验证,可在所有天气条件下24/7自动运行▪ 模块化设计,易于安装和维护▪ 丰富的自我诊断程序,具备故障分析能力▪ 可靠运行于所有天气条件：在降水条件下的性能无与伦比▪ 以坚实、低廉的激光二极管技术为基础▪ 探测卷云▪ 来自世界领先制造商的最新技术,以5000多个安装于世界各地的维萨拉云高仪为基础。&lt;/p&gt;', '20538', '5', '0', '1', '1', '0', '1', '277', '2017-11-18 12:03:10', '277', '2017-11-18 12:03:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('291', '155', 'HMP155', '304', '20545', '20547', '特点：▪ 维萨拉HUMICAP&reg;180R传感器卓越的长期稳定性▪ 可选的加热湿度探头和化学物清除功能▪ 即插即用▪ 化学物清除功能▪ 维修用USB 接口▪ 配有DTR13和DTR503防辐射罩和百叶箱▪ 气象防护外壳，IP66 防护等级▪ 可选的快速温度探头\r\n▪ 不同的输出选项：电压、RS485、电阻Pt100▪ 应用：专业气象、航空、道路天气、仪表设备等等', 'HMP155 温湿度探头维萨拉H U MICA P &reg;温湿度探头H M P155测量温湿度更加可靠。专为室外应用需求特别设计。', '&lt;p&gt;HMP155 温湿度探头维萨拉H U MICA P &amp;reg;温湿度探头H M P155测量温湿度更加可靠。专为室外应用需求特别设计。特点：▪ 维萨拉HUMICAP&amp;reg;180R传感器卓越的长期稳定性▪ 可选的加热湿度探头和化学物清除功能▪ 即插即用▪ 化学物清除功能▪ 维修用USB 接口▪ 配有DTR13和DTR503防辐射罩和百叶箱▪ 气象防护外壳，IP66 防护等级▪ 可选的快速温度探头&lt;br /&gt;\r\n▪ 不同的输出选项：电压、RS485、电阻Pt100▪ 应用：专业气象、航空、道路天气、仪表设备等等&lt;/p&gt;', '20543', '6', '0', '1', '1', '0', '1', '277', '2017-11-18 12:06:46', '277', '2017-11-18 12:06:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('292', '155', 'PTB110', '305', '20551', '20556', '特点：1.长期稳定性2.带外触发器的开启/关闭控制功能3.输出电压^&hellip;&hellip;52.5或0&hellip;&hellip;5VDC4.电流消耗小于4mA5.可安装在DIN 轨条上（35mm宽）6.可溯源至NIST(含校验证书)', '工业级PTB110气压计，维萨拉BAROCAP&reg;气压计PTB110既可以用于室温下的精确大气压测量，也可以用于温度测量范围更宽的一般环境压力监测。', '&lt;p&gt;工业级PTB110气压计，维萨拉BAROCAP&amp;reg;气压计PTB110既可以用于室温下的精确大气压测量，也可以用于温度测量范围更宽的一般环境压力监测。特点：1.长期稳定性2.带外触发器的开启/关闭控制功能3.输出电压^&amp;hellip;&amp;hellip;52.5或0&amp;hellip;&amp;hellip;5VDC4.电流消耗小于4mA5.可安装在DIN 轨条上（35mm宽）6.可溯源至NIST(含校验证书)&lt;/p&gt;', '20549', '7', '0', '1', '1', '0', '1', '277', '2017-11-18 12:09:59', '277', '2017-11-18 12:09:59');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('293', '157', '磷虾油微囊粉', '318', '20539', '20565', '酸价：标准：&le;3.0  过氧化值&le;0.25  水分&le;5.0  总脂肪: &ge;20.0', '南极磷虾油微囊粉\r\n南极磷虾油微囊粉采用微囊包埋技术特制，将南极磷虾油活性物质的形态由液态到固态。&nbsp; &nbsp;', '&lt;p&gt;&lt;strong&gt;南极磷虾油&lt;/strong&gt;&lt;strong&gt;微囊粉&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;南极磷虾油微囊粉采用微囊包埋技术特制，将南极磷虾油活性物质的形态由液态到固态。&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;产品优势：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;良好的水溶解性&lt;/li&gt;\r\n	&lt;li&gt;味道和气味适中&lt;/li&gt;\r\n	&lt;li&gt;营养性高，符合欧米伽3（EPA, DHA）、虾青素等亲和性好，营养元素可以很好的被身体吸收&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;应用领域：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;药品、食品、保健品。例如，固体饮料、压片糖果、液态食品的营养强化等。&lt;/li&gt;\r\n&lt;/ol&gt;', '20559', '3', '0', '1', '1', '0', '1', '279', '2017-11-18 12:10:42', '279', '2017-11-18 12:13:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('294', '155', 'PTB210', '306', '20562', '20564', '特点：1.串行输出压力量程为500&hellip;&hellip;1100hPa或50&hellip;&hellip;1100hPa2.模拟输出为500&hellip;&hellip;1100hPa之间的不同量程3.电子器件外壳可提供IP65 保护、防水溅4.精确稳定的测量5.可溯源至NIST（包括校准证书）', 'PTB210 数字气压计，维萨拉BAROCAP PTB210数字气压计是一款能耐受恶劣环境、户外使用的可靠气压计。', '&lt;p&gt;PTB210 数字气压计，维萨拉BAROCAP PTB210数字气压计是一款能耐受恶劣环境、户外使用的可靠气压计。特点：1.串行输出压力量程为500&amp;hellip;&amp;hellip;1100hPa或50&amp;hellip;&amp;hellip;1100hPa2.模拟输出为500&amp;hellip;&amp;hellip;1100hPa之间的不同量程3.电子器件外壳可提供IP65 保护、防水溅4.精确稳定的测量5.可溯源至NIST（包括校准证书）&lt;/p&gt;', '20561', '8', '0', '1', '1', '0', '1', '277', '2017-11-18 12:12:26', '277', '2017-11-18 12:12:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('295', '155', 'PTB330', '307', '20567', '20571', '特点：▪ 维萨拉BAROCAP&reg;传感器▪ 精确测量▪ 出色的长期稳定性▪ 通过冗余设计提高可靠性▪ 带有1年历史数据的图形趋势显器▪ 高度与海拔修正压力(QFE，QNH)▪ 用于专业气象、航空、实验室以及苛刻的工业应用领域', '用于专业气象、航空与工业用户的PTB330数字式气压计维萨拉BAROCAP&reg;数字式气压计PTB330是新一代气压计，专门用于各种高端大气压力测量。PTB330基于维萨拉自行开发的硅电容绝对压传感器-维萨拉BAROCAP&reg; &reg;传感器来进行压力测量。它具有很高的测量准确度和出色的长期稳定性。', '&lt;p&gt;用于专业气象、航空与工业用户的PTB330数字式气压计维萨拉BAROCAP&amp;reg;数字式气压计PTB330是新一代气压计，专门用于各种高端大气压力测量。PTB330基于维萨拉自行开发的硅电容绝对压传感器-维萨拉BAROCAP&amp;reg; &amp;reg;传感器来进行压力测量。它具有很高的测量准确度和出色的长期稳定性。特点：▪ 维萨拉BAROCAP&amp;reg;传感器▪ 精确测量▪ 出色的长期稳定性▪ 通过冗余设计提高可靠性▪ 带有1年历史数据的图形趋势显器▪ 高度与海拔修正压力(QFE，QNH)▪ 用于专业气象、航空、实验室以及苛刻的工业应用领域&lt;/p&gt;', '20570', '9', '0', '1', '1', '0', '1', '253', '2017-11-18 12:16:13', '253', '2017-11-18 12:16:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('296', '159', '高精度多波束测深仪', '324', '20569', '20574', '覆盖范围	7-210&deg;\r\n分辨率	&lt; 20mm@200kHz，&lt; 10mm@400kHz\r\n波束个数	256-512  等距&amp;等角模式\r\n工作频率	160kHz-400kHz\r\n数据更新率	50Hz最大\r\n有效波束	1.8&deg;x1.8&deg;@200kHz，0.9&deg;x0.9&deg;@400kHz\r\n	（其他型号可选0.5&deg;x0.5&deg;@700kHz ）\r\n姿态精度	0.03&deg;Heading，0.02&deg;Pitch/Roll，5cm Heave\r\n重量	11kg（空气中），7kg（水中）\r\n数据接口	以太网\r\n功率	60w', 'Norbit采用最先进的数字信号处理技术和先进的换能器设计理念，生产出WBMS系列多波束测深仪；该系列多波束尺寸小，信号频带宽，覆盖角度非常大，可以达到210&deg;的波束覆盖，并且具有极高的测量精度；集成Applanix WaveMaster惯导和定位系统，保证了回波信号的质量和速度；同时具有横摇姿态补偿、侧扫模式、水体测量、反散射等功能，是非常理想的水道测量及海洋科考的测深仪。', '&lt;p&gt;Norbit采用最先进的数字信号处理技术和先进的换能器设计理念，生产出WBMS系列多波束测深仪；该系列多波束尺寸小，信号频带宽，覆盖角度非常大，可以达到210&amp;deg;的波束覆盖，并且具有极高的测量精度；集成Applanix WaveMaster惯导和定位系统，保证了回波信号的质量和速度；同时具有横摇姿态补偿、侧扫模式、水体测量、反散射等功能，是非常理想的水道测量及海洋科考的测深仪。&lt;/p&gt;', '20566', '9', '1', '1', '1', '0', '1', '274', '2017-11-18 12:17:18', '274', '2017-11-18 12:41:29');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('297', '155', 'WMT700', '308', '20580', '20582', '特点：1.数据输出最小间隔0.25秒2.自诊断及验证3.不锈钢结构4.免维护6.测量范围达到75米/秒5.加热功率可达到150W7.最大3600秒平均值计算8.数据格式输出：极坐标和向量9.对温度，湿度和气压影响的完全补偿10.超大探头可提供高超声功率11.可倒置安装', 'WMT700 WINDCAP 超声风速风向传感器维萨拉WINDCAP超声风速风向传感器WMT700系列是一种坚固耐用，性能可靠的超声风速风向传感器。', '&lt;p&gt;WMT700 WINDCAP 超声风速风向传感器维萨拉WINDCAP超声风速风向传感器WMT700系列是一种坚固耐用，性能可靠的超声风速风向传感器。特点：1.数据输出最小间隔0.25秒2.自诊断及验证3.不锈钢结构4.免维护6.测量范围达到75米/秒5.加热功率可达到150W7.最大3600秒平均值计算8.数据格式输出：极坐标和向量9.对温度，湿度和气压影响的完全补偿10.超大探头可提供高超声功率11.可倒置安装&lt;/p&gt;', '20579', '10', '0', '1', '1', '0', '1', '253', '2017-11-18 12:19:43', '253', '2017-11-18 12:19:43');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('298', '137', '水下机器人AUV', '327', '20583', '20587', '技术参数：1.外径：160MM2.长度：1.7M3.材料：6065铝合金4.重量（空气中）：35KG  5.最大工作深度：100M  6.能源：自带能源1.0KWH  7.续航力：8小时8.速度：3节（巡航速度），5节（最高航速）9.通信：声学通信，北斗/GPS，WiFi，铱星，无线电台10.导航：可配置超短基线定位，惯性导航，GPS，声学多普勒，前视声呐等，具备SLAM能力。11.可搭载传感器：CTD，侧扫12.声呐，ADCP，水下摄像头，PH和溶解氧传感器等13.软件：基于TCP-IP协议软件，可为用户提供二次编程接口', '自主式水下航行器(AUTONOMOUS UNDERWATERV EHICLE，AUV)是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自动监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。青岛世纪领航科技有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&ldquo;领航&rdquo;系列AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。', '&lt;p&gt;自主式水下航行器(AUTONOMOUS UNDERWATERV EHICLE，AUV)是一种具有智能性，自主性，灵活性的高端海洋仪器装备，可在海洋生态与动力环境自动监测，应急搜救，资源勘测等领域大展身手。另外，在情报侦测，探雷排雷和军事支援等方面也发挥关键作用，被视为现代海军力量的倍增器。青岛世纪领航科技有限公司与中国海洋大学水下机器人实验室长期开展AUV系统的研发工作，所研制的&amp;ldquo;领航&amp;rdquo;系列AUV，具有航程大，速度快，模块化，可靠性高，布放回收方便等特点。&lt;strong&gt;应用（Applications）:&lt;/strong&gt;海洋科学调查、海底探测（Hydrographic Surveys）港口安防监测（Harbor Security Operations）海洋或水域环境监测（Environment Monitoring ）水下搜救（Search and Salvage Operations）水产养殖渔业应用（Fishery Operations）海军应用部署（扫雷、情报侦测、智能火力投送等）(Military Application)技术参数：1.外径：160MM2.长度：1.7M3.材料：6065铝合金4.重量（空气中）：35KG &amp;nbsp;5.最大工作深度：100M &amp;nbsp;6.能源：自带能源1.0KWH &amp;nbsp;7.续航力：8小时8.速度：3节（巡航速度），5节（最高航速）9.通信：声学通信，北斗/GPS，WiFi，铱星，无线电台10.导航：可配置超短基线定位，惯性导航，GPS，声学多普勒，前视声呐等，具备SLAM能力。11.可搭载传感器：CTD，侧扫12.声呐，ADCP，水下摄像头，PH和溶解氧传感器等13.软件：基于TCP-IP协议软件，可为用户提供二次编程接口&lt;/p&gt;', '20586', '1', '0', '1', '1', '0', '1', '241', '2017-11-18 12:28:58', '241', '2017-11-18 12:28:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('299', '137', 'SeaPROFILER', '328', '20588', '20591', '产品特点:1.多功能的配置-三维流速剖面和底跟踪、水跟踪的速度测量；2.用户可编程的声波传输技术包括:宽带、窄带、脉冲相干技术；3.有磁罗盘、倾斜传感器、温度传感器(压力传感器可选装) ；4.反射强度、误差速度和深度的测量数据都可以反映在每组数据中。产品应用范围:1.外接电池包可以使仪器实现在自容模式下工作2.可选压力传感器探索者;3.多功能传感器头可实现不同测量范围的扩展。', 'RTI公司的探索者( SeaPROFILER)系列一&mdash;直读式ADCP,代表行业最先进的声学多普勒技术,其紧凑的外形、强大的电子性能和稳定的信号处理技术提供了一个多功能平台,能够在不同深度范围内实现底跟踪速度和流速剖面的精确的测量。该系列产品由核心、通用电子部件灵活组合。这种多样化的功能组合,让客户用最低的成本获得高性能的仪器,以满足不同的海洋、河流应用需求。探索者系列(SeaPROFILER)非常适合应用于实时流速剖面测量,例如沿海监测,可以进行底部固定安装或浮标安装,使用电缆连接实现实时通讯和系统供电。探索者系列(SeaPROFILER)的底跟踪功能使仪器同样适用于安装在测船上进行走航测量。', '&lt;p&gt;RTI公司的探索者( SeaPROFILER)系列一&amp;mdash;直读式ADCP,代表行业最先进的声学多普勒技术,其紧凑的外形、强大的电子性能和稳定的信号处理技术提供了一个多功能平台,能够在不同深度范围内实现底跟踪速度和流速剖面的精确的测量。该系列产品由核心、通用电子部件灵活组合。这种多样化的功能组合,让客户用最低的成本获得高性能的仪器,以满足不同的海洋、河流应用需求。探索者系列(SeaPROFILER)非常适合应用于实时流速剖面测量,例如沿海监测,可以进行底部固定安装或浮标安装,使用电缆连接实现实时通讯和系统供电。探索者系列(SeaPROFILER)的底跟踪功能使仪器同样适用于安装在测船上进行走航测量。产品特点:1.多功能的配置-三维流速剖面和底跟踪、水跟踪的速度测量；2.用户可编程的声波传输技术包括:宽带、窄带、脉冲相干技术；3.有磁罗盘、倾斜传感器、温度传感器(压力传感器可选装) ；4.反射强度、误差速度和深度的测量数据都可以反映在每组数据中。产品应用范围:1.外接电池包可以使仪器实现在自容模式下工作2.可选压力传感器探索者;3.多功能传感器头可实现不同测量范围的扩展。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118123146_481.png&quot; style=&quot;height:875px; width:596px&quot; /&gt;&lt;/p&gt;', '20590', '2', '0', '1', '1', '0', '1', '241', '2017-11-18 12:32:41', '241', '2017-11-18 12:32:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('300', '157', '南极磷虾油', '319', '20598', '20614', '水分和挥发物：&le;3.0  磷脂：&ge;50  EPA：&ge;17 DHA:&ge;9  虾青素：&ge;200  酸价：&le;6  过氧化值：&le;0.2  不皂化物：&le;2', '南极磷虾油中Omega-3是以磷脂型态结合的Omega-3，&nbsp;磷虾油的EPA和DHA分子附着在磷脂上，而其他鱼油的omega-3附着在甘油三酯上。', '&lt;p&gt;&lt;strong&gt;ICERUBY&lt;/strong&gt;&lt;strong&gt;&amp;reg;&lt;/strong&gt;&lt;strong&gt;南极磷虾油&amp;mdash;&amp;mdash;更有效的磷脂型Omega-3脂肪酸&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;磷脂型Omega-3&lt;/strong&gt;&lt;br /&gt;\r\n南极磷虾油中Omega-3是以磷脂型态结合的Omega-3，&amp;nbsp;磷虾油的EPA和DHA分子附着在磷脂上，而其他鱼油的omega-3附着在甘油三酯上。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;天然抗氧化剂虾青素&lt;/strong&gt;&lt;br /&gt;\r\n南极磷虾油富含天然抗氧化剂虾青素。虾青素可以保护多元不饱和脂肪酸，防止其氧化，保证磷虾油的品质。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;易吸收的Omega-3&lt;/strong&gt;&lt;br /&gt;\r\n南极磷虾油提供磷脂结合的omega-3，生物利用更高，更容易被人体吸收。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;无异味&lt;/strong&gt;&lt;br /&gt;\r\n磷脂的亲水特性使其在胃内快速消化，服用之后不会有异味，也较少有反应。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;纯净无污染&lt;/strong&gt;&lt;br /&gt;\r\n南极磷虾生长在没有任何污染的南极低温水域。Iceruby磷虾油取自野生磷虾，纯净无污染。&lt;/p&gt;', '20597', '2', '0', '1', '1', '0', '1', '279', '2017-11-18 12:36:50', '279', '2017-11-18 12:42:37');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('301', '137', '航空模拟器', '329', '20602', '20605', '型号飞行模拟器是一个高性能，是FAA批准的基于BATD的飞行模拟器。它包含了所有的软件和物理控制、屏幕、计算机、桌面和装配工具。该型号飞行模拟器共有五个屏幕，三个60&rdquo;高清显示视觉屏和两个仪表屏，你可以保持态势感知能力，而不必与外界共享屏幕。显示器的大垂直范围是仿照真实飞机按照1:1比例打造的，便于俯仰和翻转，使该飞行模拟器非常容易飞行，特别有助于训练控制飞机的态度和缓慢的飞行。该型号飞行模拟器是学习飞机控制技能的完美工具，可以让你保持自信和安全。该型号飞行模拟器还可以模拟一些紧急情况，例如遇到的恶劣的天气等，真实的还原各种风险因素，让你在模拟飞行中的体验更加真实。', '该型号飞行模拟器设计的目的是让IFR、VFR、飞机系统、模拟器程序和紧急培训具有最佳的性价比。该型号飞行模拟器可以把我们模拟的所有飞机都装在两个飞机专用仪表的触摸屏上。而100度宽的视觉系统是其同等级中使用最广泛的，同时也是最快速、流畅和详细的。该型号飞行模拟器在家庭和飞行学校中都很受欢迎，因为它的多功能性和令人印象深刻的2.97平方米的视觉显示屏。', '&lt;p&gt;该型号飞行模拟器设计的目的是让IFR、VFR、飞机系统、模拟器程序和紧急培训具有最佳的性价比。该型号飞行模拟器可以把我们模拟的所有飞机都装在两个飞机专用仪表的触摸屏上。而100度宽的视觉系统是其同等级中使用最广泛的，同时也是最快速、流畅和详细的。该型号飞行模拟器在家庭和飞行学校中都很受欢迎，因为它的多功能性和令人印象深刻的2.97平方米的视觉显示屏。型号飞行模拟器是一个高性能，是FAA批准的基于BATD的飞行模拟器。它包含了所有的软件和物理控制、屏幕、计算机、桌面和装配工具。该型号飞行模拟器共有五个屏幕，三个60&amp;rdquo;高清显示视觉屏和两个仪表屏，你可以保持态势感知能力，而不必与外界共享屏幕。显示器的大垂直范围是仿照真实飞机按照1:1比例打造的，便于俯仰和翻转，使该飞行模拟器非常容易飞行，特别有助于训练控制飞机的态度和缓慢的飞行。该型号飞行模拟器是学习飞机控制技能的完美工具，可以让你保持自信和安全。该型号飞行模拟器还可以模拟一些紧急情况，例如遇到的恶劣的天气等，真实的还原各种风险因素，让你在模拟飞行中的体验更加真实。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118123625_560.png&quot; style=&quot;height:875px; width:596px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118123637_51.png&quot; style=&quot;height:357px; width:920px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118123650_244.png&quot; style=&quot;height:268px; width:922px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118123707_8.png&quot; style=&quot;height:811px; width:867px&quot; /&gt;&lt;/p&gt;', '20601', '3', '0', '1', '1', '0', '1', '241', '2017-11-18 12:37:38', '241', '2017-11-18 12:37:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('302', '159', '新型高度计', '325', '20600', '20607', '工作频率	500kHz	精度	1mm\r\n测量范围	0.1-120m	波束角	锥形6&deg;\r\n内置传感器	精度：&plusmn;1&deg;Heading，0.2&deg;Pitch/Roll，0.5&deg;Temperature\r\n重量	0.5kg(空气中),0.325kg(水中)\r\n尺寸	109mm（长度）x43mm（直径）', 'ImpactSubsea公司推出这款新型高度计ISA500，是世界上首台集成了声学高度计、横摇/纵摇姿态、艏向及温度于一体的传感器。', '&lt;p&gt;ImpactSubsea公司推出这款新型高度计ISA500，是世界上首台集成了声学高度计、横摇/纵摇姿态、艏向及温度于一体的传感器。该传感器体积小，性能非常稳定，极大的满足了海洋科考、调查领域对于高性能高度计的需求。&lt;/p&gt;', '20606', '8', '1', '1', '1', '0', '1', '274', '2017-11-18 12:38:09', '274', '2017-11-18 12:41:33');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('303', '159', '水下机器人', '326', '20609', '20611', '框架	高密度耐腐蚀聚乙烯板\r\n推进器	水平4个，垂直2个，单个推力：5.1kg/正向，4.1kg/反向\r\n脐带缆	零浮力100m（标配）\r\n照明	LED灯2个（标配），光通量：1500流明/个，开角：130&deg;\r\n高清摄像	开角：110&deg;，分辨率：1080P\r\n工作水深	100m', 'BlueROV2是一款微型的水下机器人，配备高清摄像和自动定深/定向功能。', '&lt;p&gt;BlueROV2是一款微型的水下机器人，配备高清摄像和自动定深/定向功能，其强劲的6推进器配置为该水下机器人提供强大的动力，可搭载成像声纳、水下定位系统及机械手等。&lt;/p&gt;', '20608', '6', '1', '1', '1', '0', '1', '274', '2017-11-18 12:40:58', '274', '2017-11-18 12:41:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('304', '157', '南极磷虾油胶囊', '320', '20615', '20625', '磷脂：&ge;42  EPA：&ge;10  DHA:&ge;5  虾青素：&ge;150', '南极磷虾油凝胶糖果\r\n南极磷虾油凝胶糖果是来自南极的健康食品，由纯南极磷虾油精制而成。南极磷虾油取自纯正野生南极磷虾，利用专利超低温萃取的方式提取，含有其他食品不能替代的功效。', '&lt;p&gt;&lt;strong&gt;南极磷虾油凝胶糖果&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;南极磷虾油凝胶糖果是来自南极的健康食品，由纯南极磷虾油精制而成。南极磷虾油取自纯正野生南极磷虾，利用专利超低温萃取的方式提取，含有其他食品不能替代的功效。&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 营养成分：&lt;/strong&gt;EPA、DHA、磷脂、虾青素、能量、蛋白质、脂肪等&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 配 料 表：&lt;/strong&gt;南极磷虾油、明胶、糖、甘油、纯净水、&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; 净 含 量：&lt;/strong&gt;500mg/粒或定制&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; 保 质 期：&lt;/strong&gt;24月&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 使用指南：&lt;/strong&gt;每日1-3g&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 不适宜人群：&lt;/strong&gt;婴幼儿、孕妇、哺乳期妇女及海鲜过敏者不宜食用&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; 储存条件：&lt;/strong&gt;置于阴凉干燥处&lt;/p&gt;', '20621', '1', '0', '1', '1', '0', '1', '279', '2017-11-18 12:43:51', '279', '2017-11-18 12:46:33');
