INSERT INTO `byp_exhibition_booth_product_info` VALUES ('313', '176', '企业介绍', '331', '20678', '20681', '北京贝能科技有限公司主要提供智能化作业解决方案及相关设备，可根据您的各种工程需要定制个性化的成套技术路线和实施方案。', '北京贝能科技有限公司主要提供智能化作业解决方案及相关设备，可根据您的各种工程需要定制个性化的成套技术路线和实施方案。\r\n     公司现有特种水下航行器、特种检测机器人、特种作业机器人、特种作业无人机等产品。', '&lt;p&gt;北京贝能科技有限公司主要提供智能化作业解决方案及相关设备，可根据您的各种工程需要定制个性化的成套技术路线和实施方案。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;公司现有特种水下航行器、特种检测机器人、特种作业机器人、特种作业无人机等产品。&lt;/p&gt;', '20679', '3', '0', '1', '1', '0', '1', '291', '2017-11-18 13:21:25', '291', '2017-11-18 13:21:25');
