INSERT INTO `byp_exhibition_booth_product_info` VALUES ('320', '139', 'HBF玻璃钢浮标   GFRP buoy', '335', '20727', '20733', '玻璃钢浮标是一种新型水上导航浮标，由新型高分子复合材料玻璃钢和金属等材料造。', '玻璃钢浮标是一种新型水上导航浮标，由新型高分子复合材料玻璃钢和金属等材料造。', '&lt;p&gt;玻璃钢浮标是一种新型水上导航浮标，由新型高分子复合材料玻璃钢和金属等材料造。&lt;/p&gt;\r\n\r\n&lt;p&gt;性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;浮体采用新型材料制造，各部分采用组装结构，结构轻巧，重量是同型号钢浮标的1/3，便于运输、抛设。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;耐海水及大气腐蚀，耐高温，耐强日光照射，海生物寄生少且易清除，免维护周期长。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;材料本体着色，醒目美观，颜色保留时间长，导航性能好&lt;/p&gt;', '20729', '1', '1', '1', '1', '0', '1', '246', '2017-11-18 14:18:13', '246', '2017-11-18 15:34:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('321', '139', 'HNF聚脲浮标  Polyurethane buoy', '335', '20734', '20739', '聚脲导航浮标浮体采用模塑聚脲弹性材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充。浮标的外表面喷涂优质氟碳耐候涂料，可以保证浮标的颜色鲜明。浮标整体免维护周期长，抗撞击和抗沉性能好。', '聚脲导航浮标浮体采用模塑聚脲弹性材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充。浮标的外表面喷涂优质氟碳耐候涂料，可以保证浮标的颜色鲜明。浮标整体免维护周期长，抗撞击和抗沉性能好。', '&lt;p&gt;&lt;strong&gt;HNF&lt;/strong&gt;&lt;strong&gt;聚脲浮标&amp;nbsp; Polyurethane buoy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;聚脲导航浮标浮体采用模塑聚脲弹性材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充。浮标的外表面喷涂优质氟碳耐候涂料，可以保证浮标的颜色鲜明。浮标整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能特点：&lt;/strong&gt;浮体聚脲材料具有无污染、耐腐蚀、耐强日光照射、防盐雾、防化学品腐蚀、海洋生物附着少等性能。浮体材料的颜色为本体着色并外表喷涂优质氟碳耐候涂料，浮标颜色鲜明稳定。浮体整体免维护周期长.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;浮标浮体采用模塑聚脲弹性材料制成，内部设置聚脲肋骨和不锈钢骨架增强，采用不吸水的弹性泡沫材料填充，浮体具有耐碰撞、抗挤压、抗撞击的性能。&lt;/p&gt;', '20737', '2', '0', '1', '1', '0', '1', '246', '2017-11-18 14:32:44', '246', '2017-11-18 14:32:44');
