INSERT INTO `byp_exhibition_booth_product_info` VALUES ('324', '139', 'HBF 1.0 型监测浮标', '335', '20773', '20774', 'HBF 1.0型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。', 'HBF 1.0型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。', '&lt;p&gt;HBF 1.0型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本浮标的浮体采用优质玻璃钢材料制作，外表面采用间笨新戊二醇型胶衣树脂，浮标体具有优良的耐腐蚀性、耐水性和耐候性，颜色鲜明不褪色。浮体内部采用不锈钢骨架增强，采用聚氨酯闭孔泡沫材料填充，浮体整体具有重量轻、强度高、锚系性能好、维护成本低等优点。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF 1.0型监测浮标采用太阳能电池板和免维护蓄电池为监测仪器和数据采集各种传输模块提供能源，可靠性高。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; f,浮标重量轻，短途运输和水上布设及回收都很方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; g,浮标水上操作仪器作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;', '20765', '3', '1', '1', '1', '0', '1', '246', '2017-11-18 15:09:17', '246', '2017-11-18 15:34:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('325', '154', '船用舷窗', '262', '20780', '20840', '船用舷窗GB/T 14413-1993', '船用舷窗GB/T 14413-1993', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150650_702.jpg&quot; style=&quot;height:971px; width:711px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150705_299.jpg&quot; style=&quot;height:971px; width:711px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150718_710.jpg&quot; style=&quot;height:971px; width:711px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150734_679.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150751_685.jpg&quot; style=&quot;height:971px; width:711px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150811_498.jpg&quot; style=&quot;height:971px; width:711px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150824_625.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118150837_714.jpg&quot; /&gt;&lt;/p&gt;', null, '15', '0', '1', '1', '0', '1', '224', '2017-11-18 15:09:43', '224', '2017-11-18 15:45:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('326', '122', '国产G-209卸扣', '336', '20775', '20777', '我公司自产的美标卸扣从0.3T--150T，规格齐全，出口品质。', '我公司自产的美标卸扣从0.3T--150T，规格齐全，出口品质。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118151202_331.jpg&quot; style=&quot;height:505px; width:1000px&quot; /&gt;&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '225', '2017-11-18 15:12:09', '225', '2017-11-18 15:12:09');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('327', '151', 'ROV CORING SYSTEM', '340', '20747', '20793', 'Operating Depth:         Equal to Work Class ROV Depth\r\n                                    Rating typically 4500-6000m', 'Oil &amp; Gas Research Tech.\r\nROV Coring Drilling System', '&lt;p&gt;OPERATIONAL AREAS&lt;br /&gt;\r\nThe PAG Cat 3 ROV Coring System will benefit for:&lt;br /&gt;\r\n- Coring hard sediment&lt;br /&gt;\r\n- Fractured igneous rock&lt;br /&gt;\r\n- Friable carbonate rocks&lt;br /&gt;\r\n- Near seabed areas where soft and hard layers are stacked together&lt;br /&gt;\r\n- Hydrotermal vents with large environmental concerns&lt;br /&gt;\r\n- Shallow water areas, atolls&lt;br /&gt;\r\n- Ice covered arctic oceans or areas with frequent ice&lt;br /&gt;\r\n- Seabed mining nodule sampling&lt;/p&gt;\r\n\r\n&lt;p&gt;CONCERNS&lt;br /&gt;\r\nCategory 1 Vessels&lt;br /&gt;\r\n- Have unavoidable Weight on Bit (WOB) fluctuations&lt;br /&gt;\r\n&amp;nbsp; Coring Carbonated layers may be pulverized&lt;br /&gt;\r\n&amp;nbsp; Drill string type coring systems for sulfide coring has historically captured less than 5%&lt;br /&gt;\r\n- Require high flow of fluid for drilling/coring&lt;br /&gt;\r\n&amp;nbsp; Flushing away sediment particles that best should be retrieved with core&lt;br /&gt;\r\nCategory 2 Robotic Drills&lt;br /&gt;\r\n- No WOB fluctuations.&lt;br /&gt;\r\n- Need a surface vessel location directly above&lt;br /&gt;\r\n- Used when Cat 1 not is available nor efficient for specific target or represent lower cost&lt;br /&gt;\r\nCategory 3 PAG ROV Coring System&lt;/p&gt;\r\n\r\n&lt;p&gt;- No WOB fluctuations.&lt;br /&gt;\r\n&amp;nbsp; Actual weight on bit will be accurately monitored in real-time and will be continuously adjusted to optimize the coring quality&lt;br /&gt;\r\n- Require high flow of fluid for drilling/coring&lt;br /&gt;\r\n&amp;nbsp; Required fluid flow are minimal and allows the core to be in near pristine condition&lt;/p&gt;\r\n\r\n&lt;p&gt;BENEFITS FOR PAG CATEGORY 3 CORING SYSTEM&lt;br /&gt;\r\nThe advantage of using a lightweight ROV installed coring systems is their flexibility .In all locations where there is no need for deep seabed penetration, the scientists can use any standard work class ROV for coring and capturing seabed samples with its original deepwater pressure condition. This means that the system is readily available for a low cost sampling operation. Large Category 1 vessels or Category 2 systems are not required.&lt;br /&gt;\r\n- Attached to a Work Class ROV&lt;br /&gt;\r\n- Low Cost for shallow coring targets&lt;br /&gt;\r\n- Vertical Coring on hard seabed rock surface&lt;br /&gt;\r\n- Dead-ROV Auto-Release System for emergency release of ROV&lt;br /&gt;\r\n- Captures 5 cores with its deepwater pressure condition in each dive&lt;br /&gt;\r\n- Can operate in up to 15 degrees sloped seabed&lt;br /&gt;\r\n- Cores are gyro-orientated&lt;br /&gt;\r\n- Environmentally Friendly&lt;/p&gt;', '20791', '1', '0', '1', '1', '0', '1', '269', '2017-11-18 15:18:31', '269', '2017-11-18 15:18:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('328', '139', 'HBF1.5型监测浮标', '335', '20819', '20824', 'HBF1.5 型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过 50 米，风速不超过 36 米/秒，流速不大于 2 米/秒。', 'HBF1.5 型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过 50 米，风速不超过 36 米/秒，流速不大于 2 米/秒。', '&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;HBF1.5&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF1.5型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本浮标的浮体采用优质玻璃钢材料制作，外表面采用间笨新戊二醇型胶衣树脂，浮标体具有优良的耐腐蚀性、耐水性和耐候性，颜色鲜明不褪色。浮体内部采用不锈钢骨架增强，采用聚氨酯闭孔泡沫材料填充，浮体整体具有重量轻、强度高、锚系性能好、维护成本低等优点。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF 1.5型监测浮标采用太阳能电池板和免维护蓄电池为监测仪器和数据采集各种传输模块提供能源，可靠性高。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; f,浮标重量轻，短途运输和水上布设及回收都很方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; g,浮标水上操作仪器作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;', '20818', '5', '0', '1', '1', '0', '1', '246', '2017-11-18 15:21:26', '246', '2017-11-18 15:33:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('329', '122', '国产G-210卸扣', '336', '20795', '20799', '我公司自产的美标卸扣从0.3T--150T，规格齐全，出口品质。', '我公司自产的美标卸扣从0.3T--150T，规格齐全，出口品质。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118152309_628.jpg&quot; style=&quot;height:710px; width:1000px&quot; /&gt;&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '225', '2017-11-18 15:23:23', '225', '2017-11-18 15:23:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('330', '139', 'HBF 1.25 型监测浮标', '335', '20811', '20815', 'HBF1.25型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。', 'HBF1.25型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。', '&lt;p&gt;HBF1.25型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过20米/秒，流速不大于1.55米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本浮标的浮体采用优质玻璃钢材料制作，外表面采用间笨新戊二醇型胶衣树脂，浮标体具有优良的耐腐蚀性、耐水性和耐候性，颜色鲜明不褪色。浮体内部采用不锈钢骨架增强，采用聚氨酯闭孔泡沫材料填充，浮体整体具有重量轻、强度高、锚系性能好、维护成本低等优点。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF 1.25型监测浮标采用太阳能电池板和免维护蓄电池为监测仪器和数据采集各种传输模块提供能源，可靠性高。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; f,浮标重量轻，短途运输和水上布设及回收都很方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; g,浮标水上操作仪器作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;', '20792', '4', '1', '1', '1', '0', '1', '246', '2017-11-18 15:25:52', '246', '2017-11-18 15:34:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('331', '182', '精灵P200自主水下机器人', '344', '20822', '21023', '（1）外形尺寸：标准配置1.8m &times;&Phi;0.20m\r\n（2）最大航行深度：300m\r\n（3）典型航速：1~6kn\r\n（4）续航力：12h@3kn\r\n（5）自主导航精度：绝对速度推算下误差优于0.3%航程（CEP）\r\n（6）有源校准点：航路上任意点设定\r\n（7）校准源：GPS/GLONASS/北斗\r\n（8）能源：二次锂离子电池', '精灵P200型自主水下机器人采用了模块化设计技术，一体化集成自动驾驶单元、高精度导航模块、高清成像声呐、新型推进器等核心模块，具备自主导航和智能作业能力，可由双人便携操作，完成海洋环境监测、海底地形测绘、海底成像、水下目标搜索定位、海洋高清探查、石油管线和海底电缆巡检等任务。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;&lt;strong&gt;精灵&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;&lt;strong&gt;P200&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;&lt;strong&gt;便携式自主水下机器人&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;一、产品简介&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;精灵P200型自主水下机器人采用了模块化设计技术，一体化集成自动驾驶单元、高精度导航模块、高清成像声呐、新型推进器等核心模块，具备自主导航和智能作业能力，可由双人便携操作，完成海洋环境监测、海底地形测绘、海底成像、水下目标搜索定位、海洋高清探查、石油管线和海底电缆巡检等任务。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、产品特点&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）易于使用：可双人便携操作，任务布置，数据收集展现多功能集成；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）智能探查：自主完成作业任务，具备智能避障和在线任务规划能力；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）作业模式：具备水面无线遥控、光纤遥控和自主工作等多种作业模式；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）探查载荷：一体化集成高精度多波束测深仪、高分辨率自适应孔径成像声呐，可同时完成对悬浮、沉底目标的二维和三维成像；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）体积功耗：载体载荷一体化共形设计，体积小、流体阻力小，能源利用率高，续航能力强；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）系统配置：配备新型推进系统、高精度自主导航系统和高精度声呐载荷；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（7）扩展性强：各核心部件均采用模块化设计，主要舱段之间可任意调换位置，方便扩展新的功能舱段；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（8）开源共享：根据用户要求，可提供水下机器人各系统的开源接口软件代码；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（9）用户定制：全自主知识产权，采用模块化设计，可快速响应客户的定制化需求。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;三、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（1）外形尺寸：标准配置1.8m &amp;times;&amp;Phi;0.20m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（2）最大航行深度：300m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（3）典型航速：1~6kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（4）续航力：12h@3kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（5）自主导航精度：绝对速度推算下误差优于0.3%航程（CEP）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（6）有源校准点：航路上任意点设定&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:21.0pt&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（7）校准源：GPS/GLONASS/北斗&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;（8）能源：二次锂离子电池&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;四、典型应用&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）海洋环境监测&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）水下目标搜索定位&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）海洋高清探查&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）石油管线和海底电缆巡检&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）考古与搜救&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）海底小目标探测、识别、定位与跟踪&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（7）水下成像搜索&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（8）地形地貌测绘&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（9）情报监视与侦查&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（10）海事安全&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20828', '11', '0', '1', '1', '0', '1', '294', '2017-11-18 15:38:26', '294', '2017-11-18 17:18:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('332', '139', 'HBF 2.2型监测浮标', '335', '20826', '20831', 'HBF 2.2 型监测浮标采用太阳能电池板和免维护蓄电池为监测仪器和数据采集各种传输模块提供能源，可靠性高。', 'HBF 2.2型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。', '&lt;p&gt;&lt;strong&gt;HBF 2.2&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF 2.2型监测浮标是一种水文/水质/气象监测浮标，适合布设在海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本浮标的浮体采用优质玻璃钢材料制作，外表面采用间笨新戊二醇型胶衣树脂，浮标体具有优良的耐腐蚀性、耐水性和耐候性，颜色鲜明不褪色。浮体内部采用不锈钢骨架增强，采用聚氨酯闭孔泡沫材料填充，浮体整体具有重量轻、强度高、锚系性能好、维护成本低等优点。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; HBF 2.2 型监测浮标采用太阳能电池板和免维护蓄电池为监测仪器和数据采集各种传输模块提供能源，可靠性高。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; f,浮标重量轻，短途运输和水上布设及回收都很方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; g,浮标水上操作仪器作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;', '20830', '6', '0', '1', '1', '0', '1', '246', '2017-11-18 15:39:19', '246', '2017-11-18 15:39:19');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('333', '151', 'ROV TOOLING', '341', '20803', '20832', 'Subsea gas hydrate test production proposal,subsea well maintenance and PAG section:', 'Subsea gas hydrate test production proposal,subsea well maintenance and PAG section:gas hydrate test production production proposal, riser and maintenance, RLWI well maintenance and PAG, subsea piping maintenance, Subsea ROV sales and rental and services.', '&lt;p&gt;&amp;nbsp;Subsea gas hydrate test production proposal,subsea well maintenance and PAG section:gas hydrate test production production proposal, riser and maintenance, RLWI well maintenance and PAG, subsea piping maintenance, Subsea ROV sales and rental and services.&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '269', '2017-11-18 15:40:12', '269', '2017-11-18 15:40:12');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('334', '139', 'HNF1.5型监测浮标', '335', '20846', '20854', 'HNF1.5 型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过 50 米，风速不超过 36 米/秒，流速不大于 2 米/秒。', 'HNF1.5 型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过 50 米，风速不超过 36 米/秒，流速不大于 2 米/秒。', '&lt;p&gt;&lt;strong&gt;HNF1.5型监测浮标&lt;/strong&gt;&lt;br /&gt;\r\nHNF1.5 型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖&lt;br /&gt;\r\n泊等水域进行水质和气象参数的监测。布设地点的水深应不超过 50 米，风速不超过 36 米/&lt;br /&gt;\r\n秒，流速不大于 2 米/秒。&lt;br /&gt;\r\nHNF1.5 型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，&lt;br /&gt;\r\n采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保&lt;br /&gt;\r\n持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护&lt;br /&gt;\r\n周期长，抗撞击和抗沉性能好。&lt;br /&gt;\r\nHNF1.5 型聚脲监测浮标作为水文、水质、气象实时监测系统的仪器载体，采用太阳能&lt;br /&gt;\r\n电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪&lt;br /&gt;\r\n器和数据采集器、无线数据传输模块等，通过北斗卫星或 GPRS 网络自动把监测数据实时传&lt;br /&gt;\r\n输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、&lt;br /&gt;\r\n系统可靠。&lt;br /&gt;\r\n&lt;strong&gt;性能特点：&lt;/strong&gt;&lt;br /&gt;\r\na,可安装多种监测仪器，应用范围广&lt;br /&gt;\r\nb,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;br /&gt;\r\nc,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;br /&gt;\r\nd,结构牢固，性能可靠&lt;br /&gt;\r\ne,耐腐蚀性好，维护成本低&lt;br /&gt;\r\nf,浮标重量轻，水上布设及回收都很方便&lt;br /&gt;\r\ng,浮标水上仪器操作方便&lt;br /&gt;\r\nh,浮标的仪器舱密封性能好&lt;/p&gt;', '20838', '7', '0', '1', '1', '0', '1', '246', '2017-11-18 15:50:24', '246', '2017-11-18 15:50:24');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('335', '151', 'ROV - Remote Operated Vehicle', '342', '20834', '20862', 'SUB-FIGHTER 10K-30K\r\nSUB-FIGHTER 4500', 'SUB-fighter 30K is our most powerful ROV. This is the ROV that has everything. Among other things, it&rsquo;s especially tailored for use in marine archeology.', '&lt;p&gt;&lt;strong&gt;SUB-FIGHTER 4500&lt;br /&gt;\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;&lt;br /&gt;\r\n&lt;!--[endif]--&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The SUB-fighter 4500 has been produced for Norwegian environments. This is a ROV with a lot of options at a low cost.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '20856', '3', '0', '1', '1', '0', '1', '269', '2017-11-18 15:56:31', '269', '2017-11-18 15:56:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('336', '182', '精灵E200自主水下机器人', '344', '20845', '21030', '（1）水下摄像机：实时采集水下摄像机图像，提供视觉图像软件接口。\r\n（2）前视声呐：实时采集声呐图像，提供声呐图像软件接口。\r\n（3）尺寸：2.2m &times;&Phi;0.20m\r\n（4）重量：&le;45kg\r\n（5）最大航速：4kn\r\n（6）续航时间：8h\r\n（7）最大工作深度：300m\r\n（8）通信距离水面：&ge;3km（采用无线数传通过方式），水下：500m（采用光纤通信方式）', '精灵E200是一款模块化开源的水下自主机器人产品，主要面向科研、教育和水下探查等应用领域。该水下机器人采用模块化设计，配置多组推进器，运动控制精准灵活，预留接口丰富，操控模式多样，传感器、数据和控制接口等软件代码全部开源。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;精灵&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;E200&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;便携式自主水下机器人&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;一、产品简介&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;精灵E200是一款模块化开源的水下自主机器人产品，主要面向科研、教育和水下探查等应用领域。该水下机器人采用模块化设计，配置多组推进器，运动控制精准灵活，预留接口丰富，操控模式多样，传感器、数据和控制接口等软件代码全部开源。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、产品特点&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）易于使用：便携式设计，小体积，易操作&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）硬件模块化、软件开源：满足用户运动控制，声学和光学图像处理，跟踪定位，水下通信组网，水下机器人集群等研究课题&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）操纵性好、控制模式多样：配置艉部推进1组，前后垂推各1组，可实现水下悬停定位、精确轨迹控制、原地转弯等复杂操作&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）传感器丰富：水下摄像机、成像声呐、姿态传感器、深度传感器、声学多普勒计程仪等&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）扩展性良好：超短基线定位、水声通讯机、侧扫声呐、合成孔径声呐、多波束声呐、SVP、CTD等&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）作业模式：具备水面无线遥控、光纤遥控和自主工作等多种工作模式&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（7）配置丰富：丰富灵活，可以满足不同客户的配置需求&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（8）用户定制：全自主知识产权，采用模块化设计，可快速响应客户的定制化需求&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;三、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1） 水下摄像机：实时采集水下摄像机图像，提供视觉图像软件接口。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（2） 前视声呐：实时采集声呐图像，提供声呐图像软件接口。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（3） 尺寸：2.2m &amp;times;&amp;Phi;0.20m&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（4） 重量：&amp;le;45kg&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（5） 最大航速：4kn&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（6） 续航时间：8h&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（7） 最大工作深度：300m&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（8） 通信距离水面：&amp;ge;3km（采用无线数传通过方式），水下：500m（采用光纤通信方式）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20863', '10', '0', '1', '1', '0', '1', '294', '2017-11-18 15:57:15', '294', '2017-11-18 17:20:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('337', '139', 'HNF 1.8型监测浮标', '335', '20858', '20866', 'HNF1.8型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。', 'HNF1.8型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。', '&lt;p&gt;&lt;strong&gt;HNF 1.8&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF1.8型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水质和气象参数的监测。布设地点的水深应不超过50米，风速不超过36米/秒，流速不大于2米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF1.8 型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;　　HNF1.8 型聚脲监测浮标作为水文、水质、气象实时监测系统的仪器载体，采用太阳能电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪器和数据采集器、无线数据传输模块等，通过北斗卫星或GPRS网络自动把监测数据实时传输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、系统可靠。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能特点：&lt;/strong&gt;&lt;br /&gt;\r\na,可安装多种监测仪器，应用范围广&lt;br /&gt;\r\nb,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;br /&gt;\r\nc,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;br /&gt;\r\nd,结构牢固，性能可靠&lt;br /&gt;\r\ne,耐腐蚀性好，维护成本低&lt;br /&gt;\r\nf,浮标重量轻，水上布设及回收都很方便&lt;br /&gt;\r\ng,浮标水上仪器操作方便&lt;br /&gt;\r\nh,浮标的仪器舱密封性能好&lt;/p&gt;', '20865', '8', '0', '1', '1', '0', '1', '246', '2017-11-18 15:57:58', '246', '2017-11-18 15:57:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('338', '182', '精灵M200自主水下机器人', '344', '20867', '21033', '1.	重量：12kg\r\n2.	外形尺寸：0.9mX0.12m\r\n3.	最大航行深度：200m\r\n4.	最大航速：4kn\r\n5.	续航力：8h@3kn', '精灵M200是一款打破传统水下市场的自主水下机器人产品。该产品具有性价比极高、操作简易、灵活性和扩展性高等特点，既可通过搭载各种小型声学载荷实现水下探查，又可搭载水声通讯设备实现&ldquo;蜂群&rdquo;作业。并且该产品还提供开放硬件接口和开源控制系统软件，便于开展机器人在智能传感、路径规划、运动控制、故障诊断、集群协作等研究项目。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;精灵&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;strong&gt;M200&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;微型自主水下机器人&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;一、产品简介&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;精灵M200是一款打破传统水下市场的自主水下机器人产品。该产品具有性价比极高、操作简易、灵活性和扩展性高等特点，既可通过搭载各种小型声学载荷实现水下探查，又可搭载水声通讯设备实现&amp;ldquo;蜂群&amp;rdquo;作业。并且该产品还提供开放硬件接口和开源控制系统软件，便于开展机器人在智能传感、路径规划、运动控制、故障诊断、集群协作等研究项目。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）重量：12kg&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）外形尺寸：0.9mX0.12m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）最大航行深度：200m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）最大航速：4kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）续航力：8h@3kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;三、产品特点&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）易于使用：便携式设计，小体积，轻巧，方便操作&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）探查载荷：可搭载侧扫声纳作业，满足水下探测需求&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）作业模式：具有水面遥控及水下自主作业两种作业模式&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）开源共享：根据用户需求，可提供开放硬件接口与开源接口软件代码&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）集群应用：体积小巧，作业灵活，搭载声通讯机可实现&amp;ldquo;蜂群&amp;rdquo;作业&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20869', '9', '0', '1', '1', '0', '1', '294', '2017-11-18 16:04:07', '294', '2017-11-18 17:21:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('339', '151', 'ENHANCED DRILLING', '343', '20872', '20885', 'The CTS is based on a powerful and versatile subsea electrical-driven pump.', 'Drill safer, drill faster,\r\ndrill more efficiently', '&lt;p&gt;During drilling, the EC-Drill system greatly reduces the need to regulate mud weight. Instead, the level of the mud in the riser can be finely manipulated, allowing BHP to be maintained just above pore pressure or just below fracture pressure as required.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '20880', '4', '0', '1', '1', '0', '1', '269', '2017-11-18 16:17:38', '269', '2017-11-18 16:17:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('340', '139', 'HNF2.1型监测浮标', '335', '20876', '20887', 'HNF2.1型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。', 'HNF2.1型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。', '&lt;p&gt;&lt;strong&gt;HNF2.1&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF2.1型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.1型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.1 型聚脲监测浮标，作为水文、水质、气象实时监测系统的仪器载体，采用太阳能电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪器和数据采集器、无线电数据传输模块等，通过北斗卫星或GPRS网络自动把监测数据实时传输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、系统可靠。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能特点：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; f,浮标重量轻，锚系能力强&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; g,浮标水上仪器操作作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; I,浮标稳定性好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; J,浮标颜色符合IALA标准的规定&lt;/p&gt;', '20881', '9', '0', '1', '1', '0', '1', '246', '2017-11-18 16:19:19', '246', '2017-11-18 16:19:19');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('341', '182', '精灵T200遥控水下机器人', '344', '20891', '21036', '（1）抗流能力：&ge;4kn@迎流，&ge;2kn@侧流\r\n（2）重量：&le;40kg（水下机器人）\r\n（3）尺寸：&le;600mm&times;600mm&times;450mm（长&times;宽&times;高）\r\n（4）最大工作水深：&ge;200m\r\n（5）定位精度：自主定位精度优于2m，加装超短基线定位精度更高', '精灵T200遥控式水下机器人集成水下高清摄像机和水下高分辨率成像声呐，同时具备水下自主定位能力，可满足大坝、核电站及水下桥墩等目标的检查、观测和定位。精灵T200遥控式水下机器人采用模块化设计，可根据用户需求加装超短基线定位、机械手、水质监测、测流测速等多种类传感器。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;精灵&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;T200&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;遥控式水下机器人&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;一、产品介绍&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;精灵T200遥控式水下机器人集成水下高清摄像机和水下高分辨率成像声呐，同时具备水下自主定位能力，可满足大坝、核电站及水下桥墩等目标的检查、观测和定位。精灵T200遥控式水下机器人采用模块化设计，可根据用户需求加装超短基线定位、机械手、水质监测、测流测速等多种类传感器。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;指标要求&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（1）抗流能力：&amp;ge;4kn@迎流，&amp;ge;2kn@侧流&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（2）重量：&amp;le;40kg（水下机器人）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（3）尺寸：&amp;le;600mm&amp;times;600mm&amp;times;450mm（长&amp;times;宽&amp;times;高）&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（4）最大工作水深：&amp;ge;200m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（5）定位精度：自主定位精度优于2m，加装超短基线定位精度更高&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;三、产品优势&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （1）具有全部自主知识产权，从核心部件到整机均由公司研制生产；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （2）声学探测模块属公司自研产品，实现了平台与声学探测模块的无缝对接，充分发挥了声学探测的优势和潜力；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （3）具有水下姿态自闭环功能，操作人员只需根据需要调整其位置，简化了操作；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （4）采用了光纤惯导与DVL组合导航，具有水下自主定位功能，具备水下位置实时自主解算能力；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （5）采用了公司自主研发的水下电机和水下推进器，具有功率大、效率高的优点，进一步提高了水下机器人的抗流能力、速度和机动能力。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20886', '6', '0', '1', '1', '0', '1', '294', '2017-11-18 16:22:46', '294', '2017-11-18 17:23:04');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('342', '139', 'HNF2.2型监测浮标', '335', '20900', '20912', 'HNF2.2型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。', 'HNF2.2型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。', '&lt;p&gt;&lt;strong&gt;HNF2.2&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF2.2型监测浮标是一种水文/水质/气象监测浮标，适合布设在近海、海港、内河、湖泊等水域进行水文、水质和气象参数的监测。布设地点的水深应不超过100米，风速不超过36米/秒，流速不大于2米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.2型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.2 型聚脲监测浮标，作为水文、水质、气象实时监测系统的仪器载体，采用太阳能电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪器和数据采集器、无线电数据传输模块等，通过北斗卫星或GPRS网络自动把监测数据实时传输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、系统可靠。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; 性能特点：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; a,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;b,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; f,浮标重量轻，锚系能力强&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; g,浮标水上仪器操作作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; I,浮标稳定性好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; J,浮标颜色符合IALA标准的规定&lt;/p&gt;', '20905', '10', '0', '1', '1', '0', '1', '246', '2017-11-18 16:26:57', '246', '2017-11-18 16:28:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('343', '151', 'Launch &amp; Recovery System', '353', '20892', '20907', 'HPL&trade; handles all types of work class ROV&rsquo;s for operational depths down to 4500 meters.', 'Extensive outreach and excellent dipping functionality increases safety during launch and recovery operations in harsh weather.', '&lt;p&gt;The DPL&amp;trade; (Both dipping and non-dipping A-Frame) is designed for safe and cost effective ROV handling in harsh weather, which can be delivered for applications like observation class ROV, work class ROV and Trencher systems.&lt;/p&gt;', '20904', '5', '0', '1', '1', '0', '1', '269', '2017-11-18 16:27:09', '269', '2017-11-18 16:27:09');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('344', '122', '椭圆型铝套', '337', '20935', '21608', '我公司（青岛越海机械有限公司）专业生产标准、非标准钢丝绳接头，包含铝套，铜套，钢套等各种钢丝绳压制接头。', '我公司（青岛越海机械有限公司）专业生产标准、非标准钢丝绳接头，包含铝套，铜套，钢套等各种钢丝绳压制接头。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171118/pic/20171118164909_315.jpg&quot; style=&quot;height:1099px; width:600px&quot; /&gt;&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '225', '2017-11-18 16:29:05', '225', '2017-11-20 16:27:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('345', '182', '一体化高清声学成像模块', '346', '20898', '21037', '1、高精度下视多波束测深仪\r\n（1）垂直波束宽度：1&deg;，水平开角：140&deg;\r\n（2）水平波束宽度：0.5&deg; \r\n（3）距离分辨率：2cm \r\n（4）测深精度：10cm \r\n（5）作用距离：200m \r\n2、侧视高分辨率自适应孔径声学成像仪\r\n（1）采用自适应孔径成像技术，航迹方向与垂直航迹方向均为恒定分辨率\r\n（2）分辨率：2.5cm*2.5cm \r\n（3）垂直开角：38&deg; \r\n（4）作用距离：200m \r\n（5）典型航速：1~6kn', '高清声学成像模块为一款高集成度、具备国际领先水平的声学成像产品。该产品集成有高精度下视多波束测深仪和高分辨率侧视自适应孔径声学成像仪，可应用于自主水下机器人的海底管线检查、地形地貌测绘和海底小目标探测等领域。产品采用一体化共型设计，流体阻力小，大大降低了水下机器人载体设计的复杂度。公司可根据用户需求定制不同尺寸和连接方式的高清声学成像模块。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;一体化高清声学成像模块&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;一、产品简介&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;高清声学成像模块为一款高集成度、具备国际领先水平的声学成像产品。该产品集成有高精度下视多波束测深仪和高分辨率侧视自适应孔径声学成像仪，可应用于自主水下机器人的海底管线检查、地形地貌测绘和海底小目标探测等领域。产品采用一体化共型设计，流体阻力小，大大降低了水下机器人载体设计的复杂度。公司可根据用户需求定制不同尺寸和连接方式的高清声学成像模块。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;二、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;1、高精度下视多波束测深仪&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （1）垂直波束宽度：1&amp;deg;，水平开角：140&amp;deg;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （2）水平波束宽度：0.5&amp;deg;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （3）距离分辨率：2cm&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （4）测深精度：10cm&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;（5）作用距离：200m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp;2、侧视高分辨率自适应孔径声学成像仪&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （1）采用自适应孔径成像技术，航迹方向与垂直航迹方向均为恒定分辨率&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （2）分辨率：2.5cm*2.5cm&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（3）垂直开角：38&amp;deg;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （4）作用距离：200m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; （5）典型航速：1~6kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20919', '5', '0', '1', '1', '0', '1', '294', '2017-11-18 16:31:10', '294', '2017-11-18 17:23:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('346', '183', '&quot;张赛&quot;号', '350', '20889', '20927', '船舶总长9755米、型宽17.80米，型深8.40米', '船舶总长9755米、型宽17.80米，型深8.40米', '&lt;p&gt;船舶总长9755米、型宽17.80米，型深8.40米&lt;/p&gt;', null, '99', '1', '1', '1', '0', '1', '298', '2017-11-18 16:32:23', '298', '2017-11-20 09:56:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('347', '182', 'Tinyfish微型高清侧视成像声呐', '345', '20925', '21035', '1.	距离分辨率：垂直航迹向1cm\r\n2.	波束开角：沿航迹向0.15&deg;/0.3&deg;/0.6&deg;可选\r\n3.	最远探测距离：不小于150m\r\n4.	工作航速：2kn-6kn', '本声呐可实现对海底悬浮或沉底的小目标、海底地貌的高清晰成像。\r\n（1）民用领域\r\n航道勘测、沉船或海上失事飞机搜索、海底电缆或油气管线巡检、地貌成像\r\n（2）安防领域\r\n水底凶器搜索、水下证物搜查、水下遇难人员搜查\r\n（3）军用领域\r\n沉底雷或锚雷探测、海洋环境侦查', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;Tinyfish&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;微型高清侧视成像声呐&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;一、产品简介&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;本声呐可实现对海底悬浮或沉底的小目标、海底地貌的高清晰成像。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（1）民用领域&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;航道勘测、沉船或海上失事飞机搜索、海底电缆或油气管线巡检、地貌成像&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（2）安防领域&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;水底凶器搜索、水下证物搜查、水下遇难人员搜查&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;（3）军用领域&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;沉底雷或锚雷探测、海洋环境侦查&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、技术指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）距离分辨率：垂直航迹向1cm&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）波束开角：沿航迹向0.15&amp;deg;/0.3&amp;deg;/0.6&amp;deg;可选&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）最远探测距离：不小于150m&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）工作航速：2kn-6kn&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20928', '7', '0', '1', '1', '0', '1', '294', '2017-11-18 16:35:44', '294', '2017-11-18 17:22:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('348', '151', 'Multi-Functional Connector', '354', '20914', '20934', '- Suitable for deepwater guide-lineless deployment\r\n- Direct hydraulic and electro-hydraulic control system compatible', '- Highly robust design minimises deployment damage risks\r\n- Suitable for deepwater guide-lineless deployment\r\n- Direct hydraulic and electro-hydraulic control system compatible\r\n- Reconfigurable and expandable functionality - change the SLIC&trade; through its life to suit your changing requirements', '&lt;p&gt;The SLIC&amp;trade; is an extraordinarily robust connector, specifically designed for applications where it will be subject to constant engagement and disengagement.&amp;nbsp;&lt;br /&gt;\r\nThe SLIC&amp;trade; is available as a pre-loaded or non-preloaded version, dependent on the desired application, and features ROV secondary locking to prevent accidental unlock during deployment or when exposed to live well pressure.&lt;/p&gt;', '20926', '6', '0', '1', '1', '0', '1', '269', '2017-11-18 16:35:47', '269', '2017-11-18 16:35:47');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('349', '139', 'HPE2.4型监测浮标', '335', '20929', '20942', 'PE2.4浮标是新一代低碳、环保、绿色、免维护、耐撞击、耐腐蚀航运助航标志。\r\nPE2.4型浮标由骨架和多个独立的滚塑模块组装而成。浮标骨架由316L不锈钢焊接而成，具有良好的耐腐蚀性。滚塑模块由极低密度聚乙烯材料粉末经过滚塑一次成形，具有良好的整体性，极大程度的减少材料之间的应力，抗撞击能力强。', 'PE2.4浮标是新一代低碳、环保、绿色、免维护、耐撞击、耐腐蚀航运助航标志。\r\nPE2.4型浮标由骨架和多个独立的滚塑模块组装而成。浮标骨架由316L不锈钢焊接而成，具有良好的耐腐蚀性。滚塑模块由极低密度聚乙烯材料粉末经过滚塑一次成形，具有良好的整体性，极大程度的减少材料之间的应力，抗撞击能力强。', '&lt;p&gt;&lt;strong&gt;HPE2.4型监测浮标&lt;/strong&gt;&lt;br /&gt;\r\nPE2.4 浮标是新一代低碳、环保、绿色、免维护、耐撞击、耐腐蚀航运助航标志。&lt;br /&gt;\r\nPE2.4 型浮标由骨架和多个独立的滚塑模块组装而成。浮标骨架由 316L 不锈钢焊接而&lt;br /&gt;\r\n成，具有良好的耐腐蚀性。滚塑模块由极低密度聚乙烯材料粉末经过滚塑一次成形，具有良&lt;br /&gt;\r\n好的整体性，极大程度的减少材料之间的应力，抗撞击能力强。&lt;br /&gt;\r\n&lt;strong&gt;具有以下特点：&lt;/strong&gt;&lt;br /&gt;\r\n一、高环保性&lt;br /&gt;\r\n1、产品绿色环保、无污染，可回收再利用。&lt;br /&gt;\r\n二、耐撞击&lt;br /&gt;\r\n1、浮体具有很高的弹性和硬度,被外力撞击后,迅速吸收撞击能量,恢复原形;&lt;br /&gt;\r\n2、浮标重量轻,惯性小,被撞击后可迅速移位,化解了撞击力,避免了破坏;&lt;br /&gt;\r\n3、浮体柔韧性强,抗拉伸,极难撕裂,可最大限度的保障浮体的安全;&lt;br /&gt;\r\n4、浮体内部采用特殊结构制造,内部填充密度&amp;ge;36kg/m3 聚氨酯泡沫,对浮体起到强力支&lt;br /&gt;\r\n撑,避免了漏水;&lt;br /&gt;\r\n5、浮体所有连接件均采用 316L 海上专用不锈钢螺栓连接。&lt;br /&gt;\r\n三、使用寿命长&lt;br /&gt;\r\n1、浮标耐腐蚀性能、耐紫外线照射性能极强,化学稳定性极高,数十年不会老化;&lt;br /&gt;\r\n2、 具有高强度、高耐候等特点，使用寿命长达 20 年。&lt;br /&gt;\r\n四、抗沉性:浮标的浮体模块内部填充吸水率小于 1%的聚氨酯发泡，在 2 个舱破裂的情况下&lt;br /&gt;\r\n保证不会沉没。&lt;/p&gt;', '20940', '11', '0', '1', '1', '0', '1', '246', '2017-11-18 16:37:38', '246', '2017-11-18 16:37:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('350', '151', 'SUB-FIGHTER TMS 4000', '353', '20941', '20949', 'All electric\r\n&rsaquo; Low maintenance\r\n&rsaquo; ROV locking latch and stabilization snubber', 'SUB-FIGHTER TMS 4000\r\n&rsaquo; Comply with DNV 2.22 Lifting Appliances\r\n&rsaquo; Support ROVs up to 3 T\r\n&rsaquo; All electric\r\n&rsaquo; Low maintenance\r\n&rsaquo; ROV locking latch and stabilization snubber', '&lt;p&gt;SUB-FIGHTER TMS 4000&lt;br /&gt;\r\n&amp;rsaquo; Comply with DNV 2.22 Lifting Appliances&lt;br /&gt;\r\n&amp;rsaquo; Support ROVs up to 3 T&lt;br /&gt;\r\n&amp;rsaquo; All electric&lt;br /&gt;\r\n&amp;rsaquo; Low maintenance&lt;br /&gt;\r\n&amp;rsaquo; ROV locking latch and stabilization snubber&lt;/p&gt;', '20948', '7', '0', '1', '1', '0', '1', '269', '2017-11-18 16:39:31', '269', '2017-11-18 16:39:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('351', '183', '&ldquo;向阳红10&rdquo;号', '349', '20937', '20956', '船舶总长93.0米，型宽17.4米、型深8.8米，总吨位4502，续航能力12000海里，船上定员65人。', '船舶总长93.0米，型宽17.4米、型深8.8米，总吨位4502，续航能力12000海里，船上定员65人。', '&lt;p&gt;船舶总长93.0米，型宽17.4米、型深8.8米，总吨位4502，续航能力12000海里，船上定员65人。&lt;/p&gt;', null, '98', '1', '1', '1', '0', '1', '298', '2017-11-18 16:40:02', '298', '2017-11-20 09:56:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('352', '182', '海底掩埋物实时三维成像系统', '345', '20938', '21034', '（1）像素精度：最高可达2cm\r\n（2）测深分辨率：对海底电缆、油气管线等目标掩埋深度的测量精度优于10cm\r\n（3）掩埋深度：对海底电缆、油气管线等目标可探测埋深不小于10m（东营硬质砂底）\r\n（4）探测范围：不小于正下方的90&deg;/120&deg;范围\r\n（5）水平波束数：不少于500个\r\n（6）典型航速：2kn-6kn\r\n（7）安装模式：船底固定安装、船艉拖曳、船侧悬挂安装、AUV和ROV安装', '海底掩埋物实时三维成像系统（3D BTI）可对海底悬浮、沉底和掩埋目标进行三维成像，实时输出悬浮、沉底和掩埋目标的三维图像，是海底地层三维剖面调查，海底掩埋目标探查（如海底危险爆炸物、水下掩埋沉船等），输油输气输水等管道目标外勘查，电缆光缆等线缆目标外勘查的理想设备。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;海底掩埋物实时三维成像系统&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;一、产品介绍&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;海底掩埋物实时三维成像系统可对海底悬浮、沉底和掩埋目标进行三维成像，实时输出悬浮、沉底和掩埋目标的三维图像，是海底地层三维剖面调查，海底掩埋目标探查（如海底危险爆炸物、水下掩埋沉船等），输油输气输水等管道目标外勘查，电缆光缆等线缆目标外勘查的理想设备。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;二、3D BTI 优点&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（1）探查能力强：可对航迹下方90&amp;deg;或120&amp;deg;范围内的悬浮、沉底和海底掩埋物进行三维成像，可同时给出目标的三维图像和埋深信息&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（2）相对浅地层剖面仪等传统的声学探测设备，探测效率高，能够探测尺度更小的管线目标&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（3）相对磁探设备，作用距离远，分辨率高，探测目标类型更广泛（如：可探测非金属目标），虚警率低，对载体无消磁等特殊要求&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（4）界面丰富友好：实时三维图像输出，后处理报告输出，数据内容丰富&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（5）智能跟踪：融合载体姿态与定位，为载体提供管线目标的识别，定位与跟踪输入&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp;（6）掩埋物探测：最大掩埋深度可达30m，像素精度最高可达2cm&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;三、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）像素精度：最高可达2cm&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）测深分辨率：对海底电缆、油气管线等目标掩埋深度的测量精度优于10cm&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）掩埋深度：对海底电缆、油气管线等目标可探测埋深不小于10m（东营硬质砂底）&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）探测范围：不小于正下方的90&amp;deg;/120&amp;deg;范围&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）水平波束数：不少于500个&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）典型航速：2kn-6kn&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp;（7）安装模式：船底固定安装、船艉拖曳、船侧悬挂安装、AUV和ROV安装&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20957', '8', '0', '1', '1', '0', '1', '294', '2017-11-18 16:41:19', '294', '2017-11-18 17:22:24');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('353', '183', '&ldquo;长和海洋&rdquo;号', '350', '20959', '20970', '船舶总长100.60米、型宽23.00米，型深6.0米，排水量8250，船上定员27人。', '船舶总长100.60米、型宽23.00米，型深6.0米，排水量8250，船上定员27人。', '&lt;p&gt;船舶总长100.60米、型宽23.00米，型深6.0米，排水量8250，船上定员27人。&lt;/p&gt;', null, '97', '1', '1', '1', '0', '1', '298', '2017-11-18 16:46:08', '298', '2017-11-20 09:56:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('354', '151', 'Xtreme Release Connector', '354', '20951', '20968', '- &frac34;&rdquo; 690 bar (10,000psi) full bore coupler designed for contaminated fluid service\r\n- &frac12;&rdquo; 690 bar (10,000psi) through bore coupler designed for clean fluid service', 'The Xtreme Release (XR) Connector TM differs fundamentally from all other subsea connectors because it is based on a face-to-face technology rather than a conventional male into female engagement.', '&lt;p&gt;The Xtreme Release (XR) Connector TM differs fundamentally from all other subsea connectors because it is based on a face-to-face technology rather than a conventional male into female engagement. This key differentiator enables the XR Connector to release safely, reliably and repeatedly with up to 100% of maximum bending capacity applied.&amp;nbsp;&lt;/p&gt;', '20963', '8', '0', '1', '1', '0', '1', '269', '2017-11-18 16:46:43', '269', '2017-11-18 16:46:43');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('355', '182', '海洋机器人自动驾驶仪', '346', '20961', '21020', '（1）体积：200mm（长）&times;142mm（宽）&times;100mm（高）；\r\n（2）重量：1.6kg；\r\n（3）主电源输入：18V~36V，平均功耗＜12W\r\n（4）接口：多普勒接口、惯导接口、CAN总线接口、GPS/4G/Wi-Fi/无线电天线接口、深度计接口、入/漏水接口、千兆网接口。\r\n（5）工作温度：-28℃～65℃；\r\n（6）储存温度：-40℃～70℃。', '海洋机器人自动驾驶仪可满足海洋机器人和无人驾驶船舶自主和遥控等多种工作模式需求，具有路径规划、能源监测、运动控制、自主导航、故障诊断、设备信息采集存储等多种功能。产品支持海洋机器人实现集中式和分布式控制体系架构，具有广泛的适应性。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;海洋机器人自动驾驶仪&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;一、产品介绍&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;海洋机器人自动驾驶仪可满足海洋机器人和无人驾驶船舶自主和遥控等多种工作模式需求，具有路径规划、能源监测、运动控制、自主导航、故障诊断、设备信息采集存储等多种功能。产品支持海洋机器人实现集中式和分布式控制体系架构，具有广泛的适应性。&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;二、功能特点&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;集成高精度电子罗盘、无线数传电台、wifi通信模块、4G通信模块、GPS定位模块，具备多普勒计程仪和惯导的接口，可实现路径规划、自主导航和航姿控制，具有完善的故障处理功能，包括：水池电压阈值超限、长时间达不到指定航姿、电机故障、数据链中断、速度超限、设备通信故障及漏水等。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;strong&gt;三、性能指标&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）体积：200mm（长）&amp;times;142mm（宽）&amp;times;100mm（高）；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）重量：1.6kg；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）主电源输入：18V~36V，平均功耗＜12W&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）接口：多普勒接口、惯导接口、CAN总线接口、GPS/4G/Wi-Fi/无线电天线接口、深度计接口、入/漏水接口、千兆网接口。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）工作温度：-28℃～65℃；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）储存温度：-40℃～70℃。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '20967', '4', '0', '1', '1', '0', '1', '294', '2017-11-18 16:48:20', '294', '2017-11-18 17:15:03');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('356', '183', '&ldquo;海力&rdquo;号', '349', '20972', '20982', '船舶49.8米、型宽12.00米，型深3.90米，排水量1113.2吨，续航能力5000海里，船上定员13人，作业人员22人。', '船舶49.8米、型宽12.00米，型深3.90米，排水量1113.2吨，续航能力5000海里，船上定员13人，作业人员22人。', '&lt;p&gt;船舶49.8米、型宽12.00米，型深3.90米，排水量1113.2吨，续航能力5000海里，船上定员13人，作业人员22人。&lt;/p&gt;', null, '94', '0', '1', '1', '0', '1', '298', '2017-11-18 16:51:01', '298', '2017-11-18 16:51:51');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('357', '182', '新型推进器', '346', '20984', '21022', '（1）主电源：DC24V，15A；\r\n（2）工作水深：标准深度：200M。全海洋深度可定制；\r\n（3）推力输出：30N；\r\n（4）转速控制：0~2000转/分连续可调；\r\n（5）舵角控制范围：&plusmn;25&deg;；\r\n（6）尺度：&Phi;200mm&times;560mm；\r\n（7）空气中重量：10.3kg；\r\n（8）水中重量：0.4kg。', '桨后舵推进器是一款适用于小型AUV的推进器。该产品配有四组独立的桨后舵和导管桨，可产生5kg向前的推力，可独立作为AUV的推进系统。采用了探海公司成熟的磁耦合设计，大大提高了推进器的稳定性。', '&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:28px&quot;&gt;新型推进器&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;一、产品介绍&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&lt;span style=&quot;font-size:14px&quot;&gt;桨后舵推进器是一款适用于小型AUV的推进器。该产品配有四组独立的桨后舵和导管桨，可产生5kg向前的推力，可独立作为AUV的推进系统。采用了探海公司成熟的磁耦合设计，大大提高了推进器的稳定性。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;二、性能指标&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）主电源：DC24V，15A；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）工作水深：标准深度：200M。全海洋深度可定制；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）推力输出：30N；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（4）转速控制：0~2000转/分连续可调；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（5）舵角控制范围：&amp;plusmn;25&amp;deg;；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（6）尺度：&amp;Phi;200mm&amp;times;560mm；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（7）空气中重量：10.3kg；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（8）水中重量：0.4kg。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;span style=&quot;font-family:黑体&quot;&gt;三、产品优势&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（1）采用成熟的磁耦合设计，极大提高了推进器的稳定性和环境适应性；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（2）结构紧凑、重量轻、易维护；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;（3）独特的设计比同类推进器推力更大、工作效率更高、稳定性更好。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '294', '2017-11-18 16:54:01', '294', '2017-11-18 17:17:00');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('358', '151', 'Winch Model Large', '353', '20983', '20992', 'Winch Model Large/Winch Model Medium', 'Winch Model Large/Winch Model Medium', '&lt;p&gt;Winch Model Large/Winch Model Medium&lt;/p&gt;', '20988', '9', '0', '1', '1', '0', '1', '269', '2017-11-18 16:54:45', '269', '2017-11-18 16:54:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('359', '139', 'HNF2.6型监测浮标', '335', '20989', '20997', 'HNF2.6型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3米到3000米）布设，适应风速45米/秒，流速2.0米/秒。', 'HNF2.6型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3米到3000米）布设，适应风速45米/秒，流速2.0米/秒。', '&lt;p&gt;&lt;strong&gt;HNF2.6&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF2.6型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3米到3000米）布设，适应风速45米/秒，流速2.0米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.6型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; HNF2.6 型聚脲监测浮标作为水文、水质、气象实时监测系统的仪器载体，采用太阳能电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪器和数据采集器、无线电数据传输模块等，通过北斗卫星或GPRS网络自动把监测数据实时传输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、系统可靠。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能特点：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; a,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; b,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; f,浮标重量轻，锚系能力强&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; g,浮标水上仪器操作作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; I,浮标稳定性好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; J,浮标颜色符合IALA标准的规定&lt;/p&gt;', '20996', '12', '0', '1', '1', '0', '1', '246', '2017-11-18 16:56:12', '246', '2017-11-18 16:56:12');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('360', '151', 'Gas Research Tech', '360', '21001', '21009', 'A special  Drilling, Riser and Wellhead System to drill an Exploration and  Test Production Well into the shallow deposits  150-250m below the Seafloor', 'A special  Drilling, Riser and Wellhead System to drill an Exploration and  Test Production Well into the shallow deposits  150-250m below the Seafloor', '&lt;p&gt;A special &amp;nbsp;Drilling, Riser and Wellhead System to drill an Exploration and &amp;nbsp;Test Production Well into the shallow deposits &amp;nbsp;150-250m below the Seafloor&lt;/p&gt;', '21007', '10', '0', '1', '1', '0', '1', '269', '2017-11-18 17:03:53', '269', '2017-11-18 17:03:53');
