INSERT INTO `byp_exhibition_booth_product_info` VALUES ('362', '122', '钢套压制钢丝绳索具', '338', '21014', '21156', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120094859_34.jpg&quot; style=&quot;height:1319px; width:1000px&quot; /&gt;&lt;/p&gt;', null, '7', '1', '1', '1', '0', '1', '225', '2017-11-18 17:11:53', '225', '2017-11-20 10:52:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('363', '139', 'HNF3.0型监测浮标', '335', '21024', '21032', 'HNF3.0 型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、近海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3 米到 3000 米）布设，适应风速 45 米/秒，流速 3.5 米/秒。', 'HNF3.0 型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、近海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3 米到 3000 米）布设，适应风速 45 米/秒，流速 3.5 米/秒。', '&lt;p&gt;&lt;strong&gt;HNF3.0&lt;/strong&gt;&lt;strong&gt;型监测浮标&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF3.0型监测浮标是一种水文/水质/气象监测浮标，适合布设在远海、近海、海港、湖泊等水域进行水文、水质和气象参数的监测。此浮标可以适应在任何水深（3米到3000米）布设，适应风速45米/秒，流速3.5米/秒。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF3.0型聚脲监测浮标浮体采用模塑聚脲弹性体材料制作，内部设置不锈钢骨架增强，采用不吸水的弹性泡沫材料进行填充，整个浮体整体性强，储备浮力大，在意外破损下能保持稳定性。浮标的外表喷涂优质氟碳耐候涂料，可以保证浮体的颜色鲜明，浮体整体免维护周期长，抗撞击和抗沉性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; HNF3.0 型聚脲监测浮标作为水文、水质、气象实时监测系统的仪器载体，采用太阳能电池板和免维护蓄电池为仪器提供能源保障。浮标上可以安装各种水文、水质、气象监测仪器和数据采集器、无线数据传输模块等，通过北斗卫星或GPRS网络自动把监测数据实时传输回监测中心。浮标布设在各监控点后不需人工操作，保证监测数据实时传输、数据准确、系统可靠。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能特点：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;a,配置足够的太阳能和蓄电池，可以长时间自主工作&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; b,可安装多种监测仪器，应用范围广&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; c,浮标颜色鲜明，目视效果好，不易被船只意外碰撞&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; d,结构牢固，性能可靠&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; e,耐腐蚀性好，维护成本低&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; f,浮标重量轻，锚系能力强&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; g,浮标水上仪器操作作业方便&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; h,浮标的仪器舱密封性能好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; I,浮标稳定性好&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp; J,浮标颜色符合IALA标准的规定&lt;/p&gt;', '21031', '13', '0', '1', '1', '0', '1', '246', '2017-11-18 17:21:26', '246', '2017-11-18 17:21:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('364', '166', '2000KN双卷筒液压拖缆机', '355', '21038', '21041', '绞车基本参数：\r\n额定负载：2000KN（第一层）\r\n额定速度：9m/min（第一层）\r\n支持负载：3000KN（第一层）\r\n卷筒容绳量：&phi;86mm&times;1500m\r\n卷筒尺寸：&phi;1400mm&times;2000mm', '2000KN双卷筒液压拖缆机。入籍RS船级社。   \r\n绞车基本参数：\r\n额定负载：2000KN（第一层）\r\n额定速度：9m/min（第一层）\r\n支持负载：3000KN（第一层）\r\n卷筒容绳量：&phi;86mm&times;1500m\r\n卷筒尺寸：&phi;1400mm&times;2000mm', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;2000KN双卷筒液压拖缆机。入籍RS船级社。&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;绞车基本参数：&lt;/p&gt;\r\n\r\n&lt;p&gt;额定负载：2000KN（第一层）&lt;/p&gt;\r\n\r\n&lt;p&gt;额定速度：9m/min（第一层）&lt;/p&gt;\r\n\r\n&lt;p&gt;支持负载：3000KN（第一层）&lt;/p&gt;\r\n\r\n&lt;p&gt;卷筒容绳量：&amp;phi;86mm&amp;times;1500m&lt;/p&gt;\r\n\r\n&lt;p&gt;卷筒尺寸：&amp;phi;1400mm&amp;times;2000mm&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;4 拷贝&quot; src=&quot;file:///C:/Users/lee/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg&quot; style=&quot;height:419px; width:551px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-18 17:31:04', '289', '2017-11-18 17:33:08');
