INSERT INTO `byp_exhibition_booth_product_info` VALUES ('369', '166', '石油软管', '356', '21097', '21099', '单胎体浮式软管和海底软管；双胎体浮式软管和海底软管；自由弯曲自由螺旋浮式软管和海底软管；超长（最长达300米）橡胶导管；液化天然气软管；码头软管', '单胎体浮式软管和海底软管；双胎体浮式软管和海底软管；自由弯曲自由螺旋浮式软管和海底软管；超长（最长达300米）橡胶导管；液化天然气软管；码头软管', '&lt;p&gt;单胎体浮式软管和海底软管；双胎体浮式软管和海底软管；自由弯曲自由螺旋浮式软管和海底软管；超长（最长达300米）橡胶导管；液化天然气软管；码头软管&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-19 16:20:11', '289', '2017-11-19 16:20:11');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('370', '166', '液压胶管', '356', '21100', '21102', '钢丝缠绕增强橡胶软管；钢丝编织增强橡胶软管；纤维编织增强橡胶软管；各种软管接头、快速接头及过渡接头', '钢丝缠绕增强橡胶软管；钢丝编织增强橡胶软管；纤维编织增强橡胶软管；各种软管接头、快速接头及过渡接头', '&lt;p&gt;钢丝缠绕增强橡胶软管；钢丝编织增强橡胶软管；纤维编织增强橡胶软管；各种软管接头、快速接头及过渡接头&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '289', '2017-11-19 16:24:31', '289', '2017-11-19 16:24:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('371', '166', '脐带缆', '357', '21103', '21107', '可以为客户设计、生产静态与动态海底电缆、脐带缆系统和专用海洋电缆', '可以为客户设计、生产静态与动态海底电缆、脐带缆系统和专用海洋电缆', '&lt;p&gt;公司代理英国JDR电缆产品，可以为客户设计、生产静态与动态海底电缆、脐带缆系统和专用海洋电缆&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-19 16:28:55', '289', '2017-11-19 16:28:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('372', '166', '拖钩、紧急拖钩、水密装置、导缆孔等', '358', '21117', '21118', '拖钩、紧急拖钩、导缆孔、浮筒、甲板缆桩、三角眼板等', '拖钩、紧急拖钩、导缆孔、浮筒、甲板缆桩、三角眼板等', '&lt;p&gt;拖钩、紧急拖钩、导缆孔、浮筒、甲板缆桩、三角眼板、钢丝绳拉紧器等&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-19 16:59:10', '289', '2017-11-19 16:59:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('373', '166', '绞车、锚机、吊机排缆服务', '359', '21119', '21122', '更换绞车、锚机、吊机钢缆的安装和更换，更换绳径60mm-120mm', '更换绞车、锚机、吊机钢缆的安装和更换，更换绳径60mm-120mm', '&lt;p&gt;更换绞车、锚机、吊机钢缆的安装和更换，更换绳径60mm-120mm，服务客户包括中远、中海油、大连船舶重工等&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-19 17:08:19', '289', '2017-11-19 17:08:19');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('374', '166', '高低压电气设备安装、检修、调试服务', '361', '21123', '21128', '海洋工程船舶建造工程\r\n 海洋工程船舶维修，改造及调试\r\n 电气系统继电保护及发电/主机控制\r\n     采购，安装以及调试\r\n 船舶甲板及设备专业化涂装\r\n 非标特种设备/功能撬块研发及制作\r\n 双螺杆泵生产及维修中心', '海洋工程船舶建造工程\r\n 海洋工程船舶维修，改造及调试\r\n 电气系统继电保护及发电/主机控制\r\n     采购，安装以及调试\r\n 船舶甲板及设备专业化涂装\r\n 非标特种设备/功能撬块研发及制作\r\n 双螺杆泵生产及维修中心', '&lt;p&gt;具有多年海上石油平台设施以及FPSO上部模块高低电气设备安装、检修、调试经验，相关资质齐全，核心技术人员参加过多台50MW以上发电 机组、变电站的电气调试经历，熟悉发电厂及变电站整个调试流程，有丰富的电气设备单体调试以及系统联调经验，能够独立编制调试方案、送电方案，精通发电机励磁系统，擅于解决各种电气疑难问题。&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;在继电保护方面，我们熟悉GE、Balser、ABB、Siemens、SEL、Schneider 等国外品牌的继电保护装置及高低压开关柜调试，特别是有20年的GE全系列继电保护产品调试经验。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '289', '2017-11-19 17:14:23', '289', '2017-11-19 17:14:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('375', '171', 'wiz probe', '363', '21135', '21137', '氨氮 (N-NH3) \r\n正磷酸盐 (P-PO4) \r\n硝酸盐 + 亚硝酸盐 N-(NO3+NO2) \r\n亚硝酸盐 (N-NO2)', '用于浮标在线监测传感器，可同时监测氨氮 (N-NH3) \r\n正磷酸盐 (P-PO4) \r\n硝酸盐 + 亚硝酸盐 N-(NO3+NO2) \r\n亚硝酸盐 (N-NO2)', '&lt;p&gt;用于浮标在线监测传感器，可同时监测氨氮 (N-NH3)&lt;br /&gt;\r\n正磷酸盐 (P-PO4)&lt;br /&gt;\r\n硝酸盐 + 亚硝酸盐 N-(NO3+NO2)&lt;br /&gt;\r\n亚硝酸盐 (N-NO2)&lt;/p&gt;\r\n\r\n&lt;p&gt;目前应用最广泛，最稳当的化学分析仪。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '292', '2017-11-19 23:45:56', '292', '2017-11-19 23:45:56');
