INSERT INTO `byp_exhibition_booth_product_info` VALUES ('377', '122', '无接头绳圈', '338', '21143', '21146', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120082546_352.jpg&quot; style=&quot;height:1136px; width:800px&quot; /&gt;&lt;/p&gt;', null, '8', '0', '1', '1', '0', '1', '225', '2017-11-20 08:25:58', '225', '2017-11-20 10:52:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('378', '122', '铝套压制钢丝绳索具', '338', '21158', '21162', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '我公司生产加工各种规格钢丝绳索具，包含插编钢丝绳，压制钢丝绳，无接头绳圈，钢丝绳组合索具等。', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120095242_922.jpg&quot; style=&quot;height:1366px; width:1000px&quot; /&gt;&lt;/p&gt;', null, '9', '1', '1', '1', '0', '1', '225', '2017-11-20 09:52:53', '225', '2017-11-20 10:52:33');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('379', '183', '牵引绞车', '351', '21161', '21168', '减少缆绳与绞盘之间的相对摩擦，从而避免了缆绳的磨损与摩擦生热。安全稳定，控制平稳精确，能够保持牵引器与储缆滚筒之间的张力恒定，减少张力变化带来的冲击，更好的保护缆与排缆，延长缆的使用寿命，最大拉力可达到15T，最高转速（2M/S）。', '减少缆绳与绞盘之间的相对摩擦，从而避免了缆绳的磨损与摩擦生热。安全稳定，控制平稳精确，能够保持牵引器与储缆滚筒之间的张力恒定，减少张力变化带来的冲击，更好的保护缆与排缆，延长缆的使用寿命，最大拉力可达到15T，最高转速（2M/S）。', '&lt;p&gt;减少缆绳与绞盘之间的相对摩擦，从而避免了缆绳的磨损与摩擦生热。安全稳定，控制平稳精确，能够保持牵引器与储缆滚筒之间的张力恒定，减少张力变化带来的冲击，更好的保护缆与排缆，延长缆的使用寿命，最大拉力可达到15T，最高转速（2M/S）。&lt;/p&gt;', '21165', '93', '0', '1', '1', '0', '1', '298', '2017-11-20 09:56:13', '298', '2017-11-20 09:56:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('380', '156', '插编钢丝绳扣', '364', '21164', '21172', '我公司专业生产插编钢丝绳套，插编钢丝绳扣， 镀锌插编钢丝绳，采用专业的钢丝绳索具深加工设备,根据钢丝绳的捻股、合绳工艺，单股多次插编形成，插编范围&Phi;6mm～&Phi;360mm。 破断拉力大、疲劳寿命长、耐磨性能好，安全可靠等特点 。', '插编绳扣工艺是一种先进的钢丝绳索具制作工艺。插编绳索外形美观，精确度高，缔结强度大，是最普遍的索具形式之一，我企业生产的插编绳扣采用优质钢丝绳，严格执行国家标准，取得了CCS船检认证，钢丝绳结构不同，其工作载荷不同，可根据客户要求的钢丝绳结构来计算工作载荷。', '&lt;p&gt;&lt;strong&gt;产品用途：&lt;/strong&gt;可用在各种工程起重机械、冶金矿山设备、油田井架、港口铁路装卸、林业机械、电力设备、航空及海上、陆地运输、工程抢救、打捞沉船、厂矿企业起重、吊装、牵引索具上。&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;产品特点：&lt;/strong&gt;与钢丝绳同等强度，使用安全，外形美观过渡平滑，吊装作业安全负荷大，可抗击冲击负荷，使用寿命长。&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;产品质量：&lt;/strong&gt;生产中严格执行该项技术的国际标准及国家标准，按其要求进行抽检，试验件必需达到与钢丝绳等强度，即钢丝绳破断压接部位不移、不脱开、不破裂。索具产品出厂可出具本公司证书&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '278', '2017-11-20 09:57:57', '278', '2017-11-20 09:57:57');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('381', '119', '浑浊水下摄影机', '365', '21163', '21179', '品牌：远大海洋\r\n操作系统：安卓\r\n屏幕分辨率：1920*1080分辨率\r\n摄像头：500万像素\r\n伸缩杆：3m\r\n电池：5000mAh', '浑浊水下摄影机是国内第一款VR眼镜与水下摄影相结合的一款产品。它可以在透明度20厘米的情况下看到对虾的肠道，可以帮助养殖户观测水下饲料的摄食情况、有没有死虾、粪便情况、水底有没有腐败变坏。并且能给水产养殖疾病防控带来：早期诊断，对症下药。为实现绿色、安全、高效养殖打好基础。', '&lt;p&gt;远大海洋与中国水产科学研究院黄海水产研究所共同研发了浑浊水下摄影机。&lt;/p&gt;\r\n\r\n&lt;p&gt;浑浊水下摄影机是国内第一款VR眼镜与水下摄影相结合的一款产品。它可以在透明度20厘米的情况下看到对虾的肠道，可以帮助养殖户观测水下饲料的摄食情况、有没有死虾、粪便情况、水底有没有腐败变坏。并且能给水产养殖疾病防控带来：早期诊断，对症下药。为实现绿色、安全、高效养殖打好基础。&lt;/p&gt;\r\n\r\n&lt;p&gt;国内第一款用WiFi连接多种观测设备的一款水下摄影机。可以用手机、平板电脑、VR眼镜同时观看，并且任何一款观测设备都能独立完成拍照、录像等功能。能给科学院所带来现场教学演示、水下影像资料的采集、项目验收等。能给保险公司水产养殖理赔工作带来帮助。能给国内渔业部门的技术推广站带来更好的、更准确的为养殖户服务。能给水产饲料厂和水产药品厂带来更好的、更准确的为养殖户服务，提高自己产品的销量。&lt;/p&gt;\r\n\r\n&lt;p&gt;浑浊水下摄影机总重量仅10千克，便携、操作简单。&lt;/p&gt;', '21177', '1', '1', '1', '1', '0', '1', '217', '2017-11-20 10:00:11', '217', '2017-11-20 10:26:58');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('382', '156', '合成纤维柔性吊装带', '364', '21174', '21182', '生产0.5T~200T合成纤维吊装带，安全系数6:1', '广泛用于航空、航天、核电建设、军工制 造、港口装卸、电力安装、机械加工、造船、交通运输等各个领域', '&lt;p&gt;柔性吊装带用于配合吊钩等起重吊装物体，可以适用于多种吊装条件下的物体起吊，它既有高强度，又能够不伤害物体表面，既轻便又柔软，可以多种组合的使用方式。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 柔性吊装带外表面精细，对易损物体不会造成损伤。而且吊装方式多，也可用于拖拉被吊物。拥有充足的吊装带货源，而且提供各种进口吊装带。设有独特标签，并使用国际标准色来区分承载吨位，即使吊装带磨损也易于辨认。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '278', '2017-11-20 10:02:45', '278', '2017-11-20 10:02:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('383', '119', '塘宁', '366', '21185', '21189', '规格：2L/瓶', '主要成分：由胍类大分子物质等组成。', '&lt;p&gt;&lt;strong&gt;功能作用：&lt;/strong&gt;该产品是一种新型的水产养殖用水质调理剂，它采用进口原材料制成。性能稳定，作用效果持久。产品不仅有良好的絮凝作用，尤其是对水产养殖水体中的有害微生物有很强的抑杀作用，并不会对养殖的水产动物产生应激等任何副作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;该产品通过特殊工艺复配特殊絮凝因子，能对池塘、水族缸的水质起到良好的絮凝作用，使水质清洁，一方面有利于观察、观赏或捕捞；另一方面在很大程度上减少鱼虾被病原体感染的机率。该产品能有效抑制水中细菌、病毒、真菌的滋生和繁衍，防止鱼、虾等水生动物因水中存在大量细菌、病毒等病原体感染，促使水产动物的健康和快速生长。另外，可用于受精卵表面消毒，防止病毒和细菌的污染；在虾、蟹、鱼类育苗期间，定期使用可有效预防和治疗附肢挂脏、体表污物附着、拖便等现象。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;产品性状：&lt;/strong&gt;该产品无毒、无腐蚀、无刺激、无挥发性气体和刺激性气味，特别是没有氯、碘、重金属等有害物质的残留，能符合鱼虾等水产品出口的质量要求，是当前一种新型的安全、环保、高效的水质消毒调理剂。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能指标：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;外&amp;nbsp; 观-------淡蓝色液体&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; P H 值-------6.5-7.5&lt;/p&gt;\r\n\r\n&lt;p&gt;腐蚀性-------无&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 毒&amp;nbsp; 性-------无&lt;/p&gt;\r\n\r\n&lt;p&gt;气&amp;nbsp; 味-------无&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 水溶性-------完全&lt;/p&gt;\r\n\r\n&lt;p&gt;着色性-------无&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 抑、杀菌性能-------广谱、长效、持久&lt;/p&gt;\r\n\r\n&lt;p&gt;环保性-------优良，可降解，对环境无污染&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;用法用量：&lt;/strong&gt;本品为完全水溶性液体，稀释100倍后全池泼洒。预防用量每亩（水深1-1.5米）用本品300-500ml，一般情况下每月使用1-2次；疾病发生时，水体中病原体较多，每亩（水深1-1.5米）每次用本品500-1000ml，隔天使用，连续2次。受精卵表面消毒，2PPM，10-20分钟；虾、蟹、鱼苗出现附肢挂脏、体表污物附着和拖便现象时，使用1-2PPM全池泼洒，次日换水。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '217', '2017-11-20 10:06:29', '217', '2017-11-20 10:27:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('384', '156', '合成纤维扁平吊装带', '364', '21187', '21192', '主要生产0.5T~200吨吊带', '1、重量轻，是金属吊具20%的重量，使用方便。\r\n2、不伤被吊物体表面。\r\n3、起吊平稳、安全。\r\n4、强力高，色彩鲜艳。\r\n5、提高劳动效率，节约成本。\r\n6、耐腐蚀、耐磨性能好。\r\n7、用途广泛：用于港口码头、化工、钢铁、机械、石油、电力、铁路、矿山、冶金、造船、汽车、航空航天、军队、安装及其它的工业领域', '&lt;p&gt;优点：&lt;br /&gt;\r\n1、重量轻，是金属吊具20%的重量，使用方便。&lt;br /&gt;\r\n2、不伤被吊物体表面。&lt;br /&gt;\r\n3、起吊平稳、安全。&lt;br /&gt;\r\n4、强力高，色彩鲜艳。&lt;br /&gt;\r\n5、提高劳动效率，节约成本。&lt;br /&gt;\r\n6、耐腐蚀、耐磨性能好。&lt;br /&gt;\r\n7、用途广泛：用于港口码头、化工、钢铁、机械、石油、电力、铁路、矿山、冶金、造船、汽车、航空航天、军队、安装及其它的工业领域。&lt;br /&gt;\r\n注意事项&lt;br /&gt;\r\n1、不要使用已损坏的吊索。&lt;br /&gt;\r\n2、在吊装时，不要扭、绞吊索。&lt;br /&gt;\r\n3、不要让吊索打结。&lt;br /&gt;\r\n4、避免撕开缝纫连合部位或超负荷工作。&lt;br /&gt;\r\n5、当移动吊索的时候，不要拖拉。&lt;br /&gt;\r\n6、避免强夺或震荡负载。&lt;br /&gt;\r\n7、每一个吊索在每一次使用前必须要检查。&lt;br /&gt;\r\n8、绦纶有耐无机酸的机能，但易受有机酸的伤害&lt;br /&gt;\r\n9、丙纶适用于最能抗化学物品的场所使用。&lt;br /&gt;\r\n10、锦纶有耐无机酸的能力，易受有机酸的伤害。&lt;br /&gt;\r\n11、锦纶在受潮时，强力损失可达1 5％。&lt;br /&gt;\r\n12、如果吊索是在可能受化学品污染或者是在高温下使用，则应向供应商寻求参考意见。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '278', '2017-11-20 10:07:33', '278', '2017-11-20 10:07:33');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('385', '119', '生物藻胶', '367', '21206', '21213', '规格：1KG/袋', '主要成分：天然海藻粉、诱食剂、促生长剂。', '&lt;p&gt;&lt;strong&gt;作用用途：&lt;/strong&gt;可将药物、添加剂等粘合在颗粒饲料表面，制作药饵；因具有防水功能，也可用于小杂鱼表面粘合药物投喂；自制颗粒饲料的粘合剂；具有诱食和促生长作用。投喂饲料时，可包裹饲料表面，防止饲料溶散到池水中，以保持良好水质。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;使用方法：&lt;/strong&gt;1、按每公斤饲料加入10-15克生物藻胶称重。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、把生物藻胶倒入药饵枪容器中，再按5-6倍比例的重量将温水或热水倒入其中，混合搅拌，直到出现黏糊状。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、按要求称重药粉，倒入上述糊状粘合剂中，再搅拌均匀。&lt;/p&gt;\r\n\r\n&lt;p&gt;4、将颗粒饲料倒入药饵搅拌机中，用药饵枪将搅拌好的生物藻胶均匀的喷洒在颗粒饲料上，晾晒2-3小时或直接投喂。&lt;/p&gt;\r\n\r\n&lt;p&gt;5、若与小杂鱼粘合时，先将粘合剂粉和药粉混合，然后将混合的干粉均匀撒到小杂鱼中，充分搅拌均匀并形成黏糊状态后即可投喂。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;特点：&lt;/strong&gt;具有防水功能，制作的饵料可不用晾晒，直接投入养殖水体中，24小时不溶散，保形性能好。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;贮藏方法：&lt;/strong&gt;本品需密闭保存，阴凉、通风处贮藏，防止阳光直射和高温处搁置。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '217', '2017-11-20 10:18:45', '217', '2017-11-20 10:27:15');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('386', '119', '药饵枪', '367', '21214', '21216', '规格：10L', '药饵枪是藻胶粘合剂专用喷枪，用于快速制作饲料药饵。该药饵枪系统由压力罐、空气压缩机、连接管道、手持枪头、电源线等组成。', '&lt;p&gt;药饵枪是藻胶粘合剂专用喷枪，用于快速制作饲料药饵。该药饵枪系统由压力罐、空气压缩机、连接管道、手持枪头、电源线等组成。该设备分为三个型号：YD-PQ2L，属于小体积压力罐，一次仅用2升藻胶粘合剂，每次制作药饵30-40公斤；YD-PQ10L，属于中等体积压力罐，一次可用10升藻胶粘合剂，每次制作150-200公斤药饵；YD-PQ30L,属于较大体积压力罐，一次可用30升藻胶粘合剂，每次制作药饵500-600公斤。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;特点：&lt;/strong&gt;与生物藻胶相配合，将藻胶和药品混合物喷射呈雾状，替代手工制作药饵，做到快速、均匀、粘附力大、清洁、卫生、节省药物和粘合剂。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '217', '2017-11-20 10:20:35', '217', '2017-11-20 10:20:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('387', '119', '药饵搅拌机', '367', '21217', '21219', '规格：60KG', '药饵搅拌机是进行饲料和药物机械化混合的设备，它是由料筒、齿圈、转动控制轮、电机、支架、电源线等组成。', '&lt;p&gt;药饵搅拌机是进行饲料和药物机械化混合的设备，它是由料筒、齿圈、转动控制轮、电机、支架、电源线等组成。该设备分为两个型号：YD-JB-120，一次制作30-40公斤药饵；YD-JB-200，一次制作60-70公斤药饵。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;特点：&lt;/strong&gt;将颗粒饲料放入料筒，并在其中旋转，利用药饵枪将藻胶和药品混合物喷射呈雾状，高压喷涂到颗粒饲料表面。替代手工制作药饵，做到快速、均匀、粘附力大、清洁卫生、节省药物和粘合剂。同时，制出的药饵不用晾晒即可直接投喂。&lt;/p&gt;', null, '6', '0', '1', '1', '0', '1', '217', '2017-11-20 10:22:36', '217', '2017-11-20 10:22:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('388', '119', 'TN调水王', '366', '21221', '21224', '规格：5L/桶', '主要成分：本品由多种高浓度复合有益菌发酵浓缩后，配伍植物提取物，富含有益菌产物、天然植物有机色素、以及氮、磷、钾、钙、铜、铁、锌、镁、锰等元素组成的促生长因子等组成。', '&lt;p&gt;&lt;strong&gt;主要成分：&lt;/strong&gt;本品由多种高浓度复合有益菌发酵浓缩后，配伍植物提取物，富含有益菌产物、天然植物有机色素、以及氮、磷、钾、钙、铜、铁、锌、镁、锰等元素组成的促生长因子等组成。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性状：&lt;/strong&gt;深棕色液体&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;适用对象：&lt;/strong&gt;适用于鱼类、虾蟹、海参等水生生物的育苗和养殖过程，对室内工厂化、大棚、池塘养殖均可。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;作用用途：&lt;/strong&gt;本品属于有机肥料，富含氨基酸、多糖、矿物质、其他促生长因子等；同时含有天然植物有机色素，用于池水的水色调节。本品属于绿色、环保、安全、无公害有机产品，其功能包括：&lt;/p&gt;\r\n\r\n&lt;p&gt;1、作为藻类营养剂，用于水产养殖池塘早起肥水，使池水单胞藻快速繁殖，形成良好藻相和水色，从而提高池水的自然生产力和饵料报酬。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、本产品能使池水马上形成茶褐色，保持约20~30天，降低池水透明度和遮蔽阳光照射，抑制硬毛藻、金膜藻、浒苔、水云等有害藻类的生长；同时减弱强光照射，降低夏季高温期池水的温度，使鱼、虾、参安全度夏。另外，稳定池塘生态环境，池水免受高温作用，防止池底藻类死亡、腐败和有害物质的产生。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、在养殖过程中，自然倒藻、大量换水、水色变清后，可随时使用本品迅速改水，快速形成水色，降低池水透明度，保护池塘免受大型有害藻类的大量滋生。&lt;/p&gt;\r\n\r\n&lt;p&gt;4、可减少水生动物对强光、高温的应激反应，综合性提高它们的生理、生长技能，降低其发病率和死亡率，具有较好增产作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;使用方法：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1、本品每亩池塘使用量约10~15升，根据池水深度、透明度或特殊要求，酌情增减。取本品盛于容器中，用水10倍稀释后，均匀泼洒到池中；泼洒时，启动增氧机，保障其均匀分布。本品无毒无害，为保障池塘水色持久，维持池水透明度和单胞藻密度，使用本品后不宜大换水。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、使用时，禁止与氧化消毒剂同期使用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;贮藏方法：&lt;/strong&gt;本品现配现用、稀释液当天用完；原液密闭保存，阴凉、通风处贮藏，防止阳光直射和高温处搁置。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '217', '2017-11-20 10:25:10', '217', '2017-11-20 10:25:10');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('389', '120', '海藻壁纸', '368', '21222', '21236', '产品主要亮点有：（一）纯天然特性1.纯天然阻燃传统可阻燃壁纸，由于海带（褐藻）这种神奇的植物本身用火无法点燃，遇火产生微烟。2.强抑菌不添加任何化学抑菌剂，海藻壁纸用于室内装饰，特别是在沿海地区，不会出现发霉长毛的情况。3.吸附/去除海藻壁纸可以大面积吸附重金属离子，并且吸附速度快，定期用干布擦拭或者吸尘器清理即可，无疑是抵御空气中有害金属粒子的有效利器。4.耐腐蚀海藻壁纸对空气中的酸有较强的抵抗性。5.防辐射海藻壁纸的防辐射性能在低频区的表现较好，其防辐射性能明显优于传统壁纸。', '东岚墙艺，创造海艺术生活在壁纸领域东岚高科（青岛）有限公司年轻但是充满活力。进入该领域之初，公司便于两所国家级大学紧密合作，在研发环保纸基方面给予技术支持，同时与意大利设计团队长期合作，以便给客户提供独特唯一的环保壁纸。东岚高科海藻壁纸突破传统壁纸观念，增加了其独特的功能和特点。', '&lt;p&gt;东岚墙艺，创造海艺术生活在壁纸领域东岚高科（青岛）有限公司年轻但是充满活力。进入该领域之初，公司便于两所国家级大学紧密合作，在研发环保纸基方面给予技术支持，同时与意大利设计团队长期合作，以便给客户提供独特唯一的环保壁纸。东岚高科海藻壁纸突破传统壁纸观念，增加了其独特的功能和特点。产品主要亮点有：（一）纯天然特性1.纯天然阻燃传统可阻燃壁纸，是将纸张内添加化学阻燃剂或是无机阻燃剂，而海藻壁纸，由于海带（褐藻）这种神奇的植物本身用火无法点燃，遇火产生微烟。2.强抑菌不添加任何化学抑菌剂，海藻壁纸用于室内装饰，特别是在沿海地区，不会出现发霉长毛的情况。3.吸附/去除海藻壁纸可以大面积吸附重金属离子，并且吸附速度快，定期用干布擦拭或者吸尘器清理即可，无疑是抵御空气中有害金属粒子的有效利器。4.耐腐蚀海藻壁纸对空气中的酸有较强的抵抗性。5.防辐射海藻壁纸的防辐射性能在低频区的表现较好，其防辐射性能明显优于传统壁纸。 6.防静电人们在日常生活里，有时由于穿着、气候、摩擦等原因，常常导致身体积累静电，与物体接触发生静电反应。由于海带生长于海洋，其分子结构独特，所以防静电效果远高于棉，麻等陆地植物，从而海藻壁纸可以有效的回避静电，降低静电给人们生活带来的影响。7.稳定性通常情况下，传统壁纸有的会有湿涨干缩的变现，易出现开裂，翘边等情况；而海藻壁纸在干燥，潮湿的情况下，伸缩率几乎等于零，所以海藻壁纸的韧性强，不易开裂，稳定性好。&lt;/p&gt;', '21235', '1', '1', '1', '1', '0', '1', '219', '2017-11-20 10:31:16', '219', '2017-11-20 11:12:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('390', '183', 'CTD绞车', '351', '21240', '21247', '采用一体框架式或分体式设计，安全工作负载：&le;5吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能力达到万米及以上。', '采用一体框架式或分体式设计，安全工作负载：&le;5吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能力达到万米及以上。', '&lt;p&gt;采用一体框架式或分体式设计，安全工作负载：&amp;le;5吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能力达到万米及以上。&lt;/p&gt;', '21246', '92', '0', '1', '1', '0', '1', '298', '2017-11-20 10:39:30', '298', '2017-11-20 10:39:30');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('391', '185', 'HD-MAX单波束测深系统', '373', '21243', '21251', '上图展示', 'HD-MAX是一款全数字回波测深仪，广泛适用于水文、勘察、航道、码头疏浚等行业的精密测量和水深数据记录。内置业界最高配置的工控电脑平台，实现计算机技术与测深技术完美融合；内置最新版本Hi MAX导航记录软件，方便外业采集记录。与传统外业测量所需设备相比，HD-MAX测深仪为您节省购买电脑和导航记录软件费用，性价比更高。', '&lt;p&gt;HD-MAX是一款全数字回波测深仪，广泛适用于水文、勘察、航道、码头疏浚等行业的精密测量和水深数据记录。内置业界最高配置的工控电脑平台，实现计算机技术与测深技术完美融合；内置最新版本Hi MAX导航记录软件，方便外业采集记录。与传统外业测量所需设备相比，HD-MAX测深仪为您节省购买电脑和导航记录软件费用，性价比更高。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '284', '2017-11-20 10:42:03', '284', '2017-11-20 11:04:17');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('392', '120', '多种类海藻纤维', '369', '21244', '21259', '海藻纤维用途包含纺织服装、医疗、卫生护理三大领域', '海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&ldquo;长江学者和创新团队发展计划&rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&ldquo;山东省优秀创新团队&rdquo;表彰。', '&lt;p&gt;海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&amp;ldquo;长江学者和创新团队发展计划&amp;rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&amp;ldquo;山东省优秀创新团队&amp;rdquo;表彰。海藻纤维用途包含纺织服装、医疗、卫生护理三大领域&lt;/p&gt;', '21258', '2', '1', '1', '1', '0', '1', '219', '2017-11-20 10:44:26', '219', '2017-11-20 11:12:52');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('393', '120', '海藻纤维服装产品', '371', '21264', '21266', '纺织服装：特种服装：消防服、防火服、防火衣衬里、防辐射服装、军用服装、警用服装、防护性工作服灯；普通服装：外用服饰、内衣类服饰、儿童服饰、儿童玩具、儿童纸尿裤等；家用纺织品：床上用品、窗帘、可降解阻燃壁纸等；其他用途:汽车阻燃内饰、火车阻燃内饰、飞机阻燃内饰、公共场所阻燃材料。\r\n医疗', '海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&ldquo;长江学者和创新团队发展计划&rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&ldquo;山东省优秀创新团队&rdquo;表彰。', '&lt;p&gt;海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&amp;ldquo;长江学者和创新团队发展计划&amp;rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&amp;ldquo;山东省优秀创新团队&amp;rdquo;表彰。纺织服装：特种服装：消防服、防火服、防火衣衬里、防辐射服装、军用服装、警用服装、防护性工作服灯；普通服装：外用服饰、内衣类服饰、儿童服饰、儿童玩具、儿童纸尿裤等；家用纺织品：床上用品、窗帘、可降解阻燃壁纸等；其他用途:汽车阻燃内饰、火车阻燃内饰、飞机阻燃内饰、公共场所阻燃材料。&lt;br /&gt;\r\n医疗&lt;/p&gt;', '21261', '3', '1', '1', '1', '0', '1', '219', '2017-11-20 10:47:17', '219', '2017-11-20 11:12:56');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('394', '185', 'iBeam 8120', '373', '21254', '21268', '规格请见上图', 'iBeam 8120 是中海达最新推出的拥有完全自主知识产权的小型化便携式多波束测深仪，具有较高的水深分辨率和测深精度，符合IHO  S44特级标准和《水运工程测量规范》要求。换能器采用T型设计，重量12kg，能够适应更小平台安装。单条带有效覆盖角度从30~130&deg;在线可调，工作模式可选等角、等距模式，适应不同环境使用。iBeam 8120 可广泛应用于海图绘制、地质调查、航道疏浚、搜救打捞、路由调查等多个领域。', '&lt;p&gt;iBeam 8120 是中海达最新推出的拥有完全自主知识产权的小型化便携式多波束测深仪，具有较高的水深分辨率和测深精度，符合IHO&amp;nbsp; S44特级标准和《水运工程测量规范》要求。换能器采用T型设计，重量12kg，能够适应更小平台安装。单条带有效覆盖角度从30~130&amp;deg;在线可调，工作模式可选等角、等距模式，适应不同环境使用。iBeam 8120 可广泛应用于海图绘制、地质调查、航道疏浚、搜救打捞、路由调查等多个领域。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '284', '2017-11-20 10:47:28', '284', '2017-11-20 10:47:28');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('395', '120', '海藻纤维医用产品、护理产品及阻燃工程类产品', '372', '21269', '21272', '医疗：高性能敷料、止血包、纱布、绷带、手术后护理材料等；卫生护理：纸尿裤、卫生巾、湿巾、PM2.5口罩、面膜等', '海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&ldquo;长江学者和创新团队发展计划&rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&ldquo;山东省优秀创新团队&rdquo;表彰。', '&lt;p&gt;海藻纤维产业化项目获2016年度山东省技术发明一等奖、获2016年度中国纺织工业联合会科技一等奖；科技部重点863项目技术，开发了海藻纤维生产关键技术和专用纺丝原料生产技术；教育部&amp;ldquo;长江学者和创新团队发展计划&amp;rdquo;入选科研团队进行技术攻关和产品研发；国际唯一掌握海藻纤维专用原料核心生产技术的企业；制定、修订了海藻纤维行业目前仅有的两个行业生产标准；《海藻盐酸短纤维》 、 《纤维用褐藻酸钠》；获授权海藻纤维生产关键技术相关发明专利三十余项；海藻纤维研发团队获&amp;ldquo;山东省优秀创新团队&amp;rdquo;表彰。医疗：高性能敷料、止血包、纱布、绷带、手术后护理材料等；卫生护理：纸尿裤、卫生巾、湿巾、PM2.5口罩、面膜等&lt;/p&gt;', '21271', '4', '0', '1', '1', '0', '1', '219', '2017-11-20 10:49:47', '219', '2017-11-20 10:49:47');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('396', '185', 'iBoat B1', '373', '21273', '21276', 'iBoat B1 采用双M型船体设计，阻力小，航行平稳，船身周围创造性地加入可充气气囊，使用时将气囊充满，既可全方位保护船体不受碰撞，又可提高船体载重，增强搭载能力。推进器采用独特的涵道式设计，有效防止渔网、水草等杂物缠绕，且与船底齐平，放置方便。', 'iBoat B1 采用双M型船体设计，阻力小，航行平稳，船身周围创造性地加入可充气气囊，使用时将气囊充满，既可全方位保护船体不受碰撞，又可提高船体载重，增强搭载能力。推进器采用独特的涵道式设计，有效防止渔网、水草等杂物缠绕，且与船底齐平，放置方便。  具有自主导航功能，可搭载多种测量设备。广泛应用于河流、湖泊、航道区域的水下地形地貌测量、水文测量、暗管普查等作业任务。', '&lt;p&gt;iBoat B1 采用双M型船体设计，阻力小，航行平稳，船身周围创造性地加入可充气气囊，使用时将气囊充满，既可全方位保护船体不受碰撞，又可提高船体载重，增强搭载能力。推进器采用独特的涵道式设计，有效防止渔网、水草等杂物缠绕，且与船底齐平，放置方便。&lt;/p&gt;\r\n\r\n&lt;p&gt;具有自主导航功能，可搭载多种测量设备。广泛应用于河流、湖泊、航道区域的水下地形地貌测量、水文测量、暗管普查等作业任务。&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '284', '2017-11-20 10:52:42', '284', '2017-11-20 10:52:42');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('397', '183', '超洁净CTD绞车', '351', '21275', '21284', '基于痕量金属的检查而配置的，采用合成材料制造的lebus槽及绞车法兰，导轮，防跳缆装置，可以做成移动集装箱式，特制水下连接器，严格绝缘及外部隔绝层。', '基于痕量金属的检查而配置的，采用合成材料制造的lebus槽及绞车法兰，导轮，防跳缆装置，可以做成移动集装箱式，特制水下连接器，严格绝缘及外部隔绝层。', '&lt;p&gt;基于痕量金属的检查而配置的，采用合成材料制造的lebus槽及绞车法兰，导轮，防跳缆装置，可以做成移动集装箱式，特制水下连接器，严格绝缘及外部隔绝层。&lt;/p&gt;', '21281', '91', '0', '1', '1', '0', '1', '298', '2017-11-20 10:55:20', '298', '2017-11-20 10:55:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('398', '185', 'iBoat BM1智能无人测量船', '373', '21279', '21291', 'iBoat BM1智能无人船采用三体船型设计，具有耐波性好、阻力小、重心低、船行平稳等优势。', 'iBoat BM1智能无人船采用三体船型设计，具有耐波性好、阻力小、重心低、船行平稳等优势。螺旋桨采用直流无刷电机驱动，推进器采用涵道式设计，可有效预防水草、鱼网等杂物缠绕。\r\niBoat BM1智能无人船还可搭载ADCP、水质取样箱、多波束、侧扫声纳、多参数水质分析仪等一种或多种传感器。广泛应用于河流、航道、水库、港湾等区域水下地形测量或水文测量，实现常规或应急水质采样、水质监测、水文测量、航道测绘、暗管探测等业务。', '&lt;p&gt;iBoat BM1智能无人船采用三体船型设计，具有耐波性好、阻力小、重心低、船行平稳等优势。螺旋桨采用直流无刷电机驱动，推进器采用涵道式设计，可有效预防水草、鱼网等杂物缠绕。&lt;/p&gt;\r\n\r\n&lt;p&gt;iBoat BM1智能无人船还可搭载ADCP、水质取样箱、多波束、侧扫声纳、多参数水质分析仪等一种或多种传感器。广泛应用于河流、航道、水库、港湾等区域水下地形测量或水文测量，实现常规或应急水质采样、水质监测、水文测量、航道测绘、暗管探测等业务。&lt;/p&gt;', null, '4', '1', '1', '1', '0', '1', '284', '2017-11-20 10:58:49', '284', '2017-11-20 11:04:21');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('399', '183', '地质钢缆绞车', '351', '21287', '21296', '用于底层重力或网箱取样，采用一体框架式分体式设计，安全工作负载：&le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。', '用于底层重力或网箱取样，采用一体框架式分体式设计，安全工作负载：&le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。', '&lt;p&gt;用于底层重力或网箱取样，采用一体框架式分体式设计，安全工作负载：&amp;le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。&lt;/p&gt;', '21295', '90', '0', '1', '1', '0', '1', '298', '2017-11-20 11:00:44', '298', '2017-11-20 11:00:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('400', '184', 'CASAR Turboplast', '370', '21267', '21355', '直径范围：8mm-72mm', '适用于船用起重机，海工起重机，港口起重机，浮吊，行车，龙门吊，钢厂起重机。', '&lt;ul&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;外部由8股组成&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;完全润滑&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;钢芯覆盖塑料填充层&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;具有高破断力和抗挤压型&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;适合卷筒多层缠绕&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;可提供交互捻和同向捻&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif&quot;&gt;工作温度：-50至115℃&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;', '21306', '1', '0', '1', '1', '0', '1', '299', '2017-11-20 11:01:12', '299', '2017-11-20 11:16:01');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('401', '115', '橡胶密封湿插拔水密连接器', '374', '21292', '21300', '额定工作电压高达3300V；最大工作电流750A；', '橡胶密封湿插拔水密连接器', '&lt;p&gt;5种外形尺寸；坚固耐冲击金属外壳设计；工作水深2440米；完全开放的端面密封；穿舱插座可选六角螺母及法兰盘安装方式；针芯1-70芯；标准外壳材质为316不锈钢，可选择钛合金、铝合金、铜、镍合金材质。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '210', '2017-11-20 11:01:33', '210', '2017-11-20 11:01:56');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('402', '115', '干插拔电水密连接器', '374', '21301', '21303', '最大工作电压3300V；最大工作电流95A；', '干插拔电水密连接器', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;6种外形尺寸；3-73芯；工作水深3450米（6900米可定制）；可选非磁性金属材质；镀金针芯；标准为316不锈钢材质，钛合金、铝合金、铜、镍合金可选；坚固结实的金属外壳，耐受冲击。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '210', '2017-11-20 11:03:32', '210', '2017-11-20 11:03:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('403', '185', 'iBoat BS2智能无人测量船', '373', '21294', '21305', 'iBoat BS2 智能无人测量船船体小巧，携带方便，采用双M型船体设计，耐波性好，速度快，航行稳。采用可拆卸模块化涵道式推进器设计，在防渔网、水草等杂物缠绕的优异性能之上，增添了维护方便，灵活更换的使用特性。螺旋桨采用直流无刷电机驱动，速度快，可靠性高。可搭载深测仪、ADCP、侧扫声纳等多种传感器，广泛使用于内河航道、水库、湖泊等区域的水下地形地貌以及水文测量。', 'iBoat BS2 智能无人测量船船体小巧，携带方便，采用双M型船体设计，耐波性好，速度快，航行稳。采用可拆卸模块化涵道式推进器设计，在防渔网、水草等杂物缠绕的优异性能之上，增添了维护方便，灵活更换的使用特性。螺旋桨采用直流无刷电机驱动，速度快，可靠性高。可搭载深测仪、ADCP、侧扫声纳等多种传感器，广泛使用于内河航道、水库、湖泊等区域的水下地形地貌以及水文测量。', '&lt;p&gt;iBoat BS2 智能无人测量船船体小巧，携带方便，采用双M型船体设计，耐波性好，速度快，航行稳。采用可拆卸模块化涵道式推进器设计，在防渔网、水草等杂物缠绕的优异性能之上，增添了维护方便，灵活更换的使用特性。螺旋桨采用直流无刷电机驱动，速度快，可靠性高。可搭载深测仪、ADCP、侧扫声纳等多种传感器，广泛使用于内河航道、水库、湖泊等区域的水下地形地貌以及水文测量。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;性能与优势：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;1、&lt;/strong&gt;&lt;strong&gt;续航时间长&lt;/strong&gt;&lt;br /&gt;\r\n续航时间长&lt;strong&gt;，&lt;/strong&gt;可以通过加载电池提高续航里程。&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;2、&lt;/strong&gt;&lt;strong&gt;自主航行&lt;/strong&gt;&lt;br /&gt;\r\n全自动无人化作业、定点自主返航、随时切换自动/手动控制模式、远距离实时视频传输、障碍物自动探测及避让&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;3、&lt;/strong&gt;&lt;strong&gt;兼容性强&lt;/strong&gt;&lt;br /&gt;\r\n船体控制软件可以支持WINDOWS、安卓、IOS系统&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;4、&lt;/strong&gt;&lt;strong&gt;基站扩展&lt;/strong&gt;&lt;br /&gt;\r\n基站可采用常规笔记本电脑，便于屏幕扩展, 可同时显示视屏、避障、导航、测深回波、卫星信号等信息，显示内容丰富、便于观察、易操控。&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;5、&lt;/strong&gt;&lt;strong&gt;测深模块&lt;/strong&gt;&lt;br /&gt;\r\n高性能测深模块、达到&lt;strong&gt;0.15~300m&lt;/strong&gt;超浅水和深水测量、能适应复杂环境地形测量、配备专业采集后处理软件&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;6、&lt;/strong&gt;&lt;strong&gt;数据通讯&lt;/strong&gt;&lt;br /&gt;\r\n4公里点对点射频通讯、GPRS网络无盲点通讯&lt;/p&gt;', null, '5', '1', '1', '1', '0', '1', '284', '2017-11-20 11:04:05', '284', '2017-11-20 11:04:13');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('404', '115', '12-36KV高压大电流连接器', '376', '21308', '21315', '三相，最大工作电压36KV，最大工作电流630A，', '12-36KV高压大电流连接器', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;减少水下电力传输系统连接/断开的操作时间，降低系统布放、维护成本，应用于波浪能、潮汐能、海上风能发电领域，25年设计使用寿命，额定工作温度900C,工作水深100米&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '210', '2017-11-20 11:06:30', '210', '2017-11-20 11:06:45');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('405', '185', 'iFlow RP600', '373', '21309', '21317', 'iFlow RP600 系统是中海达完全自主设计、研发和生产的活塞式ADCP产品，也是国内第一款量产化的ADCP产品，产品综合性能达到国际先进水平。可广泛应用于海洋、河流、航道的流速、流量测验工作。', 'iFlow RP600 系统是中海达完全自主设计、研发和生产的活塞式ADCP产品，也是国内第一款量产化的ADCP产品，产品综合性能达到国际先进水平。可广泛应用于海洋、河流、航道的流速、流量测验工作。', '&lt;p&gt;iFlow RP600 系统是中海达完全自主设计、研发和生产的活塞式ADCP产品，也是国内第一款量产化的ADCP产品，产品综合性能达到国际先进水平。可广泛应用于海洋、河流、航道的流速、流量测验工作。&lt;/p&gt;', null, '6', '0', '1', '1', '0', '1', '284', '2017-11-20 11:07:55', '284', '2017-11-20 11:07:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('406', '183', '地质纤维缆绞车', '351', '21307', '21323', '用于海底长柱状或短柱状重力活塞取样，采用一体框架式或分体式设计，安全工作负载：&le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。', '用于海底长柱状或短柱状重力活塞取样，采用一体框架式或分体式设计，安全工作负载：&le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。', '&lt;p&gt;用于海底长柱状或短柱状重力活塞取样，采用一体框架式或分体式设计，安全工作负载：&amp;le;30吨，可提供AHC功能、恒张力功能，PLC排缆精确控制，深度能达到万米及以上。&lt;/p&gt;', '21322', '89', '0', '1', '1', '0', '1', '298', '2017-11-20 11:09:39', '298', '2017-11-20 11:09:39');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('407', '115', '水密光电混装连接器', '374', '21318', '21325', '最大工作水深11000米；插入损耗&lt;1dB(或&lt;0.5dB）可选光电混装', '水密光电混装连接器', '&lt;p&gt;单模或多模；适用于 MINI-CON / Micro MINI-CON；最大工作水深11000米；插入损耗&amp;lt;1dB(或&amp;lt;0.5dB）可选光电混装；典型应用：声纳、ROV、AUV、压力监测、水下摄像系统、井下监测、防喷器监测。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '210', '2017-11-20 11:09:54', '210', '2017-11-20 11:10:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('408', '185', 'iPos MS11高精度惯性组合导航系统', '373', '21326', '21332', 'iPos MS11是中海达最新推出的惯性组合导航产品，拥有完全自主的知识产权，是一款综合性船载定位定姿产品。产品内置陀螺、加速度计以及GNSS接收机，并将它们的数据进行深度融合，生成高精度的定位定姿数据，是海上工程、海道测量的理想工具。iPos系统由于高精度、高速率的定位定姿数据输出，而广泛的应用于多波束测绘、海道测绘等领域。用户包括商业勘测公司、海岸港口监测机构、国家水文局等。', 'iPos MS11是中海达最新推出的惯性组合导航产品，拥有完全自主的知识产权，是一款综合性船载定位定姿产品。产品内置陀螺、加速度计以及GNSS接收机，并将它们的数据进行深度融合，生成高精度的定位定姿数据，是海上工程、海道测量的理想工具。iPos系统由于高精度、高速率的定位定姿数据输出，而广泛的应用于多波束测绘、海道测绘等领域。用户包括商业勘测公司、海岸港口监测机构、国家水文局等。', '&lt;p&gt;iPos MS11是中海达最新推出的惯性组合导航产品，拥有完全自主的知识产权，是一款综合性船载定位定姿产品。产品内置陀螺、加速度计以及GNSS接收机，并将它们的数据进行深度融合，生成高精度的定位定姿数据，是海上工程、海道测量的理想工具。iPos系统由于高精度、高速率的定位定姿数据输出，而广泛的应用于多波束测绘、海道测绘等领域。用户包括商业勘测公司、海岸港口监测机构、国家水文局等。&lt;/p&gt;', null, '7', '0', '1', '1', '0', '1', '284', '2017-11-20 11:10:59', '284', '2017-11-20 11:10:59');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('409', '115', '6.6KV高压水密连接器', '376', '21333', '21335', '最大工作电压6.6KV；最大工作电流200A；', '工作水深：8000米；3-61芯；最大工作电压6.6KV；最大工作电流200A；端面承压；湿插拔。', '&lt;p&gt;6.6KV 高压大电流连接器&lt;/p&gt;\r\n\r\n&lt;p&gt;工作水深：8000米；3-61芯；最大工作电压6.6KV；最大工作电流200A；端面承压；湿插拔。&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '210', '2017-11-20 11:11:46', '210', '2017-11-20 11:11:46');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('410', '115', 'USBL 水下定位系统', '377', '21340', '21344', '应用于水下设备、ROV、潜水员的水下跟踪和定位，带GPS导航，可实时跟踪多个水下目标，作用距离1000米。', 'USBL 超短基线水下定位系统', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;应用于水下设备、ROV、潜水员的水下跟踪和定位，带GPS导航，可实时跟踪多个水下目标，作用距离1000米。&lt;/p&gt;', null, '6', '0', '1', '1', '0', '1', '210', '2017-11-20 11:13:44', '210', '2017-11-20 11:13:44');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('411', '185', 'iSide系列高分辨率侧扫声纳', '373', '21343', '21346', '中海达最新推出iSide系列高分辨率侧扫声纳，可双频同时工作，发射多种CW及Chirp信号，先进的数字电路处理技术，结合中海达专利算法，为用户提供出色的大量程高分辨率水底图像，在海洋地貌调查、水下搜救、航道普查、反水雷、反蛙人、考古调查、路由调查等方面有着广泛应用。 iSide系列侧扫声纳由强耐压不锈钢拖鱼、高强度凯夫拉电缆、防水甲板单元和自主HiMAX SSS声纳软件组成。系统超低功耗设计，可采用交流供电或蓄电池供电，结构轻便紧凑，便于携带，可靠耐用。', '中海达最新推出iSide系列高分辨率侧扫声纳，可双频同时工作，发射多种CW及Chirp信号，先进的数字电路处理技术，结合中海达专利算法，为用户提供出色的大量程高分辨率水底图像，在海洋地貌调查、水下搜救、航道普查、反水雷、反蛙人、考古调查、路由调查等方面有着广泛应用。 iSide系列侧扫声纳由强耐压不锈钢拖鱼、高强度凯夫拉电缆、防水甲板单元和自主HiMAX SSS声纳软件组成。系统超低功耗设计，可采用交流供电或蓄电池供电，结构轻便紧凑，便于携带，可靠耐用。', '&lt;p&gt;中海达最新推出iSide系列高分辨率侧扫声纳，可双频同时工作，发射多种CW及Chirp信号，先进的数字电路处理技术，结合中海达专利算法，为用户提供出色的大量程高分辨率水底图像，在海洋地貌调查、水下搜救、航道普查、反水雷、反蛙人、考古调查、路由调查等方面有着广泛应用。&lt;/p&gt;\r\n\r\n&lt;p&gt;iSide系列侧扫声纳由强耐压不锈钢拖鱼、高强度凯夫拉电缆、防水甲板单元和自主HiMAX SSS声纳软件组成。系统超低功耗设计，可采用交流供电或蓄电池供电，结构轻便紧凑，便于携带，可靠耐用。&lt;/p&gt;', null, '8', '0', '1', '1', '0', '1', '284', '2017-11-20 11:14:26', '284', '2017-11-20 11:14:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('412', '183', '同轴缆和光电缆绞车', '351', '21336', '21349', '用于声拖、电视抓手、可视箱式取样等科考作业，安全工作负载：&le;15吨，可提供AHC功能或缆松弛不成器，PLC排缆精确控制，深度能达到万米及以上。', '用于声拖、电视抓手、可视箱式取样等科考作业，安全工作负载：&le;15吨，可提供AHC功能或缆松弛不成器，PLC排缆精确控制，深度能达到万米及以上。', '&lt;p&gt;用于声拖、电视抓手、可视箱式取样等科考作业，安全工作负载：&amp;le;15吨，可提供AHC功能或缆松弛不成器，PLC排缆精确控制，深度能达到万米及以上。&lt;/p&gt;', '21348', '88', '0', '1', '1', '0', '1', '298', '2017-11-20 11:15:23', '298', '2017-11-20 11:15:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('413', '184', 'CASAR Powerplast', '370', '21327', '21352', '直径范围：12mm-72mm', '适用于船用起重机，海工起重机', '&lt;ul&gt;\r\n	&lt;li&gt;抗旋转钢丝绳&lt;/li&gt;\r\n	&lt;li&gt;完全润滑&lt;/li&gt;\r\n	&lt;li&gt;钢芯覆盖塑料填充层&lt;/li&gt;\r\n	&lt;li&gt;具有高破断力和抗挤压型&lt;/li&gt;\r\n	&lt;li&gt;适合卷筒多层缠绕&lt;/li&gt;\r\n	&lt;li&gt;可提供同向捻&lt;/li&gt;\r\n	&lt;li&gt;工作温度：-50至115℃&lt;/li&gt;\r\n&lt;/ul&gt;', '21347', '2', '0', '1', '1', '0', '1', '299', '2017-11-20 11:15:39', '299', '2017-11-20 11:15:39');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('414', '115', '声速剖面仪', '377', '21350', '21358', '声速测量范围：1350－1900m/s，分辨率：0.001m/s，精度：&plusmn;0.02m/s；压力测量范围：500m(50bar)，分辨率：0.001%量程，精度：&plusmn;0.05%量程；温度测量范围：－5℃－+35℃，分辨率：0.001℃，精度&plusmn;0.01℃。', '工作水深500m，Acetal外壳，包含声速传感器、压力传感器、温度测量传感器', '&lt;p&gt;SVP声速剖面仪&lt;/p&gt;\r\n\r\n&lt;p&gt;工作水深500m，Acetal外壳，包含声速传感器、压力传感器、温度测量传感器。声速测量范围：1350－1900m/s，分辨率：0.001m/s，精度：&amp;plusmn;0.02m/s；压力测量范围：500m(50bar)，分辨率：0.001%量程，精度：&amp;plusmn;0.05%量程；温度测量范围：－5℃－+35℃，分辨率：0.001℃，精度&amp;plusmn;0.01℃。&lt;/p&gt;', null, '7', '0', '1', '1', '0', '1', '210', '2017-11-20 11:16:15', '210', '2017-11-20 11:16:15');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('415', '115', '光滑环', '380', '21362', '21365', '最多可达30路单模或多模光纤通路，高可靠性，数千万转使用寿命，低损耗，已应用于某国防项目。', '最多可达30路单模或多模光纤通路，高可靠性，数千万转使用寿命，低损耗。', '&lt;p&gt;光滑环&lt;/p&gt;\r\n\r\n&lt;p&gt;最多可达30路单模或多模光纤通路，高可靠性，数千万转使用寿命，低损耗，已应用于某国防项目。&lt;/p&gt;', null, '8', '0', '1', '1', '0', '1', '210', '2017-11-20 11:18:06', '210', '2017-11-20 11:18:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('416', '185', 'iTrack系列水声定位', '373', '21354', '21367', '水声定位是一种以声波为媒介的水下定位技术和方法，是通过测量声波信号传播时间、相位差等进行的水下定位。用于水下目标的跟踪定位，获取其三维坐标数据。', '水声定位是一种以声波为媒介的水下定位技术和方法，是通过测量声波信号传播时间、相位差等进行的水下定位。用于水下目标的跟踪定位，获取其三维坐标数据。', '&lt;p&gt;iTrack系列水声定位&lt;/p&gt;\r\n\r\n&lt;p&gt;水声定位是一种以声波为媒介的水下定位技术和方法，是通过测量声波信号传播时间、相位差等进行的水下定位。用于水下目标的跟踪定位，获取其三维坐标数据。&lt;/p&gt;\r\n\r\n&lt;p&gt;超短基线水声定位系统&lt;/p&gt;\r\n\r\n&lt;p&gt;iTrack UB系列超短基线水声定位系统（USBL）是唯一市场化的国产超短基线水下定位系统。&lt;/p&gt;\r\n\r\n&lt;p&gt;iTrack UB系列超短基线水声定位系统基于水声宽带扩频技术和高精度的时间同步技术，极大提高了抗多径干扰和船体噪声的能力，是目前业内先进的高精度水声定位系统。&lt;/p&gt;\r\n\r\n&lt;p&gt;长基线水声定位系统&lt;/p&gt;\r\n\r\n&lt;p&gt;iTrack LB系列长基线水声定位系统（LBL）是利用布放在海底的应答器基阵对目标进行测距，利用球面交汇，从而实现对目标的高精度定位。&lt;/p&gt;\r\n\r\n&lt;p&gt;iTrack LB 8000是中海达最新推出基于水声宽带扩频技术的长基线水声定位系统，其特点是定位精度精度高、作用范围广，且具有主动定位和被动定位两种工作模式。&lt;/p&gt;', null, '9', '0', '1', '1', '0', '1', '284', '2017-11-20 11:18:54', '284', '2017-11-20 11:18:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('417', '183', 'ROV绞车', '351', '21356', '21371', '提供AHC或恒张力功能，提供滚筒内部冷却，消除缆的发热，框架式一体式安装模式，PLC精确排缆控制，独立驱动排缆器，远程故障诊断功能，液压或电动驱动，提供做种控制及保护模式，有效保护缆和绞车。', '提供AHC或恒张力功能，提供滚筒内部冷却，消除缆的发热，框架式一体式安装模式，PLC精确排缆控制，独立驱动排缆器，远程故障诊断功能，液压或电动驱动，提供做种控制及保护模式，有效保护缆和绞车。', '&lt;p&gt;提供AHC或恒张力功能，提供滚筒内部冷却，消除缆的发热，框架式一体式安装模式，PLC精确排缆控制，独立驱动排缆器，远程故障诊断功能，液压或电动驱动，提供做种控制及保护模式，有效保护缆和绞车。&lt;/p&gt;', '21370', '87', '0', '1', '1', '0', '1', '298', '2017-11-20 11:19:14', '298', '2017-11-20 11:19:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('418', '115', '水下3D摄像', '375', '21372', '21377', '高清3D摄像，可以通过同轴或者光纤传输。10倍光学变焦，可同时进行静态高清摄影，最低3000M工作水深。自带512G内存，摄影和摄像可自动工作和存贮。', '高清3D摄像，可以通过同轴或者光纤传输。', '&lt;p&gt;水下3D高清摄像&lt;/p&gt;\r\n\r\n&lt;p&gt;高清3D摄像，可以通过同轴或者光纤传输。10倍光学变焦，可同时进行静态高清摄影，最低3000M工作水深。自带512G内存，摄影和摄像可自动工作和存贮。&lt;/p&gt;', null, '9', '0', '1', '1', '0', '1', '210', '2017-11-20 11:19:56', '210', '2017-11-20 11:19:56');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('419', '115', '自容式超高清摄像（4K UHD ）', '375', '21378', '21382', '4K-UHD 超高清摄像，21M静态图片摄像功能，可通过以太网，RS232，RS485进行传输和控制。', '自容式超高清摄像（4K UHD ）', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;4K-UHD 超高清摄像，21M静态图片摄像功能，可通过以太网，RS232，RS485进行传输和控制。自带512G大容量存储，可以进行水下自动拍摄并存贮。&lt;/p&gt;', null, '10', '0', '1', '1', '0', '1', '210', '2017-11-20 11:21:19', '210', '2017-11-20 11:21:19');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('420', '184', 'CASAR  Superplast 8', '370', '21368', '21387', '直径范围：10mm-76mm', '适用于海工起重机，港口起重机，行车，钢厂起重机。', '&lt;ul&gt;\r\n	&lt;li&gt;外部由10股组成&lt;/li&gt;\r\n	&lt;li&gt;完全润滑&lt;/li&gt;\r\n	&lt;li&gt;钢芯覆盖塑料填充层&lt;/li&gt;\r\n	&lt;li&gt;具有高破断力和抗挤压型&lt;/li&gt;\r\n	&lt;li&gt;适合卷筒多层缠绕&lt;/li&gt;\r\n	&lt;li&gt;可提供交互捻和同向捻&lt;/li&gt;\r\n	&lt;li&gt;工作温度：-50至115℃&lt;/li&gt;\r\n&lt;/ul&gt;', '21383', '3', '0', '1', '1', '0', '1', '299', '2017-11-20 11:22:24', '299', '2017-11-20 11:22:24');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('421', '115', '水下油压补偿器', '379', '21385', '21388', '四种型号：270、370、860、2700 cc，带液位传感器，高度坚固的热塑外壳，316不锈钢弹簧，带安全泄压阀，可选配低液位传感器，易于安装。', '水下油压补偿器', '&lt;p&gt;四种型号：270、370、860、2700 cc，带液位传感器，高度坚固的热塑外壳，316不锈钢弹簧，带安全泄压阀，可选配低液位传感器，易于安装。&lt;/p&gt;', null, '11', '0', '1', '1', '0', '1', '210', '2017-11-20 11:22:41', '210', '2017-11-20 11:22:41');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('422', '185', 'K系列海洋定位定向设备', '373', '21376', '21395', 'K9 RTK定位定向仪，拥有精度高，信号稳定，作业范围广等技术特点。而最新研制的K15船用定位定向仪，自带液晶屏幕，内置电池，配合中海达的水上软件和测深仪，可更为广泛地使用在水下地形测量，挖泥、炸礁疏浚工程，水底电缆、管道的铺设，跨海大桥的桩位定位等水上工程。', '中海达作为国产GNSS技术潮流的领导者，始终坚持为用户提供最人性化、稳定的定位产品。结合多年来在GNSS产品上的技术积累，针对海洋用户推出的K系列定位定向设备让用户再一次体验技术带来的重大变革。', '&lt;p&gt;中海达作为国产GNSS技术潮流的领导者，始终坚持为用户提供最人性化、稳定的定位产品。结合多年来在GNSS产品上的技术积累，针对海洋用户推出的K系列定位定向设备让用户再一次体验技术带来的重大变革。K9 RTK定位定向仪，拥有精度高，信号稳定，作业范围广等技术特点。而最新研制的K15船用定位定向仪，自带液晶屏幕，内置电池，配合中海达的水上软件和测深仪，可更为广泛地使用在水下地形测量，挖泥、炸礁疏浚工程，水底电缆、管道的铺设，跨海大桥的桩位定位等水上工程。&lt;/p&gt;', null, '10', '0', '1', '1', '0', '1', '284', '2017-11-20 11:24:02', '284', '2017-11-20 11:24:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('423', '115', 'LED高亮照明灯', '375', '21391', '21396', '照明输出: 2400 - 12000 流明\r\n闪光输出: +25,000 流明\r\n闪光频率: 连续1/4000秒 (定格图像)', 'LED高亮照明灯', '&lt;p&gt;工作水深6000米。是-款能匹配水下相机进行同步的混合闪光/照明灯, 可通过串口RS232/RS485 对其进行控制。它拥有内建的充电控制, 能够有效地储存电能,即使在20瓦的输入条件下, 依然能够输出高达+25,000流明的闪光。&lt;/p&gt;', null, '12', '0', '1', '1', '0', '1', '210', '2017-11-20 11:24:50', '210', '2017-11-20 11:24:50');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('424', '173', '船用阴极保护和防海生物ICCP&amp;MGPS', '381', '21402', '21409', '阴极保护&amp;防海生物', '荷兰CWC阴极保护&amp;防海生物', '&lt;p&gt;CORROSION 外加电流阴极防护系统 (ICCP) 的工作原理是转移金属的自然电位，持续有效地防止船舶腐蚀。 ICCP 系统可为船舶提供全方位的防护，包括保护推进和船舵系统。我们的 ICCP 系统能够有效保护船舶的所有水下金属部件以及损坏或老化的涂层。 关于涂层状况的清晰指示将会显示在我们的触摸屏上。 所有数据均可下载至外部计算机，并通过互联网传输，以供核查。 也可以通过相同的程序采用上传方式对系统进行调整。相对于牺牲阳极，我们的 ICCP 系统具有许多额外的优势，比如，从长远来看，操作成本低得多，几乎无需维护，且使用寿命长（25 年）。 我们不仅提供和设计整套 ICCP 系统，还可以根据您的规格定制牺牲阳极和所有零部件。&lt;/p&gt;\r\n\r\n&lt;p&gt;MGPS防海生物箱式冷却器适用的 ICAF 或 MGPS&amp;nbsp;&amp;ndash; 箱式冷却器始终是潜在的污染对象。 藤壶、贻贝、海藻及其他贝类生物生长在箱式冷却器上，从而会影响冷却器的传热功能。&amp;nbsp;在近海水域航行的船舶面临的风险最大。 我们的外加电流防污系统 (ICAF) 或防海生物系统 (MGPS) 可确保有效预防此类污染。其工作原理基于人工触发的铜阳极和集成钢板阴极之间的电压差。 铜在海水中溶解，防止污染和保护箱式冷却器的环境随之建成。 该系统的动力装置可确保铜阳极向海水添加所需数量的铜粒子。 该系统可确保在各种条件下均提供完美防护，且可最大程度地减少溶解的铜量，从而延长阳极的使用寿命。&lt;/p&gt;\r\n\r\n&lt;p&gt;进水口和过滤器适用的 ICAF 或 MGPS&amp;nbsp;&amp;ndash; 海水进水管工作系统不断遭受污染。 消除管道系统中的此类生物污染必定会大幅增加维护成本。&amp;nbsp;在近海水域航行的船舶面临的风险最大。 我们的外加电流防污系统 (ICAF) 或防海生物系统 (MGPS) 是防止此类污染的最佳选择。 安装在海水箱或过滤器中的 ICAF (MGPS) 系统铜阳极与动力装置相连；动力装置具有全套的控制功能，可确保需要添加到海水中的溶解铜量最少。 从而最大程度地延长阳极的使用寿命，并确保在各种条件下均提供完美防护。 在大多数情况下，除铜阳极以外，还必须安装铝或软铁阳极，以防止管道腐蚀。凭借在箱式冷却器和海水吸入冷却系统防护上多年的专业经验，我们能够确保系统的长期正常运行。 所有数据均可下载至外部计算机，并通过 Internet 传输，以供核查。 也可以通过相同的程序采用上传方式轻松进行系统调整。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '296', '2017-11-20 11:57:14', '296', '2017-11-20 11:57:14');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('425', '173', '船用电动&amp;手动葫芦', '382', '21410', '21414', '电动，手动，气动，防爆；1-300T', '韩国DKi手动&amp;电动葫芦', '&lt;p&gt;产品种类齐全，质量优异，价格水平适中，深受广大船厂用户欢迎。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '296', '2017-11-20 12:00:54', '296', '2017-11-20 12:00:54');
