INSERT INTO `byp_exhibition_booth_product_info` VALUES ('427', '173', '船用安全阀&amp;减压阀', '384', '21423', '21425', '口径最大可到DN200', '德国WILHELM阀门是专业的阀门制造商', '&lt;p&gt;德国WILHELM阀门是全球知名的专业阀门制造商，公司有着100多年的历史，产品种类齐全，外观精美，质量优异，深受船厂广大用户青睐。&lt;/p&gt;', null, '4', '0', '1', '1', '0', '1', '296', '2017-11-20 12:08:35', '296', '2017-11-20 12:08:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('428', '183', '售后服务范围', '352', '21427', '21431', '公司和青岛晨鸣海洋装备技术有限公司达成长期合作协议，并同时在青岛、上海、宁波设立售后维修服务点。', '公司和青岛晨鸣海洋装备技术有限公司达成长期合作协议，并同时在青岛、上海、宁波设立售后维修服务点。', '&lt;p&gt;公司和青岛晨鸣海洋装备技术有限公司达成长期合作协议，并同时在青岛、上海、宁波设立售后维修服务点。&lt;/p&gt;', '21430', '86', '0', '1', '1', '0', '1', '298', '2017-11-20 12:53:21', '298', '2017-11-20 12:53:21');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('429', '186', '海工产品', '385', '21436', '21441', '无', '特种设备公司致力于海洋油气水处理工艺设备，水下生产系统设施等的研发、设计、制造与测试、售后维保服务业务。', '&lt;p&gt;海工产品&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wpsFB59.tmp.png&quot; style=&quot;height:32px; width:32px&quot; /&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;海洋石油工程股份有限公司特种设备公司成立于2012年3月，公司拥有A1、A2压力容器设计许可证；A2压力容器制造许可证；GA、GC压力管道设计、制造许可证； ASME锅炉和压力容器制造证书；ISO 9001:2008 / ISO 14001:2004/OHSAS:18001:2007等质量健康安全环境管理体系认证证书。&lt;/p&gt;\r\n\r\n&lt;p&gt;特种设备公司致力于海洋油气水处理工艺设备，水下生产系统设施等的研发、设计、制造与测试、售后维保服务业务。公司已经形成天然气压缩机橇、橇装应急发电机组、空气压缩机橇、化学注入橇、分离类橇装设备、换热类橇装设备、储存类橇装设备、下游炼厂及陆地终端油气处理设备等产品，为国内外油气行业用户提供定制化、专业化、产业化、高端化的设备供货及服务。&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:15.0000pt&quot;&gt;天然气压缩机橇是海洋油气开发装备中天然气/伴生气集输、燃气发电机组等用气供应的关键装置，集天然气压缩与前后处理工艺设备、管路系统、控制系统于一体，主要为海洋油气田发电机等动力设备提供满足工况需要的压缩天然气。&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:15.0000pt&quot;&gt;海油工程特种设备公司通过技术合作，开展电驱式螺杆、往复式天然气压缩机橇业务，是世界高速往复式压缩机组行业龙头Ariel公司及国内外知名螺杆压缩机企业711研究所、Howden公司的重要合作伙伴，并且为油气行业用户提供定制化的橇装天然气压缩机组。公司拥有专业的天然气压缩机机组选型、橇内工艺流程设计、静设备设计、电仪设计、振动分析团队。先后为陆丰7-2油气田、垦利3-2油田群、锦州9-3油田、渤中34-2/4油田、锦州25-1/ 25-1南二期开发油田提供29台套橇装天然气压缩机组。&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:15.0000pt&quot;&gt;&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wpsFB6A.tmp.png&quot; style=&quot;height:140px; width:210px&quot; /&gt;&lt;img src=&quot;file:///C:\\Users\\潇潇\\AppData\\Local\\Temp\\ksohtml\\wpsFB6B.tmp.png&quot; style=&quot;height:140px; width:210px&quot; /&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;水下生产设备设施&lt;/p&gt;\r\n\r\n&lt;p&gt;当前国际上主要深水水下生产设备设施包括水下管汇系统、水下基盘、控制系统、增压系统及水下处理系统等。海油工程特种设备公司承担了国家&amp;quot;十二五&amp;quot;科技重大专项&amp;quot;深水水下生产设施制造、测试装备及技术&amp;quot;课题。结合科研项目，公司已掌握油田水下生产系统的基础设施和常规设备的研发，并积极开拓工程项目市场，先后承揽番禺35-1/35-2气田、流花19-5气田等项目水下生产设施的制造与测试。公司已经掌握了常规深水水下生产设施制造、测试关键技术，成功研发了配套的系列化测试设备，实现该类产品的制造、测试及验收方案/程序的标准化，可为客户提供成熟的专业技术与产品。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '21440', '6', '1', '1', '1', '0', '1', '220', '2017-11-20 12:58:47', '220', '2017-11-20 13:18:16');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('430', '115', '潜水钟用穿舱器', '374', '21449', '21455', '专用于潜水钟、减压舱、水下舰艇等，具备高气密性和耐压性，可传输多路电，同轴等，安全耐用，使用寿命25年。', '专用于潜水钟、减压舱、水下舰艇等，具备高气密性和耐压性，可传输多路电，同轴等，安全耐用，使用寿命25年。', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;专用于潜水钟、减压舱、水下舰艇等，具备高气密性和耐压性，可传输多路电，同轴等，安全耐用，使用寿命25年，获得 DNV、Lloyds、ABS的认证。&lt;/p&gt;', null, '13', '0', '1', '1', '0', '1', '210', '2017-11-20 13:02:34', '210', '2017-11-20 13:02:34');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('431', '186', '海化产品', '386', '21442', '21457', '轻质碳酸钠	主含量：99.2%&nbsp;MIN	40/750kg/袋\r\n重质碳酸钠	主含量：99.2%&nbsp;MIN	25/50/1000kg/袋\r\n\r\n液氯	99.60%&nbsp;MIN	1000kg/瓶\r\n烧碱	32.00%&nbsp;MIN	罐装运输\r\n聚氯乙烯	SG-3型、SG-5型	25kg/袋', '海化集团充分发挥得天独厚的卤水资源优势，立足就地精深加工、滚动增值、已成功开发出盐、碱、溴、苦卤化工等产品系列，形成了一个以上下游产品接续成链、资源循环综合利用、人与自然协调发展为特色的生态工业&ldquo;互联网&rdquo;。', '&lt;p&gt;海化集团充分发挥得天独厚的卤水资源优势，立足就地精深加工、滚动增值、已成功开发出盐、碱、溴、苦卤化工等产品系列，形成了一个以上下游产品接续成链、资源循环综合利用、人与自然协调发展为特色的生态工业&amp;ldquo;互联网&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;石油化工产品&lt;/p&gt;\r\n\r\n&lt;p&gt;近年来，山东海化集团大力调整产业产品结构，做大做强海洋化工的同时，着力发展石油化工产业。目前，海化集团石化分公司油品综合加工能力达到450万吨以上，成为集团公司支柱产业之一。海化集团加入中国海洋石油总公司后，随着发展规划的实施，一个更大更强的石化产业即将由宏伟的蓝图变为壮丽的现实。山东海化可生产的石油化工产品主要有：&lt;/p&gt;', '21456', '5', '1', '1', '1', '0', '1', '220', '2017-11-20 13:04:22', '220', '2017-11-20 13:18:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('432', '186', '化工化肥', '387', '21458', '21461', '无', '中海石油化学股份有限公司（下称&quot;中海化学&quot;）是中国海油旗下一家从事化肥、化工产品开发、生产和销售的现代化大型企业，是中国氮肥和甲醇产量最大的上市公司，生产设施位于中国海南省、内蒙古自治区及湖北省，总设计年产能达184万吨尿素、50万吨磷肥及160万吨甲醇。中海化学的生产装置和工艺技术均处于国际领先行列。', '&lt;p&gt;化工化肥&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;中海石油化学股份有限公司（下称&amp;quot;中海化学&amp;quot;）是中国海油旗下一家从事化肥、化工产品开发、生产和销售的现代化大型企业，是中国氮肥和甲醇产量最大的上市公司，生产设施位于中国海南省、内蒙古自治区及湖北省，总设计年产能达184万吨尿素、50万吨磷肥及160万吨甲醇。中海化学的生产装置和工艺技术均处于国际领先行列。&lt;/p&gt;\r\n\r\n&lt;p&gt;中海化学生产的&amp;quot;富岛&amp;quot;牌大颗粒尿素和&amp;quot;天野&amp;quot;牌小颗粒尿素均为&amp;quot;国家免检产品&amp;quot;，产品销售网络覆盖全国多个省市，远销美洲、澳洲及东南亚地区等。近年来，中海化学开展化肥直供和测土配肥两大系统工程，对农民节本增收、发展中国现代农业起到了良好的推动作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;施用方法&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;富岛大颗粒尿素具有缓释功能，在土壤中转化比较彻底，肥效优于普通尿素，施用时间比普通尿素早3-5天，增产效果明显。&lt;/p&gt;\r\n\r\n&lt;p&gt;做基肥时，水旱田施用方法各有不同：&lt;/p&gt;\r\n\r\n&lt;p&gt;旱地：在耕翻前施用，耕翻时将尿素深埋在土里，与农家肥一起使用效果更好；&lt;/p&gt;\r\n\r\n&lt;p&gt;水田：在耕地前将尿素与农家肥一起施下，然后再耕翻地，2-3天后灌水，如水田有水，施过尿素后，不可放水，防止肥效降低&amp;nbsp;。&lt;/p&gt;\r\n\r\n&lt;p&gt;做追肥时，最好条施、穴施，撒施应在小雨前后或土壤润湿时施用；&lt;/p&gt;\r\n\r\n&lt;p&gt;做返青肥用量不宜过多；&lt;/p&gt;\r\n\r\n&lt;p&gt;做分蘖肥、穗肥时要施足；&lt;/p&gt;\r\n\r\n&lt;p&gt;富岛大颗粒尿素做叶面施肥时吸收率高，效果明显，且有抑制虫害的作用。&lt;/p&gt;\r\n\r\n&lt;p&gt;富岛大颗粒尿素适宜作掺混肥料。&lt;/p&gt;\r\n\r\n&lt;p&gt;可与大豆饼、人粪尿、堆肥、厩肥等农家肥料混合施用。&lt;/p&gt;\r\n\r\n&lt;p&gt;也可与氯化钾、碳铵、过磷酸钙、氯化钙等微吸湿性化肥混合使用，混合后要立即使用，以免肥效减少。还可与硫酸铵、硫酸钾、草木灰、石灰、钙镁磷肥等混合使用，但不宜与硝酸铵、砾酸钠、碳酸钠、碳酸氢铵等吸湿性强的化肥施用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;产品优点&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;富岛大颗粒尿素，尿素纯度高、含氮量高、稳定性好，同时在生产过程中加入一定量的增效剂，施入土壤后氮素缓慢释放，作物均匀吸收，属于长效氮肥，所以具备以下优点：&lt;/p&gt;\r\n\r\n&lt;p&gt;能减少氮素淋失、挥发及反硝化作用所引起的损失；&lt;/p&gt;\r\n\r\n&lt;p&gt;基本满足作物整个生育期对氮素的需求；&lt;/p&gt;\r\n\r\n&lt;p&gt;一次足量使用，终生受益，既能节时省工，又能解决密植作物后期追肥的困难；&lt;/p&gt;\r\n\r\n&lt;p&gt;使用得当，不但产量增加，而且农产品品质得到较大改善，尤其蛋白质明显增加。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;测土施肥走进&amp;quot;千村百乡&amp;quot;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;中海化学积极响应建设社会主义新农村的号召，实施农业部发起的&amp;quot;化肥直销&amp;quot;和&amp;quot;测土施肥&amp;quot;两大系统工程，为农民降低生产成本、增加收入。同时，以肥料直供为核心任务，建立企业主导和流通环节少的化肥直供模式，为配方施肥的推广奠定了坚实基础。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '21460', '4', '1', '1', '1', '0', '1', '220', '2017-11-20 13:05:49', '220', '2017-11-20 13:18:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('433', '186', '加油加气服务', '388', '21462', '21466', '无', '中国海油加油站是中国海油直接面向消费者的终端窗口，致力于传播中国海油文化理念和致力于为消费者提供便捷的网络、优质的产品、周到的服务和安全的环境，追求企业、社会、自然的和谐共进。', '&lt;p&gt;加油加气服务&lt;/p&gt;\r\n\r\n&lt;p&gt;中国海油加油站是中国海油直接面向消费者的终端窗口，致力于传播中国海油文化理念和致力于为消费者提供便捷的网络、优质的产品、周到的服务和安全的环境，追求企业、社会、自然的和谐共进。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;产品及服务：&lt;/strong&gt;中国海油加油站竭诚为广大消费者和周边机构用户提供车辆加油、&amp;ldquo;送油上门&amp;rdquo;小额配送、便利店及加油卡支付服务等油品及非油品的销售及服务。所销的汽油、柴油主要产自中国海油惠州炼厂。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;网络布局：&lt;/strong&gt;中国海油以&amp;ldquo;两洲一湾&amp;rdquo; （长江三角洲、珠江三角洲、环渤海地区）为主要市场，依托 &amp;ldquo;一江两线&amp;rdquo;（长江水运、京广铁路、京九铁路）干线向中部地区扩展加油站网络。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;视觉形象：&lt;/strong&gt;中国海油加油站标识系统以中国海油的企业标志及中英文简称为主标识，强化&amp;ldquo;中国海油&amp;rdquo;品牌；色彩系统以蓝色和红色为主色彩，突出中国海油独特的企业视觉形象特征。卡通画的黄色海星是中国海油加油站便利店的形象标识，充满生命活力，可爱又亲和，紧扣中国海油的海洋文化。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;经营理念：&lt;/strong&gt;中国海油加油站以品牌价值最大化为核心理念。加油站管理方针是：以人为本、诚实守信；遵纪守法、开拓创新；科学管理、安全经营；节约能源、防治污染。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;经营管理：&lt;/strong&gt;中国海油加油站坚持&amp;ldquo;顾客至上，规范经营&amp;rdquo;的服务宗旨，以&amp;ldquo;百分百满意&amp;rdquo;为目标，为顾客提供高品质的油品和专业服务。加油站的每位员工上岗前都经过严格的专业培训，具有良好的职业素养，注重从细节做起，时刻用心服务于客户，令顾客的每一次光临都成为轻松愉悦的享受。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '21465', '3', '0', '1', '1', '0', '1', '220', '2017-11-20 13:09:38', '220', '2017-11-20 13:09:38');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('434', '186', '锂电池', '389', '21467', '21471', '无', '锂电池\r\n伴随能源需求增长与世界环保要求越来越高，锂电池将成为21世纪重要能源载体之一。锂电池具有高电压、比能量高、自放电低、可靠性强、无污染等性能优势，广泛应用于笔记本、数码相机、移动电话等便携设备。历经10余年发展，天津力神公司自主研发的各类锂离子电池已广泛应用到便携电子设备、电动汽车、电动工具、储能系统等相关领域。 &nbsp;', '&lt;p&gt;锂电池&lt;/p&gt;\r\n\r\n&lt;p&gt;伴随能源需求增长与世界环保要求越来越高，锂电池将成为21世纪重要能源载体之一。锂电池具有高电压、比能量高、自放电低、可靠性强、无污染等性能优势，广泛应用于笔记本、数码相机、移动电话等便携设备。历经10余年发展，天津力神公司自主研发的各类锂离子电池已广泛应用到便携电子设备、电动汽车、电动工具、储能系统等相关领域。 &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '21470', '2', '0', '1', '1', '0', '1', '220', '2017-11-20 13:11:04', '220', '2017-11-20 13:11:04');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('435', '186', '炼油产品', '390', '21472', '21480', '无', '炼油产品\r\n\r\n国海油惠州炼化分公司是国际上首座集中加工海洋高酸重质原油的炼厂，也是目前国内单系列最大的炼油企业，拥有17套先进的主要生产装置和完善的公用工程系统、辅助生产设施，年加工规模1200万吨，生产汽油、航煤、柴油、苯、液化气、石油焦等15大类产品。', '&lt;p&gt;炼油产品&lt;/p&gt;\r\n\r\n&lt;p&gt;国海油惠州炼化分公司是国际上首座集中加工海洋高酸重质原油的炼厂，也是目前国内单系列最大的炼油企业，拥有17套先进的主要生产装置和完善的公用工程系统、辅助生产设施，年加工规模1200万吨，生产汽油、航煤、柴油、苯、液化气、石油焦等15大类产品。&lt;/p&gt;\r\n\r\n&lt;p&gt;惠州炼化产品自2009年投放市场以来，销往华南、西南乃至全国各地，受到广大用户一致认可。目前，汽油质量达到国（V）标准；航空煤油低温性能显著，质量稳定，冰点可达-70&amp;deg;C以下，销售方与华南区域各主要机场建立了稳定了供销关系，产品市场占有率达40%以上；柴油品质优异，全部达到国（V）标准，高标准产品曾供应上海世博会和广州亚运会；对二甲苯等芳烃系列产品享誉市场；液化气质量指标优良，燃烧性好，获得广泛好评。凭借强劲竞争力，投产后仅一年左右时间，惠州炼化产品就在&amp;quot;两洲一湾&amp;quot;（珠江三角洲、长江三角洲和环渤海湾）拥有大量忠诚客户。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;汽油&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;顺应国际炼油技术的发展趋势和环保要求，优化产品结构。曾生产93号车用汽油（沪IV）供应上海世博会，目前全部汽油产品达到了国（V）标准。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;航煤&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;惠州炼化是全国最大的航空煤油生产厂家，航煤产品来自蜡油加氢裂化和煤柴油加氢裂化装置，产能约为210.55万吨/年。产品质量达到军用航空燃料标准，硫含量为1mg/kg以下。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;柴油&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;惠州炼化采用加氢裂化技术方案加工高酸重质原油，加氢率达88%以上，并选用国内外多项先进专利。年产柴油可达356万吨，产品质量达到全部达到国（V）标准。其中，煤柴油加氢裂化和蜡油加氢裂化两套装置生成的柴油，硫含量为1mg/kg以下，蜡油加氢裂化装置生产的柴油，十六烷值达到56以上。&lt;br /&gt;\r\n惠州炼化生产的柴油曾供应世博会和亚运会，为城市的绿色发展作出了贡献，也为惠州炼化高标准产品开拓市场奠定了良好的基础。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;对二甲苯（PX）&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;对二甲苯（PX）来自芳烃联合装置，产品质量符合石油化工行业石油对二甲苯（SH/T 1486.1-2008）优等品规格要求。&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;延迟石油焦&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;延迟石油焦来自420万吨/年世界级规模的延迟焦化装置，是以减压渣油为原料，在高温下裂解生产轻质油品时的副产物。惠州炼化石油焦产量约108万吨/年，设计指标符合SH/T 0527-92合格品1B规格要求。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;液化石油气&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;惠州炼化的液化石油气符合GB 11174-2011标准，适用于作工业和民用燃料，年设计产能为58.61万吨。针对珠三角的气候变化和居民用气特点，惠州炼化动态微调液化气的丙烷和丁烷含量，减少天气变化对居民用气的影响，在业内树立了良好的口碑，得到了居民用户的高度认可，真正做到了惠及地方百姓。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;丙烯&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;丙烯作为基本原料用途广泛，如生产聚丙烯，另外可制丙烯腈、异丙醇、苯酚和丙酮、丁醇和辛醇、丙烯酸及其脂类以及制环氧丙烷和丙二醇、环氧氯丙烷和合成甘油等。惠州炼化的丙烯按照GB/T 7716-2002标准设计生产，年设计产能为9.3万吨。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;联系方式&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '21479', '1', '0', '1', '1', '0', '1', '220', '2017-11-20 13:12:49', '220', '2017-11-20 13:12:49');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('436', '160', '面膜', '392', '21537', '21659', '无', '用于面膜表现的功能：\r\n抑制皮肤表面的细菌，损伤修复\r\n吸附黑色素，化妆品残留\r\n螯合残留在皮肤上的重金属\r\n亲肤，改善皮肤表面，微循环，滋润皮肤，长期使用可以美白皮肤', '&lt;p&gt;用于面膜表现的功能：&lt;br /&gt;\r\n抑制皮肤表面的细菌，损伤修复&lt;br /&gt;\r\n吸附黑色素，化妆品残留&lt;br /&gt;\r\n螯合残留在皮肤上的重金属&lt;br /&gt;\r\n亲肤，改善皮肤表面，微循环，滋润皮肤，长期使用可以美白皮肤&lt;/p&gt;', null, '5', '1', '1', '1', '0', '1', '273', '2017-11-20 13:52:26', '273', '2017-11-21 09:13:28');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('437', '121', '戚震辉教授在Science Advances发表原创研究结果', '391', '21481', '21514', '水分子作为自然界最常见的物质之一，其功能绝大多数被作为一种常用溶剂。然而在生物体系中，水分子的功能绝不仅仅苑囿于作为溶剂，在一些生物大分子组装体中（如抗冻蛋白），水分子作为结构的组成部分还被发现具有特殊的桥联效果，起到关键的结构稳定和支撑作用（因此也被称为structural water）。', '西工大新闻网11月20日电（葛岩）日前，生命学院戚震辉教授与湖南大学董盛谊教授、德国柏林自由大学，西北工业大学讲座教授Christoph A. Schalley教授等合作，在美国科学促进会出版的《Science Advances》 (Science子刊，是涵盖所有学术领域的开放性、综合性科学刊物）发表了题为&ldquo;Structural water as an essential comonomer in supramolecular polymerization&rdquo;的研究论文（Sci. Adv. 2017, eaao0900），西北工业大学为通讯作者单位之一。', '&lt;p&gt;&lt;strong&gt;西工大新闻网11月20日电&lt;/strong&gt;（&lt;strong&gt;葛岩&lt;/strong&gt;）日前，生命学院戚震辉教授与湖南大学董盛谊教授、德国柏林自由大学，西北工业大学讲座教授Christoph A. Schalley教授等合作，在美国科学促进会出版的《Science Advances》 (Science子刊，是涵盖所有学术领域的开放性、综合性科学刊物）发表了题为&amp;ldquo;Structural water as an essential comonomer in supramolecular polymerization&amp;rdquo;的研究论文（&lt;em&gt;Sci. Adv.&lt;/em&gt; 2017, eaao0900），西北工业大学为通讯作者单位之一。&lt;/p&gt;\r\n\r\n&lt;p&gt;打破认知：水不再仅仅作为溶剂,水分子还能成为超分子聚合物的聚合单体。&lt;/p&gt;\r\n\r\n&lt;p&gt;水分子作为自然界最常见的物质之一，其功能绝大多数被作为一种常用溶剂。然而在生物体系中，水分子的功能绝不仅仅苑囿于作为溶剂，在一些生物大分子组装体中（如抗冻蛋白），水分子作为结构的组成部分还被发现具有特殊的桥联效果，起到关键的结构稳定和支撑作用（因此也被称为structural water）。然而在制备超分子聚合物的过程中，水通常作为溶剂(solvent)来分散或者溶剂化超分子聚合单元。水作为超分子聚合物的重复单元或组成部分(structural water)的工作尚未有报道。究其原因可能存在如下两个因素：一方面，单纯水参与的超分子作用力较弱，不宜于形成具有较大聚合度的超分子聚合物；另一方面，水分子在超分子聚合过程中的作用不易表征和解释。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120135022_327.jpg&quot; style=&quot;height:544px; width:888px&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120135032_340.png&quot; style=&quot;height:897px; width:818px&quot; /&gt;利用水分子和冠醚分子之间的氢键作用，研究团队设计了一个具有三个苯并21冠7单元的超分子聚合单元。该聚合单元可以通过吸收空气中微量的水分子，形成具有高分子量和高粘性的超分子聚合物材料。通过红外、核磁、介电表征并结合计算机辅助的分子模拟，研究团队发现在这个超分子聚合物材料中所有的水分子均通过氢键相互作用将冠醚单元紧密结合起来，形成三维的超分子聚合物网络结构，同时利用分子结构中的其他氢键作用，进一步地发展成具有极高分子量聚合物的超分子粘附材料。&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171120/pic/20171120135142_48.png&quot; style=&quot;height:641px; width:864px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;联合团队还发现，该聚合物材料的高粘性可被用于制备超分子&amp;ldquo;胶水&amp;rdquo;。与市售的PVA胶水相比，该材料除了显示出极强的粘附力外，还展现了可重复利用、易于清洗和无挥发性有机物等优点。通过简单的加热&amp;mdash;冷却，即可实现粘附&amp;mdash;脱离这个高度可逆的过程。经过多次重复，该材料的高粘附性能依然保持。同时，在低温、高真空、干燥等较极端环境下，该材料依然具有优异的粘附性能。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;近年来，生命学院坚持国际化办学理念，强调国际合作，努力实现追赶超越。在学校人事处、高层次人才办公室的大力支持下，从德国引进&amp;ldquo;青年千人&amp;rdquo;戚震辉教授，聘请德国柏林自由大学Christoph A. Schalley教授为西工大讲座教授。2017年10月，为进一步推动我校国际科研合作的发展，大力引进和培养高层次、高技能人才，促进中德两国之间深入的学术及科技交流，在学校国际合作处、科管部、国资处等各部门的支持配合下，与德国柏林自由大学、德国联邦材料研究与测试中心、德国Charit&amp;eacute;医科大学（德国风湿病研究中心）联合成立了&amp;ldquo;中德空间生物材料与技术转化联合实验室&amp;rdquo;。作为中德联合实验室的首篇研究论文，此文的发表意义重大。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '223', '2017-11-20 13:52:39', '223', '2017-11-20 13:52:39');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('438', '188', '&ldquo;海力&rdquo;号科考船', '393', '21515', '21521', '青岛海力海洋调查科技服务有限公司是一家专业从事海洋科技服务的企业，主要业务范围有：科考船租赁服务、海洋调查航次搭载组织协调、海洋调查设备的销售、租赁和技术服务、科考人员的组织与安全培训、提供海上作业人员的安保装备、生活物资等后勤服务。', '青岛海力海洋调查科技服务有限公司是一家专业从事海洋科技服务的企业，主要业务范围有：科考船租赁服务、海洋调查航次搭载组织协调、海洋调查设备的销售、租赁和技术服务、科考人员的组织与安全培训、提供海上作业人员的安保装备、生活物资等后勤服务。\r\n   公司除自有的科考船舶外，与国内一些科考船管理单位建立了良好的合作关系，致力于船时共享、提高科考船资源的利用效率。\r\n   公司作为国内外一些知名品牌的海洋调查仪器设备、船舶动力装置的代理商与技术服务商，能为客户提供各类性能优良的海洋调查装备与船舶动力设备。', '&lt;p&gt;&amp;nbsp; &amp;nbsp;青岛海力海洋调查科技服务有限公司是一家专业从事海洋科技服务的企业，主要业务范围有：科考船租赁服务、海洋调查航次搭载组织协调、海洋调查设备的销售、租赁和技术服务、科考人员的组织与安全培训、提供海上作业人员的安保装备、生活物资等后勤服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;公司除自有的科考船舶外，与国内一些科考船管理单位建立了良好的合作关系，致力于船时共享、提高科考船资源的利用效率。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;公司作为国内外一些知名品牌的海洋调查仪器设备、船舶动力装置的代理商与技术服务商，能为客户提供各类性能优良的海洋调查装备与船舶动力设备。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '307', '2017-11-20 14:02:33', '307', '2017-11-20 14:03:03');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('439', '160', '伤口敷料', '394', '21540', '21660', '无', '壳聚糖纤维医用敷料\r\n壳聚糖医用敷料是由100%纯壳聚糖纤维针刺无纺布或水刺无纺布制成，无毒、无刺激、无致敏，用于各种创伤具有极好的抑菌、止血止痛、促进细胞生长、减小创面疤痕等功能。\r\n普通纯壳聚糖纤维在做创面敷料时还有一定的弊端，不具有高吸液性，与伤口接触时，因其不吸液，易粘连，不能满足现代医用敷料的要求。我们将壳聚糖纤维进行改性，生产出可以吸收创面渗出液后溶胀或水溶的壳聚糖纤维。', '&lt;p&gt;壳聚糖纤维医用敷料&lt;br /&gt;\r\n壳聚糖医用敷料是由100%纯壳聚糖纤维针刺无纺布或水刺无纺布制成，无毒、无刺激、无致敏，用于各种创伤具有极好的抑菌、止血止痛、促进细胞生长、减小创面疤痕等功能。&lt;br /&gt;\r\n普通纯壳聚糖纤维在做创面敷料时还有一定的弊端，不具有高吸液性，与伤口接触时，因其不吸液，易粘连，不能满足现代医用敷料的要求。我们将壳聚糖纤维进行改性，生产出可以吸收创面渗出液后溶胀或水溶的壳聚糖纤维。&lt;/p&gt;', null, '4', '1', '1', '1', '0', '1', '273', '2017-11-20 15:14:44', '273', '2017-11-21 09:14:04');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('440', '160', '卫生材料', '395', '21546', '21661', '无', '纸尿裤和卫生巾的使用部位因为潮湿温度适宜，是适合细菌生长的良好环境，普通的纸尿裤和卫生巾大多是采用化纤类的原材料，长时间的与皮肤接触不但可以滋生细菌产生异味还会刺激皮肤。婴儿因为用了纸尿裤产生的红屁股现象，部分女性使用卫生巾带来一些妇科炎症。', '&lt;p&gt;1.纸尿裤和卫生巾的使用部位因为潮湿温度适宜，是适合细菌生长的良好环境，普通的纸尿裤和卫生巾大多是采用化纤类的原材料，长时间的与皮肤接触不但可以滋生细菌产生异味还会刺激皮肤。婴儿因为用了纸尿裤产生的红屁股现象，部分女性使用卫生巾带来一些妇科炎症。&lt;br /&gt;\r\n2.含有壳聚糖纤维的无纺布用于纸尿裤的面层，天然生物质纤维对宝宝皮肤温和无刺激，可以长效抑菌，吸附纸尿裤里吸水树脂中的丙稀酸等残留特，为宝宝皮肤营造一个舒适安全的卫生环境。&lt;br /&gt;\r\n3.将壳聚糖纤维无纺布应用于女生卫生用品表面（如卫生巾，护垫，卫生棉条等），其广谱抑菌性大大降低女性妇科病的几率，并解决女性特殊时期的异味问题，安全无刺激。&lt;br /&gt;\r\n4由于壳聚糖纤维天然的广谱抑菌效果，被人们青睐于跟人体接触的一次性卫生材料，如隔离垫，口罩，湿巾等。&lt;/p&gt;', null, '3', '1', '1', '1', '0', '1', '273', '2017-11-20 15:15:42', '273', '2017-11-21 09:15:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('441', '160', '纤维', '396', '21550', '21662', '无', '壳聚糖纤维：我公司用阿拉斯加深海鳕蟹精制的壳聚糖为原料，经过特殊的纺丝工艺制成为纯壳聚糖纤维。\r\n壳聚糖纤维的特性（附抗菌性检测报告）\r\n具有良好的生物相容性和生物活性；\r\n天然的广谱抑菌效果，可抑制多种细菌、真菌的生长；\r\n良好的生物安全性，对人体无毒，无刺激，无致敏性，可被皮肤组织降解吸收。\r\n壳聚糖纤维的应用\r\n可以制成纯壳聚糖纤维针刺无纺布、水刺无纺布。\r\n可与粘胶纤维，棉纤维，ES纤维等以任意比例混合无纺制成水刺无纺布、针刺无纺布、热风无纺布\r\n可纺性好，可以与棉，毛，粘胶等纤维按照不同比例混纺成纱线。', '&lt;p&gt;壳聚糖纤维：我公司用阿拉斯加深海鳕蟹精制的壳聚糖为原料，经过特殊的纺丝工艺制成为纯壳聚糖纤维。&lt;br /&gt;\r\n壳聚糖纤维的特性（附抗菌性检测报告）&lt;br /&gt;\r\n具有良好的生物相容性和生物活性；&lt;br /&gt;\r\n天然的广谱抑菌效果，可抑制多种细菌、真菌的生长；&lt;br /&gt;\r\n良好的生物安全性，对人体无毒，无刺激，无致敏性，可被皮肤组织降解吸收。&lt;br /&gt;\r\n壳聚糖纤维的应用&lt;br /&gt;\r\n可以制成纯壳聚糖纤维针刺无纺布、水刺无纺布。&lt;br /&gt;\r\n可与粘胶纤维，棉纤维，ES纤维等以任意比例混合无纺制成水刺无纺布、针刺无纺布、热风无纺布&lt;br /&gt;\r\n可纺性好，可以与棉，毛，粘胶等纤维按照不同比例混纺成纱线。&lt;/p&gt;', null, '2', '0', '1', '1', '0', '1', '273', '2017-11-20 15:16:29', '273', '2017-11-21 09:16:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('442', '160', '针织', '397', '21554', '21663', '无', '壳聚糖纤维用于纺织品的功效：\r\n1. 壳聚糖特有的结构对皮肤有明显的护理功能，可保护皮肤不干燥，并对皮肤痘疹、湿疹、红斑、过敏性皮肤有辅助治疗和防治功能，适合于婴幼儿和敏感性皮肤症者，及老年人群贴身穿着可以防止瘙痒症。\r\n2. 特有的抗菌因子使产品具有优异的抑菌除臭功能。用壳聚糖纤维制成的内衣、袜子、毛巾等可以阻止细菌、真菌的繁衍，消除异味，保持皮肤的清洁。', '&lt;p&gt;壳聚糖纤维用于纺织品的功效：&lt;br /&gt;\r\n1. 壳聚糖特有的结构对皮肤有明显的护理功能，可保护皮肤不干燥，并对皮肤痘疹、湿疹、红斑、过敏性皮肤有辅助治疗和防治功能，适合于婴幼儿和敏感性皮肤症者，及老年人群贴身穿着可以防止瘙痒症。&lt;br /&gt;\r\n2. 特有的抗菌因子使产品具有优异的抑菌除臭功能。用壳聚糖纤维制成的内衣、袜子、毛巾等可以阻止细菌、真菌的繁衍，消除异味，保持皮肤的清洁。&lt;br /&gt;\r\n3. 壳聚糖纤维具有对重金属极佳的吸附性，长期穿用可有效的保护人体免受有害物质对皮肤的侵害。&lt;br /&gt;\r\n4.壳聚糖纤维面料具有有效的抗螨性，可以预防因螨虫引起的过敏性皮肤，呼吸道，泌尿系统等疾病。&lt;br /&gt;\r\n5. 壳聚糖纤维具有优良的保湿保温功能，壳聚糖的保湿保温因子高亲水性会给人以湿润柔和的舒适感和温暖感。&lt;br /&gt;\r\n6.壳聚糖纤维具有防静电特性，穿着更舒适。&lt;br /&gt;\r\n7.可降解性，废弃后对自然环境有益。&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '273', '2017-11-20 15:17:42', '273', '2017-11-21 09:16:59');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('443', '189', '海荣EPS保温轻体房模块100型', '398', '21563', '21614', '无', '施工简易、拼接快速、携带方便、保温抗寒；适用于抗震救灾房、野外施工房、户外探险房、旅游营帐房等便捷性临时居住房', '&lt;p&gt;施工简易、拼接快速、携带方便、保温抗寒；适用于抗震救灾房、野外施工房、户外探险房、旅游营帐房等便捷性临时居住房&lt;/p&gt;', '21613', '3', '1', '1', '1', '0', '1', '229', '2017-11-20 15:41:30', '229', '2017-11-20 16:37:20');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('444', '190', 'MultiCorn系列天蝠Vespertilio', '401', '21590', '21592', '天蝠装备高清可见光/热成像吊舱；机身两翼可折叠，方便携带；机身采用独有的整体壳承力结构，重量轻、强度高全包裹设计使重要部件得到充分保护。', '天蝠装备高清可见光/热成像吊舱；机身两翼可折叠，方便携带；机身采用独有的整体壳承力结构，重量轻、强度高全包裹设计使重要部件得到充分保护。', '&lt;p&gt;天蝠装备高清可见光/热成像吊舱；机身两翼可折叠，方便携带；机身采用独有的整体壳承力结构，重量轻、强度高全包裹设计使重要部件得到充分保护。&lt;/p&gt;', null, '1', '1', '1', '1', '0', '1', '266', '2017-11-20 16:20:23', '266', '2017-11-20 16:24:02');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('445', '190', 'UniCorn系列A/B', '401', '21594', '21599', '整机80%以上采用碳纤维复合材料具有极强的抗腐蚀能力；采用独有的体理壳承力结构最大化减轻机体重量，整机密闭，分离式仓体设计；可快速更换的模块化载荷舱设计 任意搭载多种专业设备；采用涡轮轴动力系统  可应对复杂任务环境。', '整机80%以上采用碳纤维复合材料具有极强的抗腐蚀能力；采用独有的体理壳承力结构最大化减轻机体重量，整机密闭，分离式仓体设计；可快速更换的模块化载荷舱设计 任意搭载多种专业设备；采用涡轮轴动力系统  可应对复杂任务环境。', '&lt;p&gt;整机80%以上采用碳纤维复合材料具有极强的抗腐蚀能力；采用独有的体理壳承力结构最大化减轻机体重量，整机密闭，分离式仓体设计；可快速更换的模块化载荷舱设计 任意搭载多种专业设备；采用涡轮轴动力系统 &amp;nbsp;可应对复杂任务环境。&lt;/p&gt;', null, '2', '1', '1', '1', '0', '1', '266', '2017-11-20 16:23:36', '266', '2017-11-20 16:24:12');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('446', '189', '海荣EPS保温轻体房模块170型', '399', '21615', '21626', '无', '该产品保温效果好、导热系数低、尺寸稳定性好、强度高且韧性好、粘接强度高、施工性好、耐候性优异、综合成本低、防火等级B1、建筑节能一体化', '&lt;p&gt;该产品保温效果好、导热系数低、尺寸稳定性好、强度高且韧性好、粘接强度高、施工性好、耐候性优异、综合成本低、防火等级B1、建筑节能一体化&lt;/p&gt;', '21625', '2', '1', '1', '1', '0', '1', '229', '2017-11-20 16:35:07', '229', '2017-11-20 16:37:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('447', '189', '海荣EPS保温轻体房模块250型', '400', '21627', '21644', '无', '250型适用于15m以下地上建筑层数不高于3层、抗震设防裂度不大于8度的EPS模块现浇混凝土剪力墙结构民用建筑；100m以下高层框架填充保温一体化外墙维护结构。', '&lt;p&gt;250型适用于15m以下地上建筑层数不高于3层、抗震设防裂度不大于8度的EPS模块现浇混凝土剪力墙结构民用建筑；100m以下高层框架填充保温一体化外墙维护结构。&lt;/p&gt;', '21643', '1', '1', '1', '1', '0', '1', '229', '2017-11-20 16:36:53', '229', '2017-11-20 16:37:26');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('448', '191', '全系统高性能星基增强定位板卡 P328', '408', '21665', '21667', '板卡支持多系统多频点，BDS B1/B2/B3；GPS L1CA/L1P/L1C/L2P/L2C/L5；GLONASS G1/G2,P1/P2；GALILEO E1BC/E5a/E5b；QZSS L1CA/L2C/L5/L1C；L-Band。', 'P328是合众思壮基于全新一代基带芯片&ldquo;天琴&rdquo;开发的支持中国精度星基增强的高性能的定位接收机，单机即可实现厘米级定位精度。', '&lt;p&gt;P328是合众思壮基于全新一代基带芯片&amp;ldquo;天琴&amp;rdquo;开发的支持中国精度星基增强的高性能的定位接收机，单机即可实现厘米级定位精度。板卡支持多系统多频点，BDS B1/B2/B3；GPS L1CA/L1P/L1C/L2P/L2C/L5；GLONASS G1/G2,P1/P2；GALILEO E1BC/E5a/E5b；QZSS L1CA/L2C/L5/L1C；L-Band。&lt;/p&gt;', '21664', '99', '1', '1', '1', '0', '1', '222', '2017-11-21 10:00:05', '222', '2017-11-21 10:18:51');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('449', '191', '星基增强信标接收机R330', '409', '21670', '21766', 'RTK，GNSS，L1/L2 GNSS，SBAS，信标和L-Band高精度定位\r\n在恶劣环境中更少的RTK飞点\r\n支持中国精度全球星基增强差分技术，单机即可获得厘米级定位精度\r\n支持RTK中国精度星基续航功能，RTK差分断开后保持RTK精度\r\n更好的周跳检测技术带来了更快加速的重捕获和更加强大的解决方案\r\n状态指示灯和菜单系统保证了R330极易使用和配置\r\n高达20Hz的数据更新率提供了最佳机械控制和指导\r\n长达50km的RTK基线', 'R330采用Hemisphere GNSS公司EclipseTM平台和我们最新的GNSS专利技术，R330支持GPS、GLONASS、BDS，R330通过使用诸如RTK、L-Band和信标等多种校正方法提供了精确的定位信息。可在任何高精度要求的海洋或者陆地应用中，都工作性能良好。', '&lt;p&gt;R330采用Hemisphere GNSS公司EclipseTM平台和我们最新的GNSS专利技术，R330支持GPS、GLONASS、BDS，R330通过使用诸如RTK、L-Band和信标等多种校正方法提供了精确的定位信息。可在任何高精度要求的海洋或者陆地应用中，都工作性能良好。&lt;/p&gt;', '21669', '98', '1', '1', '1', '0', '1', '222', '2017-11-21 10:02:58', '222', '2017-11-21 10:54:51');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('450', '191', '分体式测向定位接收机Vector VS330', '410', '21673', '21767', '支持L-Band DGNSS（中国精度全球星基增强差分技术）\r\n卓越的定向精度，包括短基线和长达10米的天线距\r\n扩展支持L1/L2 GPS/GLONASS/BDS RTK功能\r\n快速的RTK收敛和重捕获时间\r\n简洁的菜单操作\r\n在GNSS信号丢失时，可连续准确定向3分钟\r\nCOAST技术可在差分信号缺失情况下连续保持40分钟甚至更长时间的差分定位精度\r\n集成陀螺仪和倾斜传感器可改善快速启动时间，并在临时缺失GPS信号时提供航向更新信息', '通过将L-Band技术整合在VectorTM VS家族产品中，精密海洋和陆地应用要求了VectorTM VS131/VS330接收机卓越的定向和定位性能，Vector VS131是在可接收到L-Band服务区域内进行专业机械控制和导航应用的理想选择，其自身的显示和用户界面，可以便捷地安装在终端设备上；双GPS天线可根据用户的定向精度要求进行单独安装。', '&lt;p&gt;通过将L-Band技术整合在VectorTM&amp;nbsp;VS家族产品中，精密海洋和陆地应用要求了VectorTM&amp;nbsp;VS131/VS330接收机卓越的定向和定位性能，Vector VS131是在可接收到L-Band服务区域内进行专业机械控制和导航应用的理想选择，其自身的显示和用户界面，可以便捷地安装在终端设备上；双GPS天线可根据用户的定向精度要求进行单独安装。&lt;/p&gt;', '21675', '97', '1', '1', '1', '0', '1', '222', '2017-11-21 10:04:18', '222', '2017-11-21 10:55:06');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('451', '191', '星基增强定位测向智能天线/GNSS罗经VectorV320', '409', '21678', '21686', '支持GPS/GLONASS/BDS三星七频\r\n可同时提供定向、定位、起伏、横滚和俯仰\r\n支持中国精度全球星基差分，单机即可达到厘米级定位精度\r\n支持RTK中国精度星基续航功能，RTK差分断开后保持RTK精度\r\n卓越的带内和带外抗干扰能力\r\n快速的首次锁定时间\r\n95%的时间内1m的差分定位精度\r\n集成陀螺仪和倾斜传感器在GNSS卫星失锁时可持续提供航向信息\r\n支持SBAS（WAAS、EGNOS、MSAS等）和可选外部差分输入\r\nCOAST技术可在差分信号缺失情况下连续保持40分钟甚至更长时间的差分定位精度', 'VectorTM V320 GNSS罗经拥有精确定位和定向性能的卓越导航体验，支持GPS/GLONASS/BDS三星七频，高精度定位及测向。此外，支持合众思壮开发及运营的中国精度全球星基增强服务，单机即可获得厘米级高精度位置信息。采用先进的测向及定位技术从而提供了一个基于智能天线的低成本、高效率的定向和定位解决方案。', '&lt;p&gt;VectorTM&amp;nbsp;V320 GNSS罗经拥有精确定位和定向性能的卓越导航体验，支持GPS/GLONASS/BDS三星七频，高精度定位及测向。此外，支持合众思壮开发及运营的中国精度全球星基增强服务，单机即可获得厘米级高精度位置信息。采用先进的测向及定位技术从而提供了一个基于智能天线的低成本、高效率的定向和定位解决方案。&lt;/p&gt;', '21683', '96', '0', '1', '1', '0', '1', '222', '2017-11-21 10:05:50', '222', '2017-11-21 10:06:35');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('452', '191', '智能监控终端MG10', '412', '21687', '21690', '支持RS232/485串口、PPS接口、USB、EVENT、CAN等接口，可方便与其它设备同步及连接汽车的CAN总线接口，进行深度控制的开发。', 'MG10高精度GNSS定位终端具有体积小巧、功能齐全、接口丰富等特点，可方便用于车辆监控、工程检测、机械控制、自动化数据采集等项目应用。', '&lt;p&gt;MG10高精度GNSS定位终端具有体积小巧、功能齐全、接口丰富等特点，可方便用于车辆监控、工程检测、机械控制、自动化数据采集等项目应用。&lt;/p&gt;', '21689', '95', '0', '1', '1', '0', '1', '222', '2017-11-21 10:09:01', '222', '2017-11-21 10:09:01');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('453', '191', '坚固型北斗智能终端A5', '413', '21691', '21698', '支持BDS/GPS/GLONASS全星座卫星接收，支持单北斗定位，精准高效。\r\n支持CORS系统接入，最高可达亚米级定位\r\n设备支持Ntrip方式接入CORS系统，最高可达亚米级定位精度，方便进行高精度GIS采集和精准导航工作。', 'A5坚固型北斗智能终端最新升级版骁龙64位四核处理芯片，在兼容BDS、GPS、GLONASS全星座卫星系统接收的同时，支持CORS系统接入，最高可达亚米级定位精度，全网通的网络制式优化用户资产配置效率，是专业高精度采集和导航的理想选择。', '&lt;p&gt;A5坚固型北斗智能终端最新升级版骁龙64位四核处理芯片，在兼容BDS、GPS、GLONASS全星座卫星系统接收的同时，支持CORS系统接入，最高可达亚米级定位精度，全网通的网络制式优化用户资产配置效率，是专业高精度采集和导航的理想选择。&lt;/p&gt;', '21697', '94', '0', '1', '1', '0', '1', '222', '2017-11-21 10:10:07', '222', '2017-11-21 10:10:07');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('454', '191', 'GNSS智能天线UA203', '414', '21699', '21705', '多模高精度天线\r\n多模高精度GNSS接收机\r\n低成本、小型化设计\r\n频率带宽：1555～1615MHz\r\n极化方式：右旋圆极化\r\n无源增益：&gt;5dBi\r\n天线轴比：&le;2dB@轴向\r\n相位中心：&plusmn;2mm\r\n带外抑制：1585&plusmn;200 MHz&gt;40dBc', 'UA203TMGNSS智能天线提供了一种低成本的专业高精度定位解决方案。内置高精度天线和多模GNSS高精度接收机。天线具有优越的增益、相位中心、极化轴比等性能，GNSS接收机覆盖GPS、GLONASS、北斗信号的接收。输出信号接口包括两路RS232数据交换串口和一路秒脉冲信号，可为测量、机械控制、导航、授时等系统提供高精度位置、速度与时间等数据信息。', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;UA203TMGNSS智能天线提供了一种低成本的专业高精度定位解决方案。内置高精度天线和多模GNSS高精度接收机。天线具有优越的增益、相位中心、极化轴比等性能，GNSS接收机覆盖GPS、GLONASS、北斗信号的接收。输出信号接口包括两路RS232数据交换串口和一路秒脉冲信号，可为测量、机械控制、导航、授时等系统提供高精度位置、速度与时间等数据信息。&lt;/p&gt;', '21704', '93', '0', '1', '1', '0', '1', '222', '2017-11-21 10:11:07', '222', '2017-11-21 10:11:31');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('455', '191', '坚固型智能平板UG905高精度版', '415', '21706', '21711', '支持Quick Charge2.0快速充电技术，可快速对电池进行充电。续航持久的8400mAh大容量可拆卸聚合物电池，典型使用时间可达12小时。\r\nUSB Type-C，未来已来\r\nUSB Type-C接口设计，支持正反方向任意插拔，接口使用寿命可达1000次，是普通USB口的两倍。', 'UG905高精度版使用全星座卫星系统定位芯片，更快的骁龙8核处理器，32GB大容量闪存，全网通网络，电池屏幕。今天，我们与时俱进，更新系统配置，发布UG905高精度版，不仅好用，而且精度高的有点狠。', '&lt;p&gt;UG905高精度版使用全星座卫星系统定位芯片，更快的骁龙8核处理器，32GB大容量闪存，全网通网络，电池屏幕。今天，我们与时俱进，更新系统配置，发布UG905高精度版，不仅好用，而且精度高的有点狠。&lt;/p&gt;', '21710', '92', '0', '1', '1', '0', '1', '222', '2017-11-21 10:14:36', '222', '2017-11-21 10:14:36');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('456', '191', 'G990高精度GNSS接收机', '416', '21712', '21715', '采用国际一流的多频多星多系统的全球顶级主板，更高的测量精度，更高的可靠性。具有120、220或372通道，接收BD2/GPS/GLONASS、广域差分SBAS(MSAS/WAAS/EGNOS)、扩展接收伽利略、QZSS等卫星信号，保证您野外测量数据更加准确、可靠！', 'G990高精度GNSS接收机是合众思壮公司的经典之作，基于20年专业GNSS产品研发经验整合国内外优质资源，为您奉上G990高精度GNSS接收机，完美品质期待与您共同见证。', '&lt;p&gt;&amp;nbsp;G990高精度GNSS接收机是合众思壮公司的经典之作，基于20年专业GNSS产品研发经验整合国内外优质资源，为您奉上G990高精度GNSS接收机，完美品质期待与您共同见证。&lt;/p&gt;', '21714', '91', '0', '1', '1', '0', '1', '222', '2017-11-21 10:16:01', '222', '2017-11-21 10:16:01');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('457', '191', 'NET20 PLUS高性能GNSS监测接收机', '417', '21717', '21723', 'NET20 PLUS采用Linux智能操作系统，设备内置千兆网口、蓝牙、WiFi等无线接口，支持Web UI设置，可远程对接收机进行设置和维护。\r\n全频段卫星信号跟踪，支持单北斗解算\r\n设置支持BDS B1/B2/B3、GPS L1/L2/L2C/L5、GLONASS L1/L2等全频段卫星信号跟踪，并支持单北斗系统解算，保障测量数据的高安全性和可靠性。', 'NET20 PLUS是合众思壮公司针对CORS系统建设而设计的一款全星座高集成地基增强系统接收机。内置多星多频主板、3G、蓝牙、大容量存储、高容量电池、高清晰显示屏等。以LINUX系统作为开发平台，支持二次开发，功能强大稳定，更多数据接口，可兼容各领域的不同应用。', '&lt;p&gt;NET20 PLUS是合众思壮公司针对CORS系统建设而设计的一款全星座高集成地基增强系统接收机。内置多星多频主板、3G、蓝牙、大容量存储、高容量电池、高清晰显示屏等。以LINUX系统作为开发平台，支持二次开发，功能强大稳定，更多数据接口，可兼容各领域的不同应用。&lt;/p&gt;', '21722', '90', '0', '1', '1', '0', '1', '222', '2017-11-21 10:17:23', '222', '2017-11-21 10:17:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('458', '191', '全系统GNSS星基增强定位定向板卡 H328', '418', '21724', '21728', '卓越的航向精度，优于0.09度（1米基线）\r\n采用天琴芯片及全新CPU平台\r\n支持GPS，GLONASS，BeiDou，GALILEO，QZSS和L-Band\r\n支持中国精度，单机实现厘米级定位\r\n支持aRTK星链续航\r\n5cm RMS的RTK可用起伏精度\r\n强大的抗多路径效应和抗干扰能力\r\n接口丰富，支持网口，CAN，USB，串口，1PPS等多种接口\r\n硬件尺寸兼容市场主流\r\n采用最新高性能陀螺，GNSS卫星失锁时，继续保持航向', 'H328是合众思壮基于&ldquo;天琴&rdquo;芯片最新开发的一款高精度测向定位板卡，拥有一系列的最先进、最前沿的EclipseTM测向技术，包括短基线快速高精度测向，RTK定位，支持中国精度，单机实现厘米级定位精度。更低的功率消耗使其易于集成。', '&lt;p&gt;H328是合众思壮基于&amp;ldquo;天琴&amp;rdquo;芯片最新开发的一款高精度测向定位板卡，拥有一系列的最先进、最前沿的EclipseTM测向技术，包括短基线快速高精度测向，RTK定位，支持中国精度，单机实现厘米级定位精度。更低的功率消耗使其易于集成。&lt;/p&gt;', '21727', '89', '0', '1', '1', '0', '1', '222', '2017-11-21 10:18:32', '222', '2017-11-21 10:18:32');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('459', '192', 'JHC6E-DI磁力仪', '419', '21746', '21752', '参数：基线值观测标准偏差：&delta;DB&le;+0.10&rsquo;，&delta;IB&le;+0,10&rsquo;；\r\n观测准确度：∆D&le;+0.20&rsquo;，∆I&le;+0.20&rsquo;；\r\n换向差：∆D&le;+10&rsquo;，∆I&le;+10&rsquo;；\r\n三方位基线值与平均值的最大差值：∆D&le;0.20&rsquo;，∆I&le;0.20&rsquo;；\r\n无磁经纬仪器&mdash;测回水平方向标准偏差（室内）：&le;+4&rsquo;&rsquo;；\r\n整机磁化率显示（安装探头前）：&le;2X10-6；\r\n零场偏移：+1.0nt；\r\n零场偏移的温度系数：0.01nt/℃；\r\n系统噪声：&le;0.1nt（RMS）;\r\n最大分辨率：0.1nt；\r\n测量范围：0~100ut分三档：0.1nt~1999.9nt；1nt~19999nt；', '磁力仪', '&lt;p&gt;JHC6E-DI磁力仪&lt;/p&gt;\r\n\r\n&lt;p&gt;参数：基线值观测标准偏差：&amp;delta;DB&amp;le;+0.10&amp;rsquo;，&amp;delta;IB&amp;le;+0,10&amp;rsquo;；&lt;/p&gt;\r\n\r\n&lt;p&gt;观测准确度：∆D&amp;le;+0.20&amp;rsquo;，∆I&amp;le;+0.20&amp;rsquo;；&lt;/p&gt;\r\n\r\n&lt;p&gt;换向差：∆D&amp;le;+10&amp;rsquo;，∆I&amp;le;+10&amp;rsquo;；&lt;/p&gt;\r\n\r\n&lt;p&gt;三方位基线值与平均值的最大差值：∆D&amp;le;0.20&amp;rsquo;，∆I&amp;le;0.20&amp;rsquo;；&lt;/p&gt;\r\n\r\n&lt;p&gt;无磁经纬仪器&amp;mdash;测回水平方向标准偏差（室内）：&amp;le;+4&amp;rsquo;&amp;rsquo;；&lt;/p&gt;\r\n\r\n&lt;p&gt;整机磁化率显示（安装探头前）：&amp;le;2X10-6；&lt;/p&gt;\r\n\r\n&lt;p&gt;零场偏移：+1.0nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;零场偏移的温度系数：0.01nt/℃；&lt;/p&gt;\r\n\r\n&lt;p&gt;系统噪声：&amp;le;0.1nt（RMS）;&lt;/p&gt;\r\n\r\n&lt;p&gt;最大分辨率：0.1nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;测量范围：0~100ut分三档：0.1nt~1999.9nt；1nt~19999nt；0.01ut~100ut自动切换档位；有过量程保护；&lt;/p&gt;\r\n\r\n&lt;p&gt;显示期至传感器最小安全距离：2.0米；&lt;/p&gt;\r\n\r\n&lt;p&gt;显示器：四位半LCD数字式显示，读数在太阳光下清晰可见；&lt;/p&gt;\r\n\r\n&lt;p&gt;电源：12V4.4AH锂电池供电，可长时间工作；&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '309', '2017-11-21 10:38:55', '309', '2017-11-21 10:38:55');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('460', '192', 'JHC-168T高精度智能磁力仪', '419', '21753', '21755', '1、分辨率（灵敏度）：0.01nT； \r\n2、精度：0.05nT ； \r\n3、梯度容忍度：7000nT / M；\r\n4、采样率：4秒~999秒可任意设定;\r\n5、机内时钟：5秒/月（常温下）；\r\n6、温飘系数：&le;0.001nt/℃；\r\n7、数据存储时间：10年（常温下）；\r\n8、数据输出：实时采集RS-232或USB接口输出数据；\r\n9、传输速率：9600~38400波特率可选；\r\n10、尺寸与数量：主机18cmX27cmX9cm，1.6kg\r\n探头：9cmX13cm，1.2kg\r\n11、电源：12v直流电源。', 'JHC-168T高精度智能磁力仪的原理简单，仪器体积较小、精度较高、性能稳定及可靠。', '&lt;p&gt;JHC-168T高精度智能磁力仪的原理简单，仪器体积较小、精度较高、性能稳定及可靠。它被广泛地应用于以下领域：&lt;br /&gt;\r\n1、地震前兆监测，火山观测以及其它环境及灾害地质工作。&lt;br /&gt;\r\n2、地质调查：观察研究地质现象（岩石、地层、构造、矿产、水文地质、地貌等），例如矿产预测、矿产普查勘探、水文地质、工程地质勘查、地质环境保护和 &amp;nbsp; &amp;nbsp;地质填图等。&lt;br /&gt;\r\n3、陆地、海洋测绘&lt;br /&gt;\r\n4、矿产、石油和天然气勘探：研究矿体的埋深、产状和连续性，研究矿体的形状、大小，估计矿床规模；研究与油气有关的地质构造及大地构造。&lt;br /&gt;\r\n5、地磁测量&lt;br /&gt;\r\n6、铁质管道检查：对铁制品埋藏物定位，如铁桶、铁罐等。&lt;br /&gt;\r\n7、钻井井位：探测与磁性相关的地质构造。&lt;br /&gt;\r\n8、铁制军火侦测&lt;br /&gt;\r\n9、工程、环境勘探&lt;br /&gt;\r\n10、科研和高等教育&lt;br /&gt;\r\n11、考古&lt;/p&gt;', null, '2', '1', '1', '1', '0', '1', '309', '2017-11-21 10:41:29', '309', '2017-11-21 10:44:34');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('461', '192', 'JHC-188T海洋磁力仪', '419', '21756', '21758', '1、分辨率：优于0.1nt；\r\n2、灵敏度：优于0.1nt；\r\n3、精度：0.5nt；\r\n4、采样率：4秒~999秒可任意设定；\r\n5、机内时钟：5秒/月（常温下）；\r\n6、梯度容忍度：6000nt/M；\r\n7、温飘系数：&le;0.001nt/℃；\r\n8、数据存储量：基站测量可存30000组数据，带掉电保护功能；\r\n9、数据存储时间：10年（常温下）；\r\n10、数据输出：可实时采集RS-232或USB接口输出数据；\r\n11、传输速率：9600~38400波特率可选；\r\n12、键盘：12个触摸式按键；\r\n13、电源：12V直流电源；220交流电源\r\n14、拖缆长：长度可自选。', '产品组成：主机一台\r\n标准米拖缆一根\r\n小型绞车一台\r\n磁探头一个\r\n实时数据专用软件光盘一张\r\n说明书一本\r\n专用电源接线一套', '&lt;p&gt;1、分辨率：优于0.1nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;2、灵敏度：优于0.1nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;3、精度：0.5nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;4、采样率：4秒~999秒可任意设定；&lt;/p&gt;\r\n\r\n&lt;p&gt;5、机内时钟：5秒/月（常温下）；&lt;/p&gt;\r\n\r\n&lt;p&gt;6、梯度容忍度：6000nt/M；&lt;/p&gt;\r\n\r\n&lt;p&gt;7、温飘系数：&amp;le;0.001nt/℃；&lt;/p&gt;\r\n\r\n&lt;p&gt;8、数据存储量：基站测量可存30000组数据，带掉电保护功能；&lt;/p&gt;\r\n\r\n&lt;p&gt;9、数据存储时间：10年（常温下）；&lt;/p&gt;\r\n\r\n&lt;p&gt;10、数据输出：可实时采集RS-232或USB接口输出数据；&lt;/p&gt;\r\n\r\n&lt;p&gt;11、传输速率：9600~38400波特率可选；&lt;/p&gt;\r\n\r\n&lt;p&gt;12、键盘：12个触摸式按键；&lt;/p&gt;\r\n\r\n&lt;p&gt;13、电源：12V直流电源；220交流电源&lt;/p&gt;\r\n\r\n&lt;p&gt;14、拖缆长：长度可自选。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;产品组成：主机一台&lt;/p&gt;\r\n\r\n&lt;p&gt;标准米拖缆一根&lt;/p&gt;\r\n\r\n&lt;p&gt;小型绞车一台&lt;/p&gt;\r\n\r\n&lt;p&gt;磁探头一个&lt;/p&gt;\r\n\r\n&lt;p&gt;实时数据专用软件光盘一张&lt;/p&gt;\r\n\r\n&lt;p&gt;说明书一本&lt;/p&gt;\r\n\r\n&lt;p&gt;专用电源接线一套&lt;/p&gt;', null, '3', '0', '1', '1', '0', '1', '309', '2017-11-21 10:44:27', '309', '2017-11-21 10:44:27');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('462', '192', 'JHC-856TG高精度磁力仪、JHC-856T高精度磁力仪', '419', '21759', '21761', '参数：分辨率：优于0.1nt；\r\n灵敏度：优于0.1nt；\r\n精度：优于0.5nt；\r\n采样率：4秒~999秒可任意设定；\r\n显示器：双排显示；\r\n机内时钟：5秒/月（常温下）；\r\n梯度容忍度：6000nt/M；\r\n温飘系数：&le;0.001nt/℃；\r\n控制：网络远程控制；\r\n数据存储时间：10年（常温下）；\r\n数据输出：实时采集RS-232或USB接口输出数据；\r\n传输速率：波特率可选；\r\n键盘：12个；\r\n尺寸与数量：主机18cmX27cmX9cm，1.6kg\r\n探头9cmX13cm，1.2kg；', 'JHC-856T、JHC-856TG高精度智能磁力仪具有高精度、高分辨力、高稳定度，适合深部地质矿产资源勘探，在科研、石油、冶金、有色金属、地震预报、地质环境、考古、煤田、核工业、金属探测等领域广泛使用。', '&lt;p&gt;JHC-856T、JHC-856TG高精度智能磁力仪具有高精度、高分辨力、高稳定度，适合深部地质矿产资源勘探，在科研、石油、冶金、有色金属、地震预报、地质环境、考古、煤田、核工业、金属探测等领域广泛使用。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;参数：分辨率：优于0.1nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;灵敏度：优于0.1nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;精度：优于0.5nt；&lt;/p&gt;\r\n\r\n&lt;p&gt;采样率：4秒~999秒可任意设定；&lt;/p&gt;\r\n\r\n&lt;p&gt;显示器：双排显示；&lt;/p&gt;\r\n\r\n&lt;p&gt;机内时钟：5秒/月（常温下）；&lt;/p&gt;\r\n\r\n&lt;p&gt;梯度容忍度：6000nt/M；&lt;/p&gt;\r\n\r\n&lt;p&gt;温飘系数：&amp;le;0.001nt/℃；&lt;/p&gt;\r\n\r\n&lt;p&gt;控制：网络远程控制；&lt;/p&gt;\r\n\r\n&lt;p&gt;数据存储时间：10年（常温下）；&lt;/p&gt;\r\n\r\n&lt;p&gt;数据输出：实时采集RS-232或USB接口输出数据；&lt;/p&gt;\r\n\r\n&lt;p&gt;传输速率：波特率可选；&lt;/p&gt;\r\n\r\n&lt;p&gt;键盘：12个；&lt;/p&gt;\r\n\r\n&lt;p&gt;尺寸与数量：主机18cmX27cmX9cm，1.6kg&lt;/p&gt;\r\n\r\n&lt;p&gt;探头9cmX13cm，1.2kg；&lt;/p&gt;\r\n\r\n&lt;p&gt;电源：12V4.4AH的充电锂离子电池；野外生产可工作四天以上，日变可连续工作40小时以（采样间隔30秒）；&lt;/p&gt;', null, '4', '1', '1', '1', '0', '1', '309', '2017-11-21 10:47:35', '309', '2017-11-21 10:50:23');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('463', '192', 'JHC-GM5磁通门磁力仪', '419', '21762', '21764', '1、测量对象：地磁D、H、Z分量的连续变化；\r\n2、动态范围：+2500nt；\r\n3、分辨力：0.1nt;\r\n4、噪声：＜0.1nt；\r\n5、温度系数：&le;1nt/℃；\r\n6、频率响应：DC~10hz；\r\n7、采样率：1次/秒；\r\n8、传输方式：RJ-45网口；\r\n9、电源：9~18V DC;\r\n10、湿度：＜80%；\r\n11、功耗：＜5W。', 'JHC-GM5磁通门磁力仪是一种连续测量和记录地磁场D、H、Z时间变换的数字化相对记录仪。仪器系统主要由磁通门传感器激励与模拟信号处理电路、模数转换电路、GPS接收电路、液晶显示电路，以及电源电路等部分组成。', '&lt;p&gt;JHC-GM5磁通门磁力仪是一种连续测量和记录地磁场D、H、Z时间变换的数字化相对记录仪。仪器系统主要由磁通门传感器激励与模拟信号处理电路、模数转换电路、GPS接收电路、液晶显示电路，以及电源电路等部分组成。由此实现对D、H、Z三分量的数据采集、处理、存储、观测曲线的实时显示、网络通信、仪器标定等目标。JHC-GM5磁通门磁力仪是一种数字化的磁变仪。该仪器在测D、H、Z变化的同时监测测点温度的变化。仪器采用GPS定时，实时显示地磁场三分量变化曲线。仪器具有绝对测量和自动补偿功能，具有探头小型化、宽频带、大动态、高采样率和大容量的数据存储，同时具有TCP/IP网络化数据通信、USB移动硬盘存储、低功耗和温度系数小等特点。&lt;/p&gt;', null, '5', '0', '1', '1', '0', '1', '309', '2017-11-21 10:50:18', '309', '2017-11-21 10:50:18');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('464', '194', 'HEW-海军特种电缆', '420', '21793', '21798', '1.屏蔽和非屏蔽的通信电缆\r\n2.用作控制电缆和电源线的轻型强电流电缆\r\n3.船舶柴油机布线专用的特种电缆', '海军以及军事上特殊的要求注定了电线、绝缘和护套材料的品质之高。HEW-kabel所拥有的定制特种电缆借其特殊属性可带来个性化的有利优势。\r\n    各总国际认证&mdash;如：德国劳氏船级社、挪威船级社或VG-95218标准（第61-66部分，类型B&amp;J）均属于我们的产品组合。在这一专业领域中，HEW的解决方案能够满足顶级标准的灵活柔韧性。它实现了最小的电缆净重、超长的使用寿命以及显著的效率提高。', '&lt;p&gt;海军以及军事上特殊的要求注定了电线、绝缘和护套材料的品质之高。HEW-kabel所拥有的定制特种电缆借其特殊属性可带来个性化的有利优势。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;各总国际认证&amp;mdash;如：德国劳氏船级社、挪威船级社或VG-95218标准（第61-66部分，类型B&amp;amp;J）均属于我们的产品组合。在这一专业领域中，HEW的解决方案能够满足顶级标准的灵活柔韧性。它实现了最小的电缆净重、超长的使用寿命以及显著的效率提高。&lt;/p&gt;', '21792', '99', '1', '1', '1', '0', '1', '189', '2017-11-21 15:07:38', '189', '2017-11-21 15:31:54');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('465', '194', 'HEW-能源领域特种电缆', '421', '21799', '21806', '1.火焰传感器\r\n2.钻井泥流量传感器\r\n3.管道监测\r\n4.陆地和石油钻井平台上的石油开采系统', 'HEW-KABEL也是石油和天然气工业中经济开发的开括者和合作伙伴。优异的化学与机械性能以及优异的电气性能能使我们的特种电缆获得能源开采应用的资格。\r\n    此外，管道监测系统也属于HEW-OIL&amp;GAS（HEW-油气）应用领域的一员。', '&lt;p&gt;HEW-KABEL也是石油和天然气工业中经济开发的开括者和合作伙伴。优异的化学与机械性能以及优异的电气性能能使我们的特种电缆获得能源开采应用的资格。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;此外，管道监测系统也属于HEW-OIL&amp;amp;GAS（HEW-油气）应用领域的一员。例如，即使在多种应用领域中，最恶劣的热/化学环境影响下也可确保稳定、可靠的电源供应：&lt;/p&gt;\r\n\r\n&lt;p&gt;1.火焰传感器&lt;/p&gt;\r\n\r\n&lt;p&gt;2.钻井泥流量传感器&lt;/p&gt;\r\n\r\n&lt;p&gt;3.管道监测&lt;/p&gt;\r\n\r\n&lt;p&gt;4.陆地和石油钻井平台上的石油开采系统&lt;/p&gt;', '21805', '98', '1', '1', '1', '0', '1', '189', '2017-11-21 15:12:10', '189', '2017-11-21 15:31:56');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('466', '194', 'HEW-可再生能源特种电缆', '422', '21807', '21814', '1.转子制动系统\r\n2.转子破冰系统\r\n3.发电机\r\n4.用于监测机舱的温度传感器', '可持续发展是我们这个时代的挑战。HEW- RENEWABLE（HEW可再生）持续开发新的电缆解决方案，目的是让可再生能源产生更高效的能量。\r\n   我们的电缆设计对温度和高机械负荷均具备可靠的抵抗力。此外它们还满足无卤或FRNC（阻燃无腐蚀）的要求。\r\n    用含氟聚合物、热塑料、硅树脂或特种材料制成的单芯或多芯屏蔽或非屏蔽电缆，能够解决风力发电机等发电系统中特定要求的安全连接。', '&lt;p&gt;可持续发展是我们这个时代的挑战。HEW- RENEWABLE（HEW可再生）持续开发新的电缆解决方案，目的是让可再生能源产生更高效的能量。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;我们的电缆设计对温度和高机械负荷均具备可靠的抵抗力。此外它们还满足无卤或FRNC（阻燃无腐蚀）的要求。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;用含氟聚合物、热塑料、硅树脂或特种材料制成的单芯或多芯屏蔽或非屏蔽电缆，能够解决风力发电机等发电系统中特定要求的安全连接。&lt;/p&gt;', '21813', '96', '1', '1', '1', '0', '1', '189', '2017-11-21 15:17:31', '189', '2017-11-21 15:31:59');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('467', '194', 'HEW-工业特种电缆', '423', '21815', '21822', '1.静态机器（如：变压器和变频器）的布线\r\n2.旋转机器（如：电机和发电机）的布线', '我们的高品质特种电缆HEW-POWER（HEW电力）专用于电动机、发电机和变压器，他们确保了极高的可靠性。即使在极端条件下也可以保证良好的电气性能。\r\n    除了高度的耐磨性，便利的铺设特性以及极高的柔韧性，HEW-KABEL为您提供高达15KV电压运作环境下的高压耐受性、180℃的持续工作温度以及通过附加编织层所带来的额外表面保护。\r\n    而对市售浸渍树脂的耐受性、高达3.3KV的UL认证或者无卤型号的引入更是完美优化了全面的产品组合。', '&lt;p&gt;我们的高品质特种电缆HEW-POWER（HEW电力）专用于电动机、发电机和变压器，他们确保了极高的可靠性。即使在极端条件下也可以保证良好的电气性能。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;除了高度的耐磨性，便利的铺设特性以及极高的柔韧性，HEW-KABEL为您提供高达15KV电压运作环境下的高压耐受性、180℃的持续工作温度以及通过附加编织层所带来的额外表面保护。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;而对市售浸渍树脂的耐受性、高达3.3KV的UL认证或者无卤型号的引入更是完美优化了全面的产品组合。&lt;/p&gt;', '21821', '93', '0', '1', '1', '0', '1', '189', '2017-11-21 15:21:12', '189', '2017-11-21 15:21:12');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('468', '194', 'HEW-费罗热', '424', '21823', '21827', 'HEW-FILO&reg; therm将介电材料与全新开发的胶粘剂配方相结合。 结果是产品具有出色的绝缘效果的同时，还具备优异的机械属性。 此外，突出的抗化学腐蚀强度也是该产品的一大特点，从而确保了该系列的电缆产品也能够经受住最恶劣环境的考验。', '空间更小，性能更强大: HEW-FILO&reg; therm能够满足这一双重要求。 这一具有无卤阻燃性能的创新技术专门针对敏感的应用领域而开发并且为结构更紧凑，功能更强大的设计构造提供了全新的可能性。\r\nHEW-FILO&reg; therm将介电材料与全新开发的胶粘剂配方相结合。 结果是产品具有出色的绝缘效果的同时，还具备优异的机械属性。 此外，突出的抗化学腐蚀强度也是该产品的一大特点，从而确保了该系列的电缆产品也能够经受住最恶劣环境的考验。', '&lt;p&gt;空间更小，性能更强大: HEW-FILO&amp;reg; therm能够满足这一双重要求。 这一具有无卤阻燃性能的创新技术专门针对敏感的应用领域而开发并且为结构更紧凑，功能更强大的设计构造提供了全新的可能性。&lt;/p&gt;\r\n\r\n&lt;p&gt;HEW-FILO&amp;reg; therm将介电材料与全新开发的胶粘剂配方相结合。 结果是产品具有出色的绝缘效果的同时，还具备优异的机械属性。 此外，突出的抗化学腐蚀强度也是该产品的一大特点，从而确保了该系列的电缆产品也能够经受住最恶劣环境的考验。&lt;/p&gt;', '21826', '92', '0', '1', '1', '0', '1', '189', '2017-11-21 15:24:34', '189', '2017-11-21 15:24:34');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('469', '194', 'HEW-高温特种电缆', '425', '21829', '21832', '定制化的电缆开发能够满足客户多样化的要求，如：耐受-273℃至+1550℃的温度，电缆自重的最小化，耐化学腐蚀或出色的机械负荷强度。', '除了能够生产符合国家和国际标准的标准化电缆之外，HEW-KABEL的强项在于特种电缆的开发和生产，这些定制型产品具有最佳的属性以及抵抗极端条件的性能。\r\n     单独提供的定制型解决方案的基础是高加工深度（主要包括：企业自主完成拉丝、电镀和编织加工）以及特殊的，拥有专利技术的加工工艺（聚四氟乙烯条带、Micaflame技术、加热电缆技术等）。\r\n定制化的电缆开发能够满足客户多样化的要求，如：耐受-273℃至+1550℃的温度，电缆自重的最小化，耐化学腐蚀或出色的机械负荷强度。', '&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;除了能够生产符合国家和国际标准的标准化电缆之外，HEW-KABEL的强项在于特种电缆的开发和生产，这些定制型产品具有最佳的属性以及抵抗极端条件的性能。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;单独提供的定制型解决方案的基础是高加工深度（主要包括：企业自主完成拉丝、电镀和编织加工）以及特殊的，拥有专利技术的加工工艺（聚四氟乙烯条带、Micaflame技术、加热电缆技术等）。&lt;/p&gt;\r\n\r\n&lt;p&gt;定制化的电缆开发能够满足客户多样化的要求，如：耐受-273℃至+1550℃的温度，电缆自重的最小化，耐化学腐蚀或出色的机械负荷强度。&lt;/p&gt;', '21828', '91', '0', '1', '1', '0', '1', '189', '2017-11-21 15:27:37', '189', '2017-11-21 15:27:37');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('470', '194', 'HEW-微型特种电缆', '426', '21834', '21840', 'HEW-Micro优势概览：\r\n1.特殊的专业知识，精密且具产品安全性\r\n2.独特的机器和加工方法\r\n3.高科技材料\r\n4.在使用创新型特种材料方面拥有专业知识\r\n5.经过应用优化的电缆属性和设计\r\n6.最佳实践解决方案\r\n7.小批量生产', 'HEW-Micro能够开发和生产横截面积小于AWG56的定制型电缆以及横截面积小于AWG46的同轴电缆。虽然肉眼几乎看不到，但作用却不容小觑：通过采用高性能材料以及特殊的合金能够确保电缆的低噪音和高柔韧性。特殊的屏蔽层确保了理想的电磁兼容性。通过采用最现代化的材料保证了诸如：优化触觉，可消毒性/可高压灭菌性等特点以及符合ISO 10993标准的生物兼容性。', '&lt;p&gt;HEW-Micro能够开发和生产横截面积小于AWG56的定制型电缆以及横截面积小于AWG46的同轴电缆。虽然肉眼几乎看不到，但作用却不容小觑：通过采用高性能材料以及特殊的合金能够确保电缆的低噪音和高柔韧性。特殊的屏蔽层确保了理想的电磁兼容性。通过采用最现代化的材料保证了诸如：优化触觉，可消毒性/可高压灭菌性等特点以及符合ISO 10993标准的生物兼容性。&lt;/p&gt;', '21833', '90', '0', '1', '1', '0', '1', '189', '2017-11-21 15:31:48', '189', '2017-11-21 15:31:48');
INSERT INTO `byp_exhibition_booth_product_info` VALUES ('471', '195', '硅橡胶生物塑化标本', '427', '21849', '21857', '公司的产品体系有硅橡胶生物塑化标本、透明生物断层标本、剥制标本、管道铸型标本及塑化试剂和塑化设备以及塑化工艺品。', '公司的产品体系有硅橡胶生物塑化标本、透明生物断层标本、剥制标本、管道铸型标本及塑化试剂和塑化设备以及塑化工艺品。', '&lt;p&gt;&lt;strong&gt;公司简介：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 大连鸿峰生物科技有限公司成立于2004年1月，注册资本9104.5万人民币，是一家以生物塑化技术研发和生物科技项目开发为一体的中港合作企业。公司现有在职人员135人，其中本科学历人员占80%以上。公司秉承造福人民、服务社会的宗旨，引入科学的管理方法，扩大生产规模和经营范围，不断加快生物标本塑化保存技术的研究、开发和应用，谋求多元化、立体式的快速发展；以一个现代化高科技生态园式的企业形象，站在科技产业化浪潮的前沿，致力于营造健康生活，为人类的健康、社会的进步创造更丰富的价值。&lt;/p&gt;\r\n\r\n&lt;p&gt;公司拥有一支高素质的科技研发队伍，能够提供专业的生物塑化技术培训和咨询。依托成熟的生物塑化技术，自主研发了一系列生物塑化产品及其配套产品，拥有多项发明专利和实用新型专利，多次获得省、市级科技进步奖。 2006年以来，公司连续多年获得&amp;ldquo;大连市10大高新技术优秀企业&amp;rdquo;、&amp;ldquo;最佳海外学子创业企业&amp;rdquo;、&amp;ldquo;中国留学人员创业腾飞奖&amp;rdquo;&amp;ldquo;中国留学归国创业最具成长性企业&amp;rdquo;等荣誉；总经理隋鸿锦教授被评选为&amp;ldquo;大连市高新技术园区10大优秀企业家&amp;rdquo;、&amp;ldquo;海外学子10大创业明星&amp;rdquo;和&amp;ldquo;大连市归国留学人员创业标兵&amp;rdquo;等荣誉称号。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;经营范围：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&amp;nbsp; &lt;/strong&gt;生物塑化产品及生物塑化相关产品的研制、开发、生产、销售及相关技术咨询服务；生物标本制作、销售；国内一般贸易；货物进出口业务；会议服务；展览展示服务；室内外装饰装修设计；电脑图文设计；计算机软件开发、销售服务；房屋租赁。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;主要产品和技术力量：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 公司的产品体系有硅橡胶生物塑化标本、透明生物断层标本、剥制标本、管道铸型标本及塑化试剂和塑化设备以及塑化工艺品。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 生物塑化技术（流程如下图）是一种可以把生物组织保存得像活体一样的特殊技术。这种高科技的固态保存方法，集中了传统保存方法的各种优点，摒弃其缺点和不足，具有无可比拟的优势。它通过一种真空物理过程，用硅橡胶、环氧树脂、聚酯树脂等活性高分子多聚物对生物标本进行浸渗，替代生物组织中的水分和脂类。使用该技术制成的动物和人体标本，无毒、无味、干燥，又有一定的韧性，不需要特殊的维护和保养，其表面保持原有的状态，并可在显微水平保存细胞结构，具有极高的教学、科研和科普价值。目前，该技术已被广泛应用于解剖学、生物学、组织学、胚胎学、病理学、法医学、考古学、展览馆展示等多个学科和领域。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121162828_916.jpg&quot; style=&quot;height:939px; width:834px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;生产经营情况：&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 生物塑化技术的诞生，终结了福尔马林等浸制标本的时代，随着生物学、病理学、法医学及博物馆等学科的不断深入，生物塑化产品的需求日益增大。鸿峰生物塑化技术处于国际领先水平，除本单位外，只有德国能够提供同类产品，且生产能力有限，因此，我公司的生物塑化标本在国际市场拥有得天独厚的竞争优势，使得我公司的塑化产品占据60%的市场份额。在国外，与美国佛罗里达海洋馆、日本茨城县大学、爱尔兰皇家外科学院巴林分院、澳大利亚Monash大学、马来西亚Kebangsaan大学等院校均有业务往来；在国内，与清华美院、北体、浙大、南开、厦大、华科等诸多高校和科研院所及多家博物馆、科技馆、水族馆等签署合作协议。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 2004年至今， 公司举办的以&amp;ldquo;珍惜生命、关爱健康&amp;rdquo;为主题的&amp;ldquo;人体世界&amp;rdquo;科普展览在亚洲、欧美等地的20多个国家和地区相继举办，并获得极大成功，开创了一条全新的医学科普途径，公司也因此赢得了极高的国际声誉。公司在举办&amp;ldquo;人体世界&amp;rdquo;科普展览的同时，也经营其它的主题性科技文化展览，2009年生命奥秘博物馆在大连揭牌成立，开启了中国以塑化产品为主题的博物馆，2011年5月24日金石滩生命奥秘博物馆合作项目签约仪式在金石滩国际会议中心隆重举行，这为生命奥秘主题的国内展览开辟了全新的运作模式。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 随着公司发展步伐的加快，为适应新的发展需要，向更高的目标迈进，2008年6月公司迁入大连旅顺经济开发区，2011年7月占地5万平米的高科技、现代化、生态园式新基地竣工投产，为公司进一步扩大生产规模和经营范围提供了强有力的保障；为促进多元化、立体式、可持续的快速发展发挥着重要作用；为展示公司高科技、现代化的企业形象奠定了坚实的基础；为当地的经济发展注入了新的活力，2016年营业收入11,312.16 万元。目前，鸿峰公司已经成长为国际塑化行业的龙头企业，公司产品遍及国内外，并正在进军医疗、培训、文化传播领域；为建设和谐社会，创造就业机会，带动地方经济发展做出了巨大的贡献。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', null, '1', '0', '1', '1', '0', '1', '271', '2017-11-21 16:28:57', '271', '2017-11-21 16:29:42');
