INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('37', '149', 'Polyjet打印技术介绍', '19493', 'PolyJet 3D 打印与喷墨打印类似，但 PolyJet 3D 打印机并非在纸张上喷射墨滴，而是将可固化液态光敏树脂层喷射到构建托盘上。', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Po&lt;/strong&gt;&lt;strong&gt;lyjet&lt;/strong&gt;&lt;strong&gt;打印技术介绍&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;PolyJet 3D 打印的工作原理&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117084447_334.jpg&quot; style=&quot;height:100px; width:100px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;PolyJet 3D 打印与喷墨打印类似，但 PolyJet 3D 打印机并非在纸张上喷射墨滴，而是将可固化液态光敏树脂层喷射到构建托盘上。&lt;/p&gt;\r\n\r\n&lt;p&gt;该过程相当简单：&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;预处理&lt;/strong&gt;：&amp;nbsp;预建软件自动根据 3D CAD 文件计算光敏树脂和支撑材料的位置。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;生产&lt;/strong&gt;：&amp;nbsp;3D 打印机喷射细小光敏树脂液滴并立即使用紫外线将其固化。薄层聚集在构建托盘上，形成精确的 3D 模型或零件。3D 打印机会在悬垂部分或形状复杂需要支撑处喷射可去除的凝胶状支撑材料。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;支撑去除&lt;/strong&gt;：用户可轻松地用手或水去除支撑材料。可直接对 3D 打印机生成的模型和零件进行处理和使用，无需后续固化。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;PolyJet 3D 打印的优势&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;PolyJet 3D 打印技术具有快速加工和原型制造的诸多优势，甚至能快速、高精度地生成具有卓越的精致细节、表面平滑的最终用途零件。&lt;/p&gt;\r\n\r\n&lt;p&gt;制作呈现最接近实物外观平滑、精细的原型。&lt;/p&gt;\r\n\r\n&lt;p&gt;生产小批量制造工具、夹具和装配夹具。&lt;/p&gt;\r\n\r\n&lt;p&gt;生成复杂形状、繁杂细节和平滑表面。&lt;/p&gt;\r\n\r\n&lt;p&gt;通过可用的最佳材料通用性将有色的不同材料特性整合于一个模型。&lt;/p&gt;\r\n\r\n&lt;p&gt;彩色和多种材料 3D 打印&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117084932_246.jpg&quot; style=&quot;height:100px; width:142px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;我们最先进的系统能够同时喷射多种材料，因此可以将各种特性甚至颜色融入 3D 打印模型和零件中。Connex1、Connex2&amp;nbsp;和Connex3&amp;nbsp;系统可将两三种材料混合，生成具有不同且可重现的特性的复合数字材料。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;结合刚性和类橡胶材料模拟多种邵氏 A 硬度值；混合青色、品红色和黄色产生多种混合色调；甚至在类橡胶材料中调入色彩，创建观感更接近未来产品的鲜亮柔性原型。将硬质材料与类橡胶防滑表面和高精度结构（如螺纹）相结合来制作符合人体工程学的制造工具和夹具。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;凭借数百种数字材料组合和可选颜色，PolyJet 技术成为制作美观原型的理想之选，其他 3D 打印方法无法企及。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;PolyJet 3D 打印机和材料&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;使用 PolyJet 技术的 3D 打印机使用各种各样的材料，包括数百种色彩鲜亮的刚性不透明和类橡胶材料、透明与带色彩的半透明材料、类聚丙烯材料以及用于在&amp;nbsp;牙科和医学行业进行 3D 打印的专用光敏树脂。数百种复合材料增大了材料选择范围。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;FDM打印技术介绍&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;FDM 工作原理&lt;/p&gt;\r\n\r\n&lt;p&gt;采用 FDM 技术的 3D 打印机从底部开始一层一层通过挤出热塑性塑料丝构建零件。 该过程相当简单：&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;预处理&lt;/strong&gt;：&amp;nbsp;预建软件将 3D CAD 文件切片并定位，然后计算出挤压热塑性塑料的路径以及任何所需的支撑材料的位置。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;制造&lt;/strong&gt;：3D 打印机可以将热塑性塑料加热成半液态，然后通过挤压通道使其以极细小的珠状沉积。 如果需要支撑或缓冲，3D 打印机可以还可以沉积出可移除的材料作为支撑材料。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;后处理：&lt;/strong&gt;&amp;nbsp;用户可以折断支撑材料，或用清洁剂和水将其溶解，就能得到可以使用的零件。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;FDM 的优势&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;该技术清洁、易用且适合办公室环境&lt;/p&gt;\r\n\r\n&lt;p&gt;支持的生产级热塑性塑料具有机械和环境稳定性&lt;/p&gt;\r\n\r\n&lt;p&gt;其他技术无法制造的复杂几何形状和内腔可通过 FDM 技术来实现&lt;/p&gt;\r\n\r\n&lt;p&gt;FDM 热塑性塑料&lt;/p&gt;\r\n\r\n&lt;p&gt;FDM 技术使用在传统制造工艺中久经考验的热塑性塑料。 对于高度要求配合紧密性、韧度和环境耐受性&amp;ndash;或特殊性质（如静电消散、半透明度、生物相容性、VO 可燃性和 FST 评级&amp;ndash;方面）的应用，总有一款&amp;nbsp;FDM 热塑性塑料能够满足需求。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;FDM 3D 打印机&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117090159_957.jpg&quot; style=&quot;height:160px; width:160px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Idea Series&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;通过经济的模型和原型来形成您的创意。 灵感系列 (Idea Series) 3D 打印机适合您的桌面和预算。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;uPrint SE Plus&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117090304_984.png&quot; style=&quot;height:160px; width:180px&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Design Series&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;通过能承受严格测试的高强度、耐用、尺寸稳定的部件来完善您的设计。&lt;/p&gt;\r\n\r\n&lt;p&gt;F123系列&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117090331_879.png&quot; style=&quot;height:160px; width:180px&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;制造系列&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;通过适用于原型和工具的最广泛的颜色和材料属性，为产品开发的每个阶段带来敏捷性和美感。&lt;/p&gt;\r\n\r\n&lt;p&gt;Fortus 380/450mc&lt;/p&gt;\r\n\r\n&lt;p&gt;Fortus 900mc&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '1', '0', '1', '1', '1', '0', '227', '2017-11-17 09:04:08', '227', '2017-11-17 09:04:08');
INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('38', '172', '道万技术', '20285', '技术展示', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171117/pic/20171117180228_574.jpg&quot; style=&quot;height:478px; width:888px&quot; /&gt;&lt;/p&gt;', '1', '0', '1', '1', '1', '0', '221', '2017-11-17 17:58:00', '221', '2017-11-17 18:02:35');
INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('39', '168', '青岛双瑞压载水管理系统&mdash;&mdash;亚洲首家、全球第四', '20351', '青岛双瑞海洋环境工程股份有限公司（以下简称青岛双瑞）研发的拥有完全自主知识产权的BalClor&reg;压载水管理系统（BWMS），于2017年6月6日获得美国海岸警卫队（USCG）型式认可证书，成为亚洲首家、全球第四家获此证书的船舶压载水管理系统生产厂商。青岛双瑞 BalClor&reg; BWMS采用&ldquo;高效过滤+支路电解灭活&rdquo;技术，处理能力可达170-8500m3/h。', '&lt;p&gt;&amp;nbsp; 青岛双瑞海洋环境工程股份有限公司（以下简称青岛双瑞）研发的拥有完全自主知识产权的BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt;压载水管理系统（BWMS），于2017年6月6日获得美国海岸警卫队（USCG）型式认可证书，成为亚洲首家、全球第四家获此证书的船舶压载水管理系统生产厂商。青岛双瑞 BalClor&lt;strong&gt;&amp;reg; &lt;/strong&gt;BWMS采用&amp;ldquo;高效过滤+支路电解灭活&amp;rdquo;技术，处理能力可达170-8500m3/h。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; USCG型式认可证书的获得，标志着安装BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt; BWMS的远洋船舶满足美国港口的压载水排放法规，取得了包括美国在内的全球海域&amp;ldquo;通行证&amp;rdquo;。&lt;/p&gt;\r\n\r\n&lt;p&gt;2012年6月21日，美国海岸警卫队公布的&amp;ldquo;在美国排放的船舶压载水中存活生物标准（46 CFR162.060）&amp;rdquo;正式生效，该法规明确了远洋船舶在美国水域的压载水排放标准及BWMS型式认证审批程序和要求，是目前公认的全球最严格、标准最高、认证难度最大的认证审核法规。压载水管理系统必须通过极为复杂的测试才能获得 USCG的型式认可，包括在各种盐度、温度等条件下连续成功的陆基测试、6 个月以上连续成功的实船测试、依据USCG要求的电气设备环境测试。并且，所有试验必须在USCG认可的第三方独立测试机构进行。由于取得该认证是在美国及全球海域通行不可或缺的条件，全球各大压载水处理设备制造商都在积极申请。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 青岛双瑞BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt; BWMS在挪威船级社（DNVGL）的见证下，由丹麦DHI实验室进行了陆基及实船试验、新加坡TUV SUD实验室进行电气设备环境试验，并完成了工程评价、检验和其他功效评估。青岛双瑞攻克了多项认证与测试关键技术，以技术实力和专业水平赢得了各方认证机构的信任和赞誉。BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt; BWMS所有陆基测试循环和实船测试循环结果均一次性满足或超过USCG法规要求。经确认，BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt; BWMS符合美国海岸警卫队的有关设计和建造标准，并完全满足压载水排放标准要求。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; 成功获得USCG型式认可证书，是一项具有里程碑意义的重要成果，充分展示了青岛双瑞压载水管理系统全球领先的技术实力和产品核心竞争力，标志着青岛双瑞可以在更高水平上为客户提供先进可靠的压载水管理系统全面解决方案。&lt;/p&gt;', '1', '0', '1', '1', '1', '0', '290', '2017-11-18 09:06:54', '290', '2017-11-18 09:06:54');
INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('40', '168', '青岛双瑞SCR系统成功通过MDT FTA台架试验', '20359', '11月9日，青岛双瑞公司自主研发的船用低速机高压SCR系统在中国船柴青岛基地一次性通过MDT（曼恩柴油机与透平公司）的FTA台架试验，属于国内首例。同时，该系统成功通过CCS、DNV GL、LR三大船级社Tier Ⅲ排放台架试验。', '&lt;p&gt;11月9日，青岛双瑞公司自主研发的船用低速机高压SCR系统在中国船柴青岛基地一次性通过MDT（曼恩柴油机与透平公司）的FTA台架试验，属于国内首例。同时，该系统成功通过CCS、DNV GL、LR三大船级社Tier Ⅲ排放台架试验。&lt;/p&gt;\r\n\r\n&lt;p&gt;该船用低速机高压SCR系统具有结构紧凑、自动化程度高、防震性好、催化剂效率高等优点，在系统设计、催化剂性能、控制策略等方面完全满足IMO柴油机NOx排放法规Tier Ⅲ及MDT FTA相关规定。本次台架试验，该系统配套安装于MAN 6S60ME-C8.5主机上，试验实测NOx排放值远低于IMO Tier Ⅲ规定的标准，赢得MDT公司和各船级社验船师的一致好评。&lt;/p&gt;\r\n\r\n&lt;p&gt;青岛双瑞公司长期致力于&amp;ldquo;资源节约、环境保护&amp;rdquo;，在海洋环保设备及船用关键设备领域不断推陈出新，继BalClor&lt;strong&gt;&amp;reg;&lt;/strong&gt;压载水管理系统之后，抓住船舶废气排放法规实施机遇，在中船重工集团及所属各船用柴油机厂的大力支持下，成功研制出具有完全自主知识产权、适用于中低速柴油机的高压系列SCR产品。此次该系统一举通过了MDT FTA台架试验以及三大船级社Tier Ⅲ排放台架试验，不仅填补了国内空白，还成功打破国外厂家在该领域的垄断，为今后的市场规模化推广应用迈出了关键的一步。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;撰写：于航，张文涛&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日期：2017-11-10&lt;/p&gt;', '2', '0', '1', '1', '1', '0', '290', '2017-11-18 09:17:43', '290', '2017-11-18 09:17:43');
INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('41', '194', 'HEW-FILO&reg;therm/HEW-费罗热', '21788', 'HEW-FILO&reg;therm-空间更小，性能更强大：绝缘壁厚缩减为原来的1/3。HEW-费罗热将介电材料与全新开发胶黏剂配方相结合，使产品具有出色的绝缘效果的同时，还具备优异的机械属性。', '&lt;p&gt;HEW-FILO&amp;reg;therm-空间更小，性能更强大：绝缘壁厚缩减为原来的1/3。HEW-费罗热将介电材料与全新开发胶黏剂配方相结合，使产品具有出色的绝缘效果的同时，还具备优异的机械属性。&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121145132_155.png&quot; style=&quot;height:901px; width:673px&quot; /&gt;&lt;/p&gt;', '99', '0', '1', '1', '1', '0', '189', '2017-11-21 14:50:58', '189', '2017-11-21 14:53:11');
INSERT INTO `byp_exhibition_booth_technology_info` VALUES ('42', '194', 'HEW-Micro', '21791', 'HEW-Micro能够开发和生产横截面积小于AWG56的定制型电缆以及横截面积小于AWG46的同轴电缆。虽然肉眼几乎看不到，但作用却不容小觑：通过采用高性能材料以及特殊的合金能够确保电缆的低噪音和高柔和韧性。特殊的屏蔽层确保了理想的电磁兼容性。', '&lt;p&gt;HEW-Micro能够开发和生产横截面积小于AWG56的定制型电缆以及横截面积小于AWG46的同轴电缆。虽然肉眼几乎看不到，但作用却不容小觑：通过采用高性能材料以及特殊的合金能够确保电缆的低噪音和高柔和韧性。特殊的屏蔽层确保了理想的电磁兼容性。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://s3.cn-north-1.amazonaws.com.cn/aucma-test/app-b2c/20171121/pic/20171121145706_225.png&quot; style=&quot;height:900px; width:672px&quot; /&gt;&lt;/p&gt;', '98', '0', '1', '1', '1', '0', '189', '2017-11-21 14:57:10', '189', '2017-11-21 14:58:51');
