INSERT INTO `byp_information_info` VALUES ('21', '王宏会见格陵兰岛自治政府总理金﹒吉尔森', '10月30日，国家海洋局局长王宏在京会见格陵兰岛自治政府总理金﹒吉尔森，双方就进一步加强科研交流与合作交换了意见。国家海洋局副局长林山青、中国人民外交学会副会长梁建全、丹麦驻华大使戴世阁参加会见。', '995', '18280', '1', 'http://www.soa.gov.cn/xw/hyyw_90/201711/t20171101_58730.html', '', '1', '4', '1', '0', '32', '2017-11-03 10:21:32', '32', '2017-11-08 16:47:03');
