INSERT INTO `byp_information_info` VALUES ('24', '深刻领会习近平海洋生态文明战略思想', '党的十八大以来，海洋对国家经济社会可持续发展的支撑保障能力不断提升，海洋蓝色经济和低碳产业快速发展，海洋资源环境利用规模和效率不断提高，海洋经济向又好又快方向发展', '994', '18279', '1', 'http://www.zgqdlsjj.com/2017/1026/236307.shtml', '', '1', '2', '1', '0', '32', '2017-11-03 15:03:06', '32', '2017-11-08 16:46:37');
INSERT INTO `byp_information_info` VALUES ('25', '从十九大报告看中国&ldquo;海洋政策&rdquo;的变与不变', '十九大报告的表述有两个变化值得关注\r\n　　其一，报告提出加快建设海洋强国，与十八大报告相比多了&ldquo;加快&rdquo;两字。\r\n　　中国人民大学国际事务研究所所长王义桅接受中新社记者采访时称，', '999', '18273', '1', 'http://www.hyzb.org/nd.jsp?id=224', '', '1', '2', '1', '0', '32', '2017-11-03 15:24:04', '32', '2017-11-08 16:11:19');
INSERT INTO `byp_information_info` VALUES ('26', '王志刚：建设海洋强国，科技支撑必不可少', '10月20日晚上，党的十九大新闻中心组织第四场集体采访，邀请科技部党组书记、副部长王志刚，中国科学院遗传与发育生物学研究所研究员、分子系统生物学研究中心主任王秀杰', '998', '18292', '1', 'http://www.hyzb.org/nd.jsp?id=221', '', '1', '2', '1', '0', '32', '2017-11-03 15:26:24', '32', '2017-11-08 17:06:26');
