INSERT INTO `byp_information_info` VALUES ('57', '海洋局首批500吨级近岸海洋环境监测船入列', '2017年11月3日，中国海监301、302、303船交船暨入列仪式在仑头综合保障基地码头举行。碧水蓝天，3艘500吨级近岸海洋环境监测船整装停靠，船上彩旗飘扬。', '987', '18306', '1', 'http://ocean.china.com.cn/2017-11/09/content_41868303.htm', '', '1', '1', '1', '0', '32', '2017-11-09 16:01:02', '32', '2017-11-09 16:01:02');
