INSERT INTO `byp_information_info` VALUES ('64', '临港产业支撑有力 连云港海洋产业风生水起', '日前，笔者从海洋经济发展专家咨询会上获悉，2016年，全市海洋生产总值708亿元，占地区生产总值比重达29.8%。', '985', '18515', '1', 'http://www.hellosea.net/news/focus/2017-11-13/45326.html', '', '1', '4', '1', '0', '32', '2017-11-13 17:31:22', '32', '2017-11-13 17:31:22');
