INSERT INTO `byp_information_info` VALUES ('70', '海上仪器设备海洋能供电系统项目启动会召开', '11月15日，国家海洋可再生能源资金项目  海上仪器设备海洋能供电系统示范&mdash;&mdash;基于锚泊浮台的波浪能和潮流能互补仪器设备供电系统   项目启动会在北京召开。', '983', '19463', '1', 'http://www.hellosea.net/news/focus/2017-11-16/45410.html', '', '1', '4', '1', '0', '32', '2017-11-16 17:20:39', '32', '2017-11-16 17:20:39');
INSERT INTO `byp_information_info` VALUES ('71', '中菲将探讨油气勘探等可能的海洋科考合作', '　　当地时间11月15日下午，正在对菲律宾进行正式访问的中国国务院总理李克强同菲律宾总统杜特尔特会谈。', '984', '20254', '1', 'http://www.hellosea.net/news/focus/2017-11-17/45428.html', '', '1', '2', '1', '0', '32', '2017-11-17 17:16:19', '32', '2017-11-17 17:16:19');
INSERT INTO `byp_information_info` VALUES ('72', '新船将入列 青岛3000吨级以上科考船超10艘', '党的十九大报告提出  坚持陆海统筹，加快建设海洋强国  ，昭示着我国坚定不移地提高海洋资源开发能力，发展海洋经济', '982', '20261', '1', 'http://www.hellosea.net/news/focus/2017-11-17/45431.html', '', '1', '4', '1', '0', '32', '2017-11-17 17:19:50', '32', '2017-11-17 17:19:50');
INSERT INTO `byp_information_info` VALUES ('73', '2017三亚公共外交论坛开幕 主题为海洋经济', '　　11月16日上午，2017三亚公共外交论坛在三亚市图书馆拉开帷幕。本次论坛的主题为智库建设与海洋经济。', '983', '20262', '1', 'http://www.hellosea.net/news/focus/2017-11-17/45449.html', '', '1', '2', '1', '0', '32', '2017-11-17 17:22:01', '32', '2017-11-17 17:22:01');
INSERT INTO `byp_information_info` VALUES ('74', '海洋国家实验室第二个海外研究中心启动建设', '　　11月16日,海洋国家实验室第二个海外研究中心――国际高分辨率地球系统预测实验室正式签约启动建设。', '982', '20264', '1', 'http://www.hellosea.net/news/focus/2017-11-17/45435.html', '', '1', '1', '1', '0', '32', '2017-11-17 17:27:40', '32', '2017-11-17 17:29:27');
INSERT INTO `byp_information_info` VALUES ('75', '中俄产学机构签署多项协议 发力海洋高端技术合作', '一带一路 海洋高端技术论坛7日在天津经济技术开发区举行。论坛上，中俄产学机构签署多项合作协议，发力海洋技术合作。', '982', '20908', '2', '', '<p>来源：中国网　</p>\r\n\r\n<p>　 &nbsp;一带一路&rdquo;海洋高端技术论坛7日在天津经济技术开发区举行。论坛上，中俄产学机构签署多项合作协议，发力海洋技术合作。</p>\r\n\r\n<p>当前中俄关系保持高水平运行，各领域务实合作取得积极进展。中国商务部欧亚司副司长刘雪松在此间表示，中俄都是海洋和科技大国，在海洋高端技术领域合作具有广阔的前景。双方可在推动资源整合、标准对接、成果转化、项目落地等几个方面深化合作。</p>\r\n\r\n<p>&nbsp; &nbsp; 俄罗斯科学院希尔绍夫海洋研究所副所长利奥波德&middot;乐补克夫斯基在论坛上表示，中俄合作探讨海洋相关问题具有重要意义。过去中俄在油气领域合作有深厚基础，未来可在使用海洋生物资源、海洋运输等问题上开启合作研究。</p>\r\n\r\n<p>&nbsp; &nbsp; 当日，天津经济技术开发区管委会与俄罗斯科学院希尔绍夫海洋研究所、俄罗斯自然科学院、圣彼得堡国立海洋技术大学、俄罗斯联邦委员会高新技术项目促进委员会签署《中俄高端技术促进战略协议》；天津经济技术开发区管委会与中国银行天津市分行签署《助力&ldquo;一带一路&rdquo;建设全面合作协议》；海之星海洋高新技术研究院与保利集团保利科技有限公司、俄罗斯科学生产联合体有限公司等20家机构签署海洋产业链相关合作意向。</p>', '1', '2', '1', '0', '32', '2017-11-18 16:28:34', '32', '2017-11-18 16:29:07');
INSERT INTO `byp_information_info` VALUES ('76', '我国第二批国家海洋督察正式启动', '按照《海洋督察方案》，国家海洋局目前已组建第二批共5个  国家海洋督察组 ，对天津、山东、上海、浙江、广东5个省', '981', '20945', '2', '', '<p>来源：中国网 &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; 按照《海洋督察方案》，国家海洋局目前已组建第二批共5个&ldquo;国家海洋督察组&rdquo;，对天津、山东、上海、浙江、广东5个省（直辖市）开展以围填海专项督察为重点的海洋督察工作，17日，第二批海洋督察组正式开始进驻。</p>\r\n\r\n<p>&nbsp; &nbsp; 这次围填海专项督察针对当前围填海管理方面存在的&ldquo;失序、失度、失衡&rdquo;等突出问题，盯紧中央高度关注、群众反映强烈、社会影响大的围填海问题及处理情况，重点检查地方政府及其有关部门不作为、乱作为的情况。海洋督察进驻时间为1个月左右，进驻期间将设立专门值班电话和邮政信箱，受理海洋资源环境保护方面的来信来电。</p>', '1', '1', '1', '0', '32', '2017-11-18 16:38:09', '32', '2017-11-18 16:43:49');
INSERT INTO `byp_information_info` VALUES ('77', '中国  海工三杰  惊艳世界 加快建设海洋强国', '坚持陆海统筹，加快建设海洋强国。  这是中共十九大报告提出的一项伟大目标和重大历史任务。', '981', '20960', '2', '', '<p>来源：中国海洋网</p>\r\n\r\n<p>　（原标题：中国&ldquo;海工三杰&rdquo;惊艳世界 加快建设海洋强国）</p>\r\n\r\n<p>　　&ldquo;坚持陆海统筹，加快建设海洋强国。&rdquo;这是中共十九大报告提出的一项伟大目标和重大历史任务。</p>\r\n\r\n<p>　　实现这一目标和任务，不仅要在全社会大力建设海洋文化，增强全民海洋意识，而且要着力推进海洋科学技术创新，不断提升海洋工程创新能力，在探索、认识海洋，开发、利用、保护海洋等方面提升综合实力。</p>\r\n\r\n<p>　　经过多年的努力，中国海洋工程领域取得了突飞猛进的发展。堪称中国&ldquo;海工三杰&rdquo;的&ldquo;蓝鲸二号&rdquo;&ldquo;天鲲号&rdquo;&ldquo;振华30号&rdquo;闪亮登场，把中国海洋装备推向国际先进水平，不仅让国人深感自豪和骄傲，更让世界惊艳不已。</p>\r\n\r\n<p>　　<strong>挖掘&ldquo;未来的能源&rdquo;</strong></p>\r\n\r\n<p>　　&ldquo;最大钻探深度可达15250米，几乎能钻透两个珠穆朗玛峰。&rdquo;</p>\r\n\r\n<p>　　&ldquo;定海神针，能抵抗15级飓风。&rdquo;</p>\r\n\r\n<p>　　有国际媒体用这样的语言来描述&ldquo;蓝鲸二号&rdquo;，盛赞中国最新建成的全球最大石油钻井平台，称它具有在海上挖掘&ldquo;未来的能源&rdquo;的强大力量。</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"d1687153112909140eddf98006552171.png\" src=\"http://www.hellosea.net/d/file/2017-11-18/c5be3ebf5adeaab02781e629b03b3676.png\" style=\"height:277px; width:391px\" /></p>\r\n\r\n<p style=\"text-align: center;\">蓝鲸二号</p>\r\n\r\n<p>　　&ldquo;在海上挖掘 未来的能源 &rdquo;，这个说法颇为含蓄，熟悉中国海工科技最新发展动态的人其实很清楚，&ldquo;未来的能源&rdquo;在很大程度上是指海底可燃冰。人们还记得，就在今年5月，率先投入实战的&ldquo;蓝鲸二号&rdquo;姊妹平台&ldquo;蓝鲸一号&rdquo;，已经在南海成功进行了可燃冰试采，不仅一举实现了中国在可燃冰开采领域&ldquo;零&rdquo;的突破，而且累计采气达60万立方米，创造了产气时长和总量的双世界纪录。&ldquo;蓝鲸二号&rdquo;作为&ldquo;蓝鲸一号&rdquo;的升级版，其更优异的性能必将为可燃冰开采创造更成熟的条件。</p>\r\n\r\n<p>　　在&ldquo;蓝鲸二号&rdquo;项目副经理祝恺看来，该钻井平台优异性能突出体现在&ldquo;液压双钻塔&rdquo;和&ldquo;DP3闭环动力定位系统&rdquo;上。前者意味着&ldquo;蓝鲸二号&rdquo;有两套钻井系统，与一套系统相比，工作效率至少提高了30%。后者是国际海事组织的最高动力定位级别，具有两大优势。一是超级稳定性。系统根据相关数据分析来控制推进器的速度和方向，消解风浪等对平台形成的冲击力，在海洋中抵御恶劣天气。超级稳定性还体现在动力供给方面，该系统能保障动力定位始终发挥作用，即使发电机突然出现故障，备用发电机也能第一时间启动。二是绿色节能。系统可节省燃油消耗和设备维护成本，降低钻井平台油耗约10%，有效减少氮氧化合物和二氧化碳排放。</p>\r\n\r\n<p>　　在首次试航中，&ldquo;蓝鲸二号&rdquo;优异的性能得到了验证。实验团队按计划测试了平台高级发电机保护系统的性能，并设置了70多种组合的电压和频率失效状况，验证了发电机管理系统针对电网电压、频率失效和潜在失效的一级和二级保护功能，甚至还进行了短路试验。&ldquo;蓝鲸二号&rdquo;经受住考验，试验达到预期效果，取得圆满成功。而&ldquo;蓝鲸一号&rdquo;在实战中的表现同样让人啧啧赞叹。在6月进行的南海可燃冰试采中，它就经受住了台风&ldquo;苗柏&rdquo;的正面袭击，生产过程平稳如常。</p>\r\n\r\n<p>　<strong>　助力疏浚大国建设</strong></p>\r\n\r\n<p>　　&ldquo; 天鲲号 是中国疏浚装备研发建造领域的新成果。希望有关媒体客观、理性看待中国的科技发展进步和工程能力提升，不要随意联想，更不要草木皆兵、杯弓蛇影。&rdquo;这是中国外交部新闻发言人在近日一次例行记者会上对一些国际媒体提出的一条忠告。 究竟是怎样的疏浚装备，让&ldquo;见多识广&rdquo;的国际媒体都不淡定了，以至于&ldquo;浮想联翩&rdquo;呢？</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"10b6d0511c4afeff610cdd6048886e39.png\" src=\"http://www.hellosea.net/d/file/2017-11-18/fdb94ee66a293ac51bf03832b7f2133d.png\" style=\"height:326px; width:400px\" /></p>\r\n\r\n<p style=\"text-align: center;\">天鲲号</p>\r\n\r\n<p>　　&ldquo;天鲲号&rdquo;是中国自主设计建造的挖泥船，本月初在位于江苏启东的一家造船厂顺利下水。这可不是一艘普通的挖泥船，其性能指标大大超越中外联合设计、中国建造的&ldquo;天鲸号&rdquo;，取代其成为亚洲最先进、在世界范围内也属领先水平的自航绞吸挖泥船：绞刀电机额定功率6600千瓦，其挖掘功率居亚洲第一、世界前列；泥泵电机总功率1.7万千瓦，其输送总功率居于亚洲第一、世界第三；远程输送能力达15公里，亚洲第一，世界领先；最大挖掘深度可达35米，亚洲第一位，居世界前列。</p>\r\n\r\n<p>　　在&ldquo;天鲲号&rdquo;监造组副组长冯长华看来，&ldquo;天鲲号&rdquo;相较于&ldquo;天鲸号&rdquo;而言，不仅实现了技术上的飞跃，而且完全实现了自主设计研制。而这距离中国建造第一艘拥有完全自主知识产权的现代化大型绞吸挖泥船&ldquo;天狮号&rdquo;只有短短11年。彼时，中国经过多年努力，终于打破国外挖泥船技术垄断，摆脱了高价整船进口的被动局面。</p>\r\n\r\n<p>　　中国奋起追赶的高速度和取得的巨大成就，着实让外国媒体感到吃惊，但若将&ldquo;天鲲号&rdquo;与国际政治因素搅和在一起，则的确有草木皆兵之嫌。中国作为世界疏浚大国，无论是内河航道清淤，还是海港建设等，都需要世界一流的疏浚装备，因此&ldquo;天鲲号&rdquo;应运而生和投入应用是中国海工科技进步的必然结果。</p>\r\n\r\n<p><strong>　　做最强的水上大力士</strong></p>\r\n\r\n<p>　　11月7日，第十九届中国国际工业博览会在上海开幕。在当天举行的博览会颁奖仪式上，上海振华重工研发制造的1.2万吨自航全回转起重船获得了今年的&ldquo;特别荣誉奖&rdquo;。&ldquo;到目前为止，还没有这种单臂架起重量超过万吨的起重船，我们是当之无愧的全球第一。国外在这个领域原来是占有统治地位的，我们打破了他们的垄断。现在，不管是国内还是国外的客户，如果有这种千吨级以上的订单，都会咨询我们的报价。&rdquo;上海振华重工结构工程设计师姚海这样表达自豪之情。</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"31fce0fd05817be46e0fc0a04346790d.png\" src=\"http://www.hellosea.net/d/file/2017-11-18/b910ea46c2bade60489cc56d4148800a.png\" style=\"height:333px; width:395px\" /></p>\r\n\r\n<p style=\"text-align: center;\">振华30号</p>\r\n\r\n<p>　　起重船是一种用于水上起重作业的工程船舶，又称浮吊、浮式起重机，广泛应用于海上大件吊装、海上救助打捞、桥梁工程建设和港口码头施工等多个领域。上海振华重工研发制造的1.2万吨自航全回转起重船被命名为&ldquo;振华30号&rdquo;，可谓业界鼎鼎大名的明星，经常活跃在重大工程的现场。今年4月，在举世瞩目的港珠澳大桥岛隧工程最后合龙中，&ldquo;振华30号&rdquo;精彩亮相，顺利将6000吨重的&ldquo;最终接头&rdquo;进行水下吊装，为保障工程进度立下了汗马功劳。</p>\r\n\r\n<p>　　&ldquo;振华30号&rdquo;起重船集高技术、高难度、高附加值于一身，主要用于深海大件、模块、导管架起重吊运及吊装。该船长近300米，宽近60米，主甲板面积相当于2.5个标准足球场，由30万吨的油轮改装而成，其1.2万吨浮吊单臂起重能力和7000吨的全回转起重能力，均位列全球第一。&ldquo;振华30号&rdquo;具备自航能力，带DP2动力定位功能，与普通起重船相比，节约了拖轮费用和拖航时间，作业行动更加精准自如。&ldquo;振华30号&rdquo;无疑是海工装备发展的一个里程碑，它将继续支撑中国和国际打捞救助事业向深海延伸。</p>', '1', '4', '1', '0', '32', '2017-11-18 16:43:20', '32', '2017-11-18 16:43:20');
INSERT INTO `byp_information_info` VALUES ('78', '系统维护公告', '我平台将于2017年11月20日20:00-21:00期间进行系统例行维护工作。', '980', '21531', '2', '', '<p>尊敬的客户：</p>\r\n\r\n<p>我平台将于2017年11月20日20:00-21:00期间进行系统例行维护工作。系统维护期间，我平台所有功能将出现短暂中断。请您根据自身的需要，提前做好相应安排，由此给您带来的诸多不便深表歉意。同时，对您给予我平台的大力支持和积极配合表示衷心的感谢。</p>\r\n\r\n<p style=\"text-align:right\">Marine-Online海科在线平台</p>\r\n\r\n<p style=\"text-align:right\">二〇一七年十一月二十日</p>', '1', '1', '1', '0', '32', '2017-11-20 14:40:54', '32', '2017-11-20 14:48:53');
