  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `creator_id` int(11) NOT NULL COMMENT '创建人员ID',
  `updator_id` int(11) NOT NULL COMMENT '更新人员ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='后台管理用户表';

